INSERT INTO `lf_movie` VALUES (27844,54,'归来的福丹芝','姜成妍,,,高世元,,,宋宣美,,,李必模,,,李亨哲','韩国',NULL,2000,1,'<span style=\"font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\"><span style=\"font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\"><span style=\"font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\"></span><span style=\"font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\"></span><span style=\"font-family: \'sans serif\', tahoma, verdana, helvetica; line-height: 18px;\">MBC新日播连续剧《归来的福丹芝》讲述的是遇见从白马掉下来的王子的生计型江南大妈“福丹芝”，会沉浸凄凉的内心的、温暖的“正宗家庭言情”电视剧，将于2017年5月首播。</span><br /></span></span><br />',1,0,0,0,'',0,0.0,0,'权成昌','连载100',1508305818,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/694','G',0,0,NULL),(27845,54,'无穷花开了','林秀香,都枝寒,南宝拉,李昌旭','韩国',NULL,2017,2,'<span style=\"font-size:12px\">劇中以派出所為舞台，描述基層警察中發生的故事……</span>',1,0,0,0,'',0,0.0,0,'高英鐸 고영탁','连载102',1508306456,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1442','W',0,0,NULL),(27846,54,'多样的儿媳',NULL,'韩国',NULL,2000,3,'该剧讲述了一对冤家姐妹在成为了世仇家族的儿媳后发生的故事<br />',1,0,0,0,'',0,0.0,0,NULL,'连载86',1508305782,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1568','D',0,0,NULL),(27847,54,'甜蜜的冤家','朴恩惠,刘健,朴泰仁,金民灿,郑东焕','韩国',NULL,2017,4,'<span style=\"font-size:12px\">该剧讲述了被冤枉成为杀人犯的女主人公痛快地向这个充满谎言的世界复仇的故事。</span>',1,0,0,0,'',0,0.0,0,'이현직','连载92',1508306507,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1815','T',0,0,NULL),(27848,78,'青春相对论第三季','米卡·阿卜杜拉,Ysa,Penarejo,维多利亚·维达,Genneya,Walton','美国',NULL,2017,5,'<span style=\"font-size:12px\">英国王子赞德的太空之旅受到了匿名威胁，机密组织革新智库派出了年轻的麦凯拉探员前往梅伍德小镇进行调查。调查过程中，麦凯拉的探员身份被同校的三个学霸少女识破，于是四个性格迥异的小女生共同开始了卧底生活。她们究竟能不能顺利完成任务呢？这部Netflix原创剧集第一季共三集，已获第二、三季续订</span>',1,0,0,0,'',2,0.0,0,'Michael Younesi','连载3',1508307087,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4306','Q',0,0,NULL),(27849,78,'魔女之家第一季',NULL,'美国',NULL,2017,6,'<span style=\"font-size:12px\">瑞雯和切尔西是两个离婚的单身女性，她们住在一所房子里抚养各自的孩子。有一天瑞雯的一个孩子发现自己继承了ta妈妈预知未来的本领，整个大家庭顿时陷入异常混乱。Raven and Chelsea are now divorced single mothers raising their two separate families in one chaotic, but fun household full of friends. When one of Raven\'s kids begins to show signs that they have inherited her trait of seeing into the future, the already hectic household gets turned upside down, keeping even Raven on her toes.</span>',1,0,0,0,'',0,0.0,0,NULL,'连载12',1508306738,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4541','M',0,0,NULL),(27850,78,'谋杀回溯','理查德·多默,乔迪·巴尔弗,罗莎琳德·以利亚撒,保罗·瑞斯','美国',NULL,2017,7,'<span style=\"font-size:12px\">本剧用倒叙方式讲述了一个连环凶杀案的故事，剧名“Rellik”就是“杀手”英文“Killer”的回文。在剧中犯罪事件之末将会在剧集一开始就公之于众，然后以受创伤﹑毁容的伦敦警探Gabriel Markham为中心，在回溯追凶过程中剖析该警探的故事。参与演出《雪岛迷踪》及《权力的游戏》的Richard Dormer饰演高深莫测﹑不屈不挠﹑具感召力的警探Gabriel，他痴迷于追捕一个在他身心皆留下伤痕的连环杀手。Jodi Balfour饰演Gabriel的拍档Elaine，她是个爽朗﹑有热情﹑急切讨好别人的警探。艾美奖提名者Sam Miller将执导该剧，编剧Williams兄弟及其公司将担任本剧的执行制片方。</span>',1,0,0,0,'',3,0.0,0,'萨姆·米勒,Hans Herbots','连载6',1508307164,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4682','M',0,0,NULL),(27851,78,'无声的证言第一季','阿曼达·伯顿,威廉·加米那拉,汤姆·沃德','英国',NULL,1996,8,'<span style=\"font-size:12px\">一名法医在案件侦破中努力确定自己的角色。</span>',1,0,0,0,'',1,0.0,0,'Bill Anderson,哈里·胡克,Harry Hook','连载8',1508307263,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4683','W',0,0,NULL),(27852,78,'退休警察烦事多第二季','凯文·詹姆斯,丽亚·雷米尼','美国',NULL,2017,9,'<span style=\"font-size:12px\">被续订第二季的CBS喜剧《退休警察烦事多 Kevin Can Wait》在6月时有大人事变动，在剧中饰演主角Kevin（Kevin James饰）妻子Donna的Erinn Hayes宣布离开剧组，不会回归第二季。CBS宣布Donna一角会在剧中去世，第二季一开始会有一段时间跳跃。而剧组把曾在《后中之王 The King of Queens》与Kevin James合作过，于首季尾登场的Leah Remini提升为第二季常规兼女主。</span>',1,0,0,0,'',0,0.0,0,NULL,'连载4',1508306688,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5296','T',0,0,NULL),(27853,78,'在下、鄙人和我','Brian,Unger,凯伦,科尔曼,鲍比·莫尼汉,约翰·拉尔奎特','美国',NULL,2017,10,'<span style=\"font-size:12px\">探讨生命题材的CBS单镜头喜剧《我的过去、现在与未来Me, Myself &amp; I》通过描述一个人不同的生命历程来探讨生命的轨迹，有点《少年时代 Boyhood》电视剧版的感觉。该剧虽然描述50年跨度的人生，但是主要截取主角Alex Riley三个重要的人生阶段，在过去1991年的14岁少年时代，在现在2017年的40岁壮年时代，以及在未来2042年65岁的老年时代。《周六夜现场 Saturday Night Live》卡司Bobby Moynihan饰演40岁壮年时代的Alex﹑John Larroquette饰演65岁的主角﹑Jack Dylan Grazer则饰演少年时代的主角。</span>',1,0,0,0,'',0,0.0,0,'兰德尔·艾因霍恩,托德·霍兰德','连载4',1508307131,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5298','Z',0,0,NULL),(27854,78,'生活大爆炸第十一季','吉姆·帕森斯,凯莉·库柯,约翰尼·盖尔克奇,西蒙·赫尔伯格','美国',NULL,2017,11,'<span style=\"font-size:12px\">《生活大爆炸》正式获得续订第十一、十二季。</span>',1,0,0,0,'',1,0.0,0,NULL,'连载4',1508307190,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5300','S',0,0,NULL),(27855,78,'天蝎第四季',NULL,'美国',NULL,2017,12,'<span style=\"font-size:12px\">本剧根据真实故事改编，是一部快节奏的、惊险刺激的悬疑剧集。该剧由黄金编剧组合Alex Kurtzman、Bob Orci联合Nick Santora、Justin Lin开发，Justin Lin担任导演。故事描述高深莫测的计算机专家Walter O’Brien（Elyes Gabel）和一群同样具备天才头脑的国际计算机黑客共同组建全球防御网络，抵抗复杂的现代高科技威胁。http://www.55dys.com/dsj/oumei/63815/</span>',1,0,0,0,'',0,0.0,0,NULL,'连载4',1508307237,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5301','T',0,0,NULL),(27856,78,'路西法第三季','汤姆·艾利斯,劳伦·日尔曼,凯文·阿历詹卓,D.B.伍德塞德','美国',NULL,2017,13,'<span style=\"font-size:12px\">FOX宣布续订新剧《路西法》第三季。</span>',1,0,0,0,'',0,0.0,0,NULL,'连载4',1508306712,1508318888,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5538','L',0,0,NULL),(27857,78,'天赋异禀','史蒂芬·莫耶,艾米·阿克,布莱尔·雷德福,,杰米·钟','美国',NULL,2017,14,'<span style=\"font-size:12px\">Fox将推出全新X战警剧集，马特·尼克斯(《火线警告》)负责开发本剧。该剧讲述一对夫妇发现他们的孩子具有超能力，平静生活瞬间瓦解。而他们也不得不铤而走险，躲避当局，尼克斯表示本剧和大表哥的《军团》不同，该剧和“X战警”电影宇宙有密切联系，至于剧集角色，电影中熟悉的面孔或将亮相。</s