',1,0,0,0,'',0,0.0,0,'大森贵弘 / 出合小都美','11集全',1508256023,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/34617','X',0,0,NULL),(27864,43,'会痛的十七岁','徐娇,胡夏,鲁诺,王力宏,蔡卓妍,句号','大陆',NULL,2017,21,'17岁高中女生夏远远（徐娇 饰）是成绩一塌糊涂的学渣一枚，性格叛逆执着，患有先天性痛觉缺失症。经常和同样喜欢二次元的罗涛（鲁诺 饰）参加动漫社团。顾明耀（胡夏 饰）是大家眼中的超级学霸，过着按部就班的生活。在新来班主任李米（蔡卓妍 饰）的执意坚持下，夏远远和同桌顾明耀产生了奇妙的交集，并逐渐发现了彼此内心隐藏的另一面。就在此时，一个个误解和质疑接踵而至，叛逆少女夏远远能否逆袭成功？神秘角色王力宏（王力宏 饰）的出现，又能否实现她儿时的梦想？会痛的十七岁，也是成长的十七岁。&nbsp;',1,0,0,0,'',0,0.0,0,'彭发','HD1280高清国语中字版',1508256075,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40925','H',0,0,NULL),(27865,49,'美味奇缘','毛晓彤,,,披拉·尼迪裴善官,,,张雨剑,,,陈欣予,,,方逸伦,','大陆',NULL,2017,22,'痴迷美食的西餐主厨李雨哲（Mike饰）与天生味觉灵敏的电视美食节目编导宋佳茗（毛晓彤饰），因为制作一档美食节目而“杠上”，两人从最初的欢喜冤家到逐渐被对方所吸引，然而上一辈千丝万缕的恩怨纠葛却令他们备受考验，两人历经坎坷却依旧坚持梦想勇往直前 。',1,0,0,0,'',0,0.0,0,'柯政铭','53集全',1508256770,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/39761','M',0,0,NULL),(27866,54,'其实并不在乎你',',波瑠,,,东出昌大,,,仲里依纱,,,铃木伸之,,,大政绚','日本',NULL,2017,23,'结婚对象是「第二个喜欢上的人」的美都，偶遇初恋的有岛，很快两人便进入了W不伦的关系中。有岛的妻子丽华、美都的丈夫渡边也渐渐有所察觉……围绕两对夫妇四位主人公的情感和道德观念展开的「昼颜」式的大胆又现实的故事题材，意想不到的展开，未来将会如何？',1,0,0,0,'',0,0.0,0,'金子文纪 / 竹村謙太郎 / 福田亮介','10集全',1508256958,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/34124','Q',0,0,NULL),(27867,55,'武装少女machiavellism','畠中祐,高田忧希,北原沙弥香,西田望见,日高里菜,日冈夏美,松井惠理子,伊藤美来,小日向茜,花井美春','日本',NULL,2017,24,'<span style=\"font-family: Simsun;font-size:16px;\">《武装少女Machiavellism》顾名思义就是围绕一群强得要命的妹子来展开的故事——当不良少年来到极度女权的学园接受武力矫正时应该做什么？当然是打一架收一个后宫。什么？颇有渊源的老哥也是女的？作为一个猛男只能上了！执导本作的橘秀树曾负责过《苍翼默示录》等作，对于“武装少女”这一主题并不陌生，系列构成下山健人同样经验丰富，代表作有《穷神》等，而出任人设的泷本祥子，代表作为《赤龙战役》等。男主角的声优是畠中祐，代表角色为《甲铁城》男主“生驹”，女性阵容则包括高田忧希、松井惠理子、北原沙弥香等人。考虑到包含了大量的剑术知识内容，本作同样推荐给对剑术感兴趣的观众。</span><br />',1,0,0,0,'',0,0.0,0,'橘秀樹','12集全',1508260714,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/33918','W',0,0,NULL),(27868,49,'白鹿原','张嘉译,,,李沁,,,翟天临,,,秦海璐,,,刘佩琦','大陆',NULL,2000,1029,'该剧是一部世纪初渭河平原年变迁的雄奇史诗，这是一轴中国农村斑斓多彩、触目惊心的长幅画卷。特殊的时代背景，浓厚的关中风情，土地革命、抗日战争、解放战争，古老的土地，上演了一幕幕惊心动魄的画面。剧中朱先生对传统道德的坚守，白嘉轩勤劳与自私，鹿子霖望子成龙，白孝文情感波折，白灵投奔革命，黑娃被迫为匪，鹿兆鹏追求理想，鹿兆海舍生为义，演绎了两个家庭不同子孙，曲折的人生轨迹和命运归宿。大革命洪流不息，日寇入侵危机四伏，三年内战社会动荡，白鹿原风云变幻，古老的土地在阵痛中颤栗，但是中华民族的根脉必定在洗礼中承传，变革要对旧体制和生产方式重新改写，新中国将迎来明媚的阳光。',1,0,0,0,'',0,0.0,0,'刘进','77集全',1498149784,1508319036,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15137','B',0,0,NULL),(27869,53,'美国众神 第一季','瑞奇·惠特尔,,,艾米莉·布朗宁,,,伊恩·麦柯肖恩,,,布鲁斯·兰利,,,巴勃罗·施瑞博尔','美国',NULL,2017,26,'　HBO放弃开发该剧后，Starz电视台接手了American Gods。并将由Bryan Fuller（英雄、灵指神探、汉尼拔）执笔剧本。',1,0,0,0,'',0,0.0,0,'大卫·斯雷德','第08集/共08集(全)',1508262647,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/35042','M',0,0,NULL),(27870,55,'青春歌舞伎',',市川太一,,,梅原裕一郎,,,逢坂良太,,,河西健吾,,,岛崎信长','日本',NULL,2017,27,'青春歌舞伎',1,0,0,0,'',0,0.0,0,'米田和弘','12集全',1508263018,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/33956','Q',0,0,NULL),(27871,55,'雏子的笔记','M・A・O,富田美憂,小倉唯,東城日沙子,高野麻里佳,吉田有里','日本',NULL,2017,28,'<span style=\"font-family: Simsun;font-size:16px;\">不擅长和人交流却受到动物喜爱，因此在乡村担任“稻草人”这一工作的主人公高中生·雏子，与充满个性的角色们一同挑战演剧的演剧喜剧。</span><br />',1,0,0,0,'',0,0.0,0,'高橋丈夫','12集全',1508263339,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/33920','C',0,0,NULL),(27872,53,'天堂执法者第七季','艾历克斯·奥洛林,,,斯科特·凯恩,,,丹尼尔·金,,,朴敏庆','美国',NULL,2016,29,'&nbsp;　CBS已续订《夏威夷特勤组》第七季。',1,0,0,0,'',0,0.0,0,NULL,'第25集/共25集(全)',1508263592,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17068','T',0,0,NULL),(27873,55,'快盗天使BREAK','M・A・O,茅野愛衣,釘宮理恵','日本',NULL,2017,30,'<span style=\"font-family: Simsun;font-size:16px;\">《快盗天使BREAK》是《快盗天使双胞胎》的全新作品。前作在2008年第一次推出OVA动画，因此新作打着十周年纪念企划的宣传。与前作不同，此次变更了主角，算是第二代。两位主角分别由市道真央和茅野爱衣配音，钉宫理惠则为宠物角色配音。3位主人公也会分别演唱OP和ED主题歌。制作阵容基本延续前作，由岩崎良明执导，J.C.STAFF制作。个性天真烂漫、憧憬着成为正义的伙伴的天月让、与名门如月家出身的大小姐如月堇，初中三年级的两位少女，被名为“milk