·班诺伊,,,麦卡德·布鲁克斯,,,凯乐·利,,,杰瑞米•乔丹,,,大卫·哈雷伍德','美国',NULL,2017,36,NULL,1,0,0,0,'',0,0.0,0,'杰西·沃恩','更新至03集',1508900866,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40751','C',0,0,NULL),(27880,49,'传奇大亨','张翰,,,贾青,,,陈乔恩,,,宋轶,,,谭凯','大陆',NULL,2017,37,'20世纪30年代的大上海，顾家四兄弟携手进军影视界。顾家老幺顾延枚，为了兄长们的事业，跟随三哥南下新加坡开拓南洋电影市场，从此注定其一生与电影业的不解之缘。恰逢二战，时局骤变，顾氏兄弟将制片基地迁至香港。战争结束，香港百废待兴，兄长们将香港影厂托付给顾延枚。面对今非昔比的电影市场，顾延枚始终视观众为自己制作影片的源动力，终于造就顾氏兄弟电影成为香港第一家，不单令香港影圈星光闪耀，更成亚洲一时之冠。其声望日隆，被尊为“华语影视大亨”。因多年来乐善好施，热心公益，顾延枚也成为世界公认的大慈善家。',1,0,0,0,'',0,0.0,0,'庄训鑫','更新至18集',1508900744,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40697','C',0,0,NULL),(27881,49,'爱人同志','王雷,李小萌,罗昱焜,王鹏凯,周奇奇,张会中,牛飘,何明翰,任正斌,张亮','大陆',NULL,2017,38,'镇上宣传新思想的富家小姐欧阳春晓的影响，为逃避各自不幸的爱情和婚姻而逃离小镇来到广州。陈桂做了缫丝女工，沈梦苏在欧阳春晓帮助下入读坤雅女子中学，在新学校里，梦苏学习新文化接受新思想的洗礼和熏陶，认识了青年教师、共产党员麦秋实。从此，三个不同出身、不同性格的年轻女性与麦秋实等人一起，经历了省港大罢工、广州起义、白色恐怖等革命斗争的暴风骤雨……在坚守连接粤港澳和江西苏区交通线的过程中，这群青年经历了血与火的考验，面对危险、背叛、误解，最终沈梦苏和麦秋实一起坚定了信仰，一道沿着迢遥的山路踏上了战火连天的新征途，与大部队北上参加二万五千里长征。&nbsp;<br />　　本剧从新的角度讲述了第一代中国共产党人的“中国梦”，讲述了她们的爱情、命运和奋斗故事，从人性、人文的角度回望上世纪二、三十年代波澜壮阔的中国历史。本剧将焦点对准革命历史中的女人，着力塑造了沈梦苏这个为信仰和爱付出一切的传统女性，在风云变幻的大时代里浮沉起落。一个女人想要与自己所爱的人在一起竟是如此艰难。在刀锋嗜血、白色恐怖的极端环境中，有爱不敢爱，相爱不能爱；又在对信仰的追寻和坚守中得到爱的升华和实现了命运的涅槃。这是一个女人的成长史和爱情史诗，这是一群女性情感和命运的故事。',1,0,0,0,'',0,0.0,0,'毛卫宁','更新到50集',1508901211,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40562','A',0,0,NULL),(27882,49,'国民大生活','郑恺,,,袁姗姗,,,朱孝天,,,刘佳,,,严晓频','大陆',NULL,2017,39,'王舒望和陆露在泰国相遇相识，经历了一系列惊心动魄的事情之后，相爱了。回国后，两人准备结婚，却遭到了双方家庭的反对。王舒望放弃了北京的事业，来到上海，开了一家陶瓷店，向陆露的家人证明自己可以给陆露更好的生活。陆露的父母依旧认为王舒望和陆露不合适，不同意他们的婚事。王舒望的异父异母姐姐赵燕也多次来到上海，还和陆露的妈妈蒋妙音发生了争吵。这让两人的婚事再度拖延。陆露和王舒望的爱情不断经受着来自双方家庭的打击和考验。 <br />　　陆露作为一名编剧，一直追求着事业上的成功，王舒望则希望能够过田园式的生活。陆露因为工作的缘故认识了大明星淳于秋，淳于秋表面看起来风光无限，但其实却为了事业隐瞒了自己曾经结婚又离婚的事实。直到她的前妻珠珠生下孩子，大闹淳于秋电影发布会之后，才让这一段故事公诸于众。淳于秋在陆露的开导下，接受了孩子。他和陆露一起合作电影，事业也迎来了新的天地。淳于秋喜欢陆露乐观上进的生活态度，决定要追求她。  <br />　　陆露的好闺蜜马丝丝是一家服装店店主，在见到王舒望之后，被他迷住了。为了得到王舒望，她用尽心机和手段，不惜和陆露闹掰。陆露因为马丝丝与王舒望起了很大的误会，好在最终都化解了。陆露拒绝了淳于秋的追求，和王舒望和好如初。马丝丝经历了一系列事情之后，明白了友情的珍贵，深深祝福了陆露和王舒望。  <br />　　陆露和王舒望经历了来自家庭、朋友、事业等方方面面的考验之后，终于走到了一起。王舒望和淳于秋为了陆露不打不相识，最终也成为了好朋友。',1,0,0,0,'',0,0.0,0,'夏晓昀','更新至30集',1508900805,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40698','G',0,0,NULL),(27883,49,'花儿与远方','王志飞,,,蒋雯丽','大陆',NULL,2017,40,'1952年，新疆生产建设兵团在山东招女兵，副区长郝玉兰为征兵工作顺利进行，被迫搁置了自己的婚事，带头报名参军，带领着二曼、赵凤、胡彩娥等一批山东妇女来到新疆。在屯垦生活中，这群山东妇女与兵团战士们纷纷擦出爱情火花，建立家庭。冬去春来，在他们辛勤开垦之下，戈壁滩在一天天发生变化，几对夫妻也各自经历了悲欢离合：连长战涛在一次剿匪中被打坏下身，妻子二曼不离不弃，坚守着自己的爱情；赵凤和葛俊历经磨难最终牵手，赵凤成为马莲窝子小学第一位老师；耿大炮和胡彩娥在吵吵闹闹中哺育着自己的后代。主人公刘北伐和玉兰的婚姻在经历丧子之痛后，玉兰学习驾驶拖拉机，成为兵团第一位女拖拉机手，刘北伐克服难题进行农业科技攻关。这群可爱而可敬的山东大嫂和他们的男人一起，扎根边疆，艰苦奋斗，终于改变了“一代而终”的屯垦历史。',1,0,0,0,'',0,0.0,0,'鲍成志','更新至44集',1508900192,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40492','H',0,0,NULL),(27884,49,'黄大年','丁勇岱,,,张凯丽,,,张佳宁,,,马跃,,,房子斌','大陆',NULL,2017,41,'电视剧《黄大年》以时代楷模、著名地球物理学家、吉林大学教授黄大年同志为原型，展现了他心有大我、至诚报国，教书育人、敢为人先，淡泊名利、甘于奉献的爱国情怀和高尚情操，用短暂一生书写新时代知识分子爱国情怀，把个人奋斗融入实现中华民族伟大复兴中国梦的感人故事。',1,0,0,0,'',0,0.0,0,'杜军','更新至06集',1508293389,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40784','H',0,0,NULL),(27885,56,'鲁豫有约',NULL,'大陆',NULL,2017,42,'节目寻访拥有特殊经历的人物，一起见证历史、思索人生，直指生命与心灵的秘密，创造一种新颖的谈话记录。',1,0,0,0,'',0,0.0,0,NULL,'20171024期',1508899956,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/13746','L',0,0,NULL),(27886,49,'梦想越走越近','梁爱琪,,,于晓光,,,宋佳伦','大陆',NULL,2017,43,'赵家村农业大户在掌门人赵永和及长子赵家强相继过世后，留下让大儿媳文秀接管赵家农场的遗言，其子女 们为争夺遗产各怀私心，赵周两家的孩子发生激烈冲突，在家庭面临着四分五裂的危难时刻，田月英为了完成丈夫的遗愿扶助文秀接管赵家农场。文秀接管赵家之后，众人对她持排斥和怀疑的态度，各家纷纷对其发难。尤其是赵家的大女婿于得利私心太重，垂涎赵家产业，更是把文秀视为眼中钉，时刻想把文秀赶出赵家。即使这样，文秀还是一心扑在企业上，提出一个大胆的想法,打破赵家农场的旧模式，却因此激怒了村民，在亲戚的挑唆下要把文秀赶出村子。关键的时刻，正民和家平挺身而出。善良上进的文秀在云鹏、正民、家平、丽珠和共同扶持下，带领赵家村历尽磨难终于走向城镇化。而文秀和云鹏几经分离，也最终看清了彼此是相爱的人，携手走到了一起。',1,0,0,0,'',0,0.0,0,'杨晶','更新至32集',1508899905,1508319036,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{i