的消息，连载平台暂未公布。另外，偶像大师推出的乙女向游戏偶像大师SideM也将与本作进行联动，协作企划内容也将在后续的event中发表。',1,0,0,0,'',0,0.0,0,'伊藤祐毅','13集全',1508313276,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/33969','H',0,0,NULL),(27914,55,'从零开始的魔法书','花守由美里,小山刚志,大地叶,加藤将之,子安武人','韩国',NULL,2017,74,'教会历526年——。世界上有魔女存在，“魔术”也得到普及。然而，世界还并未知晓“魔法”的存在。在这样的时代里，还有着被人们蔑称为“堕兽人”的半人半兽的佣兵。他就这样每日被魔女觊觎着，还梦想着能成为人类，直到某天在森林中遇到的美丽魔女改变了他的命运。“——想变回人类吗？那么佣兵，成为吾辈的护卫吧！”自称为零的魔女说自己的【零之书】——一本一旦使用不当甚至可能毁灭世界的魔法书不知被谁盗走，现正在寻找这本书的旅途中。佣兵以零使用力量帮助他成为人类为条件，接受了成为自己最讨厌的魔女的护卫的要求。围绕着禁断的魔法书，人们的思绪开始纷乱交错……。&nbsp;<br />　　高贵的魔女与温柔的兽人所带来的极上幻想剧。',1,0,0,0,'',0,0.0,0,'平川哲生','12集全',1508314051,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/33827','C',0,0,NULL),(27915,64,'生吃','加朗斯·莫里利尔,艾拉·朗夫,哈巴·奈·乌飞拉,劳伦特·卢卡斯,乔安娜·普莱斯,伯利·兰内尔,玛丽安·费尔努,让·路易斯·斯比尔,维吉尔·勒克莱尔,贝兰奇尔·麦克尼斯','法国',NULL,2016,75,'生吃》是一部生猛至极的青少年恐怖片，也是年轻女导演朱莉娅·杜可诺的长片处女作。讲述的是一个16岁的出生于兽医之家的素食主义美少女，在进入大学之后经历了一系列事件，逐渐唤醒自己内心潜藏的恶魔，开始啃噬人肉的故事。&nbsp;<br />　　影片跟随女主角Justine，她从被迫吃下一颗生的兔子肾 脏之后，便开始出现身体上的异常，直到最终无法压抑自己内心的恶魔，开始茹毛饮血。',1,0,0,0,'',0,0.0,0,'朱莉娅·杜可诺','BD1280高清中字版',1508314456,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/36018','S',0,0,NULL),(27916,3,'缝纫机乐队','大鹏,乔杉,古力娜扎,李鸿其,韩童生,曲隽希,于谦,岳云鹏,王劲松,于洋,代乐乐,赵英俊,马大明,张一鸣,衣云鹤,曹然然,曹桐睿,宋小宝','大陆',NULL,2017,76,'《缝纫机乐队》是大鹏的第二部导演作品，延续了小人物逐梦的故事，讲述了一群有趣的摇滚爱好者帮小镇集安重拾音乐梦想的故事。&nbsp;<br />　　小镇青年胡亮（乔杉 饰）为守护家乡摇滚公园，高薪请来音乐经纪人程宫（董成鹏 饰）筹办演唱会。最后集合了鼓手-炸药（李鸿其 饰），贝斯手-丁建国（娜扎 饰），吉他手-杨双树（韩童生 饰），键盘手-希希（曲隽希 饰）组建了“缝纫机乐队”，演出筹备之际，当地房地产大亨为尽快拆除公园，表示愿出高价迫使程宫取消演出。面对高额诱惑和音乐梦想，程宫该何去何从？摇滚小镇集安的摇滚公园能否保全，集安人的摇滚梦想又将何去何从呢……',1,0,0,0,'',1,0.0,0,'大鹏','TC中字版',1508314464,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40923','F',0,0,NULL),(27917,55,'有顶天家族2','樱井孝宏,诹访部顺一,吉野裕行,中原麻衣,能登麻美子','日本',NULL,2017,77,'　　京都下鸭神社，居住于纠之森的下鸭家。继承了过去曾为狸猫界头领的亡父·总一郎的血脉的四兄弟，围绕着热爱宝冢的母亲，一直过着自己快乐的日子。 　　以继承了总一郎浓厚“傻瓜的血脉”的三男·矢三郎为中心，众人迎来了狂乱的一夜。自那一天，下一任“伪右卫门”的选举，叔父·夷川早云的策略，还有与“星期五俱乐部”之间发生的事，全都随着一阵风就这样在京都的夜空中远去，季节变换，洛中到了清香飘溢的新叶之季。毛球们毫不在意屁股的寒冷，开始蠢蠢欲动。 　　被天狗诱拐而获得神通力的人类美女·弁天离开了京都，苦恋着得意门生弁天并一直隐居着的大天狗·赤玉老师如意岳药师坊一边散发着寂寞与不快，一边仍旧每天在其破旧公寓中从不叠好的被褥上喝着赤玉红葡萄酒。 　　就在这个时候，赤玉老师的儿子，即在壮烈的父子吵架的最后因败北而离开的“二代目”，成为了英国绅士后，时隔百年终于归国。大惊失色。惊天动地。大吃一惊。这一震动天狗界以及狸猫界的大消息瞬间扩散到洛中内外。 　　以京都小镇为舞台，搅动人与狸猫以及天狗的想法的毛球绘卷第二集，终于开幕！',1,0,0,0,'',0,0.0,0,'吉原正行','12集全',1508314579,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/33708','Y',0,0,NULL),(27918,55,'怪怪守护神',',三瓶由布子,,,大空直美,,,久保由利香,,,松井惠理子,,,芝崎典子','日本',NULL,2017,78,'加贺见一也有着一条母亲留给他的遗物「樱花腰带」，但在某天，腰带竟然变身成一位穿和服的美少女桐叶，并理所当然地住了下来。此外，一也身边还有一个很爱找他麻烦的辫子眼镜妹班长千里，以及过度保护他，且动不动就想跟他一起洗澡的姐姐，在众多美少女围绕下，一也展开了一段掺杂著开心、害羞、与恐怖心情的全新生活。',1,7,0,0,'',0,0.0,0,'仓谷凉一','12集全',1508315320,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/33893','G',0,1,NULL),(27919,55,'飙速宅男 第三季','山下大辉,鸟海浩辅,福岛润,岸尾大辅,松冈祯丞,宫田幸季,诹访彩花,诹访部顺一','日本',NULL,2017,79,'总北高中自行车竞技部所属的一年级生·小野田坂道，与同年级的今泉俊辅和鸣子章吉、三年级的金城真护、卷岛裕介、田所迅一同以“Team总北”的身份在全国大赛中出场。他们突破了与王者·箱根学园以及京都伏见等对手学校的激烈比赛，漂亮地获得了综合优胜。那样炎热的夏天也已过去，三年生即将引退，总北以“新世代”的队伍在全国大赛中连霸为目标，终于开始进发！',1,0,0,0,'',0,0.0,0,'锅岛修','25集全',1508316455,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/13957','0',0,0,NULL),(27920,56,'WTO姐妹会','高伊玲,,,谢哲青','台湾',NULL,2009,80,'《WTO姐妹会》[1]是台湾八大电视台（GTV）第1台27频道每周一到周四晚间22点到23点播出的软性访谈节目，主要讨论世界各国的文化大冲击！国情不同擦出的趣味火花！到底老外是怎么看台湾呢？WTO姐妹会让您在台湾看见世界之窗。 　　世界各国的文化大冲击！国情不同擦出的趣味火花！到底老外是怎麼看台湾呢？于美人让您在台湾看见世界之窗！',1,0,0,0,'',0,0.0,0,NULL,'20171017期',1508316749,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40234','W',0,0,NULL),(27921,54,'爱情的温度','徐贤真,,,梁世宗,,,金材昱','韩国',NULL,2017,81,'此剧讲述了电视剧作家志愿生和梦想成为法国厨师的男人之间的爱情喜剧故事。',1,0,0,0,'',0,0.0,0,'河明熙','更新至18集',1508316813,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40030','A',0,0,NULL),(27922,56,'爱玩客','詹姆士（本名郑坚克）,,,夏于乔,,,吴凤,,,钟昀呈,,,自由发挥','台湾',NULL,2011,82,'《爱玩客》是三立电视台的一款推荐美食和旅游胜地的节目。由詹姆士等人联合主