.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40258','D',0,0,NULL),(27927,56,'麻辣天后传','未知','台湾',NULL,2017,87,'2017年台湾综艺节目《麻辣天后传2017》在中天综合台电视台首播以来,收视率居高不下,该节目由利菁主持，本站已有14名观众作出评价，「麻辣天后」利菁回来了！中天综合台明年１月２日起推出带状大型谈话综艺节目《麻辣天后传》，利菁暌违４年，重磅回归谈话综艺舞台，节目由伊林娱乐总经理陈婉若与孙乐欣携手合作。她对于復出很期待，还搞笑自嘲：「总不能让粉丝一直看重播节目，毕竟那时候长得不一样！」《麻辣天后传》大玩「古装穿越」，她化身东方女王准备再展风采，宣传照霸气无比。',1,0,0,0,'',0,0.0,0,'利菁','20171017期',1508317037,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40529','M',0,0,NULL),(27928,56,'美凤有约','陈美凤','台湾',NULL,2004,88,'《美凤有约》，是民视美食节目，是由陈美凤主持，提供食谱资料、当周节目介绍及曾介绍的店址的一档娱乐饮食节目。',1,0,0,0,'',0,0.0,0,NULL,'20171017期',1508317073,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40298','M',0,0,NULL),(27929,56,'美食好简单','郁芳','台湾',NULL,2017,89,'美食好简单是台湾一档美食栏目，节目主持郁芳、主厨温国智每期教你制作一种精品美食。',1,0,0,0,'',0,0.0,0,NULL,'20171017期',1508317109,1508319038,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40269','M',0,0,NULL),(27930,53,'三代同堂 第一季','Brian,Unger,,,凯伦,科尔曼,,,鲍比·莫尼汉,,,约翰·拉尔奎特','美国',NULL,2017,90,'探讨生命题材的CBS单镜头喜剧《我的过去、现在与未来Me, Myself &amp; I》通过描述一个人不同的生命历程来探讨生命的轨迹，有点《少年时代 Boyhood》电视剧版的感觉。该剧虽然描述50年跨度的人生，但是主要截取主角Alex Riley三个重要的人生阶段，在过去1991年的14岁少年时代，在现在2017年的40岁壮年时代，以及在未来2042年65岁的老年时代。《周六夜现场 Saturday Night Live》卡司Bobby Moynihan饰演40岁壮年时代的Alex﹑John Larroquette饰演65岁的主角﹑Jack Dylan Grazer则饰演少年时代的主角。',1,0,0,0,'',0,0.0,0,'兰德尔·艾因霍恩 / 托德·霍兰德','更新至04集',1508317155,1508319039,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40260','S',0,0,NULL),(27931,56,'食尚玩家','莎莎,,,颜永烈,,,谢炘昊,,,陈文翔','台湾',NULL,2007,91,'所谓“食尚玩家”，就是在游玩中享受美食，在美食中尽情游玩，所以每一期的《食尚玩家》节目都会选择一个台湾的城市或内地的城市或者其他国家的城市，同时设置一个主题，比如省钱游、浪漫游、相亲游、温暖游等，根据这个主题来进行节目的编排，选择当地有代表性或颇受网友好评的餐厅、旅游景点、人文景观、自然风景等，通过主持人在该地区的游历和对该地区的介绍，让观众了解该地区独特的美食、美丽的自然风景和当地的人文习俗等，也会向观众推荐一些颇受当地人好评或颇受网友好评的餐厅、酒店、民宿、夜市、旅游景点、礼品店等，为观众的出行提供了很好的建议，同时，《食尚玩家》节目通过对各个地区的美食和游玩的介绍，向观众传达享受生活、热爱生活的积极向上的观念。 　　在台湾，由名人或知名老饕推荐的美食总是特别让人跃跃欲试，由此《食尚玩家》节目应运而生。2007年2月4日在台湾无线卫星电视台戏剧娱乐频道（TVBS欢乐台）首播。现节目每周在TVBS欢乐台播出四期，由莎莎、颜永烈、浩角翔起等新生代主持人担当主持',1,0,0,0,'',0,0.0,0,NULL,'20171017期',1508317184,1508319039,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15741','S',0,0,NULL),(27932,56,'天天乐财神','梁赫,徐乃麟','台湾',NULL,2017,92,'4月10日起播出的益智节目《天天乐财神》，邀请徐乃麟、梁赫群搭档主持，10日下午进棚拍摄定装照。徐乃麟说节目是以扑克牌游戏为主，要获胜靠得不是运气，而是看谁「城府多深」，梁赫群在一旁帮腔，尔虞我诈、挑拨离间、舌灿莲花都是徐的工作，两人互亏互捧、一搭一唱，根本不像首次合作，配合良好。徐乃麟曾录制同类型节目，有着「乃至尊」封号，询问这次有无其他称呼？他笑说：「这次应该搞一个噱头，叫『乃皇』好了！」被一旁梁赫群笑亏：「是一种（奶黄）包吗？」冷笑话瞬间气氛降冰点。',1,0,0,0,'',0,0.0,0,'未知','20171017期',1508317270,1508319039,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40525','T',0,0,NULL),(27933,56,'同学搞什么鬼','纳豆,舒子晨,','台湾',NULL,2017,93,'同学！搞什么鬼，每个人在学校，或多或少都有听过，甚至亲身遭遇过一些非旁人所能想像的离奇灵异经验。让人在茶余饭后，甚至是多年之后回想起来，仍是令人觉得不可思议！年轻的学生或族群，总是有一股傲人的胆量，喜欢挑战一些”大人们”觉得不可为的规则和禁忌',1,0,0,0,'',0,0.0,0,'未知','20171017期',1508317303,1508319039,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40531','T',0,0,NULL),(27934,56,'小明星大跟班','吴宗宪,,,吴姗儒','台湾',NULL,2016,94,NULL,1,0,0,0,'',0,0.0,0,'未知','20171017期',1508317343,1508319039,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/13290','X',0,0,NULL),(27935,55,'新唐老鸭俱乐部','林-曼努尔·米兰达,,,贝克·班尼特,,,凯特,米库契,,,鲍比·莫尼汉,,,丹尼·朴迪','美国',NULL,2017,95,'The adventures of millionaire Scrooge McDuck and his nephews, as they travel around the world in search of treasure and wealth.',1,0,0,0,'',0,0.0,0,'弗朗西斯科·安格内斯','更新到06集',1508317373,1508319039,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40275','X',0,0,NULL),(27936,56,'型男大主厨','曾国城','台湾',NULL,2017,96,'　　《型男大主厨》自2006年7月10日首播推出以来，收视率长期占据台湾美食教学类节目收视第一名的位置，内容综合烹饪节目性质及综艺竞赛型态，也成为艺人宣传作品必上的一个节目。',1,0,0,0,'',0,0.0,0,NULL,'20171017期',1508317678,1508319039,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40346','X',0,0,NULL),(27937,56,'综艺大热门','吴宗宪,,,欧汉声,,,陈汉典,,,阿达,,,LULU','台湾',NULL,2013,97,'《综艺大热门》，为三立都会台自2013年7月1日起首播的华人综艺节目，由吴宗宪、欧汉声、陈汉典、阿达、LULU主持。',1,7,0,0,'',0,0.0,0,NULL,'20171017期',1508317711,1508319039,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40376','Z',0,1,NULL),(27938,3,'西游降魔篇','文章,舒淇,黄渤,罗志祥,李尚正,陈炳强,赵志凌,周秀娜,杨迪,释彦能,冯勉恒,谢晶晶,何文辉,唐艺昕,卢正雨,张煜雯,葛行于,张超理,程思寒','大陆',NULL,2013,98,'大唐年间妖魔横行，一小渔村因为饱受鱼妖之害请来道士（冯勉恒 饰）除妖，年轻驱魔人陈玄奘（文章 饰）前来帮忙却被误认为骗子，幸亏职业赏金驱魔人段小姐（舒淇 饰）帮助玄奘制服了鱼妖真身（李尚正 饰）。二人又在高家庄为制服猪妖猪刚鬣（陈炳强 饰） 而再次相遇，这次除妖没有成功 ，但是段小姐却对玄奘二见钟情。玄奘求助师父，得知除妖的办法是去找被压在五指山下的孙悟空（黄渤 饰）帮忙，于是他准备前往五指山，途中又遇到段小姐和手下五煞，段小姐连蒙带哄想与玄奘在一起却屡次遭拒，在四妹（周秀娜 饰）调教下想变得更有女人味却适得其反。二人决裂后玄奘独自上路，与此同时降魔师（释延能 饰）、天残脚（张超理 饰）、空虚公子（罗志祥 饰）也一同前往除妖。经过千辛万苦玄奘终于找到孙悟空，段小姐又再次出现并交给玄奘一件重要的东西，猪妖终于被降服，但是更大的危机又出现在了玄奘面前，原来孙悟空与传闻中不一样，玄奘的除魔之路能否继续？&nbsp;<br />　　本片是周星驰多年之后的力作，演员阵容延续了以往，除了主演外，还请了诸如卢正雨、杨迪等网络红人加盟。',1,7,0,0,'',7,0.0,0,'周星驰,郭子健','BD1280高清国语|粤语中字版',1508318786,1508319039,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3942','X',0,1,NULL),(27939,66,'亚瑟与梅林','Kirk,Barker,Stefan,Butler','英国',NULL,2015,99,'A young Celtic warrior and a hermit wizard must unite to defeat an evil druid.<span style=\"font-size:12px\"></span>',1,0,0,0,'',0,0.0,0,'Marco van Belle','BD1280高清中英双字',1494685068,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/46','Y',0,0,NULL),(27940,78,'猪猪侠之英雄猪少年','易烊千玺,陈轶,张子琨,戎妍','大陆',NULL,2017,100,'<span style=\"font-size:12px\">传奇五灵锁拥有可以保护世界的神奇力量，却阴差阳错地选中了“一无是处”的猪猪侠（张子琨 配音）作为它的主人，此时出现了一个可怕的黑衣人，他的目标竟是要毁掉所有的五灵锁。初出茅庐的猪猪侠迎难而上，经历重重较量，猪猪侠发现了黑衣人竟然是十三年后的自己……</span>',1,0,0,0,'',0,0.0,0,'陆锦明,钟裕','BD1280高清中字',1494685835,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/49','Z',0,0,NULL),(27941,3,'一狱一世界：高登阔少蹲监日记','王宗尧,张建声,蔡瀚亿,廖启智','香港',NULL,2015,101,'<span style=\"font-size:12px\">于日辰（王宗尧 饰），身边充斥名车美女的富二代，一次酒后驾驶， 女途人被撞至重伤。肇事48小时内面对法庭裁决，判监一年半！踏进监狱生 涯，惊觉铁窗后的天地，是自成一国、奉行暗秩序的宇宙。只要懂得融入生 存法则，便可安然渡过刑期。于日辰利用自己的富二代思维及财势，执意将 刻板的监狱生活品质高度优化。我们熟悉的监狱，从此变得不一样！他的死 敌阿积（张建声 饰）竟也被判到同一监狱服刑。阿积一贯的狂妄放任，在 狱中恃财勾结少数族裔及大圈帮横行。在铁窗绝境之中面对强大压力，他将 如何自处？</span>',1,0,0,0,'',2,0.0,0,'孙立基','BD1280高清中字',1494686411,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/50','Y',0,0,NULL),(27942,44,'锦衣卫百户','王恒,蒋嵩斌','大陆',NULL,2017,102,'<span style=\"font-size:12px\">影片主要讲述锦衣卫平定叛乱的故事。明朝末年，安惠王勾结林将军企图造反称王。锦衣卫在民间化名成陈阿牛，暗中打探两人的暗中部署的情况，途中结识了朱淑元和宋炳星，三人齐心协力将安惠王和林将军就地正法，维护了明朝统治。</span>',1,0,0,0,'',0,0.0,0,'杨鼎天','BD1280高清中字',1494686875,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/52','J',0,0,NULL),(27943,66,'向死而生','宋俊龙,李泽宇,侍宣如,唐云靖','大陆',NULL,2017,103,'<span style=\"font-size:12px\">校花诗蓝长相甜美，身材高挑。模特专业的她刚刚毕业，与帅气的男朋友伟明一同进入盛世演艺公司做实习模特。二人颜值过人，形象气质极佳，专业素质优秀，很快在公司众多模特中脱颖而出，也遭到了很多人的妒忌。因为男友家境一般，诗蓝的父亲家辉始终不同意他们恋爱。在进入盛世公司后，伟明得到盛世集团的女总裁麦总的青睐，麦总经常以工作的理由单独接见伟明。麦总的儿子皓天个性张扬，一次偶然的机会遇到诗蓝，被她清新脱俗的美吸引，对诗蓝展开了追逐。诗蓝在两个男孩儿之中挣扎，有过误会、争吵、放弃，当诗蓝最后与皓天在一起时，一个惊天的秘密出现了，万念俱灰的她走上了高层楼顶……</span>',1,0,0,0,'',0,0.0,0,NULL,'BD1280高清中字',1494687289,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/53','X',0,0,NULL),(27944,66,'浴火凤凰2','潇戈,陈媛媛,蔡鹏飞','大陆',NULL,2017,104,'<span style=\"font-size:12px\">一个热爱钢管舞的美丽少女，痛苦地徘徊在梦想与现实之间。美到令人想哭的全裸舞蹈，完美地展现出少女内心的渴望与挣扎！在执着地追求梦想过程中，无法忘却曾经悲惨的过往，更无法逃避现实的残忍，最终涅槃重生的凄美故事。</span>',1,0,0,0,'',0,0.0,0,'谈宜之','BD1280高清中字',1494687671,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/54','Y',0,0,NULL),(27945,44,'杀手的祷告','萨姆·沃辛顿,奥德娅·拉什,艾伦·里奇,薇洛妮卡·恩切圭','美国',NULL,2017,105,'<span style=\"font-size:12px\">故事讲述杀手卢卡斯(萨姆·沃辛顿饰)被雇佣，刺杀女子艾拉(奥德娅·拉什饰)，而在紧要关头他开始怜悯女孩，并改变主意加入女孩的复仇计划之中。</span>',1,0,0,0,'',0,0.0,0,'乔纳森·莫斯托',NULL,1494731568,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/56','S',0,0,NULL),(27946,66,'八万里','赵宁宇,德姬,苟晓娟,班马才格尔','大陆',NULL,2015,106,'<span style=\"font-size:12px\">根据藏族奥林匹克第一人切阳什姐的事迹创作。讲述了一位身心受挫的汉族教练重拾自我，带领并培养藏族姑娘实现奥林匹克奖牌梦想的故事。</span>',1,0,0,0,'',0,0.0,0,'柯克',NULL,1494731713,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/57','B',0,0,NULL),(27947,78,'西部世界第一季','埃文·蕾切尔·伍德,安东尼·霍普金斯,艾德·哈里斯,坦迪·牛顿','美国',NULL,2016,107,'<span style=\"font-size:12px\">故事设定在未来世界，在一个庞大的高科技成人主题乐园中，有着拟真人的机器“接待员”能让游客享尽情欲、暴力等欲望的放纵，主要叙述被称为“西部世界”的未来主题公园。它提供给游客杀戮与性欲的满足。但是在这世界下，各种暗流涌动。部分机器人出现自我觉醒，发现了自己只是作为故事角色的存在，并且想摆脱乐园对其的控制；乐园的管理层害怕乐园的创造者控制着乐园的一切而试图夺其控制权，而乐园创造者则不会善罢甘休并且探寻其伙伴创造者曾经留下的谜团；而买下乐园的一名高管试图重新发现当年的旅程留下的谜团。</span>',1,0,0,0,'',0,0.0,0,'乔纳森·诺兰,强尼·坎贝尔,理查德·J·刘易斯,米歇尔·麦克拉伦,尼尔·马歇尔,文森佐·纳塔利,弗雷德·托耶,斯蒂芬·威廉姆斯','全10集',1494732840,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/58','X',0,0,NULL),(27948,66,'金矿','马修·麦康纳,埃德加·拉米雷兹,布莱丝·达拉斯·霍华德,寇瑞·斯托尔','美国',NULL,2016,108,'<span style=\"font-size:12px\">女星布莱丝·达拉斯·霍华德加盟《金矿》，顶替米歇尔·威廉姆斯，出演马修·麦康纳的女友。片中马修扮演的勘探专家联手一位地质学家(埃德加·拉米雷斯饰)，在印尼丛林中寻找金矿，他与女友的感情遭到前所未有的考验。影片由奥斯卡最佳编剧斯蒂芬·加汉执导，正在新墨西哥州拍摄。</span>',1,0,0,0,'',0,0.0,0,'斯蒂芬·加汉','BD1280高清中字',1494750308,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/376','J',0,0,NULL),(27949,78,'冰血暴第三季','伊万·麦克格雷格,凯莉·库恩,玛丽·伊丽莎白·温斯特德,大卫·休里斯','美国',NULL,2017,109,'<span style=\"font-size:12px\">第三季的时间线将回到2010年，第一季的几年后。伊万在剧中将饰演一对形象和性格大相径庭的兄弟，哥哥埃米特是明尼苏达州一个白手起家的房地产大亨，多金，英俊，拥有美满的家庭，他把自己的经历看做一段成功的美国励志故事。而弟弟雷则拥有截然不同的生活，秃顶，大腹便便，曾经高中的霸 王现在成了一名假释官，他把自己的不幸怪罪给哥哥。凯丽·库恩扮演的Gloria Burgle是伊甸谷（Eden Valley）警局局长，一位刚刚离婚的母亲。玛丽·伊丽莎白·文斯蒂德的角色名字叫Nikki Swango，是一个桥牌爱好者和刚刚获得假释的罪犯。</span>',1,0,0,0,'',0,0.0,0,'诺亚·霍利','更新至10集',1498152297,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/77','B',0,0,NULL),(27950,78,'斯巴达克斯：诅咒者之战第三季','连姆·麦肯泰尔,马努·贝内特,丹尼尔·弗雷里格尔,帕纳·贺玛·泰勒','美国',NULL,2013,110,'<span style=\"font-size:12px\">一边：葛雷博死后，斯巴达克斯和部下带领的克雷斯、甘尼克斯和艾力冈等带领下的奴隶起义军在向罗马进军的途中取得连续的胜利。解放后获得自由的奴隶们大多加入了这支军队，使得整个奴隶起义军的力量越发壮大。一步一步地威胁着罗马的统治。在这种形势下，斯巴达克斯比以前更坚信能拿下罗马；阿苏尔死后有意卸甲归田的妮维雅和克雷斯也重新找到了为之战斗的精神力量；反倒是甘尼克斯开始沉溺在糜烂的床上生活，和美女蛇萨莎搞在了一起。另一边：罗马元老院得到了财主克拉苏的援助。克拉苏是一个有勇有谋的人物，他懂的吸取前人的经验，并且尊重对手。加上年轻且战场经验丰富的凯撒加盟，克拉苏和斯巴达克斯的战争迫在眉睫。总之，《斯巴达克斯：亡者之役》将会带来你未曾见过的传奇史诗之旅。</span>',1,0,0,0,'',0,0.0,0,'马克·贝斯利,杰西·沃恩,约翰·福西特,迈克尔·赫斯特,T·J·斯科特,里克·雅各布森','全10集',1494734282,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/81','S',0,0,NULL),(27951,46,'黑暗录像带','Emilia,Ares,Zoryan,Danielle,Baez,Katelyn,Bailey','美国',NULL,2017,111,'<span style=\"font-size:12px\">A genre-defying mixture of horror, sci-fi, myth, mystery and thrills told as four interlocking tales in one intelligent anthology. Ghosts, spirits, creatures, demons and more from the paranormal world collide with rational curiosity.</span>',1,0,0,0,'',0,0.0,0,'Vincent J. Guastini,Michael McQuown','BD1280高清中英双字',1494750088,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/375','H',0,0,NULL),(27952,3,'盖文·斯通复活','Nicole,Astra,布雷特·道顿,Emily,Eruraviel,尼尔·福林','美国',NULL,2016,112,'<span style=\"font-size:12px\">Gavin Stone, a washed-up former child star, is forced to do community service at a local megachurch and pretends to be Christian so he can land the part of Jesus in their annual Passion Play, only to discover that the most important role of his life is far from Hollywood.</span>',1,0,0,0,'',0,0.0,0,'Dallas Jenkins','BD1280高清中英双字',1494749922,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/374','0',0,0,NULL),(27953,44,'大话西游之大圣娶亲加长版',NULL,'香港',NULL,2000,113,NULL,1,0,0,0,'',2,0.0,0,NULL,NULL,1494756651,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/96','D',0,0,NULL),(27954,3,'麻烦家族',NULL,'大陆',NULL,2000,114,NULL,1,0,0,0,'',0,0.0,0,NULL,NULL,1494757065,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/98','M',0,0,NULL),(27955,78,'斯巴达克斯第二季','连姆·麦肯泰尔','美国',NULL,2000,115,'《斯巴达克斯:复仇》于2012年1月27日在美国上映，是美剧《斯巴达克斯》第二季。该片是Michael Hurst执导的历史、动作、奇幻电视剧。连姆·麦肯泰尔、露西·劳伦斯参演了该电视剧。<br /><br />《斯巴达克斯:复仇》继续讲述角斗士的大暴动，罗马共和国为此深感惊恐。盖乌斯·克罗迪斯·葛雷博率领罗马军队前往卡普亚，企图消灭日渐壮大的、以斯巴达克斯为首的自由奴隶军，永绝后患。斯巴达克斯面临两个选择，要么向奴役且杀害他妻子的人复仇，了结私人恩怨，要么忍辱负重，保存处于萌芽状态的奴隶军。',1,0,0,0,'',0,0.0,0,'Michael Hurst','全10集',1494757485,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/99','S',0,0,NULL),(27956,3,'乘风破浪',NULL,'大陆',NULL,2000,116,NULL,1,0,0,0,'',1,0.0,0,NULL,NULL,1494757770,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/109','C',0,0,NULL),(27957,44,'人口交易',NULL,'英国',NULL,2000,117,NULL,1,0,0,0,'',0,0.0,0,NULL,NULL,1494757861,1508319139,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/110','R',0,0,NULL),(27958,49,'蔚蓝50米','赵志伟,徐洋,何昕霖,张瑞涵','大陆',NULL,2017,119,'<span style=\"font-size:12px\">高能氧气剧《蔚蓝50米》是以游泳运动为主题，讲述了游泳少年们为了梦想而奋斗的故事。</span>',1,0,0,0,'',0,0.0,0,'黄元达','更新至12',1508891992,1508319149,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6332','W',0,0,NULL),(27959,49,'高能医少','魏大勋,李昕芸,李泉,孟广美','大陆',NULL,2017,122,'<span style=\"font-size:12px\">自小在孤儿院长大的华一龙，为了替孤儿院的孩子治病，考入全国顶尖的医学院，并在这里结识了魔鬼导师段添城、跆拳道女孩栗小草、“学霸”楚枫、农村来的郝开心和“富二代”权美秀。几个性格各异的医学生朝夕相对，在实现理想的路途中并肩前行。在与伙伴的相处和与老师的交锋中，华一龙获得了伙伴们珍贵的友谊，与栗小草的恋情也逐渐发展，和段添城从相互对抗到相互认同，并且在伙伴们的帮助下，为段添城完成了脑瘤手术，最终从一个对医学一无所知的倔强少年成长为一名合格的医学生。</span>',1,0,0,0,'',0,0.0,0,'李昕芸','更新至24',1508286471,1508319149,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5063','G',0,0,NULL),(27960,49,'通天狄仁杰','任嘉伦,阚清子,焦俊艳,陈奕','大陆',NULL,2017,123,'<span style=\"font-size:12px\">唐高宗年间，阎立本偶遇狄仁杰（任嘉伦 饰）蒙冤入狱事件，在助其自救后，发现他是断案奇才。适逢皇上派他去感业寺查案，遂决定带狄仁杰一同前往。在感业寺，狄仁杰侦破奇案，化解了一场佛门大劫，并与武媚娘结缘。狄仁杰一鸣惊人，被皇上派往并州，在此期间，他屡破奇案，被称为神判。时有前朝鬼兵杀人事件，狄仁杰前去查看，发现与前朝宝藏及濮王李泰意图造反有关，却被毁灭证据，无法继续。此时，发生武媚娘杀害亲女，嫁祸王皇后之事，皇上召狄仁杰回长安调查。根据武媚娘提供的线索，狄仁杰破获此案，并在李泰的住所找到前朝宝藏，成为濮王谋反的确实证据。而狄仁杰也知道此前破案过程中每遇瓶颈时为他解惑的人竟是武媚娘，只觉武媚娘深不可测，野心更是超乎自己的想象。果然不久，唐高宗因风疾发作，让武媚娘一同上朝，合称二圣临朝。</span>',1,0,0,0,'',0,0.0,0,'叶昭仪,李文龙','更新至64',1508889903,1508319149,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3772','T',0,0,NULL),(27961,49,'那片星空那片海 贰','冯绍峰,郭碧婷,王阳明,刘恩佑','大陆',NULL,2017,125,'<span style=\"font-size:12px\">大唐盛世，锦绣繁华。在造船业发达的滨海小镇常乐，人类女子陆漓女扮男装混入造船厂，希望能在船厂大展身手，实现自己扬帆远航的梦想，鲛人王子吴居蓝也带着神秘任务来到船厂，两人不打不相识，产生了纯洁的爱情。随着陆漓和吴居蓝的相爱，两人背后的阴谋也逐渐浮出了水面，陆漓在亲情和爱情之间痛苦挣扎。最终，陆漓和吴居蓝用爱化解了仇恨，人类和鲛人终于和平共处，同享盛世繁华。</span>',1,0,0,0,'',0,0.0,0,'卫翰韬','更新至26',1508890279,1508319149,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5540','N',0,0,NULL),(27962,49,'爱人·同志','王雷,李小萌,罗昱焜,王鹏凯','大陆',NULL,2017,126,'<span style=\"font-size:12px\">镇上宣传新思想的富家小姐欧阳春晓的影响，为逃避各自不幸的爱情和婚姻而逃离小镇来到广州。陈桂做了缫丝女工，沈梦苏在欧阳春晓帮助下入读坤雅女子中学，在新学校里，梦苏学习新文化接受新思想的洗礼和熏陶，认识了青年教师、共产党员麦秋实。从此，三个不同出身、不同性格的年轻女性与麦秋实等人一起，经历了省港大罢工、广州起义、白色恐怖等革命斗争的暴风骤雨……在坚守连接粤港澳和江西苏区交通线的过程中，这群青年经历了血与火的考验，面对危险、背叛、误解，最终沈梦苏和麦秋实一起坚定了信仰，一道沿着迢遥的山路踏上了战火连天的新征途，与大部队北上参加二万五千里长征。本剧从新的角度讲述了第一代中国共产党人的“中国梦”，讲述了她们的爱情、命运和奋斗故事，从人性、人文的角度回望上世纪二、三十年代波澜壮阔的中国历史。本剧将焦点对准革命历史中的女人，着力塑造了沈梦苏这个为信仰和爱付出一切的传统女性，在风云变幻的大时代里浮沉起落。一个女人想要与自己所爱的人在一起竟是如此艰难。在刀锋嗜血、白色恐怖的极端环境中，有爱不敢爱，相爱不能爱；又在对信仰的追寻和坚守中得到爱的升华和实现了命运的涅槃。这是一个女人的成长史和爱情史诗，这是一群女性情感和命运的故事。</span>',1,0,0,0,'',0,0.0,0,'毛卫宁','全50集',1508890918,1508319149,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5652','0',0,0,NULL),(27963,54,'20世纪少男少女','韩艺瑟,金知硕,李尚禹,柳贤静','韩国',NULL,2017,131,'<span style=\"font-size:12px\">《20世纪少年少女》是有关刻画未婚女性们的现实故事，主要讲述了35岁的三个女人的友情和爱情故事，母胎单身的她们经历了恋爱成长期成熟了，通过三个女性来传达关于父母和女儿的亲情，家的意义以及邻居之情的故事。出演的演员还有柳贤京，安世夏，李尚熙，吴尚津，gugudan康美娜（韩艺瑟儿役）SF9金仁诚#（金基石儿役）。该剧由参与《请回答》系列剧本创作的副编剧李善惠执笔，《家和万事成》导演执导，将接档《王在相爱》9月播出</span>',1,0,0,0,'',0,0.0,0,'李東允','连载6',1508305572,1508319149,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5848','2',0,0,NULL),(27964,54,'不良家庭','李俊赫,申恩庆,宋智浩,洪書英','韩国',NULL,2017,133,'<span style=\"font-size:12px\">想搞外遇的妈妈，不想做家长的爸爸，不想就业的儿子，想退学的女儿，在这家庭里各自都扮演着不良角色又相对和谐的四位，以未成年女儿出轨为契机想恢复正常的家庭，不过越努力越变得糟糕。一点都不像家庭似的的喜剧。</span>',1,0,0,0,'',0,0.0,0,'金敏慶','全1集',1508305697,1508319149,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6361','B',0,0,NULL),(27965,54,'达顺的春天',NULL,'韩国',NULL,2000,1261,NULL,1,0,0,0,'',0,0.0,0,NULL,'连载46',1508305746,1508319149,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3530','D',0,0,NULL),(27966,49,'冯梦龙传奇','阎维文,胡哲行,侯岩松,','大陆',NULL,2017,135,'冯梦龙，苏州人，明代著名文学家、思想家、戏曲家，他的作品有近3000多万字，尤以《喻世明言》、《警世通言》、《醒世恒言》等著述创造了中国通俗文学的新高度，为后世称颂。影片萃取冯梦龙一生几个重要时期的经历，以历史正剧的艺术形式，生动而立体地描述大时代背景下他丰硕的文化创造、高洁的人生操守、勤廉的为政理念和坚贞的爱国情...</span><span class=\"intro-more hide\">简介：冯梦龙，苏州人，明代著名文学家、思想家、戏曲家，他的作品有近3000多万字，尤以《喻世明言》、《警世通言》、《醒世恒言》等著述创造了中国通俗文学的新高度，为后世称颂。影片萃取冯梦龙一生几个重要时期的经历，以历史正剧的艺术形式，生动而立体地描述大时代背景下他丰硕的文化创造、高洁的人生操守、勤廉的为政理念和坚贞的爱国情操，尤其浓墨重彩地表现了冯梦龙在福建寿宁做知县时兴办学校、消除匪患和虎患、歼灭倭寇、禁溺女婴、兴办水利等务实爱民的政治作为。影片充分表现其爱民、清廉的形象。',1,0,0,0,'',0,0.0,0,'高峰','高清',1508256596,1508319151,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22325','F',0,0,NULL),(27967,49,'那年花开月正圆',',孙俪,陈晓,何润东,任重,胡杏儿,','内地',NULL,2017,137,'1884年，周滢跟着养父周老四来到关中，输光钱财的周老四将周滢卖到沈家当丫头。周滢逃跑时躲进吴家东院大少爷吴聘的轿中，颇具商业头脑的周滢得到了吴蔚文的赏识，被获许留在吴家。沈星移怀疑沈家大少爷被吴聘暗杀，出手将其打伤。为救昏迷的吴聘，周滢嫁入吴家冲喜。吴聘身亡，吴家处境困窘，周滢决定要重振吴家东院。周滢入股陕西织布局，却遭受了朝廷反对洋务运动势力的打击，陕西机器织布局面临重建。为救深陷牢狱的周滢，吴家交出陕西机器织布局的所有股份以及与洋商的生丝合同换得周滢一命。出狱后的周滢重燃斗志建立泾阳布厂，吴家产业再次有了新起色。庚子国难，周滢用自己的方式担起了吴家大业的重振之风，又引领了动荡时局的改革之路。',1,0,0,0,'',0,0.0,0,'丁黑','全74集',1508256684,1508319151,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1033','N',0,0,NULL),(27968,49,'大漠雄心','张译文,黑雯丽,花昆,','大陆',NULL,2017,138,'陕北汉子石光银为拔掉穷根，锁住黄沙，他几乎卖光了所有家当，爱子也不幸遇难。但他仍坚守着“生命不息，治沙不止”的信念，带领乡亲在人迹罕至的荒沙滩里植树种草。石光银在治沙过程中，不知卖掉了多少只羊、多少头牛、多少匹马，寂寞、劳累、困惑时喝过多少瓶烧酒，唱过多少曲信天游。一场场风沙曾刮走了他努力过的一切，但他凭借永不放...</span><span class=\"intro-more hide\">简介：陕北汉子石光银为拔掉穷根，锁住黄沙，他几乎卖光了所有家当，爱子也不幸遇难。但他仍坚守着“生命不息，治沙不止”的信念，带领乡亲在人迹罕至的荒沙滩里植树种草。石光银在治沙过程中，不知卖掉了多少只羊、多少头牛、多少匹马，寂寞、劳累、困惑时喝过多少瓶烧酒，唱过多少曲信天游。一场场风沙曾刮走了他努力过的一切，但他凭借永不放弃的精神，创造了一个又一个的奇迹。正因为这种执着的精神，在沙漠中，由开始的一个人、一棵树，慢慢变成一伙人、一片树，最后形成了一片绿洲。石光银的治沙精神改变了当地的自然面貌，改变了人们的生活，激励着一代又一代的人们为治沙而奋斗。',1,7,0,0,'',2,0.0,0,'强小陆','正片',1508256731,1508319151,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22580','D',0,2,NULL),(27969,44,'超霸女郎','任达华,张敏,李雨珊,','香港',NULL,1994,140,NULL,1,0,0,0,'',0,0.0,0,'李建生','正片',1489411144,1508319757,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1','C',0,0,NULL),(27970,44,'老板的故事','周润发,叶童,秦豪,','香港',NULL,1995,141,NULL,1,0,0,0,'',0,0.0,0,'韦家辉','正片',1489411595,1508319757,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/2','L',0,0,NULL),(27971,44,'血滴子秘史','王华,赵志刚,韩海华,','大陆',NULL,2000,142,'清雍正年间。登基之初，雍正（叶志康 饰）用毒酒诛灭为帮其篡位的“血滴子”杀手团，赴宴的邱钟琪（王华 饰）看出酒中端倪，佯饮后转身吐于袖囗。雍正离席后，大内高手将中毒后一息尚存的杀手团成员逐一绞杀，邱钟琪索取一大内首级，绝尘而去。雍正遂将大功臣年羹尧连降十八级，国舅隆科多禁锢畅春园，妻女发配黑龙江为奴。遭贬的年羹尧不...</span><span class=\"intro-more hide\">简介：清雍正年间。登基之初，雍正（叶志康 饰）用毒酒诛灭为帮其篡位的“血滴子”杀手团，赴宴的邱钟琪（王华 饰）看出酒中端倪，佯饮后转身吐于袖囗。雍正离席后，大内高手将中毒后一息尚存的杀手团成员逐一绞杀，邱钟琪索取一大内首级，绝尘而去。雍正遂将大功臣年羹尧连降十八级，国舅隆科多禁锢畅春园，妻女发配黑龙江为奴。遭贬的年羹尧不知去向，邱钟琪也不知所踪。鄂尔泰建言雍正利诱年羹尧，以引邱钟琪露面。在雍正与鄂尔泰亲访天下第一剑李嗣庭（赵志刚 饰）途中，邱钟琪突然杀出来，欲取雍正首级，不料，却被英姑（王美玲 饰）用暗器制止……',1,0,0,0,'',0,0.0,0,'姚寿康','正片',1489411595,1508319757,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3','X',0,0,NULL),(27972,44,'同归于尽','王诗槐,周笑莉,曹秋根,','大陆',NULL,2000,143,'故事发生在三十年代的上海。捕探林梦山（王诗槐 饰）的恋人马秀秀（周笑莉 饰）被人发现死在上海开往日本的客轮上。不久前，马秀秀在日本的前夫陈德发（黄达亮 饰）曾派人来上海，林疑此人为凶手，但此时马秀秀又活生生出现在林梦山面前，死者是谁呢？经调查，当时装尸体的铁箱买主是外籍侨民巴德列，林亲眼见到他曾追打过一个叫李莲花（...</span><span class=\"intro-more hide\">简介：故事发生在三十年代的上海。捕探林梦山（王诗槐 饰）的恋人马秀秀（周笑莉 饰）被人发现死在上海开往日本的客轮上。不久前，马秀秀在日本的前夫陈德发（黄达亮 饰）曾派人来上海，林疑此人为凶手，但此时马秀秀又活生生出现在林梦山面前，死者是谁呢？经调查，当时装尸体的铁箱买主是外籍侨民巴德列，林亲眼见到他曾追打过一个叫李莲花（常红艳 饰）的女子，根据李母描述，死者可能就是其女儿。因上司崇洋媚外，林不得已借日本警方的力量拘捕了巴德列。数日后，陈德发抵沪，他纠结黑恶势力阻止林梦山继续侦察。马秀秀为救林梦山，在陈所住旅馆与其同归于尽......',1,0,0,0,'',0,0.0,0,'沈耀庭','高清',1489411139,1508319757,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4','T',0,0,NULL),(27973,44,'三少爷的剑','林更新,江一燕,蒋梦婕,','大陆',NULL,2016,144,'“剑气纵横三万里，一剑光寒十九洲”，神剑山庄三少爷谢晓峰（林更新 饰）惊才绝艳，十年来历经上千大战未尝一败，被天