，三个妈都为能有百合这样的女儿而感到骄傲和欣慰。历尽磨难，罗世亨也慢慢地被很傻、很天真的叶百合感动，二人幸福牵手。',1,0,0,0,'',0,0.0,0,'邵警辉','40集全',1495011257,1508319773,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1160','J',0,0,NULL),(28142,49,'历史的天空',',蒋晓勤,徐贵祥,姚远,邓海南,张丰毅,孙松,李雪健,李琳,于和伟,','内地',NULL,2004,313,'凹凸山区蓝桥埠镇村民姜大牙(张丰毅 饰)在迎亲路上，遭遇日军轰炸，全村只有他、新娘子韩春云(李琳 饰)、同乡陈墨涵(孙松 饰)和朱预道(林永健 饰)四人侥幸逃生。在人生选择上，姜大牙和朱预道想投国民党，却进了新四军的队伍；而陈墨涵和韩春云想投新四军，却被国民党抓差。他们的人生境遇从此更改：在司令员杨庭辉(李雪健 饰)的栽培下，姜大牙成长为一名新四军将领，但是他的劣习却引来了部分同志的意见：张普景觉得他思想觉悟不够，窦玉泉觉得他资历尚浅。而江古碑(于和伟 饰)则嫌他对宣传干事东方闻音(殷桃 饰)示爱，从此怀恨在心，这令姜大牙的遭受了不少坎坷。与此同时，陈墨涵与韩春云也在国民党军队中找到了各自的位置。昔日的同乡，时敌时友，随时势而变。',1,0,0,0,'',0,0.0,0,'高希希','32集全',1495011259,1508319773,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1161','L',0,0,NULL),(28143,49,'别逼我结婚',',于漫洋,朱雨辰,车晓,高露,凌潇肃,佟悦,','内地',NULL,2014,314,'通过讲诉发生在“老男孩”身上的爱情、生活、事业中的大小故事，展现了在同一片蓝天下，不同阶层的价值观、人生观交织碰撞。面对婚姻，是为了所谓的和谐而牺牲掉尊严和自我，还是为了真爱，不惜放弃原有的坚持和追求，生活的磨练终会让人们找到合适自己的位置。',1,0,0,0,'',0,0.0,0,'李木戈','34集全',1495011261,1508319773,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1162','B',0,0,NULL),(28144,49,'小娘惹',',欧萱,黄慧,戚玉武,方展发,戴向宇,','其它',NULL,2008,315,'故事从现代说起。年轻少女安淇与同学李修文从加拿大回到马六甲探望她的祖母－月娘。月娘眼见安淇其实是想逃避一些问题，所以就把她一生人的故事告诉安琪。月娘的一家黄家，在30年代是马六甲当地有名气的峇峇娘惹商人家族。月娘的母亲菊香是黄家二姨太天兰的女儿。虽然天兰贵为二姨太，但是因为她是被黄元强奸后才被纳为妾室，所以身份低微。天兰和菊香常被大婆桂花和她的一房人百般欺凌。菊香因为在9岁时生病变成聋哑，所以没有反驳能力，常常被黄家其他人当成出气袋般看待。黄家素来就想把家族生意扩大。眼见富商查理张可以帮助他们，黄元就把菊香许配给查里张。查理张为人沉迷肉欲，奸狡至极。菊香眼见如此，就反抗逃婚。逃婚时遇见日本摄影师山本洋介，其后结婚，并生了女儿月娘。八年后，日本开始进攻南洋地区。洋介眼见时势不明郎，于是拜托陈盛带菊香母女去伦敦。可惜，菊香在船上遇见桂花和他的女儿。桂花与她的女儿就狠心地把菊香和月娘抛进大海里。幸而菊香母女被海水冲到岸边，一家又得以团圆。其后，日本攻克马来亚，菊香与洋介被已经变成汉奸的查理张抹黑后，死在皇军手下。还活着的月娘就投奔到外婆家。虽然黄家已经搬到英国去，但是天兰和马姐阿桃则被留下。在外婆的督导下，月娘学习传统娘惹厨艺、女红，长大后就像她母亲一般漂亮。战后，黄家回到祖屋，也把月娘当成下人看待。月娘的美貌引来表姐的妒嫉，也引来了有钱的峇峇头家、出洋归国的富少、甚至英俊潇洒的英国军官的垂青，但她独爱一个“身无分文”的小司机。牛仔其实是名门子弟陈锡，是新加坡一商人家族的后代。眼见他的身份高贵，陈锡就隐瞒身份和月娘来往。他被月娘的纯真、善良和坚强感动，深爱上她，然而二人的恋情碰到重重阻难。在各方的压力下，陈锡被逼娶了月娘的表姐，月娘则被卖给杀猪贩刘一刀。刘一刀虽然外表粗鲁，但对视对人都非常细心。月娘不甘自己的一生由人摆弄，宁可结束自己的生命，都不会当刘一刀的妻子。她的刚烈反让刘一刀敬服，与她拜为义兄妹。最后，月娘与刘一刀发展燕窝和西洋商品买卖生意，生活尚算安稳。但是，黄家最后得罪查家，生意失败，家财更被秀娟骗走。黄家终于一无所有，惨淡收场。',1,0,0,0,'',0,0.0,0,'谢敏洋','32集全',1495011262,1508319773,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1163','X',0,0,NULL),(28145,49,'南侨机工英雄传',',,秋瓷炫,朱晓渔,于晓光,','内地',NULL,2015,316,'抗战打响，日军封锁我国运输路线，危急时刻神鼓滇缅公路撑起了抗战的后勤补给，这条神奇的公路自建成时就书写了一幕幕传奇。由于急缺司机和技工，来自南洋的三千余名华侨毅然归国，不顾前途艰险，共赴国难。方家兄弟是这些华侨中的典型。大哥方万海表面上是一个投靠日军的汉奸，实际上却是中共潜伏在日军内部的地下工作者；方万海委曲求全，忍受着所有亲人和朋友的误解，为了自己的信念，在生死之间游走。弟弟方千树本是纨绔子弟，对祖国的观念很是单薄；然而在战火中，方千树看着一个个好友在日军的轰炸下惨死、在疾病的痛苦中离世，这让方千树心中感到了无比的震撼，让他明白：为了民族和国家的希望，他要重新找寻前进的方向和生命的意义。',1,0,0,0,'',0,0.0,0,'于荣光','42集全',1495011264,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1164','N',0,0,NULL),(28146,49,'男才女貌之现代美女',',霍建华,杨恭如,王曦仪,于小伟,黎一萱,','内地',NULL,2008,317,'三个性格迥异的现代美女，却是关系融洽的“闺蜜”。雨涵(王曦仪饰)，新闻系出身，凭实力在电视台打拼多年。企管系毕业的林子琪(杨恭如饰)，从海外留学归来，任职化妆品集团主管。朱芸(黎萱饰)，电视台的天气预报主持。电视台摄像师肖杰秘密拍摄到子琪所在的“BABY”公司伪劣化妆品的生产线。结果，掀起轩然大波：林子琪被公司嫁祸，被迫辞职、雨涵对林子琪产生了信任危机，矛盾和冲突接踵而至。杂志总编杨光在采风时偶遇林子琪，一见倾心。失意的林子琪闲来无事，到杨光业余做蛋糕和插花教师的咖啡馆学习，再次与他不期而遇。子琪独自跑到海南旅游散心，已经对子琪深有好感地杨光紧跟而去。浪漫的邂逅，两人竟然决定闪电结婚！子琪回到上海新单位就职，却意外发现顶头上司竟然是杨光。如何对待彼此的关系，两人的婚姻面临考验。雨涵见好友已经嫁人，自己内心更加失落，大学时恋爱三年的男友周迈当初因为一句“先有事业再有爱情”已离她而去。周迈最后向她袒露决心放手的意图，雨涵备受打击。肖杰始终在鼓舞着她，深陷在情感旋涡中的雨涵，内心在犹豫中徘徊。朱芸与电视台技术人员霍京生，恋爱七年，却因霍家父母嫌弃朱芸是外地人而无法成婚。而霍京生的一事无成、整天沉迷于电脑游戏与程序设计，更是让朱芸对他爱恨交织，这段纠缠不清的感情又该何去何从？在2007年创新中国系列活动之一“中国企业国际竞争力论坛”上， 拥有“男才女貌”影视品牌的北京星光国际传媒赢得最具创新竞争力十大传媒机构大奖，“男才女貌”品牌也被评为传媒机构自主创新十大品牌，北大星光集团董事局主席倪鹰先生同时获得最具创新竞争力十大传媒人物殊荣，并提名为2007北京朝阳文化创意产业精英人物。作为北大星光打造的“男才女貌”系列的最新力作，26集都市情感伦理剧《现代美女》一改以往风格，把视角立足于都市生活，围绕现代女性展开故事。《现代美女》的故事发生在繁华的上海，电视编导雨涵、公司高管林子琪、电视主持人朱芸、进城打拼的陈辰和自由职业者陈青青。她们身份各异，却都如珍珠般明亮璀璨。现实生活并非风平浪静，种种意外、挫折频频来袭，令她们困惑、无措。现代美女用各自不同的心路历程讲述了一段耐人寻味的情感纠葛，真实再现美女背后的困惑无奈。',1,0,0,0,'',0,0.0,0,'蒋家骏','26集全',1495011266,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1165','N',0,0,NULL),(28147,49,'男才女貌',',林心如,陆毅,冯绍峰,曾黎,姜华,','内地',NULL,2003,318,'上海名牌大学毕业的苏拉与颜如玉是一对共患难的好朋友。刚毕业的她们工作还没有着落便要面临经济困扰，苏拉还在爱情上受挫，两人身心疲惫。她们俩发誓要立足上海，接着在好友芳芳的帮助下终于有了落脚的地方，更幸运地进了同一所旅行社工作。在一次偶然中，苏拉认识了年轻有为的CEO邱石，邱石被苏拉的气质吸引，他对苏拉百般追求，苏拉却无心恋爱，只把精力全部投进事业中。苏拉的表现得到了上司的肯定，却在激烈竞争中遭到了如玉的出卖。本是好友的她们选择了两条不同的道路，友谊破裂。伤心欲绝的苏拉最终接受了邱石的追求，更与往日上司景飒开设了一间女子酒吧。正当一切都看起来十分顺利之际，邱石也受到了苏拉前男友的陷害，不得不离开公司，事业面临危机。',1,0,0,0,'',0,0.0,0,'蒋家骏','20集全',1495011268,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1166','N',0,0,NULL),(28148,49,'男才女貌 第二部',',安七炫,黎一萱,卢杰君,','台湾',NULL,2007,319,'伟齐和敏真，两个同样为爱执著而勇敢的人，本应是青梅竹马男才女貌的他们在儿时彼此遇见却又错过。一只银镯子似乎在冥冥之中牵引着他们，让他们重新一次次的遇见，误会，分开，再重遇。敏真坚持着父母对乡村学校的理想和责任，在精神上十分富足；伟齐担负着家族一直以来的事业和成就，在物质上十分富足。敏真简单的生活与伟齐奢侈的环境好像两极那样不同，但是敏真的快乐单纯却感染了伟齐，让他不再屈从命运的摆布，让他从浮华却不快乐的生活中解脱出来。而伟齐的坚定也给了敏真爱的勇气，灰姑娘的幸福最终掌握在谁的手中？这样的爱情会是泡沫还是真实？其实真正需要去面对的不是世俗的眼光，而是彼此心底的那份信任和默契。',1,0,0,0,'',0,0.0,0,'胡意娟','19集全',1495011270,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1167','N',0,0,NULL),(28149,49,'亲爱的别哭',NULL,NULL,NULL,2000,320,'《亲爱的别哭》是由顾晶导演，郭晓冬,孔维,潘雨辰等主演的内地电视剧，共26集。爱奇艺在线观看《亲爱的别哭》全集高清视频。剧情简介：主要讲述主人公穆仰天与童云一见钟情结为伴侣，生下美丽的“天使”穆童。在一次交通事故中童云去世，突如其来的打击使父女俩人产生隔阂、误会。穆童以各种坏招阻碍女性对父亲的接近，父亲因为爱女儿和怀念妻子放弃了一次次择偶的机会，俩人成为“亲爱的敌人”。但当穆仰天患脑癌不久于人世时，父亲用生命的最后时刻为女儿操...',1,0,0,0,'',0,0.0,0,NULL,'共26集全',1500049498,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18947','Q',0,0,NULL),(28150,49,'阳光的味道',',马洲,石佩灵,彭地,赵东阳,李宗霖,','内地',NULL,2010,321,'该剧讲述了90后大学生的校园生活励志故事。一个炎热的夏天，华南演艺职业学院又迎来开学的日子，刘扬、麦丽丽等女生住进了女生碧湖阁509房，宋子豪、夏凡等住进了男生玉湖阁210房，一群朝气蓬勃但又涉世不深的阳光男孩和阳光女孩在他们新的人生阶段开始了全新的生活：富家子弟宋子豪在学校十分抢眼，自我意识强，随心所欲，却也因此受到很多挫折；特困生马栓子有演唱天赋却险些被人陷害；辛美婷因傍大款违反了学校纪律而受到处分；富家女麦丽丽和学校的小保安贺军从误会、争执到产生感情，演绎了一段精彩的爱情故事，麦丽丽后来才知道贺军竟是一位将军的儿子。要毕业了，汇报剧的表演让家长们泪流满面。夏凡决定去农村支教，马柱子被部队选中参军，刘杨与宋子豪正式开始了北漂。',1,0,0,0,'',0,0.0,0,'张中一','共25集全',1501001384,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1168','Y',0,0,NULL),(28151,49,'恋上黑天使',',秋瓷炫,唐禹哲,陈昊,钱泳辰,王希维,','内地',NULL,2015,322,'本剧描述了一个年轻人组成的创意工作室21点从无到有，经历严峻考验，终于实现自己理想与爱情的故事。面临传统文化景观将遭到开发商破坏的严峻形势，年轻人放弃了即将到手的几百万营销合同，与不良商人斗智斗勇，在挫折中不断成长成熟。剧中的男主角马梁才华横溢却玩世不恭。而美丽孤傲的“白富美”叶曼凌却对这个青年产生了感情，使得一直爱慕叶曼凌的地产精英白钢情有不甘。他选中了马梁的好友杜轻言做卧底，不断设置障碍，使21点陷于绝境，马梁也因此遭遇了入狱、毁容等厄运。为了让马梁和21点走出困境，也为了揭穿白钢的阴谋，叶曼凌决定嫁给白钢。对此众人很不理解。马梁为之十分痛心，开始正视叶曼玲对自己的感情。最终叶曼凌用白钢的钱挽救了21点。年轻人的奋斗让古老的三坊七巷焕发了青春。马梁与叶曼凌也终于走到了一起。',1,0,0,0,'',0,0.0,0,'罗长安','37集全',1495011273,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1169','L',0,0,NULL),(28152,49,'誓言永恒',',易丹,钱滨,高明,李易祥,江珊,王海燕,赵峥,','内地',NULL,2009,323,'1960年代中期的一个夏天，《誓言无声》的故事已经过去三年了。原子弹爆炸成功以后，我国核导弹的研制也已经进入了最后阶段。敌对势力对此极为关注。台湾安全委员会所属的101和102两个特务机关，分别积极进行空中侦察和渗透破坏活动。反间谍总部受命在此期间务必采取有效措施，打击特务活动，确保核导弹研制工作的安全。',1,0,0,0,'',0,0.0,0,'毛卫宁','28集全',1495011275,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1170','S',0,0,NULL),(28153,49,'谎言的代价',',丁俐丹,奚美娟,金鑫,','内地',NULL,2004,324,'暂无',1,0,0,0,'',0,0.0,0,'暂无','22集全',1495011276,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1171','H',0,0,NULL),(28154,49,'网红养成记（泰语）','Ploychompoo,Jannine,Parawie,Weigel,雅娜妮·杷拉薇·维高,Mew,','泰国',NULL,2017,325,'《网红养成记 》由泰国新生代女歌手Jannine Parawie Weigel（ploychompoo），以及泰国新晋12人偶像团体MBO成员owling,belle,ninna,got,mew,jida,peem,emma,parn,tong,pam,eiffel联袂出演。这是一出校园女生们的战斗。故事围绕青少年网红直播的社会现象展开，讲述泰国校园偶像们如今都在为“粉丝量”暗地较劲，同时，他们也正在丢失一些东西。',1,0,0,0,'',0,0.0,0,'查特才.瓦拉扁根','全8集',1495037608,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/553','W',0,0,NULL),(28155,49,'网红养成记（国语）','Ploychompoo,Jannine,Parawie,Weigel,雅娜妮·杷拉薇·维高,Mew,','泰国',NULL,2017,326,'《网红养成记 》由泰国新生代女歌手Jannine Parawie Weigel（ploychompoo），以及泰国新晋12人偶像团体MBO成员owling,belle,ninna,got,mew,jida,peem,emma,parn,tong,pam,eiffel联袂出演。这是一出校园女生们的战斗。故事围绕青少年网红直播的社会现象展开，讲述泰国校园偶像们如今都在为“粉丝量”暗地较劲，同时，他们也正在丢失一些东西。',1,0,0,0,'',0,0.0,0,'查特才.瓦拉扁根','全8集',1495037610,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/554','W',0,0,NULL),(28156,49,'不共戴天','迪兰.希斯,',NULL,NULL,2000,327,'两个过气女明星，能擦出什么样的“火花”？',1,0,0,0,'',0,0.0,0,' 本·西蒙斯','更新至06集',1495037612,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/555','B',0,0,NULL),(28157,49,'原谅',',许亚军,刘琳,周莉,冯雷,霍青,','内地',NULL,2009,328,'舞蹈演员李蓉马上要迎来自己的首场演出，跟男朋友曲折也情投意合，准备结婚。在她的事业和人生都要掀开华彩乐章的时候，打击随之而来——就在演出即将开始时，双方父母碰面才知他们竟然是旧识，而李蓉的母亲徐青大失常态，坚决反对他们的婚事。李蓉和曲折拼命抗争，在无奈之下，当年真实的历史被逐渐翻开。',1,0,0,0,'',0,0.0,0,'安战军','24集全',1495011278,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1172','Y',0,0,NULL),(28158,49,'东江英雄刘黑仔',',王雷,贾青,叶项明,肖聪,蒋恺,','内地',NULL,2014,329,'《东江英雄传》讲述的是一个外号刘黑仔（王雷饰）的青年，性情如火，嫉恶如仇，从小顽劣可为人颇讲义气，为救朋友在大牢里被关了七年，出来加入中国共产党，成为党领导下的抗日武装，铲除当地土匪汉奸营救民主人士，智擒死敌日本驻港特务头子东条正之，威震港九、让日伪闻风丧胆的传奇故事。',1,0,0,0,'',0,0.0,0,'谭俏','35集全',1495011279,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1173','D',0,0,NULL),(28159,49,'海魂',',于波,朱杰,林江国,吕夏,马光泽,','内地',NULL,2011,330,'1937年7月，“七七事变”，中日战争全面爆发。一批英气逼人，血气方刚的海军学员提前从海军学校毕业登上战舰。东北农民出身的高盛中，台湾小业主出身的郭文展和海军世家出身的公子哥沙虎啸都是海校中的优秀学员，也是志同道合的好兄弟。高盛中与郭文展都默默地爱着沙虎啸的妹妹沙家大小姐沙凌云。而沙凌云却深爱高盛中，在决定即将奔赴抗日前线时，沙凌云既然决然要嫁给高盛中，高和全体官兵深受感动。然而，在高盛中与沙凌云婚礼上却“杀”出自称高盛中的东北媳妇的刘松花。高盛中与沙虎啸及原国光号的官兵分到国正号战舰。新战役开始前，沙虎啸质疑作战部的布阵方案是被动挨打。这一仗场日军果然派出飞机编队狂轰滥炸，中国海军舰队惨败，国正号也遭受重创，不得已拆下火炮与重要零件，又一次被沉入长江！郭文展负伤，沙虎啸落入江中失踪，高盛中再次挥泪告别战舰。',1,0,0,0,'',0,0.0,0,'包福明','33集全',1495011281,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1174','H',0,0,NULL),(28160,49,'惊雷行动',',杜志国,鲍鲲,何政军,郑卫莉,钱勇夫,','内地',NULL,2011,331,'急促的警铃如滚滚惊雷般在两江市的车水马龙之中响起，通体黑色的轿车如长蛇般穿梭疾驶向它的目的地。即将上任的两江市公安局副局长刘兵便坐在车中，原定公安局的他因一起拆迁工地发生的斗殴事件改变了行程。与此同时，嗅觉灵敏的新闻记者莫晓天为寻找有价值新闻线索也摸进了拆迁现场。斗殴事件中牵扯到部分警员以及警员家属的利益，刘兵多方协调暂时缓和双方的情绪，但莫晓天却被工地保安发现后殴打致伤同时指责警方漠视的态度，莫晓天随后将此事件曝光于媒体。',1,0,0,0,'',0,0.0,0,'赵浚凯','29集全',1495011283,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1175','J',0,0,NULL),(28161,49,'人民的名义[干货精简版]','陆毅,张丰毅,吴刚,柯蓝,张志坚,许亚军,胡静,张凯丽,赵子琪,白志迪,李建义,','内地',NULL,2017,332,NULL,1,0,0,0,'',0,0.0,0,'李路','全43集',1495037636,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/559','R',0,0,NULL),(28162,49,'网红猎人','曾志伟,龚静,王大虹,陈宣铭,','内地',NULL,2017,333,'投资大佬A联合一线网红PA先生在号称宇宙第一招标会现场被黑客入侵，转天一个名为“网红猎人”的微博账号爆出一系列PA先生与幕后资本勾结愚弄大众的系列黑幕，同时声称对入侵发布会“负责”，顿时舆论哗然，“网红猎人”由此进入公众视线，并宣布会定期爆料网红圈的惊天黑幕，一时间网红江红人心惶惶，人人自危。',1,0,0,0,'',0,0.0,0,'张帆','全12集',1495037638,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/560','W',0,0,NULL),(28163,49,'新三国[大电影版]','陈建斌,于和伟,张博,陆毅,黄维德,倪大红,',NULL,NULL,2000,334,'该剧以中国古典四大名著《三国演义》原著为蓝本，讲述了从东汉末年群雄割据，到官渡之战、赤壁之战后形成三国鼎立的局面，再到司马家族篡夺魏政权后天下归晋的整个过程。',1,0,0,0,'',0,0.0,0,'高希希','总集数: 8',1496237585,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/561','X',0,0,NULL),(28164,49,'狐狸的夏天第一季','谭松韵,姜潮,蒲萄,季肖冰,','内地',NULL,2000,335,'顾承泽是顾氏百货集团的总裁，也是顾家顾太太的养子。顾太太希望亲子顾瑾昀出任公司职务，而顾瑾昀却漫不经心。于是顾太太布置顾承泽任务：引导顾瑾昀任职。在这期间，顾承泽认识了服装设计师黎晏书，并意外得知她和顾瑾昀之前有过恋情，对顾瑾昀影响颇深。顾承泽便以黎晏书为突破口，招聘她进入公司，两人在相处的过程中互生情愫。顾瑾昀见黎晏书入职，决心再次追求黎晏书，可黎晏书已经对他没有感情。顾太太得知此事后强烈反对，要求顾承泽隔离两人，这使得顾承泽和黎晏书走到了一起。一场意外车祸揭开了顾承泽的身世：他是顾先生的亲子。顾承泽无法接受，精神崩溃。最终在黎晏书陪伴下，走出难关，同时顾瑾昀经历了诸多事情后也得到成长，顺利上任',1,0,0,0,'',0,0.0,0,'于中中','全21集',1495037642,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/562','H',0,0,NULL),(28165,49,'米帅复活记','帕特里克-麦考,,安德列·沃洛宁,',NULL,NULL,2000,336,'达芬奇恶魔 《达·芬奇的恶魔》被定位为冒险故事，聚焦在文艺复兴时期达·芬奇在佛罗伦萨的青年时代，融合了各种真实和戏说的历史故事。其中情节曲折惊险，描叙了各种冒险故事。',1,0,0,0,'',0,0.0,0,'尼尔森·麦科米克','更新至07集',1495037645,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/563','M',0,0,NULL),(28166,49,'狐影',',李卓霖,王梓桐,徐铭悦,徐雷智,侯传杲,','内地',NULL,2016,337,'1945年初，抗战即将取得全面胜利。内外交困的日军垂死挣扎，派出一批精锐间谍，打入驻守空军基地门户淄江城的国军司令部，企图破坏空军基地，从而避免日本本土遭到轰炸的命运。国民党方面派遣反间谍专家雷震前去应对。雷震在地下党组织的配合下，历经千难万险，终于成功消灭日军间谍。而在这个过程中，雷震也完成了思想上的转变，成长为一名共产主义战士，来到新四军根据地参加对日寇的直接作战。在根据地，雷震充分发挥自身才能，以大智大勇的斗争挫败日军一系列阴谋，成功保卫了根据地的安全。特别是妹妹雷蕾和女友乔曼的壮烈牺牲，更激励着雷震英勇奋战，为抗战事业做出了自己卓越而独特的贡献。',1,0,0,0,'',0,0.0,0,'王利兴','46集全',1495011284,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1176','H',0,0,NULL),(28167,49,'金蚕丝雨',',方芬,吴京,何美钿,李小冉,王群,沈晓海,','内地',NULL,2002,338,'孤儿云飞扬（吴京 饰）幼年即被崇真派掌门人青松道长（吴卫东 饰）带上雾峰山，由崇真派抚养成人，只是崇真派有禁律，不能收身世不详的人为门人，因此，飞扬虽然万分渴望能被收为崇真派弟子学习武功，却始终不能如愿。弟子中，更是常有人作弄欺侮飞扬，飞扬愤而反抗，却被执法堂长老赤松（张春仲 饰）再加责罚，终被派去猪舍养猪。云飞扬伤心至极决定离去，可是，云飞扬青梅竹马的恋人、赤松的女儿伦婉儿（何美钿 饰）却再三恳求他留下，再加上这十余年来每逢月圆时就会出现偷偷教云飞扬武功的黑衣师父也不赞成他离去，而且，云飞扬内心一直对掌门人青松有一股难舍之情，诸多原因下，飞扬还是留了下来，他想就近照应青松，他想将来好好报答崇真派，他想跟婉儿常相厮守。',1,0,0,0,'',0,0.0,0,'汪俊','30 集全',1495011765,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1177','J',0,0,NULL),(28168,49,'解密 DVD版',',颖儿,经超,张哲瀚,郭京飞,印小天,安以轩,白庆琳,安建,','内地',NULL,2000,339,NULL,1,0,0,0,'',0,0.0,0,'陈学冬','40 集全',1497284341,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16185','J',0,0,NULL),(28169,49,'时尚烟云','理查德·柯伊尔,汤姆·莱利,麦米·古默,','英国',NULL,2016,340,'一具莫名的尸体...一个天才设计师，却因敏感的身份不能抛头露面；一个功成名就的时尚掌门人，只是他的创意都来自剽窃...这一切有着怎样的恩怨情仇',1,0,0,0,'',0,0.0,0,'丹·泽夫','更新至07集',1495037666,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/568','S',0,0,NULL),(28170,49,'人民的名义[DVD版]','吴刚,张丰毅,陆毅,柯蓝,许亚军,张志坚,胡静,张凯丽,赵子琪,白志迪,李建义,','内地',NULL,2017,341,NULL,1,0,0,0,'',0,0.0,0,'李路','全55集',1495037668,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/569','R',0,0,NULL),(28171,49,'火线出击（下）','徐洪浩,杨舒,赵荀,张慧,夏侯镔,侯杰,敖洋,郝率,张澎澎,','内地',NULL,2017,342,'身为消防烈士之子的张梦一，继承父亲的遗志，成为了滨江首只特勤中队的中队长。张梦一与童年邻居江涛不期而遇，后者作为基层中队第一位女性指导员，却遭遇了张梦一的“花式排挤”。在面对富二代叛逆小子富强和农村少年牛奋进等队中出身迥异、性格鲜明的各色新兵时，两人更因带兵理念的不合而爆发激烈的冲突。与此同时，张梦一与富强同父异母的姐姐叶璐之间的恋情，在经历短暂的蜜月期后，陷入了取舍两难的境地。当父辈牺牲的真相在张梦一的心中渐渐显露时，他终于放下了既往的偏见与江涛携手，率领特勤中队这群青春热血的消防战士抵抗着灾难的侵袭，他们始终不忘初心，用各自的血泪、真诚和情谊在天地之间写出了一个个铿锵有力的“人”字。',1,0,0,0,'',0,0.0,0,'黄文利','全21集',1495037681,1508319774,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/571','H',0,0,NULL),(28172,49,'不可思议的德哥','李清德,','内地',NULL,2017,343,'主人公德哥是一个50多岁的中年人，他试着融入这群年轻人，试着通过自己的方式向年轻人证明自己。通过段子剧的形式，一个中年男人去跟年轻人无数次的碰撞，一次次让人大跌眼镜，意想不到，哭笑