17,355,'1946年，程樯率部接管哈尔滨伪满警察局，任公安局局长。当时的哈尔滨面临双重压力：盘踞在长春的国民党随时有可能进攻哈尔滨，隐藏的敌特组织、土匪恶霸、日伪人员甚至是流氓无赖伺机作乱。内部，公安干部来自五湖四海，工作思路、方法不同，遇到具体问题常常产生分歧，工会与农会也在争论着谁是城市管理的主导，市领导层缺乏管理大城市的经验等等，这些都给程樯和他的战友们构成巨大的压力。国民党先后派遣在美国受过特训的高级间谍和特工潜入哈尔滨。程樯聚集了公安局各方力量，依靠基层群众，阻止了敌人的一个个阴谋。为了安定社会治安，成立邻闾委员会，健全全市外侨户口管理工作，取消妓院、烟馆和赌场。肃清了潜伏在我公安局的内鬼，破获了李兆麟将军被刺案 。',1,0,0,0,'',0,0.0,0,'刘江','31 集全',1495038709,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/596','L',0,0,NULL),(28185,49,'踢腿独身女','曼努埃尔·若塞,','其它地区',NULL,2000,356,'日本的樱花',1,0,0,0,'',0,0.0,0,' 科扎诺夫','更新至11集',1495009923,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/597','T',0,0,NULL),(28186,49,'因为遇见你','孙怡,邓伦,刘敏涛,潘仪君,吴优,代超,吴竞,郭虹,罗刚,李智楠,李昊翰,夏志卿,王芷璇,黄天崎,陈旭,','内地',NULL,2017,357,NULL,1,0,0,0,'',0,0.0,0,'周晓鹏','46 集全',1495041426,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/598','Y',0,0,NULL),(28187,49,'火线出击（上）','徐洪浩,杨舒,赵荀,张慧,','内地',NULL,2017,358,'身为消防烈士之子的张梦一，继承父亲的遗志，成为了滨江首只特勤中队的中队长。张梦一与童年邻居江涛不期而遇，后者作为基层中队第一位女性指导员，却遭遇了张梦一的“花式排挤”。在面对富二代叛逆小子富强和农村少年牛奋进等队中出身迥异、性格鲜明的各色新兵时，两人更因带兵理念的不合而爆发激烈的冲突。与此同时，张梦一与富强同父异母的姐姐叶璐之间的恋情，在经历短暂的蜜月期后，陷入了取舍两难的境地。当父辈牺牲的真相在张梦一的心中渐渐显露时，他终于放下了既往的偏见与江涛携手，率领特勤中队这群青春热血的消防战士抵抗着灾难的侵袭，他们始终不忘初心，用各自的血泪、真诚和情谊在天地之间写出了一个个铿锵有力的“人”字。',1,0,0,0,'',0,0.0,0,'黄文利','全21集',1495009932,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/601','H',0,0,NULL),(28188,49,'约会恋爱究竟是什么','郭晓东,王姿允,王伟忠,樊野,朱梦瑶,李泓良,','内地',NULL,2017,359,'大龄女青年陆依依是一名生活极度规律甚至到了偏执刻板的女性，研究生毕业后顺利的成为了一名精算师，过着平稳生活，喜欢拿数字说话，偶尔还和早已去世的母亲（潜意识里的映像）话争吵。为了安抚老爸陆善家对女儿哀叹愁嫁的情绪，对现代人的爱情观全不认同的她不得已走上相亲结婚的战场。与此同时的另一方，现年35岁的欧阳宇飞，是个自诩作家的家里蹲，他日常倦在家里看书、 看电影，生活起居全靠老娘照顾，眼看着妈妈日渐衰老，欧阳也不得不考虑结婚成家独立生活，他只得硬着头皮和女性开始约会。 就这样，两个恋爱白痴开始了一场啼笑皆非的爱情故事。',1,0,0,0,'',0,0.0,0,'田晓威','全20集',1495009935,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/602','Y',0,0,NULL),(28189,49,'大师请接客','杨塑坤,贺日铭,孙小榕,臧英童,田春蕾,',NULL,NULL,2000,360,'经营网络公司失败的王小林，为躲债而遁入道门，流落沙溪镇时偶遇追债而来的原公司员工司马北。王巧舌忽悠司马北为徒，合伙算命驱邪为业。花姐古宅闹鬼，师徒二人本想趁机骗吃一顿，却误打误撞降服女鬼，发现竟是赵小薇占房装鬼混吃骗喝。王小林名声大振，孔庆西慕名而来拜王为师修习道术，四人同居古宅。与此同时，各路人马各怀鬼胎慕名前来，或因夫妻感情不合而要重出江湖再度卖春的鸡中巾帼，或因网瘾成病而绑子求解的疯魔父母，更有为了维护世界和平不惜输球的国足少年。王等四人，将挡土掩，一一化解。古宅虽小，浮世尽绘，荒诞小镇，黑色幽默。',1,0,0,0,'',0,0.0,0,'袁虎起','全6集',1495009937,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/603','D',0,0,NULL),(28190,49,'愉此一生','蒋梓乐,晏紫东,卢卓,刘亦宸,周伊,陈鹏,张怡畅,姜超,梁天,沈保平,','内地',NULL,2017,361,'该剧改编自南枝的同名小说，讲述了一位大少爷柳愉生在家道中落后发生的种种故事。民国时期的大少爷柳愉生在家道中落后，以“教师”一职实现自己的理想与抱负，然而老同学周耀华的突然归国却打乱了他的生活，紧跟而来的是一次次“艰难抉择”。',1,0,0,0,'',0,0.0,0,'陈鹏','全15集',1495009939,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/604','Y',0,0,NULL),(28191,49,'活该你单身','唐昕,许小行,欧倩如,','内地',NULL,2017,362,NULL,1,0,0,0,'',0,0.0,0,'李学鹏','全12集',1495009941,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/605','H',0,0,NULL),(28192,49,'我的室友是狐仙','周阶,吴楚一,孔奇力,王彦彬,周恒远,范淑珍,何由之,夏尉喻,李泽鹏,','内地',NULL,2017,363,'讲述狐仙陆白不顾违背天道以身涉险来到现代寻找他的救命恩人肖墨，报恩过程中面对前世宿敌的各种刁难与陷害，还有狐族敌对势力的迫害，面对身边人的猜疑与疏远，他依旧保持着一颗纯善之心，坚定着报恩信念的陆白揭开了所有人心里的疑惑，帮助恩人肖墨打败宿敌，寻回自我，但最终还是未能摆脱命运的束缚......',1,0,0,0,'',0,0.0,0,'成卫平','全23集',1495009943,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/606','W',0,0,NULL),(28193,49,'周末父母[未删减版]','刘恺威,王鸥,张萌,朱泳腾,赵楚纶,杨洋,赵悦童,史文翔,李思阳,','内地',NULL,2017,364,NULL,1,0,0,0,'',0,0.0,0,'王为','全42集',1495009950,1508319775,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/609','Z',0,0,NULL),(28194,49,'乡村爱情9（上）','赵本山,毕畅,贺树峰,唐鉴军,王小利,刘小光,于月仙,王小宝,宋晓峰,蔡维利,王小虎,','内地',NULL,2017,365,'作为中国最长寿的一部农村题材电视剧，《乡村爱情进行曲》是《乡村爱情》系列的第九部作品。这一部里，象牙山村将迎来新的改变。故事围绕新角色“第一书记”的登场展开，他的到来和其实施的新举措给村里造成了一系列的影响。赵四忽悠宋晓峰争当村主任，刘能与时俱进做起了电商，而大脚则会有新的感情故事，处处充满了正能量。据悉，本部内容还有一个神秘的惊喜，值得观众期待。',1,0,0,0,'',0,0.0,0,'孟令宇','全30集',1495009957,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/612','X',0,0,NULL),(28195,49,'爱来的刚好','