牺牲，五常眼睛灼伤，二双欲牺牲自己救治那五常的行为使二人感情升温。如要炸毁大坝，须找到当年的日本设计师佐藤，那五常在政委带领下感化佐藤，将炸药放在大坝心脏位置。此时日本即将宣布投降，抗联接到命令要放弃炸坝并保卫大坝。五常和抗联战士最终完成任务，保住了水电站，下游的上百万亩良田和数千个村落终于安全了。',1,0,0,0,'',0,0.0,0,'张多福','全42集',1495009985,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/623','J',0,0,NULL),(28202,49,'绝地枪王2[未删减版]','徐洪浩,周扬,曹磊,牛宝军,程思寒,郑媛元,王建国,陈继铭,','内地',NULL,2014,373,'那五常名声大噪，被日军视为眼中钉。抗联独立大队不断受到日军侵扰，在政委李松年的带领下，那五常和抗联粉碎了日军的阴谋。日本军部派来新的驻军联队长前原，要完成丰满水电站的最终建设，为伪满的日本政权和企业提供电力。前原找来土匪马三胡子进行招工，抗联欲通过马三胡子的女儿马上花阻止其父。马上花看上五常，引发郭二双的情感争斗。李松年请来枪械高手贾天下、林梦青辅助那五常。贾天下被俘，前原把他放回，让抗联战士对其产生误会。保卫大坝战斗中林梦青牺牲，五常眼睛灼伤，二双欲牺牲自己救治那五常的行为使二人感情升温。如要炸毁大坝，须找到当年的日本设计师佐藤，那五常在政委带领下感化佐藤，将炸药放在大坝心脏位置。此时日本即将宣布投降，抗联接到命令要放弃炸坝并保卫大坝。五常和抗联战士最终完成任务，保住了水电站，下游的上百万亩良田和数千个村落终于安全了。',1,0,0,0,'',0,0.0,0,'张多福','全43集',1495009987,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/624','J',0,0,NULL),(28203,49,'遇见爱情的利先生','陈晓,周冬雨,贾景晖,叶青,肖涵,刘雪华,米热,毛林林,任山,黄丽娅,','内地',NULL,2017,374,'刘欣桐，一个成长在贫民之家的的女孩，可是却始终不改阳光坚强的本性。她的生活原本平淡无奇，然而一次意外，她进入了一个截然不同的生活圈子，和母亲迫不得已搬进了富商纪百均的家里。自此，刘欣桐的生活发生了翻天覆地的变化。进入纪家后，刘欣桐结识了刁蛮任性的纪家大小姐纪智珍、帅气温柔的纪家大公子纪振宇以及她命中注定的爱人利耀南。纪智珍和刘欣桐对利耀南同时产生了情感，也因此发生了种种矛盾。几个人在爱情、友情、亲情的多重考验下，经历了欺骗、背叛和别离，终于有了救赎和收获。',1,0,0,0,'',0,0.0,0,'陈铭章','全41集',1495009992,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/626','Y',0,0,NULL),(28204,49,'遇见爱情的利先生[未删减版]','陈晓,周冬雨,贾景晖,叶青,肖涵,刘雪华,米热,毛林林,任山,黄丽娅,','内地',NULL,2017,375,'刘欣桐，一个成长在贫民之家的的女孩，可是却始终不改阳光坚强的本性。她的生活原本平淡无奇，然而一次意外，她进入了一个截然不同的生活圈子，和母亲迫不得已搬进了富商纪百均的家里。自此，刘欣桐的生活发生了翻天覆地的变化。进入纪家后，刘欣桐结识了刁蛮任性的纪家大小姐纪智珍、帅气温柔的纪家大公子纪振宇以及她命中注定的爱人利耀南。纪智珍和刘欣桐对利耀南同时产生了情感，也因此发生了种种矛盾。几个人在爱情、友情、亲情的多重考验下，经历了欺骗、背叛和别离，终于有了救赎和收获。',1,0,0,0,'',0,0.0,0,'陈铭章','全38集',1495009995,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/627','Y',0,0,NULL),(28205,49,'漂亮的李慧珍[未删减版]','迪丽热巴,盛一伦,李溪芮,张彬彬,王一楠,王骁,任伟,王一菲,宋文作,李东恒,','内地',NULL,2017,376,'从小生活完美的公主李慧珍(迪丽热巴饰)因家道中落沦为“龙套女”，成了初入职场处处碰壁的菜鸟。而小时候的“矮挫胖”白皓宇(盛一伦饰)却变身高富帅海归。重逢时，一个是初入职场的菜鸟，拼尽全力克服职场上种种困难，怀抱着对初恋的期待而努力；一个是事业有成的时尚精英，念念不忘想寻回记忆中的初恋，却遍寻不得，二人身份的逆转倒错，让这个爱情故事有了一丝苦涩却也不乏搞笑欢乐的暖萌情节，是一部涵盖了友情、爱情、梦想、职场的轻喜剧。',1,0,0,0,'',0,0.0,0,'赵晨阳','全40集',1495010000,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/629','P',0,0,NULL),(28206,49,'守护丽人[未删减版]','李小璐,张译,李智楠,江雪,吴岱融,刘佩琦,彭玉,许娣,白珊,吴谨言,','内地',NULL,2017,377,'幼年时，林佳因家中变故被父亲林世渊独自一人含辛茹苦带大。林佳长大后格外任性，做事不计后果。林世渊意识到女儿的问题，为挽救女儿，将其赶出家门，让她从基层职工做起，接受社会锻炼与改造。失去富裕生活的林佳负气出走、流落街头，被北京胡同里土生土长的快递员陈曦所救。普通的百姓生活让林佳无从适应，更惹出重重祸事。面对齐心协力共度难关的陈家人，林佳心底的善良被激发。陈曦对爱情、家庭的责任感教会了林佳如何重新塑造自己，也带领林佳用劳动创造价值。陈曦在日夜相处中改变了对林佳的印象，两人就此相爱。而此时，林佳昔日男友黄在远再次出手欲重新追求改头换面的林佳，林佳的亲生妈妈也从美国衣锦还乡，并试图让林佳重新过上不用劳动的生活，林佳和陈曦之间的感情变得岌岌可危。最终，林佳克服重重阻碍，奋斗成长为对社会有用的正能量女孩，也收获了和陈曦的爱情。',1,0,0,0,'',0,0.0,0,'袁英明','全50集',1495010011,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/633','S',0,0,NULL),(28207,49,'神探狄仁杰电影版','梁冠华,吕中,张子健,祝延平,','内地',NULL,2000,378,'该剧主要讲述了唐朝时的大臣狄仁杰屡破命案的故事，包括《使团惊魂》、《蓝衫记》和《滴血雄鹰》三个小故事。',1,0,0,0,'',0,0.0,0,'钱雁秋','全3集',1495010013,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/634','S',0,0,NULL),(28208,49,'潜伏在黎明之前','杨烁,胡军,甘婷婷,郭珍霓,','内地',NULL,2016,379,NULL,1,0,0,0,'',0,0.0,0,'余丁','全44集',1495010015,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/635','Q',0,0,NULL),(28209,49,'嘉庆君游台湾','黄少祺,王宇婕,江宏恩,曾莞婷,','内地',NULL,2014,380,'嘉庆君游台湾为台湾广为流传的一段民间传说，大意是在乾隆朝，尚未即位的嘉庆帝曾经微服游台湾。迄今仍有许多穿凿附会的说法，但并非史实。嘉庆帝一生不曾到过台湾。但作为台湾文化的一部分至今仍为大家津津乐道。',1,0,0,0,'',0,0.0,0,'俞惟中','共40集全',1506012513,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/636','J',0,0,NULL),(28210,49,'电竞纪元','施柏宇,阿丽亚,刘海宽,李玉洁,易易紫,邓絜文,','内地',NULL,2016,381,'男主人公“南柯”是电竞学园电竞系的新生，怀揣着电竞理想，从电竞菜鸟一步步成长为一个高手。他是“游戏上的天才，生活中白痴”，从学园中拉拢了一批性格迥异的人组成“菜鸟战队”，与电竞系精英战队抗衡。在组队的过程中，遇到女主角明真，并和女主产生了“友达以上恋人未满”的感情......',1,0,0,0,'',0,0.0,0,'孙放','全12集',1495010020,1508319776,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/637','D',0,0,NULL),(28211,49,'猎人','黄轩,高鑫,王思思,鲍鲲,','内地',NULL,2016,382,'1948年，解放军发动了辽沈战役，个别城市先行解放。郴城就是其中之一。但是国民党潜伏特务、散兵游勇、惯盗悍匪等多重阴霾使郴城陷入了不战而乱的困境，混乱和萧条充斥这个大城市的角落。原地下党员秦天亮为了使群众在新政权下重拾生机，迎接挑战，接任了郴城军管会主任。秦天亮带领侦查处处长技连才、保卫处处长孙大虎以及国外留学回国的侦查顾问耶律麒开展了一场脱胎换骨的改造工作。耶律麒对新政权一直抱着怀疑态度，虽是私家侦探专家，却一直本着一天和尚撞一天钟的态度与军管会各级干部始终保持距离。但他在这些共产党人新同行的感召下，在榜样的影响下终于变成了一名坚强的战士，发挥自己的推理特长，抽丝剥茧层层深入，在领导的运筹和同事的帮助下，最终粉碎了潜伏特务企图暗杀中央领导人的阴谋。',1,0,0,0,'',0,0.0,0,'徐昂','全41集',1495010025,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/639','L',0,0,NULL),(28212,49,'爱情万万岁','刘涛,张凯丽,韩童生,黄觉,汤镇宗,潘辰,魏巍,叶祖新,李菁菁,','内地',NULL,2000,383,'花家有“三宝”：老妈花枝俏、女儿金娜和儿子金波。花枝俏在家里说一不二多年，却在中年遭遇“被离婚”，被丈夫老金和闺蜜孙文娟双双背叛；为了重拾生活的信心，老妈把全部精力转移到女儿和儿子的婚事上。女儿金娜是个直率坦诚的二婚女，不但严辞拒绝老妈给她介绍的富二代男友，还心甘情愿地与没车没房还是外地户口的暖男吴所谓同甘共苦。儿子金波是个一事无成的少爷，却和90后的朱丽娅一见钟情加入闪婚阵营，让老妈几乎招架不住。“三宝”团结一致，共同对阵“无情老爸”、 “无良闺蜜”以及“高大上”的儿媳妇朱丽娅一家。直到花枝俏的夕阳恋人老李去世、冤家原配老金重病不起、孙文娟落跑，大家才渐渐明白：不管是哭泣、欢笑，还是吵和闹，不过是因为他们太在乎这个家。',1,0,0,0,'',0,0.0,0,'刘新','全40集',1495010027,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/640','A',0,0,NULL),(28213,49,'你好乔安','戚薇,王晓晨,陈亦飞,王柯达,白宇,黄一琳,马亮,王一楠,张晨光,','内地',NULL,2000,384,'少女乔安有着公主般的人生，突遭变故远走他乡，所有人都以为她的人生将就此没落，没想到乔安又光鲜的出现在上海——她要夺回父亲失去的广告帝国奥里斯。奥里斯上海总裁陆远扬是当年乔父的助理，了解乔安种种历史，频频刁难。打拼多年的老辣精英和势在必得的新人，在职场中展开了一场猫鼠游戏。乔安不言放弃，终获陆远扬认可，两人也产生了别样情愫，但摩擦不断。乔安唯一朋友倪好，遭遇失恋失业，与乔安抱团取暖，并认识了纨绔子弟江齐飞，二人经历了一系列共同成长，倪好却迟迟等不到江齐飞的表白。此时，乔安的富二代前男友回头，陆远扬与初恋也再度职场重逢。奥里斯面临被收购，最终，乔、陆联手保住公司，乔安身世暴露，再次消失。陆远扬带领奥里斯重回正轨，等待乔安归来 。',1,0,0,0,'',0,0.0,0,'林妍','全32集',1495010030,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/641','N',0,0,NULL),(28214,49,'整容攻略','瞿颖,辰亦儒,殷琦,张可昀,郭书瑶,赵国栋,陈泳旭,辰星雨,毋云峰,陈婧,董李无忧,蔡旻佑,','内地',NULL,2016,385,NULL,1,0,0,0,'',0,0.0,0,'林立昇','全15集',1495010032,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/642','Z',0,0,NULL),(28215,49,'谜砂','李宗翰,李乃文,赵子琪,陈瑾,张磊,曾黎,尚天瞳,石兆琪,徐少强,李净洋,阿赛,禹童,叶璇,','内地',NULL,2016,386,'缉毒支队A组组长齐雁南在潜伏打击一个贩卖毒品的犯罪团伙时突生变故。犯罪嫌疑人“黑三”的死无对证也引来检察官林冰铁面无私的调查。同时，为了得到一个价值连城的中医古秘方“谜杀”，各方势力都伸出了黑手，某大金融证劵公司总裁苏金荣就是其一。苏金棠既是贩卖毒品团伙主谋柯世兰的融资渠道，同时也是利益伙伴之一，因而连番出手，暗中动用秘密关系帮助柯世兰脱身。值此风云变幻之际，马局长告诉齐雁南，一个有信仰的公安干警，是要同时具备韧性、抗压性和耐性的。齐雁南和林冰在众人的鼓励和支持下，不畏艰难、不怕牺牲地顶住一切压力，对犯罪份子紧追不舍。最终，在马局长的带领和A组同仁共同努力下，齐雁南洗刷清白并与林冰尽释前嫌，双方携手共济，将那些隐藏的，在逃的罪犯都一一捉拿归案。',1,0,0,0,'',0,0.0,0,'林楠','全44集',1495010037,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/644','M',0,0,NULL),(28216,49,'遇见王沥川','高以翔,焦俊艳,连凯,林佑威,杜源,许还山,王若心,黄爱玲,陈冲,','内地',NULL,2016,387,NULL,1,0,0,0,'',0,0.0,0,'陈铭章','38 集全',1495038726,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/645','Y',0,0,NULL),(28217,49,'爸爸天亮叫我','施羽,刘雪华,吴孟达,','内地',NULL,2000,388,'该剧以田家大院为背景，讲述了一个有关亲情的深情故事。',1,0,0,0,'',0,0.0,0,'罗灿然','全41集',1495010048,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/647','B',0,0,NULL),(28218,49,'暗战风云','丁海峰,何琳,王茜华,陈征,程前,孙迅,','内地',NULL,2000,389,'该剧讲述了“黄梅戏头牌青衣”季素如何从纯真的女孩成长为一个坚强的母亲的故事。',1,0,0,0,'',0,0.0,0,'王强','全30集',1495010053,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/649','A',0,0,NULL),(28219,49,'鬼吹灯之精绝古城','靳东,陈乔恩,赵达,岳旸,王永泉,付枚,金泽灏,张晓谦,匡牧野,','内地',NULL,2016,390,'《鬼吹灯之精绝古城》由企鹅影视、梦想者电影、正午阳光影业联合出品，改编自天下霸唱同名小说，由孔笙、周游、孙墨龙执导，白一骢任总编剧，侯鸿亮、方芳担任总制片人，靳东、陈乔恩、赵达等人主演。该剧讲述了胡八一、Shirley杨与王胖子一起历经万险来到了塔克拉玛干沙漠中的精绝古城遗址寻找“鬼洞”的故事。 胡八一上山下乡来到中蒙边境的岗岗营子，带上了家中仅存的一本书——《十六字阴阳风水秘术》，闲来无事将书中文字背得滚瓜烂熟。之后参军到西藏，遇上雪崩掉落一条巨大的地沟当中，胡八一利用自己懂得的墓葬秘术逃得不死。复员后，胡八一和好友胖子一起加入了一支前往新疆考古的考古队。一行人历经万险来到了塔克拉玛干沙漠中的精绝古城遗址，进入了地下“鬼洞”。洞中机关重重、陷阱不断，这神秘的鬼洞似乎在一位先知的掌控之中。',1,0,0,0,'',0,0.0,0,'孔笙','全21集',1495010055,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/650','G',0,0,NULL),(28220,49,'放弃我抓紧我[未删减版]','陈乔恩,王凯,乔任梁,陈燃,张轩睿,亓航,傅迦,谢君豪,杜宁林,刘萌萌,','内地',NULL,2016,391,NULL,1,0,0,0,'',0,0.0,0,'邓衍成','全39集',1495010061,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/653','F',0,0,NULL),(28221,49,'放弃我抓紧我','陈乔恩,王凯,乔任梁,陈燃,张轩睿,亓航,傅迦,谢君豪,杜宁林,刘萌萌,','内地',NULL,2016,392,NULL,1,0,0,0,'',0,0.0,0,'邓衍成','38 集全',1495038702,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/654','F',0,0,NULL),(28222,49,'北上广依然相信爱情[未删减版]','朱亚文,陈妍希,张译,曾泳醍,王新,马灿灿,李依玲,鲍晓,黄超,','内地',NULL,2016,393,'王茂与黄依然在易结婚庆公司是上下级关系，两人从相识的那一刻起就充满矛盾，由于两人的文化差异，使彼此都不能理解。在随后的工作中，黄依然渐渐表现出来的刻苦精神和特有的才能被王茂欣赏，而在随后的工作中，黄依然也体会到他温情的一面。就在两人刚刚能够和平共处的时候，王茂却意外陷入一场事业危机，能够解救他的出路只有一条，拿到航空联盟的大型集体婚礼的合同。黄依然首当其冲协助王茂，两人克服重重困难，最终成功化解危机。在王茂与黄依然这一次跌宕起伏的闯关过程中，不知不觉擦出了爱情的火花，但是此时双方发现对方的内心深处对爱情有一堵心墙。王茂和黄依然想尽种种办法融化对方心中的冰山，尤其在共同经历了一场命悬一线的车祸之后，两人终于决定携手相伴此生。而此时的他们，对爱情的真谛和婚礼事业的神圣也有了更深层的理解 。',1,0,0,0,'',0,0.0,0,'李骏','全44集',1495010068,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/656','B',0,0,NULL),(28223,49,'豆娘','柳小海,阎汶宣,姜寒,杜旭东,曲少石,宋扬,石瀚文,柏智杰,刘硕,','内地',NULL,2016,394,'1945年，日军投降后，晋北、秦豆和几个后生被晋绥军的吴肝抓了丁，吴肝没想到抓来的秦豆居然是个女子。为了保住秦豆不被查办，吴肝请求余团长的三姨太花雾“救”了豆娘带回家，不想团长老娘看中了豆娘，要她给余家传宗接代。豆娘为自救，想法拖延与团长圆房，后在吴肝帮助下逃脱。共产党地下交通站的黄玉和麻五偶遇豆娘，并不得已绑了她，豆娘在逃跑中负伤，只得留下。豆娘和黄玉相爱了，但就在他们结婚当夜，交通站被得到密报的晋绥军屠平，除了站长汪予人之外，麻五等人都惨死在屠刀下。面对交通站被破坏的惨状，黄玉说去联系上级，竟一去无回，豆娘便开始了寻夫路。在吴肝帮助下，豆娘找到了汪予人，并感觉到组织上怀疑黄玉叛变，当豆娘找到黄玉并亲眼目睹了他的背叛，便痛心地手刃了他。豆娘和吴肝一起为解放军攻抵河阳县做内应，成功解放河阳县，并加入了解放军。最终豆娘和吴肝有情人终成眷属。',1,0,0,0,'',0,0.0,0,'常猛','40集全',1495012597,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/657','D',0,0,NULL),(28224,49,'青云志2','李易峰,赵丽颖,杨紫,成毅,秦俊杰,王俊凯,王源,易烊千玺,唐艺昕,焦俊艳,舒畅,茅子俊,刘学义,白雪,','内地',NULL,2016,395,'《青云志2》阵容由第一季原班人马倾力打造，画风一改之前清新淡雅的风格，“暗黑”色系更平添些许神秘，故事情节也将更加丰富吸睛。全新正魔阵营形成，大战将再次开启。虽然承接了第一季的剧情，风格却大不相同，充满了阴谋与争夺。十年之间，人与事皆有不同，每个人物角色也都成长了许多。陆雪琪（杨紫饰）明白了“天地不仁以万物为刍狗”的真谛，林惊羽（成毅饰）虽有动摇却仍在坚持着自己的正义，曾书书（秦俊杰饰）承担着城主的责任还心系师门。魔教三公子血公子鬼厉、毒公子秦无炎（茅子俊饰）、妙公子金瓶儿（焦俊艳饰）也即将集结上线。',1,0,0,0,'',0,0.0,0,'朱锐斌','更新至01集',1495010076,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/659','Q',0,0,NULL),(28225,49,'向幸福出发','袁姗姗,乔任梁,袁文康,周放,大左,商侃,秦沛,张兆辉,龚慈恩,','内地',NULL,2015,396,'在世纪畅想广告公司做创意的男任一凡，女友陈青不辞而别，每天晚上都到他们曾经约会的地方等待陈青归来。三年时间没等到陈青归来，反而等到一名隐约之间和陈青有着相似之处的女子——叶琳。任一凡决定开始新的生活，两人一见如故。没想到，任一凡第二天一到公司，便发现叶琳是自己公司新来的老板。更令人没想到的是，陈青是叶琳同父异母的姐姐，为了报复父亲叶双城当年的始乱终弃，重新出现在任一凡的生活中，并与叶琳生意上的竞争对手纪续刚达成默契。任一凡在这段复杂的情感中经历了迷惘和成长，同时也创办了自己的公司并成功帮助叶琳打败纪续刚。一路上，任一凡和叶琳终于看清彼此才是真爱，陈青在失去了一切之后也才明白，爱能化解恩怨，生命中有太多美好比仇恨重要得多。',1,0,0,0,'',0,0.0,0,'陈铭章','2017-09-19 期',1505837691,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/660','X',0,0,NULL),(28226,49,'夜活儿','魏子昕,李彧,刘耀阳,纪云,刘青,苏梓玲,秦勇,国佳彬,吴洪文,侯七,','内地',NULL,2016,397,'的哥窦七和他朋友们生活在北京，这群人热心正义又乐天知命。夜幕降临，他们为生活开始新的忙碌，同时品尝着大都市的人情冷暖，世间百态。他们有一股子热心劲儿，无意中和各种各样的人发生了一个接一个奇葩搞笑的事儿。当人性的贪婪、恐惧、猜疑与正直、爱心碰撞的时候，他们用正能量战胜了邪恶，收获了人生更珍贵的东西。',1,0,0,0,'',0,0.0,0,'罗岩','全15集',1495010085,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/663','Y',0,0,NULL),(28227,49,'深宅','李宗翰,刘雪华,海顿,杜源,颜丹晨,赵恒煊,于小磊,赵慧仙,杜玉明,李思思,','内地',NULL,2000,398,'唐家观茶商世家谌家以梅山茶举世闻名，二少爷谌器之打败兄长谌励之成为梅山茶传人，以守住梅山茶秘方和谌家祖宅为使命，却引得同父异母妹妹谌春华不满。谌春华为争夺家产和替母兄报仇，不惜牺牲色相与军官勾结，逼得谌器之设下空城计遁走新疆。谌春华不肯善罢甘休，谌器之被诬陷入狱，幸得发妻辜红倾家荡产搭救，才被替死救出。后化名伍家潜回唐家观。梅山茶重现，再度引起各方势力的明争暗斗。谌器之为死守秘方，不惜雪藏私定终身的表妹、赶走大儿子、逼死四姨太、不顾全家的死活。辜红苦撑家业，但不敌四方暗算，只得自杀保全秘方。昌盛一时的谌家最终繁华落尽。谌器之临死前大彻大悟，把辛苦保全的秘方交给大儿子，要他继续造福世人。',1,0,0,0,'',0,0.0,0,'海顿','全41集',1495010089,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/665','S',0,0,NULL),(28228,49,'花飞尽、归不归','陈圆,王子帅,郑淑贤,张小辉,赵千羽,胡波,杜鹏远,王慧丽,王新华,韩雪莲,','内地',NULL,2000,399,'莫小豆以为，所谓爱情，就该不顾一切、轰轰烈烈。为了倒追男神，她绞尽心思、花样百出。怎料，男神隐婚，她莫名成了人人不耻的小三！原配示威，男神践踏她的尊严、视她为粪土？她莫小豆也是有骨气的！结婚嘛，谁又不是嫁不出去。只是，没想到她闪婚的帅哥还是个有故事的好男人。两个为情所伤的人，开始了一段意想不到的婚姻生活……',1,0,0,0,'',0,0.0,0,'孙峥','全19集',1495010092,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/666','H',0,0,NULL),(28229,49,'闺蜜嫁到','隋俊波,朱泳腾,胡丹丹,贾景晖,梁丹妮,常铖,陈炜,王全有,张静懿,宋雷涛,王蔷,','内地',NULL,2016,400,'该剧讲述了一对昔日好闺蜜阴差阳错成为妯娌，从家庭到职场，摩擦与争斗不断升级，最终共同成长的故事。',1,0,0,0,'',0,0.0,0,'周俊伦','50集完',1495017784,1508319777,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}