',NULL,2017,406,NULL,1,0,0,0,'',0,0.0,0,'林哲乐','更新至7集',1495040961,1508319781,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/845','Y',0,0,NULL),(28236,49,'我的！体育老师',',张嘉译,王晓晨,王维维,张子健,','内地',NULL,2017,407,'大叔马克面临中年危机，却并不能像一个中年男人那样妥善应对:他话唠，经济虽不至于捉襟见肘，但因不善理财，经济危机好像随时有可能发生。王小米一直以来的梦想就是能被当作公主对待，以为嫁了和自己母亲一样大的大叔马克就能实现被宠爱的梦想，但她没想到享受了大叔的成熟和稳定，就要承受他性格中已经既定无法和你磨合的部分。除此之外，小后妈还要面临大叔叛逆腹黑的十五岁女儿马莉，淘气的五岁儿子马瑙，以及和自己奶奶年纪相仿的婆婆，以及那个想要和前夫重修旧好的前妻。小后妈要想得到自己想要的爱情，必须逐个搞定这些七七八八的障碍，让这些“二手亲人”爱上自己，并发自内心地爱上他们。',1,0,0,0,'',0,0.0,0,'林妍',NULL,1495007740,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1026','W',0,0,NULL),(28237,49,'亲·爱的味道',',陆毅,郭采洁,艾晓琪,李莎旻子,炎亚纶,','内地',NULL,2017,408,'“安家菜”传人安文宇因受父母意外去世的打击、跳海被救后失去味觉，从此隐迹。心怀梦想的靳津津在父亲的影响下立志要学习弘扬中华美食。两人因味觉结缘，并订立契约，也在打打闹闹中情愫渐生。而此时，安文宇青梅竹马、黄金搭档蓝芮强势回归，他的事业与爱情也遭遇双重危机。为了捍卫家族声誉和保卫自己来之不易的爱情，两人励志携手，共同努力突破重重困境，终于打破蓝芮之父蓝祁山的阴谋。蓝芮、蓝父也幡然醒悟！最终，安文宇读懂了父母的浓浓爱意，懂得了亲情的珍贵和人生的真谛，并用父母的爱意和津津的虔诚感动了评委，在世界级美食大赛中夺魁，让中华美食文化走出国门。',1,0,0,0,'',0,0.0,0,'陈铭章',NULL,1495007741,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1028','0',0,0,NULL),(28238,49,'黄大妮',',王茜华,,曹征,陈思斯,林家川,','内地',NULL,2017,409,'二十世纪60年代，地质队野外事故让黄大妮失去了刚领了结婚证的丈夫孙木林，她只好怀着孩子嫁给烟厂的牛师傅。等死而复生的孙木林找到黄大妮，她已经和牛师傅结婚并生下了儿子牛建邦。十八年艰辛而过，牛师傅不幸逝世，已在烟厂做电工的孙木林一心想和黄大妮重新结婚，名正言顺的和自己儿子孙建邦生活到一起。可是因为孙木林在美国早已经分居的妻子韩冰不同意离婚，从小被人嘲笑是私生子的孙建邦也只承认牛师傅是自己的亲生父亲，黄大妮坚决拒绝了孙木林。十几年后，黄大妮和孙木林历经生死磨难，始终不离不弃。牛建邦被亲生父母的真情深深打动，终于和亲生父亲孙木林和解。在大枣树下，他们再现了当年期待的婚礼。',1,0,0,0,'',0,0.0,0,'沈航','44集全',1495038168,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1030','H',0,0,NULL),(28239,49,'我的危险妻子',',国本雅广,伊藤英明,木村佳乃,相武纱季,高桥一生,宫迫博之,','日本',NULL,2017,410,'望月幸平与千金小姐恋爱结婚，辞去广告代理店的工作并开始经营咖啡店，过着人人称羡、一帆风顺的生活。但是幸平的妻子真理亚看似近乎完美却隐藏自己真心，让幸平处处感到束缚。在外遇小三北里杏南的怂恿下，幸平决定杀妻。下定决心要动手的幸平，某日回到家中惊见屋内斑斑血迹，而妻子却消失无踪。而后接到来自”凶手”的留言，幸平不但被威胁交付赎金，还被栽赃成嫌疑犯。接下来，真理亚不为人知的一面渐渐的浮出水面。',1,0,0,0,'',0,0.0,0,'三宅喜重','9集全',1495038180,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1032','W',0,0,NULL),(28240,49,'漂洋过海来看你',',朱亚文,王丽坤,叶青,黄柏钧,王彦霖,','内地',NULL,2017,411,'留居海外的苏芒在旅游集团就职。苏芒和田学成结婚后发现其性情大变，田学成还要求与苏芒离婚。离婚后的苏芒向公司申请回国，公司批准苏芒回国内分公司担任执行总裁。回国的时候与公司的酒店试睡员郑楚产生了误会。苏芒来到公司进行整顿裁员，郑楚幸免。公司职员私下讨论女上司因被前夫抛弃而回国，郑楚帮助苏芒解围，苏芒对其产生好感。发现自己怀孕后的苏芒去国外待产，郑楚追到国外寻找苏芒无果却遇到遭家暴而无家可归的前女友陈姗姗，出于同情便答应陈姗姗回国后住在自己的家里。苏芒带着孩子回到国内见到了日思夜想的郑楚，郑楚也表示会将孩子当成自己的来照顾。两人甜蜜相恋。苏芒在郑楚家里发现了陈姗姗，两人冲突爆发，田学成回国要和苏芒复婚。陈姗姗的出现让田学成非常尴尬的走了，原来对陈姗姗施暴的男人就是田学成。误会得以解开，有情人终成眷属。',1,0,0,0,'',0,0.0,0,'陈铭章','26集全',1495038184,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1034','P',0,0,NULL),(28241,49,'剃刀边缘',',,马伊琍,丁勇岱,芦芳生,栾元晖,','内地',NULL,2017,412,'二十世纪三十年代，能力出众，机智果敢，却没有坚定信仰的伪满警察许从良，在哈尔滨警察厅险恶的内部斗争中，凭借出色的破案才能，赢得了警察厅厅长金荣桂的信任。另一方面，许从良出于对警察厅刑事科科长关海丹的爱慕和对共产党人的钦佩，一次次帮助关海丹转危为安，并在多次行动中与关海丹并肩战斗，成长为了一名真正的共产党员。在血雨腥风的伪满警察厅，许从良一直在剃刀的边缘，与关海丹从敌对到合作，再到心心相印，最终赢得了关海丹的爱情，也收获了坚定的信仰。',1,0,0,0,'',0,0.0,0,'文章','48集全',1495038187,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1035','T',0,0,NULL),(28242,49,'霍去病',',张若昀,毛晓彤,白宇,于朦胧,李宏毅,','内地',NULL,2017,413,'霍去病在机缘巧合下，从一个奴婢的私生子成为皇亲国戚。他抓住机遇，苦练骑射本领，成为智勇双全、胆识过人的少年壮士。由于北方边境屡遭匈奴统治者的侵扰，边民苦不堪言，汉武帝决定以攻为守，发起反击。十七岁的霍去病随军作战，他出奇制胜，一战成名，被封为冠军侯。初露锋芒的霍去病在大汉朝廷的全力支持下，率领精锐之师，接连深入大漠，与匈奴展开一系列决战。他创下六天转战五个匈奴王国，斩获匈奴折兰王、卢侯王，活捉匈奴浑邪王的儿子及相国、都尉等万余人的辉煌战绩，尤其在接受匈奴浑邪王投降的过程中，霍去病单骑入敌营，力挽狂澜，胜利完成受降，表现出超乎想象的胆识和勇气，堪称一代军神。最终，霍去病彻底击溃匈奴统治者的主力，封狼居胥，成就了北疆的世代安宁。',1,0,0,0,'',0,0.0,0,'张健',NULL,1495007750,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1037','H',0,0,NULL),(28243,49,'血族 第三季',',寇瑞·斯托尔,大卫·布拉德利,米亚·梅塞德罗,凯文·杜兰,理查德·塞梅尔,','美国',NULL,2017,414,'《血族》第三季的战场将会设置在纽约，被联邦政府放弃的纽约市民将如何自救生存。吸血鬼和人类究竟谁将赢得这场战役。与此同时，“始祖”所制造的不可阻挡的转化也在逐渐走向成功。',1,0,0,0,'',0,0.0,0,'吉尔莫·德尔·托罗','10集全',1495038200,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1038','X',0,0,NULL),(28244,49,'鸡毛飞上天',',张译,殷桃,陶泽如,张佳宁,高姝瑶,','内地',NULL,2017,415,'陈江河跟着大伯陈金水四处闯荡，以“鸡毛换糖”建起鸡毛掸子厂，却被父亲拉回老家端起了“铁饭碗”，但之后因大伯力邀南下掌舵新开的袜厂而辞职，几年之后离开袜厂自立门户，开始了艰难的创业之路，创业期间与被自己曾救下的四川姑娘骆玉珠几经磨难终成夫妻。若干年后陈江河的大儿子陈旭为了家族企业的利益违心地与房地产商的女儿徐双双成婚，婚后感情的不和谐与事业的诸多不顺令其日渐消沉，生活变得糜烂，而学成归国的弟弟陈铮却忙着在已成为国际化贸易重地的义乌另辟蹊径高薪聘请奢侈品牌设计师，以网站为平台建造B2C商业模式，期间历经波折，但依然坚持不懈，他秉承父亲当年创业时的奋斗精神，憧憬未来，打造着新时代的义乌。',1,0,0,0,'',0,0.0,0,'余丁','55集全',1495038208,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1040','J',0,0,NULL),(28245,49,'宫锁珠帘',',冯绍峰,杨幂,何晟铭,袁姗姗,舒畅,','内地',NULL,2012,416,'雍正年间，候补四品典仪凌柱之女怜儿为父请命结识十七王爷允礼，二人两情依依，本要结为夫妇，没想到允礼为救老师阿灵阿，不得已娶了阿灵阿之女嘉嘉为妻，伤心欲绝的怜儿在深宫里步步为营，渴望能走出深宫过平凡的日子，不想却被宫中各股势力所利用，李卫要跟她结盟，大太监苏培盛要向她报恩，亲如姐妹的玉漱出卖她，表面和谐的深宫里埋藏着各种秘密，就在怜儿快喘不过气时，她意外地被雍正看中，成为了万千宠爱于一身的喜妃，而就在这时，她忽然发现所有的事情一下子都变复杂了，停下来就会被迫害，走下去可能连自己也不认识自己了，在三岔路口，她选择了相信阳光，相信暴风雨总会过去的，于是在她坚忍不拔的努力下，终于为自己闯出了一片天。',1,0,0,0,'',0,0.0,0,'李慧珠','37集全',1495038216,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1042','G',0,0,NULL),(28246,49,'谁寄锦书来',',王昭,王婷,尚思琪,杨帆,高冠军,','内地',NULL,2017,417,'一个叫贾阳的青年人在十多年前与初恋女友葛莹分手后，一蹶不振，浑浑噩噩靠着终日赌博为生。一日他在赌场遇到了葛莹现任老公，也是当年的同班同学刘晓亮。两人喝大酒，刘晓亮酒后吐真言，告诉了是他当年阻断了葛莹的书信往来。贾阳找到了藏匿于刘晓亮家当年他给葛莹写的情书。他去刘晓亮大闹一场，被葛莹驱逐离开。贾阳沮丧的离开刘晓亮家。回到以前校园故地重游，心灰意冷的贾阳把那封信扔到了早已废弃的邮箱里，回家睡觉。第二天他醒来的时候发现身边躺着一个漂亮的人妻，自己则成了一个升价过亿的地产大鳄。原来就是昨晚那个废弃邮箱有着神奇的魔力，让贾阳的信按着信上的日期寄回了十多年前葛莹的手里，从此产生了连锁效应，但还是与葛莹阴差阳错的错过。心有不甘的贾阳再次穿越，却发现自己的妻子依旧不是葛莹，自己则成了一个地下赌场的老板，妻子漂亮贤惠。但拥有美好人生的贾阳一心想找回初恋，所以再次穿越。不管贾阳怎么穿越，他总是与葛莹有缘无分。终于在经历数任妻子，各种身份之后。顿悟出真爱的要素不是追寻，而是奉献。最终峰回路转与初恋相遇。',1,0,0,0,'',0,0.0,0,'田键','12集全',1495038228,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1045','S',0,0,NULL),(28247,49,'端脑',',朱元冰,蒋依依,黄一琳,杨奇煜,谢佳见,','内地',NULL,2017,418,'少年夏驰天性纯良、聪明缜密，是学校推理社的成员。在一次推理社活动之后，接触过“季陆案件”的夏驰女友——晴知神秘失踪，为了寻找晴知，夏驰和好友孟秦无意中发现了一个名为“端脑”的虚拟游戏组织，并一起进入了端脑游戏的世界。在一局一局的推理游戏中，夏驰和孟秦经历了各种人性和智慧的考验，也目睹了这个游戏背后“端脑”组织拥有的巨大权力和财富，更不断怀疑和挑战着这个游戏的最终目的。经过各种九死一生、危险重重的考验，夏驰最终抵制住来自“端脑”世界的种种诱惑，救出了晴知，揭开了端脑游戏的真正目的，并发现了与地球处在平行宇宙中的另一个星球的存在。而端脑，则是这个星球为了平衡两个宇宙而打算消灭地球文明的一个危险计划。',1,0,0,0,'',0,0.0,0,'于中中',NULL,1495007760,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1046','D',0,0,NULL),(28248,49,'昭雪 第四季',',J·D·埃弗摩尔,约书亚·米克尔,亨特·巴克,丽贝卡·蒂尔尼,','美国',NULL,2017,419,'丹尼尔来到纳什维尔落脚，开始了新的篇章，告别家人的他正努力把控自己的狱外生活。他所抛下的家庭已然出现裂痕，却也有一线希祈。人生逆旅，他们能否各自向前。',1,0,0,0,'',0,0.0,0,'雷·迈克金农','8集全',1495038231,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1047','Z',0,0,NULL),(28249,49,'古战场传奇 第二季',',凯特瑞纳·巴尔夫,山姆·修汉,罗伯特·卡瓦纳奇,斯坦利·韦伯,','美国',NULL,2017,420,'Claire是一位已婚的战地护士，从1945年穿越到1743年的苏格兰。在那个一无所知的世界，她因为生命受到威胁而被迫嫁给英武浪漫的苏格兰战士Jamie。从此Claire的内心在两种截然不同的生活以及男人之间挣扎。',1,0,0,0,'',0,0.0,0,'Richard Clark','13集全',1495038233,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1048','G',0,0,NULL),(28250,49,'密查',',于荣光,连奕名,常铖,亓航,','内地',NULL,2017,421,'一九三八年，在抗日战争、国共合作背景下，蒋介石听信谗言授命西安特务组织，密裁第十八集团军高级参议、中共党员宣侠父，此举引发中共强烈抗议。迫于舆论压力，国民党被迫在西安成立破反专署，调查宣侠父失踪案。中共地下党员、原中统特工武仲明，成为国共双方共同认可的破反专员。武仲明领衔的破反专署，集结了西安军、警、特和八路军西安办事处各路人马,敌中有我，我中有敌，错综复杂，调查之旅甫一启程即步步陷阱、危机四伏！武仲明彻查宣侠父案两个月间，不仅是刀锋上的对决，也是人性的较量。在地下党组织引领下，正义同道前仆后继追寻下，武仲明终于查明真相，拿到了密裁宣侠父手谕。迫于证据确凿，蒋介石不得不向中共认账，自吞苦果。',1,0,0,0,'',0,0.0,0,'王兵',NULL,1495007762,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1049','M',0,0,NULL),(28251,49,'神犬小七 第三季',',姜潮,宋妍霏,王洋,王煜,','内地',NULL,2017,422,'一个要去南鹿岛的十人旅行团意外被困于无名荒岛之上。搜救犬小七和菜鸟搜救员边慕临时搭档去救人，结果搜救船被洋流卷走，小七和边慕也被困荒岛。“狗中贝爷”小七发挥超强的野外生存和救援本领，很快成为大家的“主心骨”。同时，小七也发现身边每个人心中都有不可告人的秘密。一只蓝黄金刚鹦鹉的闯入让小七和众人担当起了保护国家濒危动物的使命，众人也因此陷入被盗猎分子追击的漩涡。逃亡中，小七和众人接连遭遇“野人部落”、海盗和假币制造团伙所带来的麻烦。在这场荒岛大冒险中，小七始终对“八喜”不离不弃，保护了这只稀有的国家一级保护动物，同时协助警方抓获了盗猎分子、海盗和假币制造团伙等犯罪分子，最终带领大家走出了生存的困境、治愈了每个人的内心。',1,0,0,0,'',0,0.0,0,'袁晓满',NULL,1495007763,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1050','S',0,0,NULL),(28252,49,'寻阁传',',蒋宇扬,谭旭,彭莹莹,童安格,李沅纯,贾冰,','内地',NULL,2017,423,'《寻阁传》讲述神魔累世积怨，大战多年。神界的女神月瑶和魔界的撼天在征战中产生了感情。生下了长欢和长笑两兄妹。长欢降生便背负神界重任，阻止魔界打开鬼蜮之门，放出鬼王，保护人间平安。神魔两界对此都非常愤怒，一起追杀月瑶和撼天一家人。月瑶和撼天终因寡不敌众，把神魔的力量封印在儿女身上后灰飞烟灭。长欢和长笑坠落人间，长欢得以长生不老，长笑却需要轮回罔替。人世间，长欢仍然履行宿命，每一世寻找转世的妹妹长笑，保护长笑和金木水火土五阁，以抵挡魔界打开鬼蜮之门，鬼王一出，贻害人间。',1,0,0,0,'',0,0.0,0,'赵博','12集全',1495038238,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1051','X',0,0,NULL),(28253,49,'罪 第一季',',伊丽莎白·艾伦,乔治·利昂·马丁内斯,克里斯蒂安·索利诺,比利·赞恩,凯文·J·瑞恩,安东尼·海德,','美国',NULL,2017,424,'以Amanda Knox的故事基础，是关于一个美国人在伦敦，最终成为杀死她室友的主要嫌疑人的故事。当调查进一步展开，我们将知道她到底是像伦敦小报所指，是一个天真无邪的小女孩受到了不好的影响，还是一个谋杀最好朋友的疯子。当丑恶的真相一步步揭开的时候，来到伦敦为她辩护的姐姐都质疑自己是不是真的了解妹妹。这部剧将全方位揭示伦敦社会，从一个豪华但是堕落的成人俱乐部到皇室家族。',1,0,0,0,'',0,0.0,0,'加里·弗莱德','10集全',1495038240,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1052','Z',0,0,NULL),(28254,49,'老爸当家',',张国立,蒋欣,高鑫,曹艳艳,王维维,','内地',NULL,2017,425,'名厨权来有原则有担当，独自辛苦把四个女儿养大，最大的希望是家庭的和睦和女儿们的幸福。大女儿权芳是家庭妇女，因过于节俭引起大女婿黄有成的嫌弃，二人的婚姻走到分裂边缘；二女儿权薇天生丽质，因和二婚律师杜思远的婚姻，当上了“后妈”；三女儿权水性格温吞却内心刚强，和富二代郭崇的爱情遭遇父母阻挠，最终冲破桎梏；四女儿权爱遇到了一个具有艺术感的神秘男人周翔，在周翔和发小王冲之间遇到种种选择的烦恼。四姐妹各有各的困境，又不时交织在一起让大家长权来头疼不已。而他自己和黄牡丹的黄昏爱情，不但要面对态度不一的女儿们，还遭遇了小姨子艾静的威胁和阻挠。周翔误会权来导致自己父亲去世一事，使权来被推到了风口浪尖。最终艾静的去世化解了所有的误会，权家的生活重新归于平静。权来和他的女儿们以爱温暖、包容彼此，携手共迎幸福的未来。',1,0,0,0,'',0,0.0,0,'陈国星','40集全',1495038243,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1053','L',0,0,NULL),(28255,49,'胡迪尼与道尔 第一季',',斯蒂芬·霍普金斯,罗伯特·里伯曼,杰夫·兰弗洛,丹尼尔·奥哈拉,迈克尔·温斯顿,史蒂芬·曼甘,戴安娜·奎克,蒂姆·麦克纳尼,杰克博·布莱尔,','美国',NULL,2017,426,'该剧描述了《福尔摩斯》系列小说的作者柯南道尔爵士与著名魔术大师哈里霍迪尼在现实生活中的友情。他们都是20世纪的杰出人物——Houdini是个享有盛名的魔术师，以逃脱魔术著称，但他同时是个超自然现象的揭秘者；Conan Doyle是个多产的作家，但他同时是个狂热的超自然现象爱好者。他们很不情愿地携手帮助新苏格兰场（伦敦警察厅）调查英国和加拿大悬而未决的古怪案件——那些无法解释的、无法侦破的、有超自然倾向的案件。',1,0,0,0,'',0,0.0,0,'爱德华·巴瑟杰特','10集全',1495038248,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1054','H',0,0,NULL),(28256,49,'知青家庭',',任程伟,李琳,于荣光,潘虹,李成儒,','内地',NULL,2017,427,'知青宋大江返城后，因生活窘迫和婚姻失败的打击，拼命地追求金钱。在经历了复杂的情感纠葛后，与女知青陈悦清结成伴侣，收养了一个弃婴，组成了一个“知青家庭”。夫妻俩忽视了对儿子乔生的教育,外婆的溺爱使乔生渐渐堕落。宋大江为了挽救儿子，隐瞒所有人实施了“假破产”计划，并以无颜面对破产为由，远走他乡。陈悦清卖掉了仅存的婚戒和儿子摆大饼摊维持生计。家庭环境的彻底改变使乔生猛然醒悟。在经历了种种挫折之后，他的人生轨迹终于转变了。在深圳创业的宋大江，成了著名企业家。正当一家人将要团聚之时，农村姑娘朱小芳却出现了，她来寻找已丢失了二十多年的儿子，还口口声声说：弃婴乔生就是她和宋大江的亲生儿子。一段尘封多年的知青往事被揭开，横亘在宋大江心中的情结也终于解开，知青岁月中凝结的深情重又在这个知青家庭中升腾，升华。',1,0,0,0,'',0,0.0,0,'苏舟','32集完',1495017584,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1055','Z',0,0,NULL),(28257,49,'新猛龙过江',',凌飞,黑龙,苗侨伟,陈国坤,杨蓉,王伟光,杜维瀚,','内地',NULL,2017,428,'民国初年，南拳之王仇振荣与北腿泰斗杜英豪举行了一场擂台比武，十岁的小仇骏亲眼目睹了父亲仇振荣死在杜英豪的脚下，而杜英豪因此成为武术界盛传的大英雄。杜英豪其实是个重情义的人，仇振荣的死一直在他心中挥之不去。在看淡名利之后，杜英豪决定带着妻儿隐身于大上海的弄堂市井。十八年后，仇骏化名聂云找到了杜英豪。经历种种危险困难，仇骏逐渐对杜英豪有了新的认识。仇骏终于发现，其实害死父亲的凶手正是称霸上海滩的枭雄卢三雄，而他的胞弟仇震已成为卢三雄的得力帮手。卢三雄无所不用其极，对杜英豪、仇骏等人施行了一系列残忍的打击行为，甚至还勾结了日军特务头子宫本一郎。九一八事变之后，杜英豪与仇骏、仇震等人联手抗敌，消灭了卢三雄，打击日军侵华势力。',1,0,0,0,'',0,0.0,0,'金琛','36集完',1495017592,1508319787,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1056','X',0,0,NULL),(28258,49,'盘中兽 第一季',',史蒂夫·希尔,乔·拜尔德,丹尼·高顿,大卫·休默,吉姆·斯特吉斯,迈克尔·盖拉迪斯,Lorenza,Izzo,克里斯蒂尼·亚当斯,','美国',NULL,2016,429,'两个好友Tommy Moran和Dion Patras梦想一起创办一家希腊餐厅，他们多次尝试均告失败，现在他们快要失去一切，他们只剩下最后一次圆梦机会——在他们的家乡布朗克斯开一家高档餐厅。 Dion是技艺精湛的厨师，但也曾是个诈骗犯，还招惹了黑帮，面临许多法律问题。对他来说，如果事业获得成功，他就能偿还欠黑帮的巨额债务，他的那些黑暗秘密再也无人知晓。Tommy是城中最好的酒侍，鳏夫，有一个未成年的儿子。对他来说，如果事业获得成功，他的儿子就有机会过自己未曾经历过的优越生活。糟糕的是，小偷小摸的家伙、腐败的官员和穷凶极恶的黑帮匪徒永远不会放过他们。 ',1,0,0,0,'',0,0.0,0,'丹尼尔·阿提亚斯','10集全',1495010903,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1057','P',0,0,NULL),(28259,49,'柜中美人',',黄肖英,徐惠康,周渝民,胡冰卿,陈瑶,韩栋,陈若轩,','内地',NULL,2016,430,'唐朝末年，皇室喜狩猎，骊山脚下狐族不堪其扰，派出轻风、飞鸾欲与皇族结为百年之好，以保平安。轻风因立功心切，接受了狐族“主战派”的命令，进入皇宫伺机刺杀皇上。她得知飞鸾倾心于书生李玉溪，便一直帮他们牵线，引开飞鸾的注意力，以便自己完成行刺使命。入宫后，轻风为皇上的勤政爱民所感动，心生爱慕，皇帝也视其为知己，更因为皇帝曾在狩猎时救她一命，她在感情和任务中苦苦挣扎。轻风不再是一心想“立功”的人，开始体悟到善恶。又因轻风无意中得到玉玺，实际上也卷入了宫廷暗斗之中。',1,0,0,0,'',0,0.0,0,'李公乐',NULL,1495007770,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1058','G',0,0,NULL),(28260,49,'非常创业 第一季',',艾迪·盖瑟吉,马丁·弗瑞曼,亚当·布罗迪,乔赛琳·唐娜休,','美国',NULL,2017,431,'Sony的网络台Crackle预订一部新剧《创业公司 Start Up》，首季为10集，这部每集一小时剧集讲述一个聪明﹑但备受争议的科技理念，被三个看似是高科技企业家的人，利用在不正确的方向上。剧集背景为形容在不受约束﹑机会主义的迈阿密里，看哪个人为了成功不择手段。',1,0,0,0,'',0,0.0,0,'本·科泰','10集全',1495010906,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1059','F',0,0,NULL),(28261,49,'破晓',',黄志忠,陈小春,俞灏明,杨雪,何杜娟,','内地',NULL,2017,432,'淞沪会战前夕，警探田继业介入了一起妓女杀人案。但让他意外的是，这名杀人妓女竟是当初的初恋女友。出于情感的愧疚，田继业不惜一切代价地发掘案件真相，发现案件背后有强大的力量在操控案件的探查和司法程序，并牵连出政治阴谋、司法腐败、官员贪腐等众多黑幕。',1,0,0,0,'',0,0.0,0,'齐星','46 集全',1495038718,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1060','P',0,0,NULL),(28262,49,'那片星空那片海 第二季',',冯绍峰,郭碧婷,黄宗泽,王阳明,','内地',NULL,2017,433,'以繁华盛唐时期恢弘大气的航海史诗为背景，讲述了一个出身造船世家的平凡女孩和鲛人王子之间真挚动人的爱情故事。在造船业发达的滨海小镇常乐，人类女子陆漓男扮女装混入造船厂，希望能在船厂大展身手，实现自己扬帆远航的梦想，鲛人王子吴居蓝也带着神秘任务来到船厂，两人不打不相识，产生了纯洁的爱情。随着陆漓和吴居蓝的相爱，两人背后的阴谋也逐渐浮出了水面，陆漓在亲情和爱情之间痛苦挣扎。最终，陆漓和吴居蓝用爱化解了仇恨，人类和鲛人终于和平共处，同享盛世繁华。',1,0,0,0,'',0,0.0,0,'卫翰滔','更新至26集',1508894871,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1061','N',0,0,NULL),(28263,49,'那片星空那片海',',冯绍峰,郭碧婷,黄明,隋咏良,李子峰,','内地',NULL,2017,434,'怀揣梦想的平凡少女沈螺（郭碧婷饰），远离喧嚣的城市，回到安静的海岛生活。不料偶然间救起一个叫吴居蓝（冯绍峰饰）的男子，竟然是个和人类的进化方向完全不同、来自大海的高等生命体——鲛人。他以不凡的能力和智慧一次又一次地帮助沈螺度过难关，战胜危机，深深地吸引了沈螺。两人一路磕磕绊绊，从互相了解到互相信任，最后产生了深深的爱情。沈螺身上有一颗鲛人灵珠，引起了周家老爷子的觊觎，他绑架了沈螺，吴居蓝及时赶到，救出了沈螺，却付出了生命的代价。正义终于战胜了邪恶，周家老爷子被抓，得到了应有的惩罚。沈螺从悲痛中走出，决心带着两个人的梦想，更坚强地活下去。',1,0,0,0,'',0,0.0,0,'卫翰滔','30 集全',1495038696,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1062','N',0,0,NULL),(28264,49,'大秦帝国之崛起',',宁静,张博,邢佳栋,杨志刚,沈佳妮,','内地',NULL,2017,435,'秦昭王当政不久，列国展开一系列兼并战争。秦国看准时机，先与齐连横，攻略魏国大片土地。由此，战国到了秦齐赵三国并强阶段。此时秦国国内，穰侯魏冉擅权，宣太后掌政，秦昭王王权旁落。此时，局势对秦国十分有利：纵横家苏秦与燕王秘约赴齐间齐，以灭齐为目标“死间”齐国。面对国内政治困局和国外有利机遇，秦昭王毅然起用范睢，逐魏冉、废太后之权而恭养之。同时，与苏秦合谋，举兵攻破齐国。秦昭王遣将白起，相继在伊阙、郢都、华阳、长平发动四大战役，歼灭了韩魏齐楚赵百万以上兵力，使秦与列国消长发生了根本转折。自此，秦国崛起。',1,0,0,0,'',0,0.0,0,'丁黑','40 集全',1495038731,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1063','D',0,0,NULL),(28265,49,'妈妈向前冲冲冲',',秦海璐,郭晓东,胡兵,江祖平,刘庭羽,','内地',NULL,2017,436,'汪晴欲赴美探望病重的凯文，却未能成行。前夫剑平藉此想和汪晴复婚，不料胡莉抱着小孩回来尹家认祖归宗。其实真胡莉已难产过世。胎妹莎莎冒充胡莉前来尹家原本是想要一笔抚养费就走人。但她发现剑平是家IT公司的老板起了邪念。莎莎的前男友高鹏生出现，他欲拐走汪晴之子小志未遂，却造成汪晴车祸失忆。凯文康复归来见状心痛。高鹏飞被抓交代了莎莎真实身份被尹家赶出。莎莎找到凯文公司打工，为得到凯文的爱，她釜底抽薪，致剑平公司于绝境。汪晴恢复记忆，莎莎得知凯文爱的是汪晴从中破坏，汪晴误解凯文拒绝求婚。凯文情绪衰落旧病复发往生。莎莎痛悔，给汪晴留下忏悔信离开。剑平得知真相，抚慰汪晴,在孩子们期待目光中汪晴动容，一家人终获重生。',1,0,0,0,'',0,0.0,0,'罗灿然','48集全',1495010919,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1064','M',0,0,NULL),(28266,49,'爱，来得刚好',',韩栋,江铠同,李威,张熙媛,王伟,','内地',NULL,2017,437,'清岺从小在孤儿院长大，善良开朗乐于助人，她拥有“绝对嗅觉”，凭着对气味的敏感开始了香水的研制工作。清岺梦想做好香水创造财富、回报孤儿院和社会。为了达成梦想，清岺在各种逆境中坚持前进。在追求梦想的过程中，清岺得到了徐庆伦、段天朗、段益华等人的全力帮助，更与段天朗从欢喜冤家成为一对相互扶持的恋人。在此期间，清岺还找到了家人，重享亲情。经历了重重挫折之后，清岺最终凭借自己的努力和众人的支持做出了自己的品牌香水，实现了梦想、获得了爱情。',1,0,0,0,'',0,0.0,0,'王连平','60集全',1495010922,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1065','A',0,0,NULL),(28267,49,'三生三世十里桃花',',余翠华,任海涛,杨幂,赵又廷,张智尧,于朦胧,黄梦莹,','内地',NULL,2017,438,'狐帝白止幺女白浅，因贪玩成性，被父母幻化为男儿身，以司音的名字投入昆仑虚墨渊门下。一日，白浅知二哥孩子即将出生，偷溜下山，想赶回青丘看小侄女降生，却被翼君擎苍撞到，擎苍将白浅绑入翼界，在那里，她与翼界二皇子离镜结为好友，并互相心生爱慕。不久，师父墨渊潜入翼界，救回白浅。思念白浅的离镜，偷离翼界，到昆仑虚对白浅表明心意，两人终携手。不料，白浅这段初恋，却被好友玄女嫉妒。玄女年少时，曾凭易容得到与白浅一般无二的绝色容颜，趁离镜一直在犹豫他与司音的情感之时，成功用自己的脸诱惑离镜，横刀夺爱。白浅惨遭友情、爱情双重背叛。',1,0,0,0,'',0,0.0,0,'林玉芬','高清',1504980791,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1066','S',0,0,NULL),(28268,49,'周末父母',',刘恺威,王鸥,张萌,朱泳腾,赵楚仑,','内地',NULL,2017,439,'于致远、赵佳妮结婚五年，3岁半的儿子于震轩周一至周五住在外婆家，夫妻二人只有双休日才把孩子接回家，享受短暂的亲子时光，他们是这个城市里司空见惯的“周末父母”。一次偶然的机会，赵佳妮意识到“父母是有有效期的”，为了能够参与儿子的成长，夫妻二人开始努力奋斗，争取早日结束这样的生活。在奋斗的过程中，于致远从一个愣头青记者成长为铮铮铁骨的当家主编，而赵佳妮也从一个碌碌无为的小女人晋升为独当一面的外企员工。在这个过程中，这对小夫妻面对高速发展的社会中的诱惑，一次次守住底线，向着目标前进。最终，他们坚守住时代的价值观，彼此不离不弃，终于明白陪伴才是对孩子最深的爱。',1,0,0,0,'',0,0.0,0,'王为','42集完',1495017620,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1067','Z',0,0,NULL),(28269,49,'青年霍元甲之冲出江湖',',李浩轩,刘真君,徐少强,计春华,寇振海,','内地',NULL,2017,440,'霍父是镖局元老，后退隐江湖，不希望子承旧业。可过去的仇人非要置霍家于死地。大难来临之时，霍元甲无力拯救家人，受尽屈辱。突击学艺，救全家和乡亲们于水火之中，成为全村英雄。他被恶势力盯上。诱其上钩，欲用其利。霍元甲灭恶人，被迫离乡逃往天津港。霍元甲为生存和天津港黑帮殊死搏斗，占领天津码头，欲共处平和，却无法生存，只好到天津卫开镖局。但镖局市场已被瓜分，三家各有背景。老镖局设尽法子将霍元甲挤出天津卫，并将其投进监狱置于死地。霍元甲被迫出手，统一镖局，威震四方。怎料，漕帮和青帮都看上了他。连王爷都为了个人目的拉霍元甲下水。霍元甲本想济世百姓，却沦落成草寇。在打败了日本浪人和盗国宝勾结洋人的清王爷之后，决定退出江湖。但黑暗的时代不会让他安生。',1,0,0,0,'',0,0.0,0,'都晓','45集全',1495012454,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1068','Q',0,0,NULL),(28270,49,'战火中的兄弟',',陈晓雷,曹炳琨,原雨,高艺涵,胡亚捷,石兆琪,','内地',NULL,2017,441,'在二十世纪三十年代末的江南水乡。民间抗日志士高明远率领的队伍是当地一支著名的抗日力量，在一次劫日军监狱救人行动中，他们偶遇新四军游击队，也遇到了曾经的同学—现任新四军游击队队长的心月。心月欣赏明远的人品和才能，希望明远加入新四军，共同抗日。明远和手下的兄弟们固执地凭借个人的力量对抗日军，险些铸成大错。在心月的帮助下，明远等人认识到自己的鲁莽和任性，幡然悔悟，加入游击队，与心月一起携手作战。虽然开始有些无所适从，但经过努力，大家逐渐适应了部队生活。他们英勇奋战，挫败了日军扫荡计划。明远和他的兄弟们也在战斗中成长，成为真正的革命战士，与此同时，明远和心月也碰撞出了爱情的火花。',1,0,0,0,'',0,0.0,0,'寇占文','44集完',1495017634,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1069','Z',0,0,NULL),(28271,49,'双喜盈门',',潘长江,,张大静,肖光奕,徐熙颜,','内地',NULL,2017,442,'郑合适抱着鲜花向钟情已久的方美兰求婚，不料婚没求成，反被方美兰的前小叔子曹天风一板儿砖开了瓢。当年，师父方清平“嫌贫爱富”，他明知徒弟郑合适与方美兰相好，愣是棒打鸳鸯逼女儿嫁给了曹家。郑合适一怒之下与方清平断绝师徒关系，并另立门户开办“合适居”，与师傅唱对台戏。恰逢村里计划开发凤凰山旅游，方清平、郑合适师徒二人明刀明枪地展开了竞争，演绎出一场精彩的龙虎斗。无私的郑合适为凤凰村发展所做的努力终于得到了方清平的认可，他开始逐渐转变了对郑合适的态度。师徒二人从对抗到携手，从分歧到统一，最终郑合适如愿收获爱情，师徒冰释前嫌。在他们的牵头带动下，凤凰村旅游项目发展势头喜人，凤凰村精神文明建设收获累累硕果。',1,0,0,0,'',0,0.0,0,'韩兆','43集完',1495017658,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1070','S',0,0,NULL),(28272,49,'淘气爷孙',',杜源,刘欢,朱茵,徐梵溪,巩汉林,','内地',NULL,2017,443,'80后小夫妻是“凤凰男”与“公主病”的组合，他们5岁的孩子在“高知”外公外婆的溺爱下成长，而伴随着农村的爷爷奶奶闯入他们的生活后，一场关于地域、文化、生活习惯和教育理念的“夺子”大战就此展开。三对组合、六个大人，每个人都对“带孩子”这件事有着自己的理念和方法。在笑料迭出的冲突中，家庭成员们逐渐得到了成长与改变，最终一家人过上了和睦幸福的生活！</br>',1,0,0,0,'',0,0.0,0,'侯明杰','42集全',1495012390,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1071','T',0,0,NULL),(28273,49,'黄金女保镖',',陶洋,郑淳璟,余铭轩,马心怡,蒋龙,','内地',NULL,2017,444,'明朝初年，京城美容老店美珍堂藏着五个各怀绝技的女侠，燕王朱棣为了对付即将登基的皇太孙，化名江湖大侠赵子庚秘密培养最强侠女组织，五个女孩儿在美容院爆笑生活日常的同时与多方势力的斡旋和交集，最终她们成长为五位超级女侠成立了“黄金女保镖”，共同携手应对幕僚封建势力，维护百姓、维护正义。故事背景虽在古代，但一切人物思想如同现代，在面对工作、爱情、友情中勇敢做自己，以另类而幽默的笔调，讲述了一个完全颠覆的明史故事，并且通过女性武侠的视角，借除恶惩奸之旅，投射了一群都市年轻女人为理想和爱而奋斗的酸甜苦辣。',1,0,0,0,'',0,0.0,0,'圣桑','12集全',1495010947,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1072','H',0,0,NULL),(28274,49,'漂亮的李慧珍',',迪丽热巴,盛一伦,李溪芮,张彬彬,王骁,','内地',NULL,2017,445,'从小生活完美的公主李慧珍因家道中落沦为“龙套女”，成了初入职场处处碰壁的菜鸟。而小时候的“矮挫胖”白皓宇却变身高富帅海归。重逢时，一个是初入职场的菜鸟，拼尽全力克服职场上种种困难，怀抱着对初恋的期待而努力；一个是事业有成的时尚精英，念念不忘想寻回记忆中的初恋，却遍寻不得，二人身份的逆转倒错，让这个爱情故事有了一丝苦涩却也不乏搞笑欢乐的暖萌情节，是一部涵盖了友情、爱情、梦想、职场的轻喜剧。',1,0,0,0,'',0,0.0,0,'赵晨阳','46 集全',1495038679,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1073','P',0,0,NULL),(28275,49,'降龙伏虎小济公 第一季',',张倬闻,赵韩樱子,书亚信,晏紫东,邬靖靖,','内地',NULL,2017,446,'降龙伏虎小济公剧情讲述了佛祖座下的大鹏鸟被神秘妖魔乾坤洞主所蛊惑，偷盗七件佛门至宝下凡，被十八罗汉阻止。大鹏鸟哄骗看守婆罗洞的胖瘦仙童越狱出逃，降龙罗汉连忙追击，不料大鹏鸟自爆佛宝得以逃生，而降龙罗汉则受了重伤。佛祖命令降龙罗汉转世下凡捉拿大鹏鸟，但李氏女主人若兰却被乾坤洞主附身，降龙欲进入若兰腹中时被乾坤洞主偷袭，危急时刻他将护体金龙打入若兰腹中，成为胎儿之魂，而自身与乾坤洞主决斗后两败俱伤。七年后，降龙罗汉的藏身秘法破解，降龙罗汉元神重伤未愈，浑浑噩噩中附体在前往天台县上任县令却遇害身亡的贾道济身上，伏虎罗汉发现了贾道济的身份，并点醒降龙罗汉，但此时降龙罗汉重伤未愈，无法与已经七岁的金龙佛胎李修缘元神合一，于是伏虎化作凡人充当天台县师爷，与伏虎一同保护李修缘，等待降龙罗汉伤愈在进行元神合一，成为真正的降龙转世。降龙罗汉附体的贾道济、伏虎罗汉化身的甄虎、护体金龙转世的小修缘、被罚下凡间的胖瘦仙童，因为罗汉护法而让先天死胎复生的剑仙之女小胭脂一起收妖魔、破悬案、护佑三界平安。',1,0,0,0,'',0,0.0,0,'简远信','20集全',1495010953,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1074','J',0,0,NULL),(28276,49,'美国罪恶 第一季',',蒂莫西·赫顿,菲丽西提·霍夫曼,W·厄尔·布朗,佩内洛普·安·米勒,理查德·卡夫拉尔,','美国',NULL,2016,447,'故事描述一起带有种族色彩的谋杀案及随后的审判过程给所有相关人员造成的影响，包括受害人及其家人、罪犯及其家人等。当一对住在莫德斯托市的夫妇遭人入室行凶后，由此引出的社会问题在当地引发强烈反响，人们将它视为反映当代美国人种族观、阶级观和性别政治的一面镜子。',1,0,0,0,'',0,0.0,0,'约翰·里德利','11集全',1495010955,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1075','M',0,0,NULL),(28277,49,'孤战',',陈卫国,苗圃,王雅伦,冯恩鹤,刘钇彤,姚安濂,','内地',NULL,2017,448,'1943年，一份我党潜伏汪伪和军统的人员名单因负责人的被捕，被锁在上海银行保险箱。共产党员陈晓奉命利用指纹术制作指纹套以取出名单。行动失败，保险箱钥匙被汪伪特工部得到，联系人宋姐在牺牲前要陈晓务必拿到名单。与组织失联的陈晓发现自己怀孕。我党在特工部的卧底谢易夫，帮陈晓以军统特务“康子芹”的身份潜入敌营。除了李世杰的怀疑，冷剑屏的不满，范伟宸的捣乱，敌营里你死我活的权力斗争，也让康子芹步入悬崖边缘。她利用敌人权利之争，帮李世杰报复冷剑屏并除掉其爪牙陆天齐，危机与机会并存的敌营，怀孕带来的生理和心理反应等一个个生死关头，她都坚持下来，最终她凭借信念和智慧，惊险的拿到名单，并瓦解了敌人的一个惊天阴谋。',1,0,0,0,'',0,0.0,0,'姚星星','52集完',1495017669,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1076','G',0,0,NULL),(28278,49,'学渣少年',',牛信信,孙越,何云伟,倪虹洁,何文辉,','内地',NULL,2016,449,'以初中生牛信信的家庭、校园、日常生活为主要场景，展现一个有一些任性有一些叛逆、永远积极乐观的初中生的幽默生活片段。',1,0,0,0,'',0,0.0,0,'牛朝阳','6集全',1495010961,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1077','X',0,0,NULL),(28279,49,'小草青青',',王茜华,于震,刘钧,何翯,戴笑盈,','内地',NULL,2016,450,'美丽姑娘何青青高中毕业回村做了大队广播员，与知青苏卫东恋爱。1977年双双高考，苏卫东顺利考上大专，何青青却连续三年落榜。为给相依为命的哥哥何大牛换亲，小多忍痛割爱与初恋苏卫东分手，嫁给八卦岭残疾青年赵春来。婚后的何青青一直在爱情与婚姻，梦想与现实间挣扎，一场车祸夺走了丈夫春来和哥哥大牛的生命。嫂子喜鹊造谣何小多谋害金锁。为了给遇难丈夫一个交代、为了偿还欠下的巨债、为了回击喜鹊对自己的诬陷，历经三年艰辛寻凶路，何青青也从美丽的“地瓜嫂”蜕变为强悍的“杀猪婆”。并一个人拉扯三个弟妹长大成人、就在此时何青青查出肝癌，她隐瞒病情，继续寻找喜鹊下落，只为石榴能在婚礼前能与母亲喜鹊团聚。喜鹊喜极而泣，她带着三弟妹动情向何青青叩首谢恩。',1,0,0,0,'',0,0.0,0,'王梓','55集全',1495012512,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1079','X',0,0,NULL),(28280,49,'守护丽人',',朱少杰,李小璐,张译,李智楠,吴谨言,刘佩琦,','内地',NULL,2017,451,'幼年时，林佳一因家中变故被父亲林世渊独自一人含辛茹苦带大。林佳一长大后格外任性，做事不计后果。林世渊意识到女儿的问题，为挽救女儿，将其赶出家门，让她从基层职工做起，接受社会锻炼与改造。失去富裕生活的林佳一负气出走、流落街头，被北京胡同里土生土长的快递员陈曦所救。普通的百姓生活让林佳一无从适应，更惹出重重祸事。面对齐心协力共度难关的陈家人，林佳一心底的善良被激发。陈曦对爱情、家庭的责任感教会了林佳一如何重新塑造自己，也带领林佳一用劳动创造价值。陈曦在日夜相处中改变了对林佳一的印象，两人就此相爱。而此时，林佳一昔日男友黄在远再次出手欲重新追求改头换面的林佳一，林佳一的亲生妈妈也从美国衣锦还乡，并试图让林佳一重新过上不用劳动的生活，林佳一和陈曦之间的感情变得岌岌可危。最终，林佳一克服重重阻碍，奋斗成长为对社会有用的正能量女孩，也收获了和陈曦的爱情。',1,0,0,0,'',0,0.0,0,'袁英明','47集全',1495012525,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1080','S',0,0,NULL),(28281,49,'最后一张签证',',王雷,陈宝国,张静静,赵擎,王诗槐,','内地',NULL,2017,452,'1937年，上海沦陷，出身外交世家的普济州因不满与姚素珍指腹为婚，在其婚礼上，竟然当场逃婚，辗转至中国驻奥地利维也纳领事馆任职，并与其偶像女小提琴家海伦雨中邂逅。1938年，奥地利被德国吞并，纳粹疯狂迫害犹太人，犹太人只有拿到外国签证，才可以逃离奥地利，但各国忌惮纳粹，以各种借口拒办签证，惟有中国驻维也纳领事馆，向犹太人敞开签证大门。普济州秉承总领事旨意，顶住重重压力，冒着巨大风险，与领事馆同仁一道为犹太难民办理通往中国上海的签证，尤其在独力执行“七人名单”绝密任务中，与以汉斯为代表的德国纳粹斗智斗勇、巧妙周旋，在犹太抵抗组织的配合下，历尽艰险，冲破重重险阻，将一个个大科学家找到并救出，展现了中华民族至情至善的人性光辉。',1,0,0,0,'',0,0.0,0,'花箐','46集全',1495012530,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1081','Z',0,0,NULL),(28282,49,'于成龙',',成泰燊,王雅捷,印小天,巫刚,修庆,','内地',NULL,2017,453,'讲述于成龙的为官经历，再现这位“吏者之师”的感人风范，生动诠释于成龙“待民要宽、治吏当严”的为官主张，弘扬他“以民为本、勤政清廉、敢于担当”的为官精神，力求塑造一位有血有肉、铮铮铁骨、廉能并重的廉吏形象。',1,0,0,0,'',0,0.0,0,'吴子牛','40集完',1495017687,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1082','Y',0,0,NULL),(28283,49,'合伙人','朱亚文,郑元畅,李佳航,','内地',NULL,2016,454,' 由朱亚文、郑元畅、李佳航、菅纫姿、韩雨芹、迟嘉、童苡萱、张雨彤等领衔主演的青春励志成长都市情感剧《合伙人》今日曝光“三人行”海报及“伙拼”版预告片。该剧讲述了古冬青、霍志远与王子三个90年代末的大学生从白手起家到成为网络行业领军人物的创业传奇，以及与不同性格女人间爱恨纠葛的故事。',1,0,0,0,'',0,0.0,0,NULL,NULL,1495007799,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1084','H',0,0,NULL),(28284,49,'黑名单 第三季',',詹姆斯·斯派德,梅根·布恩,迪亚哥·克莱特霍夫,瑞安·艾戈尔德,','美国',NULL,2015,455,'新季开始时，Liz为了逃亡做出一件很不靠谱的事情，这激怒了Ressler。Ressler发誓不惜一切代价抓住自己以前的搭档——即便那意味着将其他人置于危险之中。令人感到意外的是，Ressler因为某种原因被迫拯救逃亡中的Liz。Liz和Red除了要躲避联邦调查局和中央情报局的联合追捕，还要躲避一个强大的新敌人——Solomon先生。他不仅直接威胁Liz和Red，还威胁他们所爱的人。事实上，Red身边一个非常亲密的人就因为Solomon先生的出现而陷入险境，导致每个人都性命堪忧。',1,0,0,0,'',0,0.0,0,'乔·卡纳汉','23集全',1495010985,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1085','H',0,0,NULL),(28285,49,'塞尔福里奇先生 第四季',',杰里米·皮文,Greg,Austin,Catherine,Bailey,Billy,Barratt,Calum,Callaghan,','英国',NULL,2016,456,'主要描述百货业先驱者哈里·戈登·塞尔弗里奇(1858-1947)的传奇经历。塞尔弗里奇是美国出生的英国商人，1906年来到英国，开始在伦敦牛津大街建造塞尔弗里奇百货商店。该店于1909年开业，成为百货商店的“始祖”。后来，情妇和赌瘾让塞尔弗里奇失去了巨额家产，在穷困潦倒中死去。与塞尔弗里奇有染的著名女性包括：伊莎朵拉·邓肯(Isadora Duncan)，现代舞的创始者，使舞蹈成为人类肢体与感情的自然表达方式，因披肩卷入跑车轮胎中而意外身亡；安娜·帕芙洛娃(Anna Pavlova)，俄罗斯芭蕾舞演员，当代著名的舞蹈家，为传播和普及芭蕾舞艺术做出重大贡献。',1,0,0,0,'',0,0.0,0,'Robert Del Maestro','10集全',1495010987,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1086','S',0,0,NULL),(28286,49,'塞尔福里奇先生 第三季',',杰里米·皮文,弗兰西丝·奥康纳,埃斯林·洛福斯,','英国',NULL,2015,457,'这部10集的历史剧主要描述百货业先驱者哈里·戈登·塞尔弗里奇（1858-1947）的传奇经历。塞尔弗里奇是美国出生的英国商人，1906年来到英国，开始在伦敦牛津大街建造塞尔弗里奇百货商店。该店于1909年开业，成为百货商店的「始祖」。后来，情妇和赌瘾让塞尔弗里奇失去了巨 额家产，在穷困潦倒中死去。与塞尔弗里奇有染的著名女性包括：伊莎朵拉·邓肯（Isadora Duncan），现代舞的创始者，使舞蹈成为人类肢体与感情的自然表达方式，因披肩卷入跑车轮胎中而意外身亡；安娜·帕芙洛娃（Anna Pavlova），俄罗斯芭蕾舞演员，当代著名的舞蹈家，为传播和普及芭蕾舞艺术做出重大贡献。',1,0,0,0,'',0,0.0,0,'Roy Evans','10集全',1495010989,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1087','S',0,0,NULL),(28287,49,'塞尔福里奇先生 第二季',',杰里米·皮文,弗兰西丝·奥康纳,埃斯林·洛福斯,黛茜·雷德利,','英国',NULL,2014,458,'讲述了美国商人Harry Selfridge在19世纪初的伦敦开设全英国最著名的塞尔福里奇百货公司的故事，第一季曾吸引来超过800万观众，甚至曾一度冲高至950万观众，是英国ITV自2011年《重案组女警》以来最受欢迎的新剧。第二季将从1914年7月讲起，重点讲述这家百年老店如何度过第一次世界大战浩劫的故事。',1,0,0,0,'',0,0.0,0,'Anthony Byrne','10集全',1495010991,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1088','S',0,0,NULL),(28288,49,'塞尔福里奇先生 第一季',',安德鲁·戴维斯,杰里米·皮文,弗兰西丝·奥康纳,汤姆·古德曼·希尔,Will,Payne,','英国',NULL,2013,459,'塞尔弗里奇是美国出生的英国商人，1906年来到英国，开始在伦敦牛津大街建造塞尔弗里奇百货商店。该店于1909年开业，成为百货商店的始祖。后来，情妇和赌瘾让塞尔弗里奇失去了巨额家产，在穷困潦倒中死去。与塞尔弗里奇有染的著名女性包括：伊莎朵拉·邓肯，现代舞的创始者，使舞蹈成为人类肢体与感情的自然表达方式，因披肩卷入跑车轮胎中而意外身亡；安娜·帕芙洛娃，俄罗斯芭蕾舞演员，当代著名的舞蹈家，为传播和普及芭蕾舞艺术做出重大贡献。',1,0,0,0,'',0,0.0,0,'Anthony Byrne','10集全',1495010993,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1089','S',0,0,NULL),(28289,49,'黑狐之风影',',吴承轩,王梓桐,康杰,李卓霖,杨沫,','内地',NULL,2016,460,'1945年，为彻底击溃妄图扭转战局的日军，中共中央南方局派王文渊前往湘西战场。王文渊潜入日军核心机要部门盗取了日军作战计划情报，同时还发现了日军试图暗杀中国守军高级将领的“蝙蝠计划”。为阻止日军阴谋，王文渊只身进入重庆，与日本特工波田久雄展开生死对决，为赢得抗战胜利立下战功。抗战胜利后，国民党悍然挑起内战，却遭遇覆灭的下场。国民党军官宋永峥奉命留在贵州，寻机对贵州展开一系列破坏行动。王文渊针锋相对，粉碎了宋永峥的阴谋。宋永峥不甘失败，纠集一伙山匪四处破坏，伺机反攻。为彻底消灭匪帮，赢得全国的解放，王文渊率部进山剿匪，与宋永峥展开了一场殊死搏斗。',1,0,0,0,'',0,0.0,0,'王德庆','42集完',1495017683,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1090','H',0,0,NULL),(28290,49,'远大前程',',陈思诚,佟丽娅,袁弘,黄志忠,','内地',NULL,2016,461,'洪三元携母亲和好友齐林到上海投奔严华，卷入两大公司权利斗争。严华此时是一名码头工人，他不畏强权被推举为工人领袖。洪三元则凭借机智多次在凶险的上海滩化险为夷。洪三元与忠义之士沈达义结金兰，与来上海报父仇的林依依在斗智斗勇中成为莫逆，女扮男装的林依依爱上洪三元。洪三元接近富家女于梦竹，于梦竹爱上洪三元。严华遇险，为共产党人李新力所救，加入共产党。林依依为报仇铤而走险，洪三元与其奔走天涯。林依依遇难，洪三元重回上海滩。在严华和李新力进步思想的感召下，洪三元放弃来之不易的“美好生活”，为护送李新力离开上海倾其所有甚至生命。洪三元逐渐懂得，共产党带领的这条道路，才是他所想追求的远大前程。',1,0,0,0,'',0,0.0,0,'谢泽',NULL,1495007805,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1091','Y',0,0,NULL),(28291,49,'真爱的谎言之破冰者',',罗晋,潘之琳,','内地',NULL,2017,462,'一个装有冰毒的快递，打破了都市白领谭逗逗的平静生活，寄件人是七年前逃婚的男友靳远。逗逗在去往警局的路上逃脱，直奔包裹寄来的城市海滨寻找靳远。靳远是警方乔梁等监控中的嫌疑人，涉嫌用拍卖交易为贩毒集团洗钱。逗逗舍不了这段感情，打定主意要带他走出黑暗重新做人。其实靳远的真实身份是警方刘局派遣打入贩毒集团蔡炳坤（坤叔）内部的卧底。面对逗逗的热情，他不得不冷颜以对，冀望她早日放弃自己脱离危险；同时他还要应对毒贩们的挑衅与考验。而乔梁亦发现女友黄馨月爸爸黄队是内鬼。最终，靳远和禁毒大队用鲜血的代价取得了战斗的胜利，捣毁了犯罪集团',1,0,0,0,'',0,0.0,0,'余淳',NULL,1495007806,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1092','Z',0,0,NULL),(28292,49,'春风十里不如你','周冬雨,张一山,尤靖茹,','大陆',NULL,2017,463,'二十世纪九十年代，文学青年秋水遵从父母的意愿考入医学院，遇到性格截然不同却一样爱他的小红和赵英男。面对两个女孩的追求，秋水虽然选择了自己认为应该喜欢的赵英男，但心里一直住着小红；在秋水与赵英男交往的七年里，小红也还是一直守在秋水身边。即将毕业之时，痴迷文学的秋水被赵英男批评不务正业，两人渐行渐远；但小红理解秋水...</span><span class=\"intro-more hide\">简介：二十世纪九十年代，文学青年秋水遵从父母的意愿考入医学院，遇到性格截然不同却一样爱他的小红和赵英男。面对两个女孩的追求，秋水虽然选择了自己认为应该喜欢的赵英男，但心里一直住着小红；在秋水与赵英男交往的七年里，小红也还是一直守在秋水身边。即将毕业之时，痴迷文学的秋水被赵英男批评不务正业，两人渐行渐远；但小红理解秋水，欣赏他的文学才华，是秋水的心灵伴侣。?',1,0,0,0,'',0,0.0,0,'马进','更新至40集',1504407594,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/21118','C',0,0,NULL),(28293,49,'朝歌',',刘镇明,任海曜,吴谨言,张哲瀚,保剑锋,林佑威,刘敏,','内地',NULL,2016,464,'商朝年间，帝乙迁都朝歌，希望这座城市像早上嘹亮的歌曲般欣欣向荣。时光荏苒，帝位传至帝辛，他好大喜功，征战各方，弄得民不聊生。幸有西岐姬昌之子姬考，帝辛之子殷郊少年英雄，希望能以绵薄之力，解救百姓于水火中。姬考被陷害进入奴隶营，殷郊舍命相救。在逃亡路上姬考遇见了姜子牙、哪吒、杨戬等能人异士，并在他们的帮助下逃回西岐。公元前1048年，姬考改名姬发，会同八百诸侯集体讨伐帝辛，终于将殷商覆灭。不想在此过程中，殷郊误以为母亲死于姬发之手，倒戈相向。经过一番较量，殷郊终于明白王权在谁手里不重要，能带给黎民百姓幸福才是最重要的。殷郊自尽而死，姬发登基成为西周的王，他继续着当年跟殷郊共同的愿望，让天下黎民获得幸福。而在伐纣故事的过程中，这些历史人物的轨迹也给朝歌这座城留下了很多的名胜古迹和风俗习惯。',1,0,0,0,'',0,0.0,0,'李达超',NULL,1495007807,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1094','C',0,0,NULL),(28294,49,'别让爱你的人等太久',',田少波,张萌,田雷,高曙光,高宝宝,','内地',NULL,2016,465,'2013年的七夕，北京，因被母亲逼婚逃出家门的王希杰住进了合租屋，随后回来的室友唐晓晓也正因为和他相同的境遇而郁闷。两人碰面，同时记起两年前的一段纠纷。化解先前误会的同时，他们边喝酒边相互倾诉，旧情复燃。随后，性格的迥异和生活习惯的大相径庭让他们由惺惺相惜又迅速变成了死对头，就在两人矛盾不断升级时，唐晓晓却发现自己怀孕了。对于怀孕截然不同的态度让两人经历了各种起起伏伏之后关系也变得微妙起来，同时先后得知此事的两个家庭也卷了进来，由此引发了一系列饱含着酸甜苦辣各种情感的事情，经历过风风雨雨的两人渐渐地擦出了爱情的火花，最终，挺着大肚子的唐晓晓在王希杰密谋的盛大求婚仪式上成为了千万网民眼中“最幸福的女人”。',1,0,0,0,'',0,0.0,0,'王建军','35集完',1495017691,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1095','B',0,0,NULL),(28295,49,'心里的声音',',李光洙,郑素敏,金秉玉,金美京,金大明,','韩国',NULL,2016,466,'《心里的声音》讲述了男主角赵石“一事无成”，孤独的坚持着自己画漫画的梦想，他笔下的人物脱离了一般漫画中梦幻优美的固有形象，配色也多少有些夸张。这样的漫画很难被常人认可，满怀希望送去出版社，却被编辑嘲讽。就连自己的父母和哥哥也觉得赵石的漫画并没有意思。不断受挫的赵石并没有因此放弃自己的梦想，直到自己重逢了学生时期的初恋爱凤。被所有人称为无趣的这部作品却让爱凤笑到不能自已。一直不被肯定的赵石也因此获得了希望。最终，赵石的作品被越来越多的人赞赏，甚至到了因为读者的期盼不能随心停载休假的时候，受到喜爱和鼓励的赵石也有了被人气所困的烦恼，但是当他看到自己已经成了尚未成功的同窗极度羡慕的对象，想到自己一直持续画下去的动力就是希望自己的漫画能给人带来笑声，赵石再次找到了初心，有了继续前进的动力。',1,0,0,0,'',0,0.0,0,'河秉勋','10集全',1495011008,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1096','X',0,0,NULL),(28296,49,'北上广依然相信爱情',',朱亚文,陈妍希,张铎,曾泳醍,王新,','内地',NULL,2017,467,'王茂与黄依然在洛芙婚庆公司是上下级关系，两人从相识的那一刻起就充满矛盾，由于两人的文化差异，使彼此都不能理解。在随后的工作中，黄依然渐渐表现出来的刻苦精神和特有的才能被王茂欣赏，而在随后的工作中，黄依然也体会到他温情的一面。就在两人刚刚能够和平共处的时候，王茂却意外陷入一场事业危机，能够解救他的出路只有一条，拿到航空联盟的大型集体婚礼的合同。黄依然首当其冲协助王茂，两人克服重重困难，最终成功化解危机。在王茂与黄依然这一次跌宕起伏的闯关过程中，不知不觉擦出了爱情的火花，但是此时双方发现对方的内心深处对爱情有一堵心墙。王茂和黄依然想尽种种办法融化对方心中的冰山，尤其在共同经历了一场命悬一线的车祸之后，两人终于决定携手相伴此生。而此时的他们，对爱情的真谛和婚礼事业的神圣也有了更深层的理解。',1,0,0,0,'',0,0.0,0,'李骏','44集完',1495017695,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1097','B',0,0,NULL),(28297,49,'放弃我，抓紧我',',陈国华,陈乔恩,王凯,乔任梁,陈燃,张轩睿,','内地',NULL,2016,468,'一次意外溺水，长时间脑部缺氧让著名服装设计师厉薇薇失去了部分记忆，她的记忆停留在23岁。记忆中热恋的同为设计师的男友竟成了竞争对手，而好朋友霍骁却成了她的未婚夫。薇薇不相信自己会和前男友陈亦度分手，她努力调查前因。未婚夫霍骁为了保护薇薇，追回自己的未婚妻，千方百计阻挠薇薇调查，守在她周围。厉薇薇回溯过去，发现自己和身边的人在忙碌中逐渐忘记了最初的梦想。薇薇和陈亦度分手的原因，也是因为两人在追逐事业的过程中，忽视了爱与沟通，在斗气和误会的道路上越走越远，陈亦度误会薇薇和霍骁的关系，最终和她分手。30岁的厉薇薇决定改变现状，她逐步解开过去的误会，不但找回了爱情，也重拾了初心和梦想。',1,0,0,0,'',0,0.0,0,'邓衍成','38集全',1495011013,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1098','F',0,0,NULL),(28298,49,'真心想让你幸福',',吕国镔,范明,朱锐,闫学晶,王丽云,马德钟,','内地',NULL,2016,469,'单身父亲宋大年是一名出租车司机，为了给儿子更好的生活条件，他在下班之余也会接一些私活。在一次做酒后代驾的时候发生了意外，宋大年撞死了人。他对受害者家属十分愧疚，除了经济赔偿之外也一直努力地对受害者家属进行补偿。他在生活中对受害者家属翠翠关怀备至，甚至在翠翠早产后需大量输血时挽救了翠翠母子的性命。赔偿后宋大年的日子过得十分艰难，失去工作，到处打工。在最艰辛的日子里，前妻一家以及朋友都对宋大年伸出了援助之手，也正因如此，无论多辛苦他也没放弃过对生活的希望。翠翠也渐渐地被宋大年的真诚所感动，原谅了宋大年。最后，死者被发现原是自杀，洗清冤屈的宋大年和翠翠确立了感情。每一个人都对生活抱有了真心与善良的态度，人们渴望幸福，守护幸福，最终大家都获得了幸福。',1,0,0,0,'',0,0.0,0,'王滨','38集完',1495017756,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1099','Z',0,0,NULL),(28299,49,'我的岳父会武术',',宋丹丹,倪大红,肖央,王太利,姜妍,','内地',NULL,2016,470,'派出所马所长退休后，儿女的婚姻大事问题一直令她忧心。马所长的儿子丁满意第一次闪婚后，其妻突然不告而别，剩下他独自抚养儿子丁当。五年后，丁满意遇到通情达理的白燕，然而前妻的父亲程大吉刑满释放后找上了门，号称要为出走的女儿和留守的孙子捍卫好这个家庭，给丁满意和白燕的再婚制造了诸多障碍。与此同时，马所长的女儿丁如意也被程大吉的侄子程功迷得神魂颠倒，让马所长苦恼不已。就在马所长一家被程大吉折腾得闹翻天的时候，却意外传来了程璐已经身亡的消息。程大吉受到巨大刺激住了院，得到了马所长和白燕两家的悉心照顾。痊愈后，程大吉亲自为丁满意和白燕举行了婚礼，而丁如意和程功也走上了感情正轨。此时，程璐却意外地回来了，她解释当年是受父亲逼婚，放弃了自己的爱情嫁给了满意，而她这次回来也是为了接走丁当并找回自己的幸福。丁家原谅了她，并体会到了爱与宽容的价值。',1,0,0,0,'',0,0.0,0,'苏浩旗','40集完',1495017745,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1100','W',0,0,NULL),(28300,49,'老公们的私房钱',',范明,左小青,涂松岩,高露,潘虹,','内地',NULL,2016,471,'住北京的郑妈妈有三个闺女三个女婿，由于郑妈妈教女有方，一大家子日子过得其乐融融无比蜜甜。可突如其来的一段录音却让郑妈妈怀疑已去世的老伴曾经藏有私房钱。为防止女儿们的家庭不稳，郑妈妈郑重其事地嘱咐三个女儿要想把自己的老公看住，必须从私房钱查起。于是，三姐妹经过缜密筹划采用引蛇出洞、突然袭击、声东击西等招数，对自己的老公发起了私房钱大战。一番闹剧过后住北京的郑妈妈有三个闺女三个女婿，由于郑妈妈教女有方，一大家子日子过得其乐融融无比蜜甜。可突如其来的一段录音却让郑妈妈怀疑已去世的老伴曾经藏有私房钱。为防止女儿们的家庭不稳，郑妈妈郑重其事地嘱咐三个女儿要想把自己的老公看住，必须从私房钱查起。于是，三姐妹经过缜密筹划采用引蛇出洞、突然袭击、声东击西等招数，对自己的老公发起了私房钱大战。一番闹剧过后三个原本幸福的家庭陷入情感信任危机，直接导致大闺女家冷战、二闺女家离婚、三闺女家分居。这一切让引发“战争”的郑妈妈后悔莫及，她又做起了“消防员”，穿梭于三个家庭中百般劝解，一场场战争才趋于平静。经历诸多事件，大家领悟到生活的真谛是相互信任，夫妻间信任才能使家庭和睦。',1,0,0,0,'',0,0.0,0,'白杨','47集完',1495017733,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1101','L',0,0,NULL),(28301,49,'淬火成钢',',王晖,郭广平,张铎,战菁一,','内地',NULL,2016,472,'该剧从1936年4月周恩来与张学良密谈合作开始讲起，直至西安事变结束，全面展现了在这一历史时期，中国共产党为了能够号召全国人民抗击日本侵略者，在国际和国内的各种政治势力中作出努力。全剧通过展现一方面军的铁家父子、四方面军王家兄妺和二方面军程家姐弟在会宁大会师前后的坎坷和历练，反映了当时红军到达陕甘地区所面临的严峻形势以及为完成三军会师所付出的巨大的努力。同时该剧还展现了毛泽东、朱德、周恩来、张国焘、徐向前、任弼时、张学良、蒋介石、胡宗南等一批风云人物，展示着各自的政治本色和军事较量。最终，在党中央、毛泽东等的领导下，广大红军战士不仅克服千难万阻完成了三军大会师，实现了红军的统一。',1,0,0,0,'',0,0.0,0,'张玉中','34集全',1495012579,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1102','C',0,0,NULL),(28302,49,'美人私房菜之玉蝶传奇',',郑爽,马天宇,蒋毅,吴其江,王纯,','内地',NULL,2016,473,'北宋年间，来杭州督运粮草的皇子赵元卿，偶以蹴鞠认识了天香楼的美厨娘宋玉蝶，并对其倾心不已，此时玉蝶正打算跟学武归来的义兄李马成亲。而完颜部派将军完颜泽利跟踪赵元卿，伺机杀之，追杀过程中完颜泽利放火烧了天香楼。与此同时，李马因打伤差点玷污林姬儿的督粮官，被打入大牢。玉蝶营救李马不成，却看见化为灰烬的天香楼，便直奔京城要找赵元卿说个明白。赵元卿得知玉蝶的遭遇万分愧疚，承诺将李马救出。不久，秦贵妃意外发现玉蝶竟是自己十八年前失踪的女儿。此时，完颜泽利趁机向朝廷提出要与玉蝶“婚配”，李马为救身在完颜大营的玉蝶，自毁容貌，混入完颜大营，里应外合，最终将完颜泽利等人全部消灭。战事平息，李马要回杭州重开天香楼，殊不知，赵元卿早已开建天香楼。新店开张之际，玉蝶等人突然出现，自此，美厨娘宋玉蝶与李马修得百年好合。',1,0,0,0,'',0,0.0,0,'梁辛全','50集全',1495011027,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1103','M',0,0,NULL),(28303,49,'追婚记',',霍思燕,王阳明,谭凯,周楚楚,陶慧,','内地',NULL,2016,474,'身为三姐妹之长的白芍，在受老爸白守城管束三十年之后，终于迎来了把老爸“嫁“出去的好日子，然而白父却因对三个女儿不放心，不愿意与老伴儿张姨出国定居。为让老爸放心出国，以便自己获得自由，白芍与不打不相识的混血大男孩陆六安开始了假扮情侣的戏码。而一向让老爸最放心的二女儿白芨却遭遇婚姻危机，丈夫麦冬抛下自己与女儿不知所踪，正是苦难之际，却再度遇见土豪追求者周岗松。虽为养女却十分受宠的幺女白苏为了舞蹈事业，瞒着老爸整容归来，与整容医生任海龙上演了一出萝莉与大叔的欢喜情缘。',1,0,0,0,'',0,0.0,0,'刘恺','41集完',1495017738,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1104','Z',0,0,NULL),(28304,49,'大唐荣耀',',尹涛,景甜,任嘉伦,万茜,舒畅,','内地',NULL,2017,475,'沈珍珠出身名门，被选为广平王李豫之妃，生下长子唐德宗李适，后被李适追封为睿真皇后。她只是一介江南女子，内心善良，心存社稷，与人为善，在安史之乱之时只愿留在长安与百姓共同进退，被长安百姓所尊重。离散之中虽有大将默延啜对其追求，但仍坚守对李豫的爱。唐朝收复长安后，流散之人不得入宫，但李豫一心要接珍珠回来，珍珠以李豫太子前程为重，重回民间，后李豫多处寻找，珍珠始终不愿入宫，只愿成全李豫。她凭着达礼知书的才识，和德才兼备的优良品质，赢得李豫一生对她无法忘怀，而她又不事奢华，以一个和字协理后宫，知民间百姓疾苦。一代才女沈珍珠为唐朝中期的发展做出了一定的历史贡献。',1,0,0,0,'',0,0.0,0,'刘国楠','全60集',1495009892,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1105','D',0,0,NULL),(28305,49,'深宅1927',',李宗翰,刘雪华,杜源,,颜丹晨,','内地',NULL,2016,476,'唐家观茶商世家谌家以梅山茶举世闻名，二少爷谌器之打败兄长谌励之成为梅山茶传人，以守住梅山茶秘方和谌家祖宅为使命，却引得同父异母妹妹谌春华不满。谌春华为争夺家产和替母兄报仇，不惜牺牲色相与军官勾结，逼得谌器之设下空城计遁走新疆。谌春华不肯善罢甘休，谌器之被诬陷入狱，幸得发妻辜红倾家荡产搭救，才被替死救出。后化名伍家潜回唐家观。梅山茶重现，再度引起各方势力的明争暗斗。谌器之为死守秘方，不惜雪藏私定终身的表妹、赶走大儿子、逼死四姨太、不顾全家的死活。辜红苦撑家业，但不敌四方暗算，只得自杀保全秘方。昌盛一时的谌家最终繁华落尽。谌器之临死前大彻大悟，把辛苦保全的秘方交给大儿子，要他继续造福世人。',1,0,0,0,'',0,0.0,0,'海顿','41集完',1495017759,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1106','S',0,0,NULL),(28306,49,'街头霸王：复苏',',Mike,Moh,Natascha,Hopkins,克里斯蒂安·霍华德,阿兰·莫西,','英国',NULL,2016,477,'《街头霸王：复苏》，继先前描写两大主角“隆（Ryu）”与“肯（Ken）”的《街头霸王：暗杀拳》之后，由Machinima与CAPCOM再度合作推出的《街头霸王》系列改编真人迷你影集。这次的剧情设定为《街头霸王5》的前传，重点摆在失踪多年又再度复归的原美国海军陆战队上尉“查理．纳什（Charlie Nash）”，剧中纳许采用了与《街头霸王5》相同的半机械化造型。',1,0,0,0,'',0,0.0,0,'乔伊·安沙','4集全',1495011037,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1107','J',0,0,NULL),(28307,49,'隔离死城 第一季',',Charles,Beeson,艾略特·莱斯特,Neil,Mcenery-West,克里斯·伍德,克劳迪娅·布莱克,汉娜·曼根·劳伦斯,大卫·吉雅西,','美国',NULL,2016,478,'《隔离死城》是由比利时剧改篇，讲述亚特兰大的一座大城市中，爆发一种致命的传染病，于是政府立即隔离了城市，而里面的人只能靠自己存活下去。在事件发生后，原本的爱人因此反目成仇，为了生活他们什么都干得出来。庆幸的是，还是有一群不靠谱的英雄出现了。反应了隔离区里的社会百态，人性的变化和伪英雄的出现。',1,0,0,0,'',0,0.0,0,'大卫·努特尔','13集全',1495011039,1508319788,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1108','G',0,0,NULL),(28308,49,'大雪无痕',',何政军,赵恒煊,曹颖,杜源,曹力,雷献禾,康宁,','内地',NULL,2000,479,NULL,1,0,0,0,'',0,0.0,0,'任程伟','20 集全',1495041416,1508319791,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1458','D',0,0,NULL),(28309,49,'新还珠格格',',海陆,张睿,李佳航,邱心志,邓萃雯,刘雪华,赵丽颖,高梓淇,孙耀琦,潘杰明,李平,','内地',NULL,2000,480,NULL,1,0,0,0,'',0,0.0,0,'李晟','98 集全',1495041419,1508319791,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1459','X',0,0,NULL),(28310,49,'少年四大名捕',',何晟铭,陈伟霆,张钧甯,贾青,黄俊文,','内地',NULL,2000,481,NULL,1,0,0,0,'',0,0.0,0,'张翰','48 集全',1497288452,1508319791,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16274','S',0,0,NULL),(28311,49,'前夫求爱记 DVD版',',高