故土和母亲依依不舍，但是美丽的大丽还是追随着丈夫踏上了南去的列车，从此开始了她坎坷的人生。1978年，上海女孩顾敏华毕业后分配到820厂，因美丽脱俗，又长得像电影《小花》里的陈冲，故而被众人叫做“小花”。她的到来引来男孩们的竞相追求，却也因美貌招来不少的麻烦，她的爱情与婚姻充满着磨难。',1,0,0,0,'',0,0.0,0,'李大为','30集全',1499875389,1508319794,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18733','D',0,0,NULL),(28483,49,'精武飞鸿',',何润东,郭品超,郝蕾,陈西贝,王绘春,','内地',NULL,2007,654,'翟枫和闫应元因精武门与宝芝林的恩怨相识并结为兄弟，两人本欲联手共振国威，却因柯亦难的介入而被指为各自门派的罪人，翟枫更因被怀疑与霍元甲之死有关而受到武林同道的追杀。为了查明真相及霍元甲临终所嘱国宝之秘，两人历经磨难与日方势力及黑帮分子展开了斗智斗勇的决逐，并最终于围城之地绝杀邪恶势力，保得国宝安全。',1,0,0,0,'',0,0.0,0,'李惠民','40集全',1499875391,1508319794,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18734','J',0,0,NULL),(28484,49,'亲爱的回家 DVD版',',于娜,蒋毅,胡兵,罗灿然,','内地',NULL,2000,655,NULL,1,0,0,0,'',0,0.0,0,'韩雪','36 集全',1497284446,1508319795,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16224','Q',0,0,NULL),(28485,49,'东方红1949',NULL,'中国大陆',NULL,2000,656,'一部主旋律与反特谍战完美结合的红色惊险长篇力作！一曲反映出中华人民共和国建立和中国共产党胜利必然性的民族正气歌！该剧由国家一级作家赵锐勇、王彪著名导演苏舟及唐国强、杜雨露主演，以刺杀毛泽东始末为主线，精心打造一部中国的《列宁在》',1,0,0,0,'',0,0.0,0,'苏舟','40集全',1495041561,1508319795,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1758','D',0,0,NULL),(28486,49,'外科风云靳东CUT',NULL,'中国大陆',NULL,2000,657,'这是一个海归老干部叨叨庄合辑！外可护，内可哄，温情绅士，高冷内敛，逗比耍宝，你想看的靳东这里都有',1,0,0,0,'',0,0.0,0,'李雪','34集全',1495041582,1508319795,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1762','W',0,0,NULL),(28487,49,'极速当医生',NULL,'中国大陆',NULL,2000,658,'用爆笑另类的方式解读电视剧《外科风云》',1,0,0,0,'',0,0.0,0,'李雪','9集全',1495041588,1508319795,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1764','J',0,0,NULL),(28488,49,'最后的警察','唐泽寿明,洼田正孝,佐佐木希,黑川智花,,','日本',NULL,2017,659,'故事始自1985，横滨中央署刑事课刑警京极浩介（唐泽寿明 饰）在执行任务时遭遇爆炸而陷入昏迷，这一睡便是三十年时间。2015年的一天，沉睡良久的浩介意外醒来，睁开眼后发现这个世界已经发生了翻天覆地的巨变。时代的进步让他恍如乘坐时光机而来的古代人，曾经相濡以沫的妻子加奈子（和久井映见 饰）也不知何时另外组建了新的家庭。在引出一番混乱后，他被年轻有为的青年刑警望月亮太（洼田正孝 饰）逮捕。在此之后，浩介得遇当年的后辈和上司，并借助他们的帮助重归警察队伍。有趣的是，他被分配成为亮太的搭档。 一个是凭借热血鲁莽前冲的粗暴大叔，一个是崇尚智力和科技的新世纪青年，他们将上演怎样的故事呢？',1,0,0,0,'',0,0.0,0,'猪股隆一','更新至7集',1498763918,1508319795,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/14745','Z',0,0,NULL),(28489,49,'风云2',NULL,'中国大陆',NULL,2000,660,'聂风练魔刀解救武林危机后，魔性难除，步惊云，第二梦恐风误伤无辜，将风留在一孤岛中修练，解除魔性，怎料风魔性突发，伤了梦，闯到铁剑门闹事，云为阻止风开杀戒，与之激战，双双堕入急流，生死未卜',1,0,0,0,'',0,0.0,0,'李惠民','42集全',1495012331,1508319795,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1765','F',0,0,NULL),(28490,49,'我的胡搅年代',NULL,'中国大陆',NULL,2000,661,'穿越过去已经不稀奇，本剧将时空背景设定于明天之后的未来，天马行空发明家的胡搅，在网红的姊姊胡爱推波助澜下，将拜会华人世界首屈一指的营销专家沈薇，力邀她营销永不落地之科技垃圾桶。出于一片孝心的胡搅坚持自己的发明梦想，一路跌跌撞撞，充满各种趣味冲突、乌龙创意。',1,0,0,0,'',0,0.0,0,'左孝虎','40集全',1495012342,1508319795,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1766','W',0,0,NULL),(28491,49,'漂洋过海来看你 未删减版',NULL,'中国大陆',NULL,2000,662,'英国旅游集团高管苏芒在婆婆央求下，瞒着不能生育的丈夫陈嘉明借精生子。不料被丈夫发现并遭劈腿，两人离异。自尊心极强的苏芒对爱情和婚姻陷入绝望，决定离开伤心地返回中国，却被医生告知怀孕成功。她决定独自把孩子生下来，带着肚子里的小生命回到了上海任总部旅游事业部总监。　　此时上海总部旅游体验师郑楚向女友陈姗姗求婚，却被其以恨铁不成钢为由拒绝，陷入事业和感情困局。空降上司苏芒因为各种传闻在新环境中陷入孤立无援的境地，但热心的郑楚走进了她的生活。两人从欢喜冤家到相濡以沫，女魔头和刺头下属从冰与火的对抗到相爱。办公室恋情和来历不明的孩子考验着一对重燃爱情希望的恋人。',1,0,0,0,'',0,0.0,0,NULL,'44集全',1495012358,1508319795,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1767','P',0,0,NULL),(28492,49,'极速磨剃刀',NULL,'中国大陆',NULL,2000,663,'用爆笑另类的方式解读电视剧《剃刀边缘》',1,0,0,0,'',0,0.0,0,NULL,'14集全',1495012360,1508319795,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1768','J',0,0,NULL),(28493,49,'一起长大（会员）',NULL,'中国大陆',NULL,2000,664,'万辉投资公司总裁万天野与妻子丁曼在结婚纪念日突然离婚，丁曼远走美国。送走丁曼后万天野搭载了一对父子却遭遇车祸，万天野成了孤儿毛毛的监护人，并结识了护士孟小夏。万天野此时又遭人设计公司破产，万天野变得一无所有。孟小夏在万天野举目无亲时伸手相助，与万天野、毛毛组成了快乐的三口之家。破产后的万天野开上了出租车，抚养毛毛。孟小夏在与万天野相处的过程中渐生好感。丁曼回国得知万天野的变故后为其租房居住，孟小夏因拆迁也住进了丁曼的房子，四人同住矛盾不断，万天野左右为难。万天野的好兄弟段少辉暗恋丁曼多年，孟小夏男闺蜜李嘉豪也对孟小夏情有独钟。万天野因为毛毛得到了再次成长的机会，他宽容地面对命运的安排，逐渐成为一个有担当的男人。最终每个人都在复杂的情感关系中找到情感的归属，孟小夏接受了李嘉豪，段少辉找到自己的幸福，毛毛也回到了母亲身边。丁曼重新认识了万天野，二人重归于好。',1,0,0,0,'',0,0.0,0,'邵兵','32集全',1495012365,1508319795,1,'h