5','J',0,0,NULL),(28500,49,'放弃我抓紧我未删减版',NULL,'中国大陆',NULL,2000,671,'《放弃我抓紧我》根据桐华同名网络小说改编，讲述了设计师厉薇薇（陈乔恩饰）因为一次意外失去了部分记忆的故事。张铎饰演的莫凡和陈亦度（王凯饰）从小一块长大，他们一起洗澡，一起练习拳击，感情十分深厚，因为这种深厚的情感，让之后莫凡的复仇充满碰撞和矛盾，但也正因如此，让之后的发展更具看点。',1,0,0,0,'',0,0.0,0,'邓衍成','39集完',1495017716,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1776','F',0,0,NULL),(28501,49,'疯狂刺客之龙之子',NULL,'中国大陆',NULL,2000,672,'《疯狂刺客》是由蜜瓜传媒独家出品，由王小帅担任监制，加飞担任总制片人，刘明哲、董小白、延滨、梁志乐、刘云、杨浩宇、赵亮等主演的古装穿越虚实结合的魔性武侠喜剧。该剧主要讲述了位处于人生低谷的四男一女主人公，为了赢取一千万奖金而参加了全球首款灵魂体验游戏《疯狂刺客》，从而开展了一段穿越时空的亡命之旅。',1,0,0,0,'',0,0.0,0,'吴昊','23集全',1495012446,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1778','F',0,0,NULL),(28502,49,'消失的凶手',NULL,'中国大陆',NULL,2000,673,'神探松东路此次来到一个名叫香城的地方去探寻一宗连环自杀案的真相的故事。银行相继倒闭，大批失业游民流落街头。一连串离奇自杀案件仿佛指引着松东路去探究隐藏在其背后更大的黑幕。十年前被掩埋的屠村案件被揭开、疑犯通过文字游戏传递着口令，接踵而至的案件掀起了巨大的恐慌，城中风云攒动，人人自危，富商、警察、教授、学生。每个人的言行举止都充满疑点，而每个人都在猜测下一个离奇自杀的会不会是自己。究竟是谁密谋了这一切，让这个原本美好的地方变成了绝望之城，寻找真相迫在眉睫',1,0,0,0,'',0,0.0,0,'罗志良','8集全',1495012448,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1779','X',0,0,NULL),(28503,49,'暴走神探',NULL,'中国大陆',NULL,2000,674,'上海滩，十里洋场，租界林立，妖孽辈出，钱多人傻，浮华与罪恶并存，故名冒险家乐园，又名魔都。作为租界最聪明的一名包打探，范如一（阮经天饰）每天都要跟三教九流打交道，从中获取各式各样的查案信息，也因此深得老板信任。可直到有一天，在接手老板交代的一项绝密任务之后，各种意想不到的离奇事件接踵而至：军阀之女宋小乔（杨子姗饰）遭到绑架，少年小六惨死街头，贵族学校女学生、巡捕房同事等均被卷入其中且无一幸免，范如一试图阻止无辜者被杀，结果却连他自己也始料未及，所有凶案的头号凶嫌，竟然是他自己！为了洗刷罪名，范如一使尽浑身解数，既要躲避来自黑道、捕房和神秘杀手的多方追捕，更要保护报童小猴和风尘盲女慧兰（周冬雨饰），舍得一身剐，终于慢慢接近真相，可真相却比他想象的残酷得多',1,0,0,0,'',0,0.0,0,'罗卓瑶','6集全',1495012450,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1780','B',0,0,NULL),(28504,49,'大秦帝国之崛起 央视版',NULL,'中国大陆',NULL,2000,675,'秦昭王当政不久，列国展开一系列兼并战争。秦国看准时机，先与齐连横，攻略魏国大片土地。由此，战国到了秦齐赵三国并强阶段。此时秦国国内，穰侯擅权，宣太后掌政，秦昭王王权旁落。此时，局势对秦国十分有利：纵横家苏秦与燕王秘约赴齐间齐，以灭齐为目标死间齐国。面对国内政治困局和国外有利机遇，秦昭王毅然起用范睢，逐魏冉、废太后之权而恭养之。同时，与苏秦合谋，举兵攻破齐国。秦昭王遣将白起，相继在伊阙、郢都、华阳、长平发动四大战役，歼灭了韩魏齐楚赵百万以上兵力，使秦与列国消长发生了根本转折。自此，秦国崛起。',1,0,0,0,'',0,0.0,0,'丁黑','34集全',1495012452,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1781','D',0,0,NULL),(28505,49,'孤雁',NULL,'中国大陆',NULL,2000,676,'年春，保密局南京站二处侦防科科长李梅在一次行动中脑部受重创造成部分失忆，忘记了自己共产党员的身份。中共情报员佯装叛变设计让李梅的记忆复苏。和党组织恢复联系后的李梅配合组织完成任务，同时找准时机吸纳中央陆军大学战术教官高峰。保密局南京站站长胡一夫一直暗中监控李梅，李梅几次险象环生。期间她与高峰出生入死，擦出了爱情火花，结为连理。最终李梅协助高峰率部宣布起义，解放军百万雄师渡江，南京解放。',1,0,0,0,'',0,0.0,0,'李辉','45集全',1501344923,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1782','G',0,0,NULL),(28506,49,'孤芳剧透社',NULL,'中国大陆',NULL,2000,677,'小编整理了独家记录的《孤芳不自赏》主创片场花絮，正片播出期间每天一集同步更新。同屏展示正片花絮内容，让追剧粉丝快速了解钟汉良、、甘婷婷、孙艺洲镜头后的艰辛与逗比一面。',1,0,0,0,'',0,0.0,0,NULL,'40集全',1495012461,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1783','G',0,0,NULL),(28507,49,'青年霍元甲之冲出江湖未删减版',NULL,'中国大陆',NULL,2000,678,'霍父是镖局元老，后退隐江湖，不希望子承旧业。可过去的仇人非要置霍家于死地。大难来临之时，霍元甲无力拯救家人，受尽屈辱。突击学艺，救全家和乡亲们于水火之中。成为全村英雄。他被恶势力盯上。诱其上钩，欲用其利。霍元甲灭恶人，被迫离乡逃往天津港。霍元甲为生存和天津港黑帮殊死搏斗。占领天津码头，欲共处平和，却无法生存，只好到天津卫开镖局。但镖局市场已被瓜分，三家各有背景。老镖局设尽法子将霍元甲挤出天津卫，并将其投进监狱置于死地。霍元甲被迫出手，统一镖局，威震四方。怎料，漕帮和青帮都看上了他。连王爷都为了个人目的拉霍元甲下水。霍元甲本想济世百姓，却沦落成草寇。在打败了日本浪人和盗国宝勾结洋人的清王爷之后，决定退出江湖。但黑暗的时代不会让他安生',1,0,0,0,'',0,0.0,0,'都晓','51集全',1495012463,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1784','Q',0,0,NULL),(28508,49,'三生三世十里桃花杨幂cut',NULL,'中国大陆',NULL,2000,679,'九尾白狐青丘帝姬，战神墨渊之徒，位居上神却洒脱逗趣，嗜喝酒常迷路，不善送礼，历情劫为凡人，遇此生挚爱经三生爱恨别离。',1,0,0,0,'',0,0.0,0,'林玉芬','58集全',1495012470,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1785','S',0,0,NULL),(28509,49,'学院传说之三生三世桃花缘',NULL,'中国大陆',NULL,2000,680,'讲述了草根少女汪兰和高冷校草苗李在相互吸引的过程中，无意间触发了别样三生三世的玄幻奇缘，看似平静的校园聚集了仙、龙、狐等多个种族，奇幻新鲜的爱情、友情大冒险就此展开。',1,0,0,0,'',0,0.0,0,'邱晧洲','40集全',1495012486,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1786','X',0,0,NULL),(28510,49,'结婚前规则',NULL,'中国大陆',NULL,2000,681,'《结婚前规则》由著名编剧马广源编剧，对当代都市青年的感情进行了全新的剖析和探索。在曝光的超长片花中，沙溢饰演的欧少杰被相恋多年的女友（殷桃饰）狠心抛弃，马苏饰演的江楚儿与被富婆包养的男友在领证当天分手，机缘巧合之下，二人相识后，因为一场乌龙怀孕事件，迅速开启了一段无感闪姻。该剧以现实生活中常见的社会热词为主线，闪婚、试婚、隐婚，出轨，伴随着这些敏感话题将其中鲜明的人物性格、丰富的情节设置、错综复杂的人物关系、理想与现实的矛盾冲突以及深度的情感反思与表达一一带出，信息量十足。',1,0,0,0,'',0,0.0,0,'杨影','35集全',1495012497,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1787','J',0,0,NULL),(28511,49,'真实的人类（瑞典版）第二季',NULL,'欧美其他',NULL,2000,682,'智能人的广泛应用虽然很大程度上帮助了人类，但他们与人类之间的矛盾也越来越激烈。与此同时，智能人的发明者所发明的具备自主感情的智能人出现在人们的视野。它们的内存被扩充，用来留给它们自己更多的自由愿望以及独立性。它们体内的一些代码可以开始整合和平衡不同的情感。也可以同时处理多种情感因素。但是，当智能人有了独立思想，当人类变得贪婪不止，智能人与人类原有的相处模式被渐渐打乱。一些人开始依赖智能人，孤独老人把智能人当自己的孩子，孩子把智能人当自己的家人甚至父母姐妹。一些人类开始抵触智能人的存在甚至捕杀他们，而智能人虽然进化很多，却依旧保持天真，时常不明白人类行为的复杂与暴力。一场对抗就此展开。',1,0,0,0,'',0,0.0,0,NULL,'10集全',1495012502,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1790','Z',0,0,NULL),(28512,49,'真实的人类（瑞典版）第一季',NULL,'欧美其他',NULL,2000,683,'故事发生在智能人的使用无所不在的社会，做饭、开车、甚至辅导孩子学习、陪伴聊天。这些无所不能的机器人成为了人们生活中不可缺少的伴侣。这些智能人被量产的原始目的是为了辅佐人类，然而他们却慢慢开始在很多领域甚至是特殊领域替代人类工作者。它们虽然长得和人类相似，但他们拥有异于常人的明亮蓝色或者绿色瞳孔。这些智能人原本一直遵循着一个叫做的程序，这程序规定了一系列防止其伤害人类的规则。随着他们被用于越来越多的领域，某些违反法律的使用方式开始频频出现，一群地方警察开始注意到智能人带来的危害并且打击智能人相关违法犯罪活动。',1,0,0,0,'',0,0.0,0,NULL,'10集全',1495012504,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1791','Z',0,0,NULL),(28513,49,'孤芳不自赏',NULL,'中国大陆',NULL,2000,684,'【大屏端超级影视会员独享观看；移动端乐次元影视会员专享下载】四国征战不休，晋国国力最强，晋国国王亲弟镇北王楚北捷（钟汉良饰）英勇善战、武功谋略过人，令其他三国闻风丧胆。晋燕交战之际，燕国敬安王府遭到围陷，一夜之间王府覆灭。婢女白娉婷（杨颖饰）与小王爷何侠（孙艺洲饰）在逃亡时离散。楚北捷被白聘婷的琴声所倾倒，钟情相恋。但因为不同的阵营处境注定了两人此生情路坎坷，爱情虽浓却障碍重重，既有晋国国王的疑心，又有小敬安王何侠的各种挑拨，还要面对四国纷争不断的乱世天下。在种种困难前，楚北捷不改初心，情场上付深情，默默守护；战场上出奇兵，与白娉婷联手击败何侠，成功阻止了一场生灵涂炭的战争，守护了天下安宁。',1,0,0,0,'',0,0.0,0,'鞠觉亮','62集全',1495012507,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1792','G',0,0,NULL),(28514,49,'孤芳不自赏钟汉良cut版',NULL,'中国大陆',NULL,2000,685,'楚王爷钟汉良走路带风，气场两米八。《孤芳不自赏》精简版之钟汉良，你想看的钟小哇这里都有。满足迷妹舔屏的欲望。拿去不用谢！',1,0,0,0,'',0,0.0,0,NULL,'60集全',1495012509,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@li