行动组，暗中打击鸦片工厂、销售点及运输渠道，诛杀卖国投敌的大毒枭；他俩故意示弱来麻痹袁也和石原，为此他们忍受着敌人无数次的凌辱，最终配合新四军主力摧毁敌人的鸦片运输专列。',1,0,0,0,'',0,0.0,0,'毛卫宁','42集全',1495012588,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1810','N',0,0,NULL),(28531,49,'爱情面前谁怕谁',NULL,'中国大陆',NULL,2000,702,'通过讲述余小渔、罗美琪、安叶、佟童四个不同年龄女孩的经历，展开一幅幅都市女性百态图。故事以生活为基础，辐射职场，折射家庭。当四位女主角经历了不同的情感挣扎、婚里婚外后，终于感悟，任何附着在爱情上的额外条件都是一道道枷锁，女人想要成为生活的强者只有自强不息，有尊严才能活得更精彩。',1,0,0,0,'',0,0.0,0,'卢伦常','36集全',1495012595,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1811','A',0,0,NULL),(28532,49,'爱情悠悠药草香',NULL,'中国大陆',NULL,2000,703,'由蒋家骏导演，娄艺潇、宣萱、韩栋、钱泳辰、倪虹洁领衔主演。该剧以民国时期医药世家白家为背景，讲述封建制度下，大家族恩怨情愁，爱恨纠葛的悲喜故事。',1,0,0,0,'',0,0.0,0,'蒋家骏','48集全',1495012597,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1812','A',0,0,NULL),(28533,49,'X女特工',NULL,'中国大陆',NULL,2000,704,'《女特工》讲述了身手矫健、怀揣正义梦想的率真少女钟离与谭睿玲、罗逸菲同被选为特工训练营一员，共同经历了残酷的国际化特工训练，与其他学员在特训战场上斗计斗智斗勇，结下深厚的姐妹情谊，成长为冷静顽强、干练美艳的精英女特工。',1,0,0,0,'',0,0.0,0,'于敏','42集全',1495012599,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1813','X',0,0,NULL),(28534,49,'笑傲江湖',NULL,'中国大陆',NULL,2000,705,'华山派大弟子令狐冲生性豁达不羁，初入华山武功平凡，后遇高人授以独孤九剑，更意外取得五岳各派剑法精髓，因而引致师父岳不群的猜疑，借口逐出师门。其实岳不群表面正直，内里奸诈，为独得旷世秘笈葵花宝典，竟设计谋令武林各派相互暗算，唯最终作法自毙。',1,0,0,0,'',0,0.0,0,'胡意涓','国民初恋朵',1497019703,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1814','X',0,0,NULL),(28535,49,'心理罪2-独家策划',NULL,'中国大陆',NULL,2000,706,'心理罪独家视频包含：对比神探之方木柯南、美剧、最毛骨悚然十大镜头、盘点诡异恐怖的被害方式方木的断案方式，另外还有精彩彩蛋！',1,0,0,0,'',0,0.0,0,'程浩','6集全',1495012604,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1815','X',0,0,NULL),(28536,49,'谎言背后',NULL,'中国大陆',NULL,2000,707,'《谎言背后》作为温柔系列剧第五部，前四部依次是《温柔的背后》《温柔的背叛》《温柔的谎言》《真爱背后》，该剧仍以当下最热门的爱情、婚姻谎言为主题，以单元剧的形式展示都市男女在爱情婚姻中所饱受的欺骗之痛、背叛之苦，通过这些婚姻与爱情的悲情故事为观众带来更多经营爱情、婚姻的经验和教训。',1,0,0,0,'',0,0.0,0,'张族权','39集全',1506096622,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1816','H',0,0,NULL),(28537,49,'我的爱对你说',NULL,'中国大陆',NULL,2000,708,'丁福乐出身普通工人家庭，他有理想有抱负，不甘心过父母安排的人生道路，要自主励志创业。父亲丁宗池逼迫丁福乐与他不爱的培芸结婚。在婚礼上，九九冲进现场解救了丁福乐。然而，九九的父亲尚达仁与樊伟母亲谷一萍逼迫九九与樊伟订婚。订婚仪式上，丁福乐拥抱了九九并说出自己的爱，为此，尚达仁开除了丁福乐。丁福乐经历无情打击，九九以超常之爱帮助他走出人生困境，并走向成功。尚达仁和谷一萍转变了对丁福乐的看法。福乐和九九两人在创业中找到真爱终成眷属，樊伟重新认识自我，找到了属于自己的真爱',1,0,0,0,'',0,0.0,0,'田少波','42集全',1495012627,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1817','W',0,0,NULL),(28538,49,'旋风十一人',NULL,'中国大陆',NULL,2000,709,'市中学生联赛，连输两场出线无望的中足球队迎来了新教练穆奇（胡歌饰）。穆奇强硬的执教风格引来所有队员的抵触，也为这里带来了新的生机。连刚接手足球班的实习老师裴朵（江疏影饰）也跟穆奇冲突不断。但穆奇用他特有的方法因材施教，带领这支本不被看好的球队一路由市联赛杀进了省联赛。在裴朵的帮助下，穆奇与队员们建立了深厚的情谊，曾经人人头疼的问题学生们不仅信心倍增训练积极，学习成绩也突飞猛进，穆奇和裴朵的关系也不断升温。就在一切步入正轨之际，大大小小的麻烦也接踵而来，穆奇的过去被挖了出来，队员们也面临着人生的第一次选择。面对各种压力，队员们团结一致坚持到最后一场比赛，挥洒青春、汗水与热血。赛季结束后，穆奇向学校辞去了球队主教练一职，而他带来的拼搏精神影响着所有队员。',1,0,0,0,'',0,0.0,0,'林健龙','31集全',1495012629,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1818','X',0,0,NULL),(28539,49,'遍地狼烟',NULL,'中国大陆',NULL,2000,710,'山村少年牧良逢本是猎户人家的孩子，天生擅长枪支运用，枪法奇准。一个阴差阳错的机会，他开枪击伤了一位欺压寡妇的国军军官。从而踏上了与日寇厮杀的征途：潜入沦陷区刺杀汉奸。与鬼子狙击手的生死较量，配合新四军摧毁鬼子小型兵工厂和印钞厂，收编土匪解救战俘',1,0,0,0,'',0,0.0,0,'虎子','28集全',1495012631,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1819','B',0,0,NULL),(28540,49,'我是杜拉拉',NULL,'中国大陆',NULL,2000,711,'三十岁的职场精英杜拉拉，不日就要问鼎总监级别。而她和王伟的恋情也瓜熟蒂落，领证结婚过上了幸福生活。不料，公司突然出现空降兵海归凯西，同为人事经理，要和拉拉竞争人事总监。凯西比拉拉年轻，但能力丝毫不逊色。两人在公司的人事招聘、年会方案等工作中短兵相接，好几次拉拉都险些败下阵来。拉拉感到压力巨大，总监之位也摇摇欲坠。但拉拉没想到的是，凯西和王家相识已久，尤其受到婆婆陆爱华的喜爱。凯西深受西方文化熏陶，想当然的和王家走的很近，给拉拉带来了不少麻烦。拉拉虽是职场精英，却是个家庭菜鸟。起初她在平衡职场和家庭间奔命，惹出不少风波，甚至和王伟有了矛盾。但拉拉骨子里的善良坚持，让她逐渐成长。最终，拉拉凭借自己的努力与对家庭的真心维护，赢得了婆婆喜爱，成长为一名好妻子好媳妇，过上了职场家庭双丰收幸福的生活。',1,0,0,0,'',0,0.0,0,'刘俊杰','40集全',1495012637,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1820','W',0,0,NULL),(28541,49,'神秘博士圣诞特别篇',NULL,'英国',NULL,2000,712,'《神秘博士》是一部由英国广播公司出品的长寿英国科幻电视剧。此片描述了一名神奇的名为博士（）的时间领主用他伪装成世纪年代英国警亭的时间机器塔迪斯（，时间和空间相对维度的缩写）在时间、空间中旅行的冒险。他与其搭档在时间、空间中探索悠游、惩恶扬善、拯救文明、帮助弱小。从小到叔，英国国宝级剧集《神秘博士》完成了角色的重生，将这个角色的接力棒，从马特史密斯交到了彼得卡帕尔蒂手上。博士之前的旅伴珍娜路易斯科尔曼将继续出演她的角色。一个典型的《神秘博士》式冒险故事始于的控制台，博士准备带着他的旅伴见识浩瀚宇宙里的新一站，但总歪打正着走进危险之境，总有宇宙难题需要博士去拨乱反正。博士也常常会遇到他最恐惧的敌人以消灭一切为目的的达雷克星人。有了博士那满脑子丰富的宇宙知识和旅伴们偶尔的灵机一动，他们总能化险为夷。博士的冒险故事大多发生在英国，但也可能发生在外国、外星球、古代，甚至未来。时间旅行和再生的预设令《神秘博士》每一集都可以讲一个独立的故事，每一代博士都可以有各自的性格，总体上却始终保持统一。神秘博士圣诞特辑讲述了令观众津津乐道的博士与爱人瑞雯宋的故事，为两人谱写了圆满的结局。',1,0,0,0,'',0,0.0,0,'史蒂文·莫法特','2集全',1495012638,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1821','S',0,0,NULL),(28542,49,'爱的阶梯',NULL,'中国大陆',NULL,2000,713,'罗灿然执导，张檬、张睿、霍政谚、迪丽热巴、杨诚诚、邹廷威等联袂主演的都市爱情电视剧。该剧讲述了讲述了在欲望的都市里，大学时代的三兄弟在告别校园后各自走上了不同的奋斗征程，并在商场上施展远大抱负的故事。',1,0,0,0,'',0,0.0,0,'罗灿然','69集全',1495012644,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1822','A',0,0,NULL),(28543,49,'东方战场',NULL,'中国大陆',NULL,2000,714,'《东方战场》是由孟凡耀监制，路奇执导，黄海冰、罗嘉良、叶璇、俞飞鸿、袁咏仪、马晓伟、刘璇、应采儿、张鲁一、侯祥玲周航等主演的反映中国十四年抗战的史诗大剧。该剧是中国首部全景式展现中国十四年抗日战争辉煌历史的作品，真实再现了从年事变到年月日日本战败投降的这段历史时期内，发生在东方战场的多个具有影响力的事件。',1,0,0,0,'',0,0.0,0,'路奇','66集全',1495012648,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1823','D',0,0,NULL),(28544,49,'警花与警犬',NULL,'中国大陆',NULL,2000,715,'李姝寒和倪娜进入女子警犬队内心相当抵触，两人分别以不同的方式对抗着无法逃避的命运。唐优优最先融入到新的集体中。李姝寒的失误，致使樱桃受伤而面临淘汰。通过帮助失忆的凶悍马里努斯犬重归扑咬犬行列，摸索出一套情感关注的全新驯导方法，并成功帮助爱犬摆脱心理阴影重返工作岗位。倪娜和自己史宾格猎犬先后遭遇地铁安检时的恶意投诉和搜爆现场的致命错误，加上李姝寒对自己的误解，一连串挫折和困境使倪娜开始自我反思，最终战胜了训练大型扑咬犬的挑战，并在野外救援遇险时修复了和李姝寒的关系。唐优优带领牧羊犬翻越障碍时过于追求难度，导致警犬受伤失聪，使她明白了兴趣爱好与职业素养的区别，在帮助警犬突破训练瓶颈的过程中，感悟到成长和自我实现的道理，用以犬为师理念，实现了人犬合一的默契境界。',1,0,0,0,'',0,0.0,0,'谷锦云','44集全',1495012657,1508319796,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/1824','J',0,0,NULL),(28545,49,'尖刀出鞘',NULL,'中国大陆',NULL,2000,716,'日军特高课在长治秘密训练特别挺进队，其队员个个身怀绝技，穿着八路军服装，模仿八路军的生活方式和训练方式，并且用战俘进行实战训练。同时还秘密派遣大量谍报人员潜伏我抗日根据地搜集情报，并实施破坏活动。八路军针对日军的作战计划，快速组建了一支特战大队，与日寇展开了一场惊心动魄的特殊战斗。',1,0,0,