hp?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15048','S',0,0,NULL),(28552,49,'刺客列传 第二部',',牛牛,查杰,朱戬,熊梓淇,陈雨成,薛翔匀,','内地',NULL,2017,723,'天下共主启昆被刺身亡后，天下大乱，由天璇、天枢、天玑和天权四国瓜分天下。而后蛮族遖宿国入侵中垣，接连拿下天枢和天玑两国，遖宿士气大涨，想要并吞天璇和天权。瑶光王子慕容离离开天权去往遖宿，怂恿遖宿举兵天璇，另一方面利用仲堃仪和天璇杀死遖宿王毓埥。而后成功扶植毓骁上位，并且在毓骁的帮助下立郡。为平衡天下大势，仲堃仪派门徒楚艮宁与顾十安前往天璇，辅佐陵光，天璇逐渐强盛。慕容离自我设计失踪，诱使天权和遖宿举兵天璇，天璇灭。慕容离复出，却被仲堃仪算计，被迫和遖宿兵戎相见，遂向天权求助，天权助慕容离击退遖宿。原以为天下从此太平，却不料开阳野心浮出水面，仲堃仪献计开阳导致天权将军因慕容离惨死。执明和慕容离离心，两人最终兵戎相见。但为了国家与天下子民的利益，执明与慕容离最终联手，消除误解，铲除暗黑势力。',1,0,0,0,'',0,0.0,0,'何澍培',NULL,1496592162,1508319798,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15049','C',0,0,NULL),(28553,49,'有爱的日子',',陈建斌,王劲松,杨亚洲,','内地',NULL,2000,724,NULL,1,0,0,0,'',0,0.0,0,'丁嘉丽','20 集全',1497542884,1508319799,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16509','Y',0,0,NULL),(28554,49,'上海探戈',',林心如,陈勋奇,刘锡明,陈孝萱,陈国邦,陈勋奇,','内地',NULL,2000,725,NULL,1,0,0,0,'',0,0.0,0,'周海媚','43 集全',1497542916,1508319799,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16510','S',0,0,NULL),(28555,49,'择天记 未删减版',',古力娜扎,吴倩,曾舜晞,许龄月,陈数,钟澍佳,麦咏麟,孔厉大,','内地',NULL,2000,726,NULL,1,0,0,0,'',0,0.0,0,'鹿晗','更新到 52 集',1496333649,1508319800,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/14577','Z',0,0,NULL),(28556,49,'用心过日子',',丁海峰,左翎,张小磊,徐卫,罗方序,','内地',NULL,2007,727,'这是一部由独特视角展现爱情，婚姻，家庭伦理道德的情感剧，剧中五个不同身份的女人面对生活的酸甜苦辣和情感的爱恨惆怅，表现出了各自不同凡响的自我拯救和宽容豁达的人格力量，每个人物都饱含传统道德精神，每个人物都是关照自身心灵的一面“镜子”，在她们的身上充满了现实的困惑和追求家庭幸福美满的自信，她们珍视家庭和睦和亲情关系的心理如层层云雾遮蔽的阳光，无时无刻不在冲破障碍放射着光芒。',1,0,0,0,'',0,0.0,0,'陆涛','共24集全',1500049499,1508319800,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18726','Y',0,0,NULL),(28557,49,'饭制剧：七次的初吻',',李易峰,鹿晗,杨洋,张艺兴,陈伟霆,陈学冬,吴亦凡,',NULL,NULL,2017,728,NULL,1,0,0,0,'',0,0.0,0,'赵丽颖','更新到10集',1504581381,1508319800,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/14581','F',0,0,NULL),(28558,49,'皇朝太医',',罗海琼,孙耀威,李立群,李小冉,马精武,靳德茂,','内地'