工智能：伏羲觉醒 VR版','雷鹏宇,姜佩瑶,祁汉,','大陆',NULL,2000,799,'讲述了一群互联网商界精英围绕着人工智能系统“伏羲”展开争斗的故事。这部剧融合了高科技、商战、人性、科幻等多种元素，深入探讨了“执念”这一人性问题，堪称一出互联网江湖版“无间道”和“小时代”的合体大戏。Box的公司蝙蝠科技出现了始料未及的技术危机，他请来了前下属叶行嘉及其团队解决了危机，随后Box提出了高薪收编团队及其技术“伏羲...</span><span class=\"intro-more hide\">简介：讲述了一群互联网商界精英围绕着人工智能系统“伏羲”展开争斗的故事。这部剧融合了高科技、商战、人性、科幻等多种元素，深入探讨了“执念”这一人性问题，堪称一出互联网江湖版“无间道”和“小时代”的合体大戏。Box的公司蝙蝠科技出现了始料未及的技术危机，他请来了前下属叶行嘉及其团队解决了危机，随后Box提出了高薪收编团队及其技术“伏羲”的要求，而叶行嘉的执念在于将一直沉睡的“伏羲”唤醒，所以拒绝Box的请求。随后，叶行嘉创业团队的二当家杰西却擅自向Box介绍团队和技术，达成了并购意愿。与叶行嘉青梅竹马的投资人Cathy一直在暗中帮助叶行嘉摆脱Box幽灵般的纠缠，可是Box还是挖走了叶行嘉的团队。对叶行嘉来说，“伏羲”是他的全部，而今他已经一无所有，坠入人生低谷。历经种种情感的纠结，叶行嘉终于找到了唤醒伏羲的钥匙……',1,0,0,0,'',0,0.0,0,'郑小岳','6集全',1497283443,1508319832,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16178','R',0,0,NULL),(28629,49,'魂断秦淮',NULL,'中国大陆',NULL,2000,800,'故事主要讲述从宫中逃亡出来的宫女王宁氏，带着襁褓中的女儿流落民间。年后，女儿柳如是长成一位绝色才女。一次偶然的机会，她与赫赫有名的文坛领袖钱谦益在秦淮河畔邂逅了，二人由敬慕彼此的才华而心生爱意。在经过无助而无奈的时空等待、感情试探和生活考验之后，二人终于互明心迹并终成眷属。',1,0,0,0,'',0,0.0,0,'朱建新','30集全',1499270752,1508319832,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18239','H',0,0,NULL),(28630,49,'远征远征','张丰毅,沈培艺,万思维,','大陆',NULL,2014,801,NULL,1,0,0,0,'',0,0.0,0,'吴斌','38集全',1497283449,1508319832,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16180','Y',0,0,NULL),(28631,49,'幻城 DVD版',',宋茜,马天宇,张萌,金喜善,麦迪娜,胡兵,邵兵,鞠觉亮,','内地',NULL,2000,802,NULL,1,0,0,0,'',0,0.0,0,'冯绍峰','62 集全',1496937897,1508319836,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15447','H',0,0,NULL),(28632,49,'一起同过窗','武雨泽,徐晓璐,庞瀚辰,李若嘉,于翔,应岱臻,丁翔南,李川,桑砚,','内地',NULL,2016,803,'路桥川、钟白、任逸帆是青梅竹马，从小学起就是同学，又一起考入了南方传媒大学，可谓一路同窗。年少的羞涩感情逐渐萌芽，乐观直率的钟白一直对温和的桥川有爱慕之情，默默付出但从未说出口，而逸帆一直把桥川和钟白看作家人。桥川与钟白考入了摄影系，逸帆被分到了西班牙语班，又陆续认识了肖海洋、林洛雪、毕十三、顾一心、李殊词、余皓等同学。多彩的大一时光，九个青春男女彼此见证对方的成长，有欢笑打闹也有烦忧苦恼……',1,0,0,0,'',0,0.0,0,'毕鑫业','全34集',1496989000,1508319839,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15492','Y',0,0,NULL),(28633,49,'花间提壶方大厨第2