是对孩子最深的爱。',1,0,0,0,'',0,0.0,0,'王为','32集完',1495017724,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3496','Z',0,0,NULL),(28638,49,'剧说你要来',NULL,'大陆',NULL,2016,809,'这是全国首档\"双屏实时互动\"周播剧场。观众们可以通过手机端的H5界面，实现评论和投票实时登上电视大屏。弹幕终于可以上电视啦，投票的结果也可以决定演员生死和剧情走向。',1,0,0,0,'',0,0.0,0,NULL,'39集完',1495017738,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3497','J',0,0,NULL),(28639,49,'根性青蛙','松山研一,满岛光,前田敦子,胜地凉,新井浩文,,','日本',NULL,2017,810,'16年前，冒冒失失的中学生浩史（高泽父母道饰）在公园被同学五利良地瓜（菊池宇晃饰）推倒，压到了一只青蛙。没想到这只青蛙竟然附着在衣服上，变成了一只会说话、有感情、充满斗志的平面青蛙“蹦吉”。从此浩史与这世上唯一一只平面青蛙一起，时而互助、时而争吵，转眼活到了30岁。30岁的浩史（松山研一饰）一事无成，没心没肺地浪费着光阴，蹦吉也奈何他不得。直到有一天他与从小暗恋的京子（前田敦子饰）重逢，让他深受触动，抱着“不想自己变成无聊的成年人”的信念，浩史决定拿出硬骨头精神，重新活出自己。',1,0,0,0,'',0,0.0,0,'菅原伸太郎','10集完',1495017755,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3500','G',0,0,NULL),(28640,49,'奇星记之鲜衣怒马少年时','吴磊,陈翔,张予曦,郝劭文,郑合惠子,何美钿,,','大陆',NULL,2017,811,'传说在每一次时局动荡，天下大乱之际，都会有天降奇星，重建秩序。时至今日，历史重演。一场举国皆知的流星雨过后，当朝年轻皇帝派亲信少年白泽前往塞外找寻天降奇石，希望能以界世奇石的无穷力量排除奸妄，安定天下。少年白泽才识过人，正直善良以国为家，却因自己为罪臣白家之后的身份不能被朝廷重用。此次他决心完成这个关系到江山社稷的秘密任务，恢复家族荣誉。任务途中白泽在边塞小镇误打误撞，结识了鬼灵精怪放荡不羁的顽劣少年展雄飞，以及跟班小胖“元帅”冥冥之中缘分注定，随后得知原来雄飞、小胖正是白泽父亲当年手下兄弟之后。于是三个少年一路并肩作战。前途曲折，不仅有各路枭雄对流星石的虎视眈眈，还有朝堂之上的佞臣陷害追杀，危机重重。缘分让白泽邂逅草原少女吉雅，在其危难之际出手相救。二人互生情愫。同时自幼暗恋白泽的皇帝之妹紫苏小公主也偷偷溜出皇宫，加入少年冒险小队，怎料千金公主竟与痞气十足的小滑头展雄飞成了欢喜冤家，一路打打闹闹，笑料百出。就这样五个少男少女一路历经世间百态，战胜邪恶敌人的同时逐步化解内部的矛盾分歧，最终用爱与友情团结在一起。用青春和热血，胆魄与智慧完成了艰巨任务。那颗能够引人入魔，诱惑世间众人互相厮杀抢夺的界世奇星。',1,0,0,0,'',0,0.0,0,'黄祖权','51集全',1498579442,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3501','Q',0,0,NULL),(28641,49,'明星时代精编版','李晟,盛冠森,贺彬,房程程,,','大陆',NULL,2017,812,'三十年代上海，一家濒临倒闭的电影公司，当家人兰姐发现公司快揭不开锅，员工纷纷来索要拖欠的酬金，兰姐一哭二闹三上吊全然失效，听说有位公子哥儿高君是位电影发烧友，不仅家世显赫，还疯狂喜爱电影，便以给扮演男一号为诱饵，赢得了高家的资金投入，然而兰姐发现这位高君不是省油的灯，虽然还不是一个明星，但明星所有的毛病他一样都不少，而且随着他演上几部戏，益发变本加厉，面对这样一位矫情却十分天真，滥情却为人善良的帅气老板，兰姐发现自己陷入了爱的漩涡。',1,0,0,0,'',0,0.0,0,'谢鸣晓','23集完',1495017759,1508319844,1,'http:||zy.wlzhan.com