T','陈乔恩,,陈国华,阮惟新,','大陆',NULL,2016,818,'饰 薇薇。薇薇安厉设计总监，一次意外溺水长时间脑部缺氧失去了部分记忆，记忆停留在23岁。失忆前是穿普拉达的女魔头，现在却变成了热血萝莉女神经。 23岁的她不像现在这般富有，却有一个美满快乐的家庭，不像现在这样装作女王在残酷的商战中厮杀。 曾经最爱的陈亦度成为了她的敌人。身边没有朋友，只有自己的发小霍骁。',1,0,0,0,'',0,0.0,0,'邓衍成','39集完',1495017821,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3509','F',0,0,NULL),(28648,49,'放弃我抓紧我之王凯CUT','王凯,,陈国华,阮惟新,','大陆',NULL,2016,819,'饰 陈亦度。DU集团董事长，阴郁俊美才华横溢，冷酷无情的霸道总裁。七年前与薇薇深情相爱，七年后却与她成为相见分外眼红的竞争对手，两人在商业竞争中往来相互耍狠刺痛对方，陈亦度却每每在关键时候停手让薇薇绝处逢生。两人之间因为薇薇失忆而频频发生误会。他回想起过去七年两人所经历的痛苦，或许重来一次他们之间也不会有结果。',1,0,0,0,'',0,0.0,0,'邓衍成','39集完',1495017823,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3510','F',0,0,NULL),(28649,49,'OS GIRLS','谭妍喆,罗怡恬,郑越敏,谈楚然,王梓璐,,','大陆',NULL,2016,820,'本剧讲述了五个13岁到22岁，身份背景完全不同的女孩在JC艺人学院努力实现明星梦想的故事。五个姑娘从初次见面的尴尬到在明星面前装熟，每天发生着令人捧腹的小故事。在强剧情的同时，辅以内心OS，处处有梗。',1,0,0,0,'',0,0.0,0,'叶笑寒','更新至11集',1495017861,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3511','O',0,0,NULL),(28650,49,'美人私房菜','郑爽,马天宇,蒋毅,吴其江,苑琼丹,,','大陆',NULL,2016,821,'北宋年间，来杭州督运粮草的皇子赵元卿，偶以蹴鞠认识了天香楼的美厨娘宋玉蝶，并对其倾心不已，此时玉蝶正打算跟学武归来的义兄李马成亲。而完颜部派将军完颜泽利跟踪赵元卿，伺机杀之，追杀过程中完颜泽利放火烧了天香楼。与此同时，李马因打伤差点玷污林姬儿的督粮官，被打入大牢。玉蝶营救李马不成，却看见化为灰烬的天香楼，便直奔京城要找赵元卿说个明白。赵元卿得知玉蝶的遭遇万分愧疚，承诺将李马救出。不久，秦贵妃意外发现玉蝶竟是自己十八年前失踪的女儿。此时，完颜泽利趁机向朝廷提出要与玉蝶“婚配”，李马为救身在完颜大营的玉蝶，自毁容貌，混入完颜大营，里应外合，最终将完颜泽利等人全部消灭。战事平息，李马要回杭州重开天香楼，殊不知，赵元卿早已开建天香楼。新店开张之际，玉蝶等人突然出现，自此，美厨娘宋玉蝶与李马修得百年好合。',1,0,0,0,'',0,0.0,0,'梁辛全','50集完',1495017864,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3512','M',0,0,NULL),(28651,49,'风中玫瑰','刘威,韩宇,姜中锦,,','大陆',NULL,2015,822,'（两集一个故事）几个不同职业、不同经历的女性，却都因钱丧弃人格，丧失人性而堕入深渊。她们是如何堕落的？在她们的世界里钱真的可以抵得过这世上的任何东西？《风中玫瑰》就是讲述了女人如何禁不住金钱和欲望的诱惑一步步的迷失自己。本片选出了几个典型的故事，不动声色的讲述了女人如何一步步迷失自己的故事，现实地重现了这些刻骨铭心的人性故事，展现生活中的矛盾与冲突，为迷失的女人点亮指路明灯，敲响警钟。',1,0,0,0,'',0,0.0,0,'毓博','20集完',1495017870,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3513','F',0,0,NULL),(28652,49,'刀锋乱世情','张磊,庹宗华,白庆琳,,','大陆',NULL,2011,823,'一九三七年底的扬州古城，烟花垂泪堤柳哀号，日本侵略者的铁蹄踏碎了一个个温馨的水乡梦。那一夜，人称“修脚小神刀”的华扬生一把飞刀掠过，救下了正被日本兵追杀的国民党团座安骏雄。扬州首富桂之章的小女儿桂玉蓉是安骏雄的恋人，却在一次偶患脚疾时爱上了为她解除极度脚痛的小师傅华扬生。于是，已经是安骏雄救命恩人的修脚小神刀同时又成为了安骏雄的情敌，一场乱世情爱便被人性道义善恶叛逆扭曲得面目全非了。<BR>修脚师华扬生飞刀杀死两个日本兵，竹内之助追捕时杀害了他的父亲。华扬生携秋兰出逃途中住房被炸，误以为秋兰已死。在南禾镇，意外与曾经在扬州搭救过他的桂昱蓉相见。<BR>桂昱蓉遵从父命嫁给国军团长安一雄，她却暗中爱上华扬生。安一雄妒忌华扬生和桂昱蓉的关系，尽管得知华扬生就是救过他的小神刀，依然多次设计暗害；驻守南禾镇的竹内之助怀疑化名常顺的华扬生是杀了日本兵的凶手，但华扬生总是死里逃生。<BR>秋兰没死，他寻找到华扬生，却被安一雄强奸，她带着屈辱结束了自己的生命。华扬生修脚时用断魂刀法杀死竹内之助为父报了仇，企图炮轰桂家大院的安一雄也死在华扬生的刀下。<BR>解放后，华扬生失踪了三十年，桂昱蓉苦苦等他三十年。竹内樱子重返南禾镇，为父亲赎罪。华扬生终于再次拿起修脚刀，和桂昱蓉一起走进属于他们自己的生活……<BR>',1,0,0,0,'',0,0.0,0,'谷诗阳','更新至29集',1505141145,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3514','D',0,0,NULL),(28653,49,'幸福的旅程','郭德纲,姜超,,','大陆',NULL,2011,824,'“幸福号”客轮实际是一个浓缩的社会，各种生活背景的人都可以集合到这条船上。全船人员共同生活在一起，人与人之间很容易发生各种各样的矛盾和故事，他们会共同面对困难，共同享受生活的快乐，船上每个人身上还会产生各种有趣的事情。',1,0,0,0,'',0,0.0,0,'王宏桥','更新至60集',1495017889,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3515','X',0,0,NULL),(28654,49,'香格里拉','胡歌,王力可,,','大陆',NULL,2011,825,'《香格里拉》讲述的是一个高原上的少年，如何在生与死的各种考验中成长的故事，而这个故事包含的，有爱情，有各种势力的明争暗斗，也有面对外敌入侵大家的团结一心，这些又都是发生在香格里拉，这片传奇的雪域高原上，少数民族身上热情如火的精神，造就了这个传奇。',1,0,0,0,'',0,0.0,0,'蒋家俊','33集完',1495017896,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3516','X',0,0,NULL),(28655,49,'纯白','堀北真希,柳乐优弥,志田未来,高梨临,菜菜绪,,','日本',NULL,2016,826,'出身于千叶县一个小城市的有村朱里厌烦了看护老人的工作，加上刚好被男友劈腿，她所幸辞职上京，来到了专门面向政要权贵开办的酒店是贵族医院东王医院当护士。担任护士长的田野岛心令行禁止，赏罚分明，一切以患者为中心，谨慎严厉地统治着这座白色大奥。朱里在此期间结识了松冈菜菜以及和田木棉子两位朋友，她小心翼翼周旋在白衣天使的宫斗中，时刻梦想着有朝一日被某个富家公子哥相中，上演麻雀变凤凰的人生胜利剧。而海归的天才外科医生仲野孝太郎似乎又称为她前世的仇敌一般口舌不断。',1,0,0,0,'',0,0.0,0,'今井夏木','10集完',1495017913,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3517','C',0,0,NULL),(28656,49,'恋爱真美','袁姗姗,雷佳音,张峻宁,张雯,肖雨雨,王若涵,翁虹,黄柏钧,吕凉,,崔亮,','大陆',NULL,2016,827,'嫉恶如仇、铁骨铮铮的女汉子徐梓琳是一名默默无闻的娱乐记者，为了实现自己的新闻理想，不得不忍受每天趴明星窗根儿，挖名人隐私的狗仔生活。<BR>玩世不恭、用情专一的屌丝男夏利宾是一名天赋异禀、技术高超的汽修工，为让财迷丈母娘同意女友小美下嫁，每天努力工作，拼命赚钱，甚至不惜跟人搭伙买房。<BR>一场相亲节目彻底改变了两人原有的生活轨迹：临时“客串”女嘉宾的徐梓琳和为赚外快“扮演”男嘉宾的夏利宾，在直播现场互掐，这场没按套路出牌的激辩，让徐梓琳一夜成名，被粉丝奉为“女权主义的宅男女神”，从此，升职、加薪、开专栏、被土豪求婚，过的风生水起，而夏利宾却为此经历了失恋、失眠、失业、各种奇迹般的倒霉……于是，这对原本毫无关系的欢喜冤家开始了一场场“复仇”与“反复仇”的残酷斗争……<BR>与此同时，拼房合伙人柏平和卫蓝甜蜜的办公室隐婚也开始遭遇各种层出不穷、危机四伏的情感考验……<BR>在经历了婚姻、现实、亲情、友情的种种历练之后，这些年轻人由衷地感慨道：永远恋爱真美……<BR>',1,0,0,0,'',0,0.0,0,'安建','36集完',1495017925,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3518','L',0,0,NULL),(28657,49,'最后的格格','霍思燕,陈键锋,严宽,唐宁,萧蔷,李倩,程莉莎,,周家文,','大陆',NULL,2007,828,'《最后的格格》主要讲了清朝末年，裕王府的云香格格和戏子温良玉相爱，二人私奔那一晚，正好隆裕太后宣布退位共和，被乱民冲散，云香为王府的仇人方天羽所救，良玉流落街头，二人九死一生，再重逢却因为天羽对云香的爱而几次分离，结果云香为了照顾发疯的母亲而堕落，良玉放弃好不容易得来的工作，一直相随，最后把云香拉出泥藻，没想到那一晚，天羽居然制造了一场阴谋，将良玉扔入河中，云香得知良玉已死，刺杀天羽，结果被抓进牢……',1,0,0,0,'',0,0.0,0,'刘逢声','40集完',1495017927,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3519','Z',0,0,NULL),(28658,49,'人间正道是沧桑',',孙红雷,黄志忠,王若麟,柯蓝,杨雪,','内地',NULL,2009,829,'该剧通过1925年至1949年间杨氏兄弟姐妹不同的人生脉络，融个人命运与国家、民族的命运于一体，将重大主题与生动的人物、丰富的故事巧妙相融，集中展现了从黄埔时期的国共合作到共产党战胜国民党、国民党退逃台湾这一历史时期波澜壮阔的政治历史画卷，生动再现了共产党顺应时代潮流，取代国民党，建立新中国的必然历史命运。1925年，湖南醴陵。杨氏家族有三个子女，长子杨立仁是个教书先生，沉稳多谋，绵里藏针；在广州读书的女儿杨立华独立而有主见；小儿子杨立青生性顽劣但勇敢正直。杨廷鹤作为一家之长，坚持中国传统的“家国”观念，不求子女大富大贵，但求他们能团聚在自己身边，并成长为对国家的有用之人。立仁与立青虽是亲兄弟，但关系并不融洽。立仁受革命思潮感染，准备暗中行刺在湖南巡视的北洋政府要员。立青偷拿立仁的枪支玩耍走火，误伤了少年林娥，更使得刺杀计划提前夭折。立青察觉到立仁的意图，主动独揽罪名，却对立仁只顾自己的念想而不管全家的安危愤恨不已。官方的深入调查几乎让行刺计划曝光，杨廷鹤多方斡旋才免去了立青的罪名，将大事化小，可是立仁和立青均已无法在老家安身立命。无奈之下，兄弟俩先后离乡背井前往广州，各自发展找寻前途。立仁通过杨家世交楚材介绍成为黄埔军校的参谋教官，而立华早已是广州国民政府的机要人员。立青对前途一片迷茫，在立华的介绍下，他先后认识了国民革命元老级人物董建昌和共产党籍黄埔政治教官瞿恩一家。在他们的帮助下，立青凭借超强的绘图技艺顺利地考入黄埔军校。学习期间，渐渐成熟的立青将瞿恩视为人生导师，并对瞿恩的妹妹瞿霞产生了爱慕之情，还与范希亮、穆震方等三期六班的同学结下深厚的情谊。1949年上海解放前夕，杨廷鹤病重去世，他一生所盼的家庭团聚最终未能实现，立仁带着立华和全家人远渡台湾。立青作为共和国功臣回到上海准备投入新中国的建设，他带着林娥、立秋等人到父亲杨廷鹤的墓前拜祭。杨氏兄弟姐妹随时代变革历尽分分合合，此刻虽隔海遥望，但依旧期待着血浓于水的民族统一。</br>',1,0,0,0,'',0,0.0,0,'张黎','50集全',1498322251,1508319844,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17542','