他来到香港协助佐藤大藏组建香港的宪兵及情报机构。但叶冲早已选择为国报效，在新京时就以秋蝉为代号，为我党提供日军重要情报。叶冲来到香港与宫本苍野和佐藤大藏、清泉上野等老牌日本间谍斗智斗勇，同时又被我党同志姜俊涛和军统薛萍等人怀疑身份，他陷入重围一路披荆斩棘，一次次地化解了身边的危机。但叶冲最终还是身份暴漏，被送回日本受审，在爱人何英的帮助下逃离了虎穴，回到香港继续为我党进行地下工作，在好友的帮助下，击败了宫本苍野和清泉上野，在姜俊涛和梁雪梅的婚礼上摆脱了日本女魔头清泉纯子的追杀，为抗战胜利作着不懈努力。受降仪式上，佐藤大藏向千万香港人民低下了头。抗站胜利了，姜俊涛、叶冲、何英等人圆满的完成了自己的任务，携手奔赴新的战场。',1,0,0,0,'',0,0.0,0,'付宁',NULL,1498665922,1508319847,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17696','Q',0,0,NULL),(28676,49,'梦断乐缘堂',',孙耀威,隋俊波,陶为,施大生,高语阳,','内地',NULL,2011,848,'抗日战争中期，江南的一个小镇——灵湖镇的桃花巷内，主人翁任旭堂出身于一个中医世家，虽然年纪轻，但从小在他父亲的熏陶下，颇懂医理。他为人聪明能干，办事精明，但又心地善良，生就一副乐天派的性格，好开玩笑，爱说俏皮话，所以引起非议。任旭堂为同一条巷的丁家小姐打抱不平，也为了归还给父亲办丧事而欠下的高利贷债务，到丁家去当了一个挂名的“入赘女婿”。任旭堂为治疗当地流传的一种从日本军营里传出来的瘟疫，发明了“三才九天汤”这一药方；通过和日本军部的特务、镇上保安团团长的斗争，终于用他的人品、才干，得到了人们的认可。',1,0,0,0,'',0,0.0,0,'白秋林','27集全',1498665960,1508319847,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17697','M',0,0,NULL),(28677,49,'草根王',',王志飞,,刘蓓,王奎荣,许还山,','内地',NULL,2010,849,'上个世纪三十年代天津卫，朱三因为要相亲借了一件大褂，却不料惹出了一连串的事端，他先是被诬陷入狱。在狱中遇到了天津卫高买行的老大霍一手，出狱后成为了“高买”。又因为保护国宝“绿天鸡壶”而遭追捕，逃走后拜师学艺，变成了相士“无非子”。朱三经历了人生种种奇遇，与喜如、吴亦真、鲁桂花等发生了一段段爱恨情仇。日军侵华民族危亡的紧急关头，朱三挺身而出，以民族大义为重，利用自己特殊的身份，给民众送来了中国必胜的信念和勇气。',1,0,0,0,'',0,0.0,0,'张国立','30集全',1498666021,1508319847,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17698','C',0,0,NULL),(28678,49,'一路狂奔',NULL,'中国大陆',NULL,2000,850,'三友成衣公司董事长周京平事业上如日中天但青少年时代几段惨痛经历给心灵蒙上了一层厚厚阴影；周京平助手陶正旗表面对周毕恭毕敬暗地里却因为一段历史恩怨无时无刻不思量着复仇计划；聪明漂亮女大学生安小竹一来到三友公司便陷入了一条若明若暗曲径之中；而随着周京平昔日同桌、才华横溢时装设计师唐洁出现使本就烟雾重重人际关系显得更加扑朔迷离还有围绕们身边执著艺术家黄辛木、善解人意齐娅迷惘彷徨唐作利欲熏心安恭',1,0,0,0,'',0,0.0,0,'陈国军','高清',1508895089,1508319847,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18238','Y',0,0,NULL),(28679,49,'风雪飘落的季节',',舒畅,曹培昌,陈健,','内地',NULL,2000,851,'一九三七年，太行山下，山西省和顺县，日军龟尾中队偷袭八路军总部机关，游击支队女战士郝喜娥带领五名战士将敌人引开，被逼至绝路，英勇跳崖，五人壮烈牺牲，一人失踪.....',1,0,0,0,'',0,0.0,0,'王斑','21集全',1498666240,1508319847,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{i