86,49,'名捕震关东',',崔凤娟,韩东,吴奇隆,任泉,左小青,范冰冰,王九胜,','内地',NULL,2002,858,'不明身世东瀛刀客挑战中原胞弟，欢喜冤家刁蛮公主戏谑冷峻剑客，寻寻觅觅幕后真凶竟成咫尺天涯。 嘉靖年间，武林名宿诸葛 侯(董志华 饰)席下四大弟子：冷血(任泉 饰)、无情(吴奇隆 饰)、铁手(王久胜 饰)、追命(卢星宇 饰)，奉师命为朝延屡建奇功，名震关东，人称“四大名捕”。倭寇首领伊腾(吴奇隆 饰)野心勃勃，欲逐鹿中原，却遭无情重创。因此不惜一切代价要除去无情，而无情发现与自己外貌相似的伊腾竟是自己的孪生兄弟！原来二十年前他们的生父为东瀛贵族，在中土经商时，结识一名妓柳，生下双胞胎。迫于压力，柳抱无情出走，而伊腾用尽手段。而无情将计就计一举将伊腾等押解出境。与此同时，“彩灯会”为害江湖，而在灭灯行动中，各门派伤亡惨重，冷血却成为师门败类，为洗脱罪名，冷展开调查，发现主谋竟是师傅，而在他背后还隐藏着更大的秘密和危机。刀剑无情人有义。冷血、无情、公主(范冰冰 饰)和师妹雅风(左小青 饰)之间的情感纠葛在战斗中升华，最终找到了自己的情感归宿。根据温瑞安武侠名著《四大名捕》系列改编。',1,0,0,0,'',0,0.0,0,'王响伟','34集全',1499875383,1508319851,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18730','M',0,0,NULL),(28687,49,'人民的名义',',陆毅,张丰毅,吴刚,许亚军,张治坚,','内地',NULL,2017,859,'一位国家部委的项目处长被人举报受贿千万，当最高人民检察院反贪总局侦查处处长侯亮平前来搜查时，看到的却是一位长相憨厚、衣着朴素的“老农民”在简陋破败的旧房里吃炸酱面当这位腐败分子的面具被最终撕开的同时，与之案件牵连甚紧的汉东省京州市副市长丁义珍，却在一位神秘人物的暗中相助下，以反侦察手段逃脱法网，流亡海外。案件线索终定位于由京州光明湖项目引发的一家H省国企大风服装厂的股权争夺，牵连其中的各派政治势力却盘根错节，扑朔迷离。汉东省检察院反贪局长陈海在调查行动中遭遇离奇的车祸。为了完成当年同窗的未竟事业，精明干练的侯亮平临危受命，接任陈海未竟的事业。在汉东省政坛，以汉东省委副书记、政法委书记高育良为代表的“政法系”，以汉东省委常委、京州市委书记李达康为代表的“秘书帮”相争多年，不分轩轾。新任省委书记沙瑞金的到来，注定将打破这种政治的平衡局面，为汉东省的改革大业带来新的气息。',1,0,0,0,'',0,0.0,0,'李路','55集完',1495387785,1508319852,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5245','R',0,0,NULL),(28688,49,'金剑雕翎',NULL,'中国大陆',NULL,2000,860,'《金剑雕翎》是海润自《三少爷的剑》之后拍摄的第二部武侠剧，改编自台湾著名武侠小说作家卧龙生的同名作品。和大多武侠小说一样，讲述的是为了得到人人梦寐以求的武功秘集禁宫武林经典，众武林高手行走江湖，寻找通入禁宫的唯一方式金剑，由此引来数场武林风波。',1,0,0,0,'',0,0.0,0,'王奕开','39集全',1499270842,1508319854,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18243','J',0,0,NULL),(28689,49,'越活越明白',NULL,'中国大陆',NULL,2000,861,'张谢义有个漂亮的妻子和可爱的儿子。在张母的呵护下，日子过得有滋有味。不久，谢义下岗，遭妻子歧视。为保住有家庭，谢义任劳任怨，在母亲的帮助下做辣白菜自谋生路。谢义从没有钱到有钱，妻子从蛮横到体贴，谢义变了。金钱使他私欲膨胀，最后迫使母亲出走。黄浦江边，张母思绪万千，面对滚滚江水，她想得很多很多。',1,0,0,0,'',0,0.0,0,'吴培民','24集全',1499270864,1508319854,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18244','Y',0,0,NULL),(28690,49,'人民的名义 TV版','陆毅,柯蓝,张丰毅,','大陆',NULL,2017,862,'一位国家部