','H',0,0,NULL),(28694,49,'侯天明的梦',',柴碧云,吴佩柔,迟蓬,张喜前,','内地',NULL,2017,866,'该剧讲述了黔江农民侯天明在家乡和北京职场打拼的故事。',1,0,0,0,'',0,0.0,0,'梦继','40集全',1501604116,1508319857,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/20103','H',0,0,NULL),(28695,49,'妒忌',',黄奕,詹小楠,王志飞,徐秀林,孟广美,','内地',NULL,2000,867,'段大功和段大伟是一对品学兼优的好兄弟，但因家里贫穷，只能供一个孩子读大学，抓阄的结果是哥哥如愿以偿。于是，哥哥一帆风顺，毕业后作了服装设计师，弟弟却因帮哥哥凑学费而啷铛入狱。大伟误以为自己的被捕是哥哥设的局，八年来一直梗梗于怀。出狱这天，他拒绝回家，独自去闯天下。好在狱中时光并没有荒废，他结识了画家死囚，并学会了绘画。可正当他要崭露头角时，却被突然出现的老画家毕成扼断了前程。他以为又是哥哥暗中使坏，却不知这一切缘于老画家与死囚之间的一段恩怨往事。为了报复哥哥，更为了夺取自己曾失去的一切，大伟从此开始了和哥哥的较量。虽然大功一让再让，都不能使他罢手。结识了哥哥的女友芷烟后，大伟别有用心地向她展开了猛烈的追求。大功选择了疏远芷烟，默默离开，不料大伟却在一次次的接近中无法遏制地真心爱上了芷烟。无奈芷烟不肯接受他，大伟在事业和爱情都坠入低谷后，返回了家乡，却无意间听说自己并非母亲的亲生。一时情急，大伟深夜驾船独自驶向大海。',1,0,0,0,'',0,0.0,0,'赵青','21集全',1499244601,1508319857,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18168','D',0,0,NULL),(28696,49,'蓝色三环','古月,陈之辉,,','大陆',NULL,1998,868,'二十世纪四十年代中叶，中国历史上曾经有过一个极其短暂的特殊瞬间。 抗日战争胜利后，中国共产党和国民党在战争期间结成的抗日民族统一战线已不复存在。在美国的支持下，国民党军队大举进攻解放区，中国共产党领导下的军队和人民，坚决进行反对国民党军事进攻的自卫作战…… 面对中国全面内战即将爆发的严重局势，美国总统杜鲁门调整对华政策，派已经退休的前陆军参谋长马歇尔五星上将为总统特使，来华进行军事调停，成立了军事三人小组及其领导下的军事调处执行部。一时间，佩带蓝色三环标志的国，共，美三方人员活跃在各地，制止军事冲突，建立了和平民主。',1,0,0,0,'',0,0.0,0,'王保华','20集完',1495220708,1508319858,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4218','L',0,0,NULL),(28697,49,'空港塔台','刘威,李强,普超英,,','大陆',NULL,1998,869,'首都国际机场空中管制塔台。主任刘鸣飞和年轻的管制员们突遇飞机事故紧急迫降，他们临危不乱，从容指挥，化险为夷。',1,0,0,0,'',0,0.0,0,'陈燕民','16集完',1495220709,1508319858,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4219','K',0,0,NULL),(28698,49,'的士大劫案','陈太钟,王永旗,,','大陆',NULL,2002,870,'本剧是一部反映社会现实别无选择的刑侦记录片。',1,0,0,0,'',0,0.0,0,'栾戈平','12集完',1495220711,1508319858,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4220','D',0,0,NULL),(28699,49,'穿梭恋人第3季',NULL,NULL,NULL,2000,871,'《穿梭恋人第3季》是由彭大卫,龙冠武导演， 由应禹诚,郑丹丹,虞文涛等主演的内地电视剧，共12集，爱奇艺为你提供穿梭恋人第3季全集在线观看；穿梭恋人第3季剧情简介：笑宝离开后，杨梅回到回到梅氏，并改名为梅梅，快乐人生与星愿合并。一切似乎都