月独身','奚美娟,,','大陆',NULL,1995,972,'讲述一位日本新娘(安雯饰)的故事，真人真事改编，奚美娟在里边儿是演安雯丈夫的姐姐。安雯在里边刚刚结婚，中国老公就出差办事远走他乡了，最后一直到死都没有回来。',1,0,0,0,'',0,0.0,0,'彦小追','8集完',1495382857,1508319875,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4703','M',0,0,NULL),(28801,49,'承诺','金鑫,金梦,,','大陆',NULL,1995,973,'主要讲述了一个雨夜，一个男子在加班回家的路上被一个新婚前夕的卡车司机撞死，死者留下了年迈的母亲，体弱多病的妻子以及两个不更事的女孩。后经发现死去的男子主要死因是心脏病发作。但肇事司机毅然担负起照顾这一家的责任，在共同的生活中，双方相互谅解，而司机的女友只能无奈地与他分手。司机和那个死者的妻子以及女儿之间先后产生了情感及爱情故事。最终男主角并没有和两个女人中的任何一个结婚，故事以悲剧收场，一条铁轨延续到远方，一个简单的行李和一个孤单的背影消失在视线的尽头。',1,0,0,0,'',0,0.0,0,'黄蜀芹','30集完',1495382858,1508319875,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4704','C',0,0,NULL),(28802,49,'太极宗师之太极门','郑嘉颖,唐艺昕,林佑威,袁冰妍,白冰,应昊茗,黄文豪,何中华,邵美琪,邹廷威,郝泽嘉,,','大陆',NULL,2017,974,'民国时期，朱飘逸为完成父亲遗愿，在家门惨遭灭顶之时，逃到陈家沟太极门。一度产生自暴自弃念头的朱飘逸在梁普方及陈清源的开导下，开始在太极门学习太极拳。朱飘逸学成太极拳之后，为将龙头杖交给革命军，与亲人朋友一同到上海。在上海，朱飘逸一面推广太极拳，一面等候革命军消息。在杀父仇人张凌海的阴谋下，朱飘逸不得已去探寻龙头杖的秘密，最终在革命军的帮助下，完成了父亲的遗愿。回到上海之后，朱飘逸为了保护上海能够和平解放，与日本黑龙会展开斗争，最终直捣黑龙会，粉碎了日本人的野心。',1,0,0,0,'',0,0.0,0,'何澍培','更新至35集',1496044028,1508319875,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4708','T',0,0,NULL),(28803,49,'无言的旅程','王庆祥,沈慧芬,,','大陆',NULL,1996,975,'主要讲述了6位年轻人因为“无憾人生就试一次大挑战”这样一个校园活动而结识，并一起踏上了一段追梦旅程的故事。选角采取了网络海选的形式，颇为新颖。6位年轻人通过这部剧将华丽转身成为戏剧界将来的新星。',1,0,0,0,'',0,0.0,0,'林兵','4集完',1495382864,1508319875,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4709','W',0,0,NULL),(28804,49,'盛世华衣',NULL,'大陆',NULL,1996,976,NULL,1,0,0,0,'',0,0.0,0,NULL,'20集完',1495382866,1508319875,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4710','S',0,0,NULL),(28805,49,'学校的阶梯','广濑铃,神木隆之介,间宫祥太朗,健太郎,,铃木勇马,','日本',NULL,2017,977,'这是一部讲述毫无存在感的女高中生，在受班级中心组织的学生会长的欺负的同时，用言语的力量存活于学校的校园电视剧。女高中生春菜燕（广濑铃饰），本来是要看四周同学面色站于最低位置的学生，被逼做谁都没兴趣当的学生会长，这时她遇上被成为“魔法师”的传说中的演讲撰稿人雫井彗（神木隆之介饰），他为了在腐败的学校进行革命而把“演讲力量”传授给燕，让她慢慢爬上学校的阶梯到达顶峰。',1,0,0,0,'',0,0.0,0,'南云圣一','10集完',1495557492,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4712','X',0,0,NULL),(28806,49,'中国龙看大剧',NULL,'大陆',NULL,2017,978,'黑龙江卫视推出的一款特别节目，带您走进电视剧的台前幕后。',1,0,0,0,'',0,0.0,0,NULL,'2017-05-16期',1495382874,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4715','Z',0,0,NULL),(28807,49,'桃花灿烂',',王学兵,梁静,殷桃,王同辉,林好,','内地',NULL,2007,979,'70年代末的江南小城，小小的铁路装卸站，一段偶然的相遇，陈星与陆粞互生倾慕。机智善良相貌不凡的陆粞鹤立鸡群，连装卸站的头号美人水香都对他青睐有加。恢复高考后，陈星积极备考。然而家庭成份的阴霾却袭上陆粞的心头，让他不得不放弃了梦想，而选择站长留给他的晋升机会。陈星和陆粞之间第一次出现裂痕，陆粞也在失落中禁不住水香的诱惑，这让陈星更加失望，转而垂青身旁守侯已久的阳光男孩朱亦文。高考结果出来，陈星被一所名牌大学录取。陆粞只能默默伤怀。水香爱陆粞无果，赌气嫁给一个干部子弟。原本因此而出现转机的陆粞与陈星，却因为水香的弟弟大毛从中作梗，再次错过。陆粞为了前途，向上司沈可为妥协，迎娶了他那传闻性格不正常的妹妹——沈小妹。陈星伤心欲绝，在陆粞婚礼当晚酩酊大醉，与朱亦文发生了关系。敏感的沈小妹惶惶不可终日，故意告诉陈星她“怀上了”陆粞的孩子。陈星负气嫁给了朱亦文。朱亦文却在婚后露出了真正的面目，陈星生活在虚假的幸福和真实的痛苦之间，备受煎熬。沈小妹终于真的怀孕了，为了从陆粞心里永远赶走陈星，不惜挺着大肚子设计陷害陈星。陆粞气愤至极，医生却警告陆粞，小妹的身体状况已经不容许胎儿继续发育，否则将有生命危险。最终，沈小妹不顾众人劝阻，与胎儿双双死在手术台上。陆粞也由此成为沈可为报复的对象，顷刻间一无所有，生活又回到原点。水香的第二次婚姻也宣告失败。陆粞同情水香，与水香合伙搞起了孵化场，生意很快发展起来。陆粞终于发觉陈星的婚姻根本就是一个虚假的躯壳，为了保护自己心爱的女人，陆粞和朱亦文大打出手。朱亦文为了报复陆粞不择手段，陆粞却借此从朱亦文手中换取了陈星的自由。陆粞向陈星求婚，陈星留下了幸福的泪水。幸福来去匆匆，陆粞在好不容易与知心爱人打造美好生活的时候，却走到了生命的尽头——陆粞与陈星举办了简朴的婚礼后，微笑着离开人世。桃花灿烂的季节，陈星平安生下了一个酷似陆粞的男孩儿——“阳”。',1,0,0,0,'',0,0.0,0,'方刚亮','21集全',1505405941,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18161','T',0,0,NULL),(28808,49,'莲花岛',',牛犇,王馥丽,赵苏婷,夏宗佑,关亚军,','内地',NULL,2004,980,'本剧是首次将当代苏南农村的新貌搬上银屏的国内连续剧。它鲜活真实地再现了在改革开放进一步深化的新形势下，广大苏南农村的人民在当地党，政领导的带领下，披荆斩棘，群策群力逐步迈上一条持续全面发展道路的故事。',1,0,0,0,'',0,0.0,0,'张筠','21集全',1505405942,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18160','L',0,0,NULL),(28809,49,'千里难寻','刘欣,李霞,,','大陆',NULL,1994,981,NULL,1,0,0,0,'',0,0.0,0,'颜学恕','11集完',1495382878,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4718','Q',0,0,NULL),(28810,49,'家家有本难念的经','曹颖,刘金山,,','大陆',NULL,1996,982,'本剧是一部描写北京普通市民生活的，既有独立性而又有连续性的风俗喜剧。它的镜头无一不是对准了生活在现时代不同市民喜、怒、爱、乐和恩恩怨怨。',1,0,0,0,'',0,0.0,0,'陈燕民','28集完',1495382879,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4719','J',0,0,NULL),(28811,49,'第二条战线','洪剑涛,,','大陆',NULL,1996,983,'本剧中既有于伯阳,杜凤仪感情性上的纠葛催人泪下,又有杜凤仪被活埋而死的英勇壮烈。有罗亚春为了他人的幸福而坦诚表白心迹的感人至深了有郑介民,叶佑五等国民党要员的勾心斗角致一方于死地的。',1,0,0,0,'',0,0.0,0,'王保华','23集完',1495382881,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4720','D',0,0,NULL),(28812,49,'大秦腔','储智博,毛孩,郝岩,,','大陆',NULL,1997,984,'故事发生在中国陕西省，时间民国六年（公元1927年）死囚韩茂臣一声惊天地，泣鬼神的秦腔花脸绝唱，引出了三代人七十年纵横纠葛的人生故事。过路的军官为这一声绝唱怒劫法场，从鬼头大刀之下救出韩茂臣；新娘子改翠为这一声绝唱遭遇了一场传奇的婚恋；纯情善良的双池为这一声绝唱，不顾森严的封建礼教投入了戏子的怀抱；身世不清的儿子为这一声绝唱，持刀砍向九死一生的父亲；戏园老板更为这一声绝唱，抛家舍业苦渡人生。仇视秦腔的韩子生却又身不由己继承了秦腔，他像父亲一样走红西安城的大街小巷，心灵深处烙满了父亲遗留下的许多情债…',1,0,0,0,'',0,0.0,0,'于庚庚','33集完',1495382882,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4721','D',0,0,NULL),(28813,49,'士兵的故事','肖显鹏,李大光,,','大陆',NULL,2000,985,'本剧取材于伤残军人张学礼同志的部分真实事迹，此片献给每一个士兵，献给中国残疾同胞，献给为中国残疾人事业贡献爱心的每一个人。',1,0,0,0,'',0,0.0,0,'李晓军','7集完',1495382883,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4722','S',0,0,NULL),(28814,49,'金钱本色','何冰,蒋凯,赵倩,马捷,,','大陆',NULL,1997,986,'伟峰在少年时辍学到海南闯天下，历经多年的商海沉浮和奋斗，成为星辰集团的总裁，为扩大星辰集团的实力，他收买情报，查人隐私，使用各种手段挤垮竞争对手，还通过拳击比赛害死黄平，吞并其公司。为得到银行的信贷部主任兰心洁，布下金钱隐阱，夺得其芳心。计算机专家颜清明（黄平的弟弟）通过精心安排，被乌伟峰聘为星辰集团的财务总管，为他在竞争中出谋划策，但在关键时刻夺取了总裁之位。伟峰也因命案暴露而入狱……',1,0,0,0,'',0,0.0,0,'李晓军','21集完',1495382884,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4723','J',0,0,NULL),(28815,49,'一年又一年','许亚军,刘莉莉,刘威,,','大陆',NULL,1998,987,'故事通篇从百姓生活变化及凡人小事入手，在不经意的叙述中将中国二十年来的种种变化呈现在观众面前：平反昭雪、知青返城、恢复高考、下海经商、出国热潮、股市风云、下岗再就业等等，全剧再现二十年间百姓物质生活的迅速改善，和思想的种种变化，令观众如同穿梭时间隧道，再回首，不胜感慨。故事发生在1978年至1998年的改革开放二十年间。电影放映员陈福生一家与文革中蒙冤的领导干部林汉民一家是多年的领居，陈家的儿子陈焕与林家的女儿林平平从小青梅竹马，又一起上山下乡。77年恢复高考，陈焕考上师范大学，而一向争强好胜的林平平却因父样的政治问题被拒之学校门外。物换星移，林平平的父亲落实政策，重返领导岗位，林平平考上北京大学。陈焕与平平虽结百年，却情缘难续。一年又一年，陈家与林家在各自不同的社会层面上经历着二十年来社会巨变带给他们精神与物质的一次次冲击与洗礼。',1,0,0,0,'',0,0.0,0,'安战军','21集完',1495382886,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4724','Y',0,0,NULL),(28816,49,'夏季无风','刘小宁,周丽华,王志刚,,','大陆',NULL,2003,988,'本剧用一种表面看似不淡却暗流汹涌的原生态叙事手法讲述了一个县委书记在人生的一个短暂片段里所面对的困境。内地某国家级贫困县县委书纪赵长林在这个夏天遭遇了事业和人生的最大困境：市委要求县里精简干部，然而各方面的裙带关系却令他举步维艰；反倾销致使与县里签订购销合同的农民蒙受重大损失，纷纷登门闹事；女儿小云身染重病，似巨额的治疗费让全家难以负荷；儿子小海与社会上的不良少年混在一起，已经很久没有回家了……',1,0,0,0,'',0,0.0,0,'李利宏','20集完',1495382887,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4725','X',0,0,NULL),(28817,49,'人民的名义卫视版','陆毅,张丰毅,吴刚,许亚军,柯蓝,张志坚,胡静,张凯丽,,','大陆',NULL,2017,989,'一位国家部委的项目处长被人举报受贿千万，当最高人民检察院反贪总局侦查处处长侯亮平前来搜查时，看到的却是一位长相憨厚、衣着朴素的“老农民”在简陋破败的旧房里吃炸酱面。当这位腐败分子的面具被最终撕开的同时，与之案件牵连甚紧的H省京州市副市长丁义珍，却在一位神秘人物的暗中相助下，以反侦察手段逃脱法网，流亡海外。案件线索终定位于由京州光明湖项目引发的一家H省国企大风服装厂的股权争夺，牵连其中的各派政治势力却盘根错节，扑朔迷离。H省检察院反贪局长陈海在调查行动中遭遇离奇的车祸。为了完成当年同窗的未竟事业，精明干练的侯亮平临危受命，接任陈海未竟的事业。在H省政坛，以H省委副书记、政法委书记高育良为代表的“政法系”，以H省委常委、京州市委书记李达康为代表的“秘书帮”相争多年，不分轩轾。新任省委书记沙瑞金的到来，注定将打破这种政治的平衡局面，为H省的改革大业带来新的气息。',1,0,0,0,'',0,0.0,0,'李路','52集完',1495382889,1508319876,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4726','R',0,0,NULL),(28818,49,'人民的名义无尿点版','陆毅,张丰毅,吴刚,许亚军,柯蓝,张志坚,胡静,张凯丽,,','大陆',NULL,2017,990,'一位国家部委的项目处长被人举报受贿千万，当最高人民检察院反贪总局侦查处处长侯亮平前来搜查时，看到的却是一位长相憨厚、衣着朴素的“老农民”在简陋破败的旧房里吃炸酱面。当这位腐败分子的面具被最终撕开的同时，与之案件牵连甚紧的H省京州市副市长丁义珍，却在一位神秘人物的暗中相助下，以反侦察手段逃脱法网，流亡海外。案件线索终定位于由京州光明湖项目引发的一家H省国企大风服装厂的股权争夺，牵连其中的各派政治势力却盘根错节，扑朔迷离。H省检察院反贪局长陈海在调查行动中遭遇离奇的车祸。为了完成当年同窗的未竟事业，精明干练的侯亮平临危受命，接任陈海未竟的事业。在H省政坛，以H省委副书记、政法委书记高育良为代表的“政法系”，以H省委常委、京州市委书记李达康为代表的“秘书帮”相争多年，不分轩轾。新任省委书记沙瑞金的到来，注定将打破这种政治的平衡局面，为H省的改革大业带来新的气息。',1,0,0,0,'',0,0.0,0,'李路','55集完',1495382894,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4729','R',0,0,NULL),(28819,49,'少奇同志在武汉','郭法曾,,','大陆',NULL,1992,991,'少奇同志三部曲之一',1,0,0,0,'',0,0.0,0,'王保华','3集完',1495382895,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4730','S',0,0,NULL),(28820,49,'铁血军魂','章贺,李曼,,','大陆',NULL,2017,992,'“七七事变”后，毕业于日本陆军士官学校的前清贝勒瑞年返回天津参加抗战。天津抗战失利后，瑞年投入了国民党鲁西游击区冯竞先将军的麾下，也开始了和曾经被他拒婚的前清贵族小姐淑娟的恋情。在日军的进攻和内奸的破坏下，鲁西失守，冯竞先殉国，瑞年和淑娟几经周折，终于投身于八路军中。在经过了最初的不解、怀疑、甚至抵触后，瑞年渐渐认识到中国共产党的先进性和坚强的抗日决心，也认清了国民党顽固派的反动和腐朽，成长为一名光荣的共产主义战士和八路军高级指挥员；并在战场上，亲手击毙了卖国求荣的妹夫李海潮，战胜了昔日陆士的同学，强劲的对手日本侯爵近藤敏夫，为中华民族的正义之战，做出了自己的贡献。',1,0,0,0,'',0,0.0,0,'金霖','40集全',1498666290,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4732','T',0,0,NULL),(28821,49,'产科医鸿鸟','绫野刚,松冈茉优,吉田羊,星野源,,','日本',NULL,2017,993,'妇产科医师鸿鸟樱良（绫野刚饰）出生不久母亲便因难产去世，自幼在育幼院长大，陪伴他的只有钢琴。为了不让其他母子重演自己经历过的悲剧，更为了向所有新生婴儿说声“恭喜”，鸿鸟成为一个充满爱心的妇产科医生。鸿鸟在医院凭借冷静的判断力与体贴病患的心，努力帮助有各种不同问题的母亲。而脱下医师白袍后，鸿鸟便将所有感情寄托在琴声中，化身为昵称“BABY”的神秘天才钢琴家。拥有双重身分的鸿鸟，除了对生命诞生心怀感谢，更要为新生儿们编织光明的未来。',1,0,0,0,'',0,0.0,0,'土井裕泰','10集完',1495382899,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4733','C',0,0,NULL),(28822,49,'我是幸运儿','林申,吕一,鲍大志,李肖宁,宋珂欣,高郡伟,,','大陆',NULL,2017,994,'漫画家王小幸因为母亲王丽娜的一个失误，导致她成为了一场网络风波的主角，两次婚史接连被爆出。王小幸却在查幕后黑手的过程中擒获了一个暗恋自己长达十年的男人——丁学琪。这个单纯又深情的男人，让她又重新焕起了对婚姻对家庭的憧憬，鼓起了追逐爱情的勇气。但天不遂人愿，各种各样的麻烦随即接踵而来：丁学琪父母的百般阻挠、王小幸的受孕困难、两任前夫的轮番捣乱，让小两口措手不及。好在他们有足够的勇气和信心去争取自己的幸福，在生活的矛盾渐渐隐退之后，小两口的生活终于走上了正轨。虽然生活也会余下劫后的心惊，但是他们倍加珍惜来之不易的安宁，似乎这样的平静就是他们此生最大的愿景。',1,0,0,0,'',0,0.0,0,'刘国彤','37集完',1495382900,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4734','W',0,0,NULL),(28823,49,'密谍伙伴第2季','伊夫林·布洛初,杰克·拉斯基,沃伦·布朗,卡伦·普莱西,达斯汀·米利甘,休·狄伦,,','美国',NULL,2017,995,'根据真人真事改编，描述五个加拿大、美国和英国年轻人在二战期间前往安大略湖一个绝密训练基地接受间谍技能训练（包括破坏、暗杀、爆破、勒索、摩斯密码、地图学和招募年轻人投身抵抗运动的口才），他们随后被派到德军占领地区执行重要任务。联邦调查局和战略情报局（Office of Strategic Services）负责训练和监管这个团队。',1,0,0,0,'',0,0.0,0,'David Frazee','10集完',1495382901,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4735','M',0,0,NULL),(28824,49,'夜市人生','陈小艺,张晨光,刘亚津,馨子,徐立,黄梦莹,,张东东,','大陆',NULL,2017,996,'本剧讲述了夜市小贩魏红偶遇失散多年的前夫李庆祥，为其倾其所有但最终发现前夫在外早有妻女，孤立无援之际，对魏红暗恋已久的大志对其关怀备至。然而大志嫁给大款的前女友联合魏红前夫等人，对魏红展开了毁灭性的报复。大志带领小贩们奋起反抗，多番人生的波折，各种暗礁的埋伏，最终两人见证风雨之后的真情。剧情悬念转折不断，却又真实还原现实世界里普通百姓在遭遇生活“水逆”的过程中，或坚韧努力或迷失自我的百态人生。',1,0,0,0,'',0,0.0,0,'毛尉光','48集完',1495382902,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4736','Y',0,0,NULL),(28825,49,'和妈妈一起谈恋爱','阎学晶,张磊,刘丛丹,孙绍龙,林源,周韵茹,张岩,,','大陆',NULL,2017,997,'美丽善良的晨曦婚后获知自己因先天子宫畸形无法生育，婆家的偏见和对丈夫的愧疚让她主动放弃了婚姻。离异后晨曦没有再婚，而是收养了三个女儿唐果儿、方小菲、张天爱。虽然姓氏不同，母女之间的亲情更胜血脉。二十年后，唐果儿婚礼前夕，身患绝症的生母唐美珍出现，希望果儿原谅自己曾经犯的错，晨曦苦心促成母女相认，让果儿陪伴生母度过生命最后的时光。方小菲未婚夫的父亲竟然是晨曦20年来始终无法忘记的前夫吴东，为了小菲的幸福，晨曦选择彻底释怀过去。经历了太多人生的坎坷风雨，爱情终于眷顾了晨曦，然而这个叫张大哲的男人竟然是三女儿天爱的生父。得知真相的天爱无法接受大哲，大哲最终赢得晨曦的心，成为晨曦的第五任丈夫。面对不幸的人生，晨曦没有退缩，反而拾起了别人的不幸，努力绽放出属于自己的美丽幸福之花。',1,0,0,0,'',0,0.0,0,'白涛','44集完',1495382904,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4737','H',0,0,NULL),(28826,49,'犯罪心理：超越边界','加里·西尼斯,安娜·古恩,泰勒·詹姆斯·威廉姆,丹尼尔·海尼,,','美国',NULL,2017,998,'《犯罪心理：超越边界》为《犯罪心理》的衍生剧，主要围绕FBI探员如何帮助国外居住的美国公民解决问题而展开。每年有超过6800万美国人离开美国本土在全球各地活动，当危险来袭时，FBI联调局国际反应小组成员随时出动，帮他们解决遇到的各种问题。小组成员包括：队长杰克-加勒特，在FBI待了20年，刚刚被指派负责这个部门。特别顾问克拉拉-塞格尔，学识渊博，在杰克的请求下加入小组帮助他们破案。技术分析员蒙蒂，平常在总部工作，他对陷入困境的家庭以事无巨细的方式处理，协助队伍找到被遗留的线索，以及找到远在海外的真凶。马特-西蒙斯，不仅是一位在国外长大的军人还是一个居家好男人，喜欢探索和融入不同的文化，最重要的是他的侧写能力对整个团队致为关键。',1,0,0,0,'',0,0.0,0,'罗伯·拜利','12集完',1495382905,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4738','F',0,0,NULL),(28827,49,'热血尖兵','王紫逸,王笛,张宁江,宣言,方慧,,','大陆',NULL,2017,999,'一次重大反恐行动中，敌我激烈交锋，特战队员陆飞和司马战歌攻坚之际却发现恐怖分子中竟有昔日战友张小武，是该激动还是心痛？张小武无情地向陆飞连开数枪，可刺耳的枪响无法阻止陆飞的记忆回到那个明媚的夏天。<BR>那年，张小武还是个一切依赖母亲的“妈宝”，身为网络天才的他丝毫不知母亲将不久于人世的现实；看上去适应力极强的“农二代”司马战歌，背后则承担着巨大的经济压力；而陆飞自己还是个桀骜不驯的“富二代”，玩世不恭的背后是对自由的误解。三个性格迥异的年轻人带着不同的目的入伍，迈入了同一个军营，部队的锤炼让他们从针锋相对变成无间的战友，人生获得火红的涅槃。尤其在两次大规模现代智能型战争红蓝军对抗演习中，他们出奇制胜，通过网络战、斩首行动等以少胜多，屡次上演惊天逆转。<BR>可不久后张小武性格突变，一系列过激行为导致被部队除名，不知所踪。此次陆飞突破重重围剿，在反恐行动中重遇变身海盗的张小武，才明白这背后定另有隐情。但此刻，他们已命悬一线……<BR>',1,0,0,0,'',0,0.0,0,'熊早','28集全',1496249745,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4739','R',0,0,NULL),(28828,49,'江城警事','林申,杨烁,张佳宁,蒋小涵,魏积安,王璐瑶,方青卓,汤镇业,,','大陆',NULL,2017,1000,'主人公杨先长相平平，爱贫嘴，整天忙的是社区家长里短的琐屑小事，但他有使不完的热心劲，用不尽的小智慧。故事主要讲述杨先在解决一个接着一个问题时，他流露出的真性情，他怎么和像他一样普通的居民建立起鱼水关系一样的情义，以及他在情与法两难之间作出的抉择。故事中还提到一对企业家的生死之争，在围绕着资本和市场开展着激烈的相争的同时，他们又不失责任感的悲壮故事，同时，也讲述了几对年轻恋人，在各自的感情道路上，对生活、事业、爱情、婚姻的感受和领悟。这个故事，和大家身边发生或亲历的事情，没有多少区别，也许就是观众们自己的故事。',1,0,0,0,'',0,0.0,0,'刘光','32集完',1495382908,1508319877,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4740','J',0,0,NULL),(28829,49,'终级记忆',NULL,NULL,NULL,2000,1001,'《终级记忆》是由陈应歧导演，肖荣生,鲍蕾,杨童舒等主演的内地电视剧，共32集。爱奇艺在线观看《终级记忆》全集高清视频。剧情简介：讲述了25年前电影院一场大火的记忆虚幻又真实，将现今看似毫无关联的人和事紧紧联系在一起。',1,0,0,0,'',0,0.0,0,NULL,'共32集全',1500049482,1508319878,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18942','Z',0,0,NULL),(28830,49,'何所冬暖何所夏凉','贾乃亮,王子文,',NULL,NULL,2000,1002,'《何所冬暖何所夏凉》是由詹成霖导演，贾乃亮,王子文,陈晓东等主演的内地电视剧，共44集。爱奇艺在线观看《何所冬暖何所夏凉》全集高清视频。剧情简介：六年前，简安桀失手推倒怀孕的沈晴渝导致她流产。为了稳住简安桀的情绪，沈晴渝的外甥席郗辰打了她一巴掌。就是这一巴掌，打散了简安桀对整个简家的留恋。简安桀求助于初恋男友叶蔺无果后，心灰意冷之下，在法国开始了她六年的画地为牢。却隐约察觉到似乎总有一双眼睛正在偷偷地盯着自己。她却不知那双眼睛正是一直暗恋她的...',1,0,0,0,'',0,0.0,0,NULL,'共50集全',1507394933,1508319878,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/21674','H',0,0,NULL),(28831,49,'铁血莲花',NULL,NULL,NULL,2000,1003,'《铁血莲花》是由叶伟英导演， 由谢君豪,王璐瑶,秦岚等主演的内地电视剧，共36集，爱奇艺为你提供铁血莲花全集在线观看；铁血莲花剧情简介：该剧以澳门望厦村热血青年林伟良英勇无畏反抗殖民统治，义薄云天地击毙当时葡国殖民统治者澳门总督沙瓦德的...',1,0,0,0,'',0,0.0,0,NULL,'36集全',1498752507,1508319878,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4767','T',0,0,NULL),(28832,49,'假凤虚凰',NULL,NULL,NULL,2000,1004,'《假凤虚凰》是由何佳男导演， 由赵予熙,刘济恺,董子鸣等主演的内地电视剧，共12集，爱奇艺为你提供假凤虚凰全集在线观看；假凤虚凰剧情简介：大宣国太子叶清歌与北褚国公主苏域，出于结盟原因成为夫妻，在揭开对方不可告人的秘密后，这一对欢喜冤家就...',1,0,0,0,'',0,0.0,0,NULL,'共12集全',1498308348,1508319878,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4768','J',0,0,NULL),(28833,49,'三国客栈',NULL,NULL,NULL,2000,1005,'《三国客栈》是由宁小宇导演， 由穆乐恩,程六一,李浩闻等主演的内地电视剧，共15集，爱奇艺为你提供三国客栈全集在线观看；三国客栈剧情简介：山寨《三国大传》剧组来到某三国景区拍摄，饰演貂蝉的颜欣儿与董制片关系特殊，介绍自己前男友郭子嘉饰演张...',1,0,0,0,'',0,0.0,0,NULL,'共15集全',1495382926,1508319878,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/4769','S',0,0,NULL),(28834,49,'奇怪的搭档',',池昌旭,,,南志铉,,,崔泰俊,,,权娜拉,,,李德华,,,南纪爱,,,尹福仁,,,金弘波,,,金叡园,,,许俊硕,,,金亨奎,,,黄灿盛,,,洪锡天,,,李诗雅','韩国',NULL,2017,1006,'<span style=\"color:#111111;WIDOWS: 1; TEXT-TRANSFORM: none; BACKGROUND-COLOR: rgb(255,255,255); TEXT-INDENT: 0px; DISPLAY: inline !important; FONT: 12px/19px Helvetica, Arial, sans-serif; WHITE-SPACE: normal; FLOAT: none; LETTER-SPACING: normal; WORD-SPACING: 0px; -webkit-text-stroke-width: 0px\">卢智旭（池昌旭 饰）为了替父亲实现梦想而成为检察官，外貌与才华并存的他后因故转行成为律师。殷奉熙（南志铉 饰）是一名跆拳道少年国家代表出身的司法研修生。因一场神秘事件，殷奉熙意外成为了犯罪嫌疑人。为了找出真凶，现为律师的卢智旭和身为实习检察官的她便组起了“奇怪的搭档”。</span>',1,0,0,0,'',0,0.0,0,'朴善浩','第30集',1500272807,1508319896,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/19084','Q',0,0,NULL),(28835,49,'青城之恋',',邓萃雯,林保怡,乔振宇,修庆,炽龙,','内地',NULL,2005,1007,'二、三十年代，身为教授之女的梅兰(邓萃雯 饰)是青岛有名的美人，在众多的追求者中她选择了父亲的得意门生医学高材生赵振航(林保怡 饰)。婚后振航接手了父亲一手创办的医院，并和梅兰住进了位于海滨祖传的别墅。梅兰和振航育有一双儿女――雨桐(乔振宇 饰)和雨荷(刘佳 饰)，一家四口幸福地生活着。振航将全部的心思放在了医院上，梅兰则相夫教子。然而平静的生活却难以持久，一个偶然的机会令梅兰邂逅了赵氏医院的天才眼科医生谢维西(修庆 饰)。维西英俊的外表，健硕的身材和执着的爱恋在梅兰的心中激起了波澜。赵振航的医院专门救助那些穷苦的百姓们，他一生的愿望就是能让穷苦的病人也能得到及时的治疗，为此，他苦心经营着医院。他对人对事一向严苛有加、温情不足，但内心里却善良而真诚。由于他把精力几乎全放在了医院里，甚至在结婚纪念日里仍顾不上与妻子共进晚餐，梅兰便时常感到落寞无趣。于是，当热情浪漫的谢维西一而再再而三地邀约她时，梅兰的内心起了波澜。在谢维西那里，即便是小小的心愿，她也能得到满足。虽已为人母多年，但因从未涉世，梅兰仍是一位纯真善良柔弱的女人。与谢维西的来往令她感到些许的不安，于是她每次与谢维西出去，都会主动告诉赵振航。赵振航并不以为意，不仅完全信任妻子，有时还鼓励她出门多交些朋友，尽量开朗些。一天，谢维西又约她出去，说是要给她一个惊喜。梅兰忍不住好奇，跟他出门而去。临走时，把女儿雨荷托付给保姆张妈。张妈一时忙于家务，不留神间雨荷不见了。张妈急忙打电话让赵振航回家。赵振航放下公务跑回家中，和张妈一起四处寻觅雨荷的下落，却一直没有找到。晚上，当梅兰开心地回到家中时，方才知晓此事。她一时惊呆了。这时，电话响了，一名巡警在一个河滩边发现了雨荷的尸体。赵振航不愿相信，带着梅兰匆匆赶到了那里，才发现雨荷竟然是被人扼死的。看着赵振航怀里已然没有体温的女儿，梅兰当场晕了过去。此事既出，大家都来帮着料理起小荷的身后事，而梅兰因一时无法接受而住进了医院，接受精神疗养。而赵振航与梅兰共同的朋友舞蹈家贝天虹精心照顾着梅兰。警署很快便查出了雨荷遇难的真相：幼小的雨荷被一位名叫李炳雄的男子杀死在小河边。而李炳雄则是因为私人诊所破产、妻子难产而死陷入疯狂中的。李炳雄带着刚出生的女儿逃亡不久，遂自首，并在拘押室自杀身亡。赵振航压抑着巨大的悲痛继续回到医院工作。而他的文秘兼学生乌红莉看在眼里，默默地照顾着他。乌红莉的父亲原本是被赵振航无偿救助的一位临危病人，在临终前，他将乌红莉托付给了赵振航。赵振航教会乌红莉协助自己做一些日常性的事务性工作，同时慢慢地教导她的医术。在多年的相处中，乌红莉由敬生爱不由自主地爱上了赵振航。但她清楚自己的爱恋是不会有结果的，所以她一直默默地为他付出着，并苦苦钻研医术，以求能够更好地协助赵振航。为摆脱丧女之痛，赵振航与梅兰商量再生一个孩子。但残酷的现实却再次侵袭了他们：梅兰已无法再生育。这个消息令二人再次痛苦万分。赵振航多年的同窗好友高刚从烟台来拜访。闲谈中，赵振航得知高刚正在一家孤儿院做义工，于是他又心生一念：何不去领养一个孩子？但梅兰坚决不同意，在她心中，没有任何一个孩子能够替代死去的雨荷。赵振航只好作罢。梅兰怀着一种自责整日独自一人沉浸在痛苦中，无以自复。此时，谢维西又适时闯入，巧舌以簧地将梅兰心中的郁结一一打开。梅兰的心得到了细致的安抚。二人重新开始约会。但梅兰一直与谢维西保持着一定的距离，内心将他当作知心朋友。二人的交往频繁起来，终于令赵振航产生了疑虑。经过几次事件，误会产生。赵振航这才想到当时雨荷出事那天，梅兰也是因为与谢维西出去才导致了女儿的惨死。他的内心产生了怨恨。赵振航夜以继日地工作，以图消解丧女之痛。乌红莉此时萌生了一个强烈的愿望：为他一个女儿。但无论她如何去做，赵振航一直对其保持着长者的位势。乌红莉在痛苦中煎熬着。当她得知谢维西追求梅兰后，为了令赵振航不再受到伤害，她主动找到谢维西，表示了自己愿意与他交往的愿望，谢维西自然是惊喜万分，答应她不再去找梅兰。但没过几天，谢维西仍然我行我素继续追求梅兰。乌红莉无奈，只好找到梅兰，告知她谢维西只是一个浪荡的公子哥。梅兰方才明白，谢维西只是贪图自己的美貌，遂决心不再理睬谢维西，重新回归家庭。为了摆脱寂寞与伤痛，梅兰主动提出要领养一个孩子。而此时的赵振航却认为，梅兰这么做，是因为自己不能生育而想领养一个孩子后与谢维西私奔。他不知如何是好，刚巧在高刚就事的孤儿院里听说李炳雄的女儿就在这里。一个报复的念头由此而生。犹豫中，赵振航将那个女孩子收为养女。他企图用这种方式来报复梅兰与谢维西。梅兰毫不知情，欣喜地跑到烟台将幼小的孩子抱在怀中，为她取名雨阳。为了避人口舌，加之幼小的雨阳身体较弱，梅兰决定带着孩子留在烟台，等天暖之后再回青岛。被梅兰拒绝的谢维西此时才发现自己已经真正爱上了梅兰，遂百般打听，终于在回青岛的船上找到了梅兰。但梅兰不只拒绝了他的感情，也拒绝他的任何帮助。即便如此，谢维西仍苦苦纠缠。此情景正好被赵振航看到，从此在他心中埋下了深深的怨恨。此后，谢维西频频追求梅兰，却被梅兰严辞拒绝，并不再与之见面。这时赵振航才发现，梅兰并没有与谢维西私奔的念头。但虽如此，他仍然固执地认为如若没有谢维西的出现，梅兰是不会轻易抛下雨荷外出的。他深深地怨恨着梅兰，但言语中却从未表达。看着梅兰对雨阳无微不致的呵护，他冷笑着，但同时又痛苦着，因为幼小的雨阳每次看到他都会甜甜地笑出声来。',1,0,0,0,'',0,0.0,0,'李路','共30集全',1500049467,1508319898,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18171','Q',0,0,NULL),(28836,49,'《择天记》鹿晗cut',NULL,'中国大陆',NULL,2000,1008,'不恃优越天资而怠傲，不因求索艰辛而潦草；肩披星霜能逆势，顺达心意自逍遥。鹿晗主演的电视剧《择天记》月日即将登陆乐视视频。静待鹿晗精彩演绎长生传说！',1,0,0,0,'',0,0.0,0,'鹿晗','更新至52集/共50集',1496592613,1508319898,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15151','0',0,0,NULL),(28837,49,'择天记未删减版',NULL,'中国大陆',NULL,2000,1009,'太初元年，有神石从天而降，四散人间。传说得观神石碑文者可知天机。神石自此成为人间圣物，天下因此纷乱久矣。直至人族联合西域妖族，将魔族驱赶到极地草原，方始承平。少年陈长生身世神秘，在襁褓之中被师傅计道人从黄金巨龙口中救下，收为关门弟子。十数年里传授道书三千卷。然而陈长生体质特异，无法修行，命数活不过二十岁。十多岁的陈长生出师下山，要去周朝神都夺取大朝试的头名以得观神石，逆天改命。风从虎，云从龙。因缘际会与自身努力，陈长生抵挡住了种种势力的打压，迈过修行关隘，实力一日千里。也结识了少年天才唐三十六、妖族公主落落、妖族武将轩辕破这些挚友，在他们的帮助下，在强手如林的大朝试中拔得头筹。进入神石碑陵后，一夜观尽陵前碑，引得天象震动。然而一切却只是开始，随着天下