通各类武器的公孙四娘、“人版移动书库”上官紫苏、医学鬼才谭双叶。在接二连三的诡异案件中，调查组还原事实真相，破除坊间迷信。随着调查逐步深入，众人渐渐发现，有人妄想用卑劣的手段企图颠覆和谐的大唐。最终邪不胜正，调查组彻底击碎了恶势力的邪恶阴谋，少年们也除了那份不变的热血豪情之外，更多了一份坚定的守护家与国的责任之心。',1,0,0,0,'',0,0.0,0,'王骏晔','更新至48集',1497431446,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15032','R',0,0,NULL),(29037,49,'寻人大师',NULL,NULL,NULL,2000,1190,'《寻人大师》是由李泽露导演， 由胡耘豪,何花,钟镇涛等主演的内地电视剧，共12集，爱奇艺为你提供寻人大师全集在线观看；寻人大师剧情简介：由爱奇艺出品、上海海棠果影业 联合出品，“网剧一哥”白一骢 总编剧、新锐导演李泽露联手打造首部网生话题...',1,0,0,0,'',0,0.0,0,NULL,'共12集全',1498308298,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16458','X',0,0,NULL),(29038,49,'被催眠的催眠师',',杨玏,朱颜曼滋,杨奇鸣,何美璇,鲍鲲,','内地',NULL,2017,1191,'民国年间，图腾催眠创始人孟青松为将催眠术这门科学发扬光大，在天海市创建了图腾馆。图腾馆弟子孔目，在催眠领域造诣颇深，但却玩世不恭，一天正在街上做“试验”的他，偶遇勤奋努力却饱受歧视的热血女巡警宋奕，宋奕误将孔目当做流氓逮捕。恰在此时一宗命案发生,孔目阴差阳错被宋奕带到案发现场。众人束手无策时孔目一眼看破玄机，施展催眠术成功揪出凶手，也因此和宋奕结缘。孟青松闭关修炼多日，出关之时，孟青松的儿子，亦是图腾馆大弟子的孟海突然从日本归来。与此同时意外却发生了，孟青松突然昏倒，卧床不起，孟海通过诊断，发现孟青松中了极其难解的催眠术而陷入了昏迷。当时在场的只有孔目，所有矛头都指向了孔目。孟海自幼不喜孔目这个师弟，又不满父亲将自己喜欢的师妹夏曳许给了孔目，此刻借着父亲昏迷之事，找人追杀孔目。宋奕得到消息后赶去孔目的藏身地点，却发现孔目已悬梁自尽。',1,0,0,0,'',0,0.0,0,'谭嘉言','19集全',1496592172,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15057','B',0,0,NULL),(29039,49,'栀子花开',',杨肸子,范晓东,李晟,江若琳,彭宇,','内地',NULL,2017,1192,'白悠悠和于子恒是一对相恋四年的大学生情侣，毕业前夕，白悠悠当众向于子恒求婚，于子恒却当众提出分手。白悠悠无意间发现父母已达成协议，将在其大学毕业时办理离婚手续。经历男友背叛和父母欺骗的双重打击，白悠悠的人生跌入谷底，幸好身边有一直暗恋她的男闺蜜高尚陪伴。于子恒毕业实习，与心仪高尚的郑妮娜一起工作。胡侃侃和谢若琳同校四年毫无交集，却因为胡妈和谢爸的突然再婚变成了异姓兄妹。胡侃侃一边与从美国逃婚回国的宋唯纠缠不清，一边又与毫无血缘关系的妹妹谢若琳剪不断理还乱。经过种种困难挫折，白悠悠、于子恒有情人终成眷属，胡侃侃、宋唯也相约五年后美国再聚。本剧通过白悠悠、于子恒、胡侃侃、谢若琳等为代表的95后大学生不同的成长经历，描写当代大学生的梦想与奋斗，爱情与友情。',1,0,0,0,'',0,0.0,0,'沈婳',NULL,1496592173,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15058','0',0,0,NULL),(29040,49,'花自飘零',NULL,'中国大陆',NULL,2000,1193,'他们围绕着文潇雨、娱乐中心老板何伟和情妇文的中学同学陈丹莉，服务员世间冰美人林芳，演绎了市场经济的大潮中当代都市各色人等的心路历程，观念砥砺及命运交易，李海文爱上了林芳并生了个儿子，杨志鸣通过文潇雨的小学老师沈静知道自己是文潇雨的生父，而采取措施不让别的男人接近文潇雨，并采取种种手段对接近文的男人予以打击。罗晓明为了给文父治病不惜卖身一位富婆并拿到了订金，而文潇雨爱上了外表丑陋而内心善良的魏刚，但魏刚始终不接受文潇雨的爱。何伟破产了，陈丹莉吸毒赌博并出于嫉妒毁了文潇雨的容。',1,0,0,0,'',0,0.0,0,'郭郅','22集全',1499270886,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18245','H',0,0,NULL),(29041,49,'至亲血统 第二季',',凯尔·钱德勒,琳达·卡德里尼,茜茜·斯派塞克,本·门德尔森,约翰·雷吉扎莫,','美国',NULL,2017,1194,'Rayburn一家人正竭力掩盖他们的严重罪行。一些Danny过去认识的神秘人突然出现，带来了一个危险的阴谋。执法部门继续调查Danny的谋杀案，他们距离真相越来越近。妄想和不信任导致Rayburn一家人曾经团结和睦的家庭关系彻底破裂。谎言堆积如山，盟友遭到背叛，人际关系被毁，所有人都被逼入绝境。在绝望之中，好人也可能干出非常邪恶的事情。',1,0,0,0,'',0,0.0,0,'Daniel Zelman','10集全',1496592178,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15062','Z',0,0,NULL),(29042,49,'画心师 第一季',',祝绪丹,熊梓淇,鲍天琦,李俊辰,孙博豪,','内地',NULL,2017,1195,'画心师岑欢因遭逢变故来到苍城，被中医铺子的宁为玉和司马空空救下。三人来到陆宅，结识了大小姐陆小曼与卫道人士九思，最终五人一起踏上了化人执念、解人心忧之途。在经历了一系列展现了人世间亲情、爱情、友情的故事后，他们终于感悟出：人生在世，遵守本心才是正途，邪魔外道终究会被正义打败。岑欢与宁为玉等人的感情日渐深重，他们也慢慢发现，自己所处的世界竟然只是一个梦境，而罪魁祸首，竟然就是妖兽转世的宁为玉和司马空空二人。最终，为了让世间的人醒来，不沉沦于梦境之中，他们选择牺牲了自己，唤醒了这个世界。',1,0,0,0,'',0,0.0,0,'林健龙','20集全',1496678968,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15063','H',0,0,NULL),(29043,49,'致命武器 第一季',',达蒙·威亚斯,克莱恩·克劳福德,查尔斯·贝克,乔丹娜·布鲁斯特,斯普雷吉·格雷登,','美国',NULL,2017,1196,'本剧讲述了精神受困于失去妻儿的前海豹突击队，现德州警察的Martin Riggs与他的新拍档——刚过50岁生日的洛杉矶警探Murtaugh打击犯罪的故事。',1,0,0,0,'',0,0.0,0,'马修·米勒','更新至18集',1504362416,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15067','Z',0,0,NULL),(29044,49,'情事 第二季',',多米尼克·威斯特,露丝·威尔森,毛拉·蒂尔内,乔舒亚·杰克逊,','美国',NULL,2017,1197,'《情事》讲述了纳什和妻子海伦结婚多年，两人育有四个可爱活泼的孩子，长久以来婚姻十分幸福美满。纳什是一名教师和有抱负的小说家，他与妻子海伦有四个孩子，一家人平时生活在纽约，夏天的时候他们就来到岳父岳母家位于长岛海边的房子度假，纳什在这里构思自己正在创作的新小说。有一天，纳什一家人在长岛当地一个很受欢迎的餐厅就餐时，偶遇情绪低落的女服务员艾莉森。艾莉森的丈夫科尔是一位锋芒毕露的牛仔，经营着位于长岛东侧的一个濒临倒闭的农场，这个农场已经在他的家族中传了好几代。科尔为人有些鲁莽，夫妻二人经济状况也不佳，他与艾莉森的婚姻存在一些问题。本剧从不同的视角出发，独特的故事叙述方式加上精彩的剧情，让第二季收获了更高的评价。',1,0,0,0,'',0,0.0,0,'马克·米罗','12集全',1496592184,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15068','Q',0,0,NULL),(29045,49,'开荒岛民 第一季',',扎克·克雷格,玛丽安娜·宝拉·韦森特,瑞斯·达比,Jessica,Lowe,Brooke,Dillman,','美国',NULL,2017,1198,'该剧为荒岛求生题材单镜头喜剧，讲述一群人因飞机失事撞落到一个无人居住的荒岛上。荒岛上充满了各种危险，他们一方面排除危险，一方面寻求联系外界的方式，更重要的是，他们要改造荒岛，以适合自己居住。虽然岛上麻烦很多，但是，麻烦的来源更多的是自己造成的。',1,0,0,0,'',0,0.0,0,'詹姆斯·格里菲斯','10集全',1496592188,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15071','K',0,0,NULL),(29046,49,'思美人网络版',NULL,'中国大陆',NULL,2000,1199,'战国时期，群雄争锋。生于名门的天才少年屈原（马可饰），机缘巧合爱上了民间女奴莫愁女（张馨予饰）。然而，身处内忧外患、危机重重的楚国，二人虽相知相恋，却不能相守相依。为了冲破命运的桎梏，二人不畏门第之别，相爱相惜，在同恶霸与权贵的斗争中卷入了宫斗权争、家国情仇的漩涡。与此同时，身负宏才大略的屈原，一步步踏上了拯危救国、九死不悔的旅程。有心报国，无力回天，屈原终万念俱灰，痛沉于汩罗江；莫愁女则驾舟去远，从此荡舟江湖。',1,0,0,0,'',0,0.0,0,'张孝正','81集全',1497113690,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/14640','S',0,0,NULL),(29047,49,'总裁误宠替身甜妻',NULL,'中国大陆',NULL,2000,1200,'原本应该是最亲的双生姐妹，却在父母离异之后走上了不同的道路。姐姐变得腹黑冷血，为了达到目的不择手段，而妹妹善良单纯，一直照顾着重病的母亲金钱与权势的诱惑，一场看似玩笑的婚姻，将几个人的命运紧紧连在了一起。本想是为姐姐做一个简单的替身任务的妹妹，却没有想到，从此之后的生活再无宁日，来自亲人的一次次阴谋与逼迫，最终将她拉进了这个越来越大的阴谋漩涡之中',1,0,0,0,'',0,0.0,0,'侯杰','33集全',1497432428,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/14645','Z',0,0,NULL),(29048,49,'唐山大地震',NULL,'中国大陆',NULL,2000,1201,'唐山大地震，年月日，发生于中国唐山的里氏级大地震，造成人死亡；本片根据温州张翎的小说《余震》改编，描述年唐山地震中，一位母亲只能选择救姐弟之一。母亲最终选择救了弟弟，但姐姐却奇迹生还，后被解放军收养，年后家人意外重逢，心中的裂痕等待他们去修补的悲感情节，再一次勾起了当代人们对那一段惨痛灾难的回忆！',1,0,0,0,'',0,0.0,0,'姚晓峰','38集全',1496679164,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15247','T',0,0,NULL),(29049,49,'金太狼的幸福生活',NULL,'中国大陆',NULL,2000,1202,'剧中由王雷饰演的金亮是当下夹板男的一个缩影。不管矛盾再多，金亮始终和爱人小米携手，一一克服遇到的困难。这一角色会让很多和他一样的夹板男找到共鸣。而两家人变一家人的小两口和两个老人那种貌似平静却又激流暗涌的生活，加上几位老戏骨的传神幽默的演绎，也会让观众捧腹之余，学会勇敢直面问题和矛盾。',1,0,0,0,'',0,0.0,0,'余淳','40集全',1496073945,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/14654','J',0,0,NULL),(29050,49,'丑女无敌1DVD版',',刘晓虎,毛俊杰,王凯,张峰,','内地',NULL,2000,1203,NULL,1,0,0,0,'',0,0.0,0,'李欣汝','40 集全',1497284449,1508319948,1,'http:||zy.wlzhan.com|inc|api.php?ac@li