wd}/14658','J',0,0,NULL),(29067,49,'栀子花开2017',',杨肸子,范晓东,李晟,江若琳,彭宇,',NULL,NULL,2017,1192,'白悠悠和于子恒是一对相恋四年的大学生情侣，毕业前夕，白悠悠当众向于子恒求婚，于子恒却当众提出分手。白悠悠无意间发现父母已达成协议，将在其大学毕业时办理离婚手续。经历男友背叛和父母欺骗的双重打击，白悠悠的人生跌入谷底，幸好身边有一直暗恋她的男闺蜜高尚陪伴。于子恒毕业实习，与心仪高尚的郑妮娜一起工作。胡侃侃和谢若琳同校四年毫无交集，却因为胡妈和谢爸的突然再婚变成了异姓兄妹。胡侃侃一边与从美国逃婚回国的宋唯纠缠不清，一边又与毫无血缘关系的妹妹谢若琳剪不断理还乱。经过种种困难挫折，白悠悠、于子恒有情人终成眷属，胡侃侃、宋唯也相约五年后美国再聚。本剧通过白悠悠、于子恒、胡侃侃、谢若琳等为代表的95后大学生不同的成长经历，描写当代大学生的梦想与奋斗，爱情与友情。',1,0,0,0,'',0,0.0,0,'沈婳','16集全/免VIP',1499450166,1508319949,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15313','0',0,0,NULL),(29068,49,'鸡毛飞上天卫视版',NULL,'中国大陆',NULL,2000,1214,'陈江河跟着大伯陈金水四处闯荡，以鸡毛换糖建起鸡毛掸子厂，却被父亲拉回老家端起了铁饭碗，但之后因大伯力邀南下掌舵新开的袜厂而辞职，几年之后离开袜厂自立门户，开始了艰难的创业之路，创业期间与被自己曾救下的四川姑娘骆玉珠几经磨难终成夫妻。',1,0,0,0,'',0,0.0,0,'余丁','更新至58集/共40集',1496765270,1508319949,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15323','J',0,0,NULL),(29069,49,'丁丁小姐','成止微,韩依诺,金玲,张烨,吴边,','内地',NULL,2017,1215,'范晔、王聪聪、慕容复、句华本来是象牙塔里无忧无虑的高富帅，一夜之间他们变成了“她们”。性别的转换让“她们”无从适应，从花花公子变成了身无分文的柔弱女子，从无忧无虑陷入了生活的窘境。就在她们不知所措，在神秘人的指引下，她们穿越到了“宋城”这一平行空间。为了获得“包吃包住”的待遇，她们去报名参加了女团“树屋女孩”的选秀，阴差阳错的成为了的练习生。本以为生活会迎来一丝曙光，没想到“包吃包住”是要付出等价的辛勤与汗水。为了生存，四个“女孩”必须要和一群青春活力的女生同吃同住，有诱惑、也有尴尬、有友情、还有爱情，从而引出了各种爆笑囧事，同时“她们” 的情感也悄悄的发生了变化， “她们”还愿意变回去吗？',1,0,0,0,'',0,0.0,0,'胡扬','更新至11集',1496592101,1508319949,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15000','D',0,0,NULL),(29070,49,'热血长安全集','徐海乔,鞠婧祎,李鹤,张辛苑,刘冠麟,程小蒙,徐瑾','大陆',NULL,2017,1216,'<span style=\"color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; line-height: 24px; text-indent: 28px;\">公元626年，大唐都城长安内突然异象丛生，疑案四起，人心惶惶。大理寺成立调查组，调查这些看似怪力乱神的事件，成员囊括通晓伽罗术的萨摩多罗，“人版移动书库”上官紫苏，超强分析能力的大理寺少卿李郅，熟练的制造火药并操作连环火枪的黄三炮，精通各类武器的公孙四娘，医学鬼才仵作谭双叶。</span><br />',1,0,0,0,'',0,0.0,0,'王勇','全 48集',1497634167,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16494','R',0,0,NULL),(29071,49,'战争不相信眼泪',NULL,'中国大陆',NULL,2000,1217,'年春，一批红军女兵在强渡嘉陵江后与主力失散，误打误撞闯进了羊坝头地区战场。羊坝头的一场恶战，把失散的女子独立团尖刀班的女兵战士们和红军主力派来的护士班女兵们聚到了一起。为了减少不必要的伤亡，接到红军作战某部的杨团长命令，尖刀班和护士班一起护送伤员，北上寻找红军主力部队。从此一群年轻的女兵们将独自面对险恶环境、狡诈的敌人，开始了一段可歌可泣的长征！',1,0,0,0,'',0,0.0,0,'苏舟','33集全',1506096517,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15143','Z',0,0,NULL),(29072,49,'唐朝好男人',NULL,'中国大陆',NULL,2000,1218,'《唐朝好男人》改编自网络当红小说家多一半的同名小说，再现原著中屌丝男逆袭唐朝变黄金的爆笑崛起励志传奇人生。讲述了银行职员王子豪穿越到唐朝成为贵族，搞发明、做生意，同时坠入情网的故事。',1,0,0,0,'',0,0.0,0,'孙恺凯','40集全',1496592563,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15144','T',0,0,NULL),(29073,49,'艺术学院那些事儿',NULL,'中国大陆',NULL,2000,1219,'富农文艺屌丝付乾，历经艰辛，过关斩将，农文屌终于逆袭考上了全国最顶级的艺术天堂上中北艺术学院导演系，进校报道第一天，就遇上了文青造梦、巨款被劫、白天遇鬼、萝莉色诱等奇葩事件。百变戏痴校花刘圆媛，众男梦中女神凯如，性感尤物欧丽娅，金刚芭比阿奔等等一群神经病一样的顶级艺术生，让刚入校的付乾如同坐上了过山车，从艺术天堂掉到了人间地狱，发生了一系列高大上又接地气的青春正能量爆笑故事。',1,0,0,0,'',0,0.0,0,'洪彬','24集全',1506096551,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15146','Y',0,0,NULL),(29074,49,'封神英雄榜',NULL,'中国大陆',NULL,2000,1220,'姜子牙师从元始天尊，修道中和狐狸精、野鸡精误会冲突，二妖联合玉石琵琶精向女娲求救。女娲劝服她们忘却仇恨。子牙法力大增，师弟申公豹妒恨，骗去他的补天七彩石。时逢商纣无道，女娲发怒，要三妖听命于有补天五彩石之人灭商。',1,0,0,0,'',0,0.0,0,'王伟廷','50集全',1496679134,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15245','F',0,0,NULL),(29075,49,'独孤天下',',蓝志伟,胡冰卿,张丹峰,安以轩,徐正曦,李依晓,','内地',NULL,2017,1221,'南北朝乱世，各朝各代不断更替。北周一代贤臣独孤信因“独孤天下”的预言而倍受世间瞩目，他膝下育有三女，皆为绝代佳人，其中长女独孤般若一心想要成为未来的皇后，实现独孤天下的预言，为此不惜抛弃自己的爱情，嫁入北周皇室，但在成为天下最尊贵的女人后，她却因意外死于难产。独孤信受此事件影响，被政敌所害，为保全全家，不得不自杀身亡，独孤氏从此败落。</br>次女独孤曼陀贪慕富贵，不愿与未婚夫杨坚成婚，反而抢走了妹妹独孤伽罗的未婚夫，嫁给了唐国公，后来生下李渊成为大唐之母。而在风雨飘摇中最终接下守护独孤氏重任的幼女独孤伽罗，却凭着自己的聪慧和毅力，一直顽强地生活在乱世之中。她与杨坚的感情，也从一开始的政治婚姻，渐渐演变到后来的两心相知，伉俪情深的两人最终共同联手，统一了全国，成为了大隋的开国帝后。',1,0,0,0,'',0,0.0,0,'何澍培',NULL,1497630128,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16572','D',0,0,NULL),(29076,49,'刺客列传之龙血玄黄',',牛牛,查杰,朱戬,熊梓淇,陈雨成,薛翔匀,',NULL,NULL,2017,1222,'天下共主启昆被刺身亡，导致天下大乱，天璇、天枢、天玑和天权四国瓜分天下，后蛮族遖宿国入侵中垣，接连拿下天枢和天玑两国，遖宿士气大振，瑶光王子慕容离离开天权前往遖宿，怂恿遖宿举兵天璇，利用仲堃仪和天璇杀死遖宿王毓埥，成功扶植其弟毓骁上位，并在毓骁帮助下成功立郡。为平衡天下大势，仲堃仪派顾十安与门徒艮墨池前往天璇，辅佐陵光，慕容离眼见宿敌天璇国势渐兴，自我设计失踪，诱使天权和遖宿举兵天璇，天璇灭。慕容离复国，却遭仲堃仪算计，被迫和遖宿兵戎相见，遂向天权求援，天权助慕容离击退遖宿，却引发国之内乱，原天枢属国开阳野心更浮出水面，仲堃仪献计开阳王佐奕，执明心腹因慕容离惨死，执明和慕容离就此离心，兵戎相见。',1,0,0,0,'',0,0.0,0,'何澍培','30集全',1500568755,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16570','C',0,0,NULL),(29077,49,'楼外楼',',张铎,秦海璐,叶璇,','内地',NULL,2017,1223,'清道光二十八年，洪瑞堂在西湖桥畔创办了楼外楼。民国早年，洪家家道中落，楼外楼也被昔日好友肖翰干勾结军阀巧取豪夺。楼外楼第三代少东家洪顺森丢了祖业，轻生不成，远走他乡。迫于生计洪顺森进了丰裕楼做了伙计，深得老板高林贵的赏识，同时赢得了歌女春天的爱慕。天有不测风云，肖翰干不肯罢休，追杀洪顺森，高老板舍身相救，临终将女儿梅姑托付洪顺森。几经浩劫之后，妻子梅姑去世，洪顺森痛定思痛，与春天联手夺回楼外楼，并将其发扬光大。楼外楼虽名声远播，然生逢乱世，一波又一波的巨变让洪顺森的梦想遭受着考验。在经历了民国建立以及抗日战争的洗礼之后，楼外楼几经生死存活下来，而洪顺森的儿子也加入了中国共产党，投入到中国的解放事业中去。新中国成立之后，楼外楼更成为民族餐厅的骄傲',1,0,0,0,'',0,0.0,0,'苏舟',NULL,1497630126,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16571','L',0,0,NULL),(29078,49,'我女朋友的男朋友','白澍,蔡文静,李川,梁浩,于蓓蓓,陈锦昀','大陆',NULL,2017,1224,'<br /><span style=\"color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px;\">理工男阿宅，一个脑洞突破天际，但面对女神，秒变战五渣的宅男。无意间获得黑科技，按心仪对象，制定了属于自己的恋爱型机器人，夏娃阴差阳错间却被迫绑定“男友”机器人亚当。而这个颜好身材正，撩汉、生活技能双满级的“男友”，让阿宅又爱又恨，难以割舍。另一方面，夏娃因程序问题，性格在无助小白兔、暴力女武神、阴险腹黑女、圣母白莲花间切换，一时间鸡飞狗跳，上演了一系列相爱相杀的搞笑故事</span><br /><br /><div style=\"top: 0px;\"></div>',1,0,0,0,'',0,0.0,0,'张娜、方仿妨','16集全',1497113486,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16009','W',0,0,NULL),(29079,49,'乐次元影视会员之16年那点事儿',NULL,'中国大陆',NULL,2000,1225,'川普到底是怎么赢希拉里的？朴槿惠的猪队友是有多不靠谱？嘴炮的心灵鸡汤你还喝么？老司机要开车了！一起冲向吧！！',1,0,0,0,'',0,0.0,0,'冯小刚','6集全',1496592628,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15159','L',0,0,NULL),(29080,49,'乡村爱情7',NULL,'中国大陆',NULL,2000,1226,'《乡村爱情圆舞曲》将继续沿承诙谐、幽默、轻松、自然的轻喜剧特点，用真实、本色的表演讲述那些在象牙山村里发生的大事小情、家长里短、恩恩怨怨、是是非非。本剧将在原有成功的基本冲突和人物性格的基础上，继续讲述那些关于爱情，关于婚姻，关于事业的故事。',1,0,0,0,'',0,0.0,0,'赵本山','66集全',1496592632,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15161','X',0,0,NULL),(29081,49,'咱家',NULL,'中国大陆',NULL,2000,1227,'郭虎和兰馨的爱情从一开始就遭到家人的反对和仇人四毛的要挟。父母和兄弟姐妹恪守传统观众，不接受兰馨比郭虎年龄大且有过婚姻并带着个孩子现实，而郭虎和兰馨却又坚守爱的阵地。四毛为报私仇，千方百计想拆散一对有情人，并不惜制造恶性事件，导致兰馨成了植物人。经历了小妹摔伤腿的事故，艾红以欺骗方式嫁给郭虎的波折，以及父亲含恨离世的悲伤，兰馨也终于在郭虎爱的呼唤中苏醒。这对有情人终于得到家人的祝福。为了孩子，郭虎选择了放弃，却不料兰馨的失踪的前夫突然从国回来，兰馨的女儿悦悦突然发病，让他们又一次面临选择。',1,0,0,0,'',0,0.0,0,'汪锡宏','54集全',1496592633,1508319950,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15162','Z',0,0,NULL),(29082,49,'寂寞空庭春欲晚',',刘萌萌,王伟,郑龙,张芷溪,张彬彬,郑爽,刘恬汝,苏茂,阮伟旌,米雪,张晓晨,刘恺威,陈良平,徐少强,程砚秋,曹艳,王若心,杨明娜,祝绪丹,吴锦源,','内地',NULL,2000,1228,NULL,1,0,0,0,'',0,0.0,0,'斯琴高丽','37 集全',1496679034,1508319953,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15236','J',0,0,NULL),(29083,49,'相爱穿梭千年2 DVD版',',张籽沐,文咏珊,武艺,卫莱,张晓晨,李素欣,魏大勋,王德顺,郭雪芙,郑凯,孙祺龙,','内地',NULL,2000,1229,NULL,1,0,0,0,'',0,0.0,0,'张新成','28 集全',1496679044,1508319953,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15239','X',0,0,NULL),(29084,49,'中国造',NULL,NULL,NULL,2000,1230,'《中国造》是由马进导演， 由曹磊,刘雨涛,冯静等主演的内地电视剧，共20集，爱奇艺为你提供中国造全集在线观看；中国造剧情简介：该剧被称为励志版的青春偶像剧，反映了中国当代大学生的创业生活以及对社会的深刻思考。据该剧导演马进介绍...',1,0,0,0,'',0,0.0,0,NULL,'更新至19集',1505406050,1508319953,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/16350','Z',0,0,NULL),(29085,49,'爱的牵绊.2017','porshe_saran,peakpattarasaya','泰国',NULL,2000,1231,'<span style=\"font-family: 宋体; font-size: 14px; background-color: rgb(255, 222, 173);\">爱的牵绊2017新番泰剧由porshe_saran、peakpattarasaya主演新版爱的牵绊故事是根据七台女王Aump经典作品改编，泰剧爱的牵绊2017也可以叫霸道总裁的代孕小娇妻 。剧情讲述男主母亲为了抱孙子招聘代孕母亲，女主为了报复母亲去应聘代孕母亲，结果两人在小岛上日久生情。但是男主母亲只要孩子，女主生下孩子后被追杀。这段代孕之恋何去何从？</span><br />',1,0,0,0,'',0,0.0,0,'porshe_saran、peakpattarasaya','15全',1497024997,1508319954,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/15816','A',0,0,NULL),(29086,49,'脸谱',',邢岷山,陶慧敏,王玉璋,马昌钰,徐雷,','内地',NULL,2008,1232,'宁海市刑警支队队长徐雷，职业素质高，办案能力强，爱好手工雕刻，尤其爱好制作各式各样的人物脸谱，家里摆放着许多图腾脸谱，也有自己创造的艺术形象，形形色色，煞是生动。妻子高洁是警官大学老师，小俩口结婚刚刚三年，徐雷的父亲徐奉公已经退休在家，徐雷与家人，朋友过着简单而平静的生活。刑警队遇到一起杀人强奸案，看门人老北有重大嫌疑，但是警方并不能找到确切的老北犯罪证据。刑警队副队长何青在针对嫌疑人老北的审讯上有过激行为，为此徐雷和何青产生冲突。就在老北收押期间，宁海市又发生了一起类似的强奸杀人案，老北被释放，陆自立兄弟进入徐雷，何青视野，在不断跟踪调查后，陆自立有充分的作案动机，并且死者手中紧握的纽扣和陆自立身上完全相符。何青认定陆自立就是杀人凶手，徐雷虽觉不妥，但仍对陆自立实施了抓捕行动。然而陆自立在刑事诉讼法庭上告知他是先天性性无能，不可能作案，被排除嫌疑，案件的侦破工作陷入僵局。办案人员根据罪犯在现场遗留下来的蛛丝马迹推测作案人的身形，体貌特征，惊奇的发现其竟与队长徐雷十分吻合。',1,0,0,0,'',0,0.0,0,'张仲伟','20集全',1499875367,1508319954,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/18725','L',0,0,NULL),(29087,49,'大明王朝惊变录',',黄志忠,申军谊,归亚蕾,王庆祥,胡可,高虎,严宽,','中国大陆',NULL,2017,1233,'该剧以年土木堡之变为线索描写了民族英雄于谦力挽狂澜却最终落为权力斗争牺牲品的故事。',1,0,0,0,'',0,0.0,0,'黄克敏','40集全',1502036307,1508319955,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/20403','D',0,0,NULL),(29088,49,'吉祥天宝','赵丽颖,金起范,朱梓骁,陈昱霖,王喜,廖碧儿,元华,许明虎,王海祥,',NULL,NULL,2000,1234,'朱天宝原为建兴王爷幼子，因深受宠爱被长兄朱天祥嫉妒，在一次外出途中被朱天祥加害，后失去记忆被民女孟小蝶收留。在孟小蝶的帮助下成为名讼师，为民请愿，最后得见圣上。朱天宝在无意间发现朱天祥的巨大阴谋，揭穿朱天祥的阴谋后成为皇上功臣。但他却拒绝了高官厚禄，向皇上讨了九品王爷，逍遥于民间。        ',1,0,0,0,'',0,0.0,0,'元德','全40集',1498152123,1508319955,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17444','J',0,0,NULL),(29089,49,'六扇门','林峯,迪丽热巴,方中信,孙耀琦,应昊茗,郭芮溪,黄文豪,何中华,沈保平,李东恒,',NULL,NULL,2000,1235,'明朝中叶，老皇帝昏迷不醒，立储之事悬而未决，皇子和齐王觊觎皇位，明争暗斗，此时京城惊现连环杀人案，责成京师六扇门办理案件，六扇门统带申梓木本想和稀泥，却不想儿子申力行意外卷入案件当中，申梓木被迫带着申力行共同破案。申力行天赋异禀，很快破案，却也揭开了宫廷斗争的序幕。随着申力行调查的深入，案件牵扯越来越大，终于翻出了十多年前皇后犯下的一桩罪行，真相会影响皇位传承，也因为案件，申梓木被人暗害，申力行痛不欲生，却这时，皇帝病愈，齐王抓住机会将申力行破案的结果密奏皇上，龙颜大怒，皇子被软禁，齐王眼看即位，申力行突然发现背后隐藏着惊天的秘密。        ',1,0,0,0,'',0,0.0,0,'刘国辉','40集全',1498152123,1508319955,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17445','L',0,0,NULL),(29090,49,'超星星学园','肖战,王玉雯,白澍,伍嘉成,彭楚粤,徐晓璐,谷嘉诚,郭子凡,洪辰,赵磊,陈泽希,',NULL,NULL,2000,1236,'这是一个架空现实的平行世界，这个世界不看学历、金钱、年龄，一切以星座能力为最高标准。在这个世界里，处女座是最不受欢迎的星座，而狮子、天秤、巨蟹因为出众的能力而占据了社会的上流阶级。       一对正在备孕的夫妇，为了改善未来的生活条件，打算生一个天秤座的孩子，用天秤座超强的社交能力使整个家庭提升一个阶级，无奈妻子早产，生出了一个处女座的女孩，她从小便被各种排挤。突然有一天，女孩发现自身处女座超能力的觉醒，被“超星星学园”招收入学。可是，刚一入学，女孩便与这个世界最富有的财阀之子展开了一段奇妙关系......        ',1,0,0,0,'',0,0.0,0,'黄元达','全30集',1498152123,1508319955,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17446','C',0,0,NULL),(29091,49,'新白娘子传奇','赵雅芝,叶童,陈美琪,石乃文,乾德门,尹宝莲,江明,夏光莉,阮虔芷,',NULL,NULL,2000,1237,'白蛇素贞（赵雅芝 饰）还是一条没有什么法力的小蛇时曾被捕蛇老人所抓，幸得一小牧童相救。素贞心内发誓，一定要报答这份救命之恩。一千年以后，白蛇修成人身，往人间报恩时相遇青蛇小青（陈美琪 饰），将其驯服，以姊妹相称。得到菩萨明示之后，素贞前往杭州西湖找到了千年后的小牧童、此 时是一个药堂的学徒许仙（叶童 饰）。天上降下大方贤惠又漂亮的女子，自然是呆学生许仙所不曾妄想的。而巧用妙计的素贞让二人相识不久很快就结成秦晋之好。只是许仙耳根软弱，误听法海和尚谗言，用雄黄试出妻子真身，活活吓死。白素贞带着有孕之身飞西天盗仙草，更与天兵交手，救回许仙一命，却也直接导致小产的后果。许仙仍未懂得娘子深情，再次听信谗言的他用钵对准白娘子的时候，素贞再也无法逃脱，被压在雷锋塔下。要等他年儿子高中状元，才可盼望从中复出……        ',1,0,0,0,'',0,0.0,0,'夏祖辉','全50集',1498152123,1508319955,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17447','X',0,0,NULL),(29092,49,'三国','陈建斌,于和伟','大陆',NULL,2000,1238,'三国 本片根据中国古典四大名著之一《三国演义》改编。东汉末年，朝纲混乱。内有董卓巨奸权倾朝野，专横跋扈；外有黄巾军起义，撼动社稷。时有曹操韬光养晦，欲为国除害。几番征...',1,0,0,0,'',0,0.0,0,NULL,'全95集',1498152123,1508319955,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17448','S',0,0,NULL),(29093,49,'超级巨星','Push,Ramita,Mahapreukpong,Tao,Phiangphor,Gypso,Ramita,Mahapreukpong,Woonsen,Virithipa,Pakdeeprasong,Kittiphong,Tantichin',NULL,NULL,2000,1239,'Win pakorn（普提查·克瑟辛饰）曾是泰国超级巨星，但因Gay的传闻远离娱乐圈多年，后悄悄买房准备过新生活。Wannueng（Ramita Mahapreukpong饰）梦想成为明星，但父母把房子卖了逼她回国外居住，Wannueng任性回到原来的家，也就是Win的新家，Wannueng想尽办法和Win住在了一起。两人同住一个屋檐下，欢喜冤家狭路相逢，于是一段啼笑皆非的故事就此展开 。        ',1,0,0,0,'',0,0.0,0,'未知','全28集',1498152123,1508319955,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/17449','C',0,0,NULL),(29094,49,'真情告别',',胡兵,瞿颖,胡东,孔琳,保剑锋,','内地',NULL,2002,1240,'大学毕业生王文到《爱慕》杂志社应聘，成为杂志社的一名编辑。王文的上司顾安臣(胡兵 饰)，两年前丧妻，一直沉浸在自责之中。在工作中两人一直吵吵闹闹，各持己见。资深编辑周年进(胡东 饰)与妻子刚刚离婚。活泼、开朗的王文使他从阴郁的心情中解脱出来。他爱上了王文，王文也对他渐生好感。总编李桦(孔琳 饰)是个典型的女强人，但她逐渐被安臣不羁的气质所吸引，开始追求安臣，并与之发生了一夜情。安臣发现在王文不高兴时，自己总会有激烈的心跳，原来王文在两年前做换心手术时，使用的心脏正是安臣前妻临终时捐赠的。发现这个秘密后，两人很快堕入爱河。周年进和李桦同病相怜，两人合谋拆散安臣和王文，不惜使