想的弟弟却走上以命抗争的革命之路。',1,0,0,0,'',0,0.0,0,'王文杰','更新至34集',1503418395,1508319959,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/20039','B',0,0,NULL),(29117,49,'仙侠剑',',陈伟滔,蒋毅,徐申东,张晨光,汤镇业,包贝尔,刘庭羽,陆昱霖,陈威翰,田丽,高雄,徐少强,陈秀丽,','内地',NULL,2017,1260,'《仙侠剑》该剧讲述了神剑门后人宋声秋，闯荡江湖过程中，意外与青梅竹马的心上人何玉凤重逢，二人携手除暴安良，平定武林动乱。',1,0,0,0,'',0,0.0,0,'朱锐斌','46集全',1501344850,1508319959,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/19968','X',0,0,NULL),(29118,49,'青恋','郭京飞,车晓','大陆',NULL,2017,1263,'<span style=\"font-size:12px\">孙明亮、张乐观和吴可为是同村高中同学，性格不同家境迥异，却不妨碍彼此兄弟情谊，直到某日发生了一件意外三人从此渐行渐远。六年后，有着不同生活轨迹和经历的他们在家乡重逢。从父亲手中接班的孙明亮使尽招数关停了家族的污染企业，流转来土地，和张乐观、吴可为一起兴办生态农庄。其间有误会、有纷争的三个昔日小伙伴，在创业过程中冰释前嫌，孙明亮也收获了自己的爱情。最终，在新的村主任孙明亮带领下，家乡走上新农村生态致富之路。</span>',1,0,0,0,'',0,0.0,0,'马进','更新至13',1508890587,1508917949,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6477','Q',0,0,NULL),(29119,49,'轩辕剑之汉之云','张云龙,于朦胧,关晓彤,张佳宁','大陆',NULL,2017,1265,'<span style=\"font-size:12px\">远古黄帝战败群魔，战斗中震裂成两截的宝剑化为剑气。东汉末年，剑气又变为朝云和暮云。彼时，人间一对朝云、暮云兄弟诞生，却因战乱自幼失散。成年后，这对兄弟相逢在蜀魏交界之地，朝云是飞羽军勇士，暮云则是铜雀军勇士，双方各为其主互不知情。铜雀军将领淳于越暴虐无道，滥杀无辜，时常侵掠蜀地。飞羽军为保境安民，与铜雀军常有征战，朝云和暮云也在战场上刀兵相见。待朝云逐渐知晓真相后，努力在兄弟亲情的感召下救暮云于危难之中。朝云眼见战争导致民不聊生，痛心疾首，誓要还百姓安居之地，他们在部族少女耶亚希帮助下，历尽艰险，克服种种困难，找到了象征正义的黄帝剑及精神力量，坚定了心中战胜邪恶、保卫和平的信念。最终兄弟同心，联手打败暴虐的淳于越，飞羽铜雀化剑为犁，消弭了战火，保一方黎民平安。剑的传说，绵延永恒。</span>',1,0,0,0,'',0,0.0,0,'潘文杰,金沙','更新至50',1508905632,1508917949,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/3239','X',0,0,NULL),(29120,62,'非诚勿扰','孟非,黄菡,乐嘉,宁财神','大陆',NULL,2010,1266,'<span style=\"font-size:12px\">《非诚勿扰》是江苏卫视一档适应现代生活节奏的大型婚恋交友节目，为广大单身男女提供公开的婚恋交友平台，精良的节目制作和全新的婚恋交友模式得到观众和网友广泛关注。新节目的互动形式将完全突破过去传统的交友方式，完全体现新时代男女的婚恋观。节目中有24位单身女生以亮灯和灭灯方式来决定报名男嘉宾的去留，经过“爱之初体验”、“爱之再判断”、“爱之终决选”、“男生权利”等规则来决定男女嘉宾的速配成功。</span>',1,0,0,0,'',0,0.0,0,NULL,'20171021期',1508905970,1508917949,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/5182','F',0,0,NULL),(29121,65,'1922','托马斯·简,莫莉·帕克,尼尔·麦克唐纳,布莱恩·达西·詹姆斯','美国',NULL,2017,1267,'<span style=\"font-size:12px\">故事讲述了一个简单又骄傲的牧场主，为了经济利益和儿子一起谋杀了妻子。而在埋葬其尸体时，他发现自己被老鼠恐吓，并确信妻子并没有放过他！</span>',1,0,0,0,'',0,0.0,0,'扎克·希尔迪奇','BD1280高清中字',1508908434,1508917949,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6933','1',0,0,NULL),(29122,3,'赛车总动员3：极速挑战','欧文·威尔逊,克里斯黛拉·阿朗索,克里斯·库珀,内森·菲利安','美国',NULL,2017,1268,'<span style=\"font-size:12px\">讲述世界冠军闪电麦坤已成为当代车坛的传奇人物，曾五次夺得活塞杯冠军。但车坛风云突变，新车辈出，这让闪电麦坤的优势受到巨大威胁，更可怕的是，麦坤的自信也日渐瓦解。为了重返巅峰，闪电麦坤背水一战，但他对竞速的热爱，能为其回归之战注满能量吗？而除了麦坤外，影片中还有两位关键角色——酷姐拉米雷兹与黑风暴杰克逊。前者是一个阳光但严厉的赛车技师，将帮助麦坤重回巅峰；后者造型酷炫、速度奇快无比，是新一代赛车中的领跑者，也是麦坤最大的竞争对手。</span>',1,0,0,0,'',0,0.0,0,'布莱恩·菲','BD1280高清国语',1508908589,1508917949,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6709','S',0,0,NULL),(29123,65,'人皮脸','斯蒂芬·多尔夫,莉莉·泰勒,朱利安·科斯托夫,詹姆斯·布鲁尔','美国',NULL,2017,1269,'<span style=\"font-size:12px\">据外媒报道，由于档期冲突，莉莉·泰勒(哥本哈根电影节最佳女主角)将代替女演员安吉拉·贝蒂斯本加盟千禧年电影公司的《德州电锯杀人狂》前传电影《人皮脸》，并将在片中出演杀人狂“人皮脸”的母亲一角，此外斯蒂芬·多尔夫也将加盟该片。影片将会追溯到杀人狂的青少年时期，预计2017年上映。</span>',1,0,0,0,'',0,0.0,0,'亚历山大·布斯蒂罗,朱利安·莫利','BD1280高清中字',1508908639,1508917949,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6934','R',0,0,NULL),(29124,43,'昼行闪耀的流星','永野芽郁,三浦翔平,白滨亚岚,山本舞香','日本',NULL,2017,1270,'<span style=\"font-size:12px\">与谢野雀是在乡下长大的高中一年级学生。由于父亲去海外工作的缘故，她要去东京和谕吉叔叔一起生活了。上京第一天，她在去叔叔家的途中晕倒，恰巧被路过的狮子尾所救。在去叔叔家的路上，被狮子尾背著的小雀意外地发现狮子尾的脖子上有一颗痣，她不禁把这颗痣与记忆中曾引导迷路的年幼的自己的，那颗闪烁在白天中的星星重叠了起来。就这样，小雀新生活的第一天总算过去了。对接下来的新生活不禁有些期待的她，迎来了转校的第一天。不料却在学校里跟狮子尾重逢。还发现狮子尾竟然是老师，还是自己的班导。而邻座的男生马村对她的态度也十分奇怪，让她很在意。新的环境，新的邂逅，新的友情和恋情。那颗星星究竟是什么，时至今日已经分辨不出，那是梦境还是现实。</span>',1,0,0,0,'',0,0.0,0,'新城毅彦','BD1280高清中字',1508909331,1508917949,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6935','Z',0,0,NULL),(29125,44,'99号牢房内的博弈','詹妮弗·卡朋特,文斯·沃恩,汤姆·盖里,唐·约翰逊','美国',NULL,2017,1271,'<span style=\"font-size:12px\">A former boxer-turned-drug runner lands in a prison battleground after a deal gets deadly.</span>',1,0,0,0,'',0,0.0,0,'S·克雷格·扎勒','BD1280高清中字',1508909582,1508917949,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6936','9',0,0,NULL),(29126,44,'战狼2','吴京,弗兰克·格里罗,吴刚,张翰','大陆',NULL,2017,1272,'<span style=\"font-size:12px\">故事发生在非洲附近的大海上，主人公冷锋（吴京 饰）遭遇人生滑铁卢，被“开除军籍”，本想漂泊一生的他，正当他打算这么做的时候，一场突如其来的意外打破了他的计划，突然被卷入了一场非洲国家叛乱，本可以安全撤离，却因无法忘记曾经为军人的使命，孤身犯险冲回沦陷区，带领身陷屠杀中的同胞和难民，展开生死逃亡。随着斗争的持续，体内的狼性逐渐复苏，最终孤身闯入战乱区域，为同胞而战斗。</span>',1,0,0,0,'',0,0.0,0,'吴京','BD1280高清中字',1508916411,1508917951,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6845','Z',0,0,NULL),(29127,44,'洪荒宫斗之杀手为妃','童卓,,,王婉晨,,,李一','大陆',NULL,2000,1273,'唐朝某年，女杀手夏蝉从小接受着秘密组织的特训，而其目标就是进宫谋害皇上，秘密组织好趁机夺取政权，而夏蝉在秘密组织的精心安排下，以秀女的身份进宫，秘密组织在其进宫前给了其预设身份，也精心培养了她才艺和武功，并告诉她，宫中有个刘公公，是其内应。可是没想到，夏蝉进宫前，突然因为马车事故，头部被重创而失去了记忆。导致其脑力大减并忘记了一切，入宫后，当上了最低等的嫔妃，即：侧八品秀女。而她所有的记忆，只是宫人灌输了一些家室和背景。她俨然从一个帅气的女杀手变成了天真的傻白甜。&nbsp;<br />　　入宫后，眼见嫔妃侍寝后出来，用类似傅园慧接受采访时候的套路，在太监面前兴奋的说着自己此次侍寝的时长多么惊人，夏蝉一脸错愕，她不懂男女之事，又不喜争权夺利，故很难理解为何大家对皇上如此趋之若鹜。&nbsp;<br />　　后众秀女面见皇后，所有秀女都恨不得表现自己伶俐，用微表情分析皇后心态的、给皇后表演魔术的、在皇后面前跳钢管舞的等等，大家都想借机成为皇后面前的红人，好有机会接近皇上。只有失忆的夏蝉不言不语。不想事后，其他秀女全部被皇后以狗血的欲加之罪害死，只有傻乎乎的夏蝉活了下来。',1,0,0,0,'',0,0.0,0,'黄超','BD超清',1508917344,1508917951,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6937','H',0,0,NULL),(29128,66,'后宫太子妃',',王丽云,,,姚锐,,,刘占领,,,赵智芳,,,上官红叶','大陆',NULL,2000,1274,'天宝十五载（756），唐肃宗李亨即位，唐玄宗被尊称为太上皇，即位后前朝稳定，后宫子嗣单薄，皇太后命皇上选秀充实后宫，并选举女官充满6尚24司。小李子是皇上的贴身太监， 皇上命小李子也去负责选秀之事，在众秀女的争斗中，小李子无意间解救了一名被欺负的秀女蕊儿，蕊儿在秀女中假装懦弱被欺负实则是江湖组织烟雨阁的死士，进宫来是为了完成任务，蕊儿开始利用小李子成为嫔妃，刁蛮的永庆公主很喜欢和小李子玩，经常整小李子，令小李子本来不平静的日子更加不平静。蕊儿在和小李子朝夕相处的过程中产生了感情，不忍继续，一次次任务失败，组织知道了此事刺杀小李子，莫秀为救小李而死，紧接着又绑架了小李子以做要挟，蕊儿该如何抉择？&nbsp;<br />　　威严的皇上，高贵的皇后，刁蛮的公主，冷艳的刺客，贤淑的女官。',1,0,0,0,'',0,0.0,0,'姚锐','BD超清',1508917443,1508917951,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6938','H',0,0,NULL),(29129,43,'后青春之歌','何傲儿,,,李逸朗,,,蔡淇俊,,,霍柔心','大陆',NULL,2000,1275,'故事围绕四个即将步入青春末期的闺蜜，她们感情深厚却有着不同的价值观和人世观。在时代的驱动下她们爱慕虚荣，势利冷漠，随着一系列的事情相继发生让她们又是软弱不堪，互相猜疑。承受着爱情和事业的压力却还要面临着友情和亲情的考验。她们将要为余下的青春留下铭心的记忆。',1,0,0,0,'',0,0.0,0,'黄伟贤','BD超清',1508917527,1508917951,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6939','H',0,0,NULL),(29130,66,'狐闹干探','刘屹宸,,,颜圣婷,,,李紫菻,,,桑茗胜,,,杨森','大陆',NULL,2000,1276,'据《山海经》记载：青丘之山，有兽焉，其状如狐而九尾。自商帝辛之妃苏妲己后，九尾狐族血脉凋零，分九支隐世而居。为求进化九尾大能，后世传人偶有现世，必掀腥风血雨残杀世间。&nbsp;<br />　　民国初年，江南叶家古镇，首富叶家寿宴当日被灭满门，所有死者的尸体上都出现了神秘的黑紫色纹理。为了尽快平息此事镇长限期5日内必须破案，随着调查的深入，叶家灭门案真相逐渐浮出水面，原来真凶的目的竟然是想利用上古法阵修炼成九尾狐妖。危机下阿离被封印的记忆解开，原来她竟然是九尾狐纯血后裔，觉醒的阿离能否阻止曲南燕进化的阴谋……',1,0,0,0,'',0,0.0,0,'麦兜','BD超清',1508917617,1508917951,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6940','H',0,0,NULL),(29131,3,'壶说扒盗','大宽,,,大飞','大陆',NULL,2000,1277,'故事讲的是天津卫陈九爷以及一群像陈九爷一样侠肝义胆的天津人为保护国宝的故事。 国宝天鸡壶将要在地下拍卖的消息突然不胫而走，陈九爷派孙子陈天勤和李明等参加拍卖。日本商人哲藤一男为得到国宝也雇佣了刘大等人来参加拍卖。 拍卖中陈天勤设计将天鸡壶拍得。此举让哲藤一男等人非常恼怒。哲藤一男用计逼陈天勤盗壶。被逼无奈的陈天勤只得雇佣大宽大飞等人帮自己盗壶。 陈九爷担心宝物不安全，准备把宝物从家中转移走。获悉此事的陈天勤要求大宽大飞将宝物调包。 在调包过程中，大宽大飞等人却将国宝私自留下。日本人发觉上当后，派刘大等人绑架了陈天勤要陈九爷拿壶换人。陈九爷找到大宽大飞帮忙。 在约定的日子双方僵持关键时',1,0,0,0,'',0,0.0,0,'胡敬佩','BD超清',1508917696,1508917951,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6941','H',0,0,NULL),(29132,66,'虎朋狗友','晁坤,,,钱初九,,,张领领,,,金鹏真','大陆',NULL,2000,1278,'保安二虎二狗因小区盗窃案受到处分，两人认为女业主Rose是盗贼，为讨回被扣工资奖金，决定抓贼抓藏跟踪Rose。Rose是国际间谍头目，发现有人跟踪，遂下令杀人灭口，而二虎二狗却在枪口下神秘消失，Rose方觉对手非同一般，请来国际杀手，却阴差阳错地被二虎二狗一次次离奇逃脱。最终Rose一伙被抓获，二虎二狗对自己盲目的行为哭笑不得。',1,0,0,0,'',0,0.0,0,'一鱼','BD超清',1508917771,1508917951,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6942','H',0,0,NULL),(29133,43,'荒唐毕业季','林丹丹','大陆',NULL,2000,1279,'安雯、张萌萌、顾星文和晴子闺蜜团临近毕业在礼堂买醉，第二天，安雯、萌萌、晴子三人醒来发现身穿婚纱，唯独缺少死党星文，可谁都想不起来，昨晚到底发生了什么事，三人开始顺着线索回忆昨晚的荒唐行为，之后在寻找星文的途中被警察误认为珠宝店劫匪，发生一连串啼笑皆非的故事。',1,0,0,0,'',0,0.0,0,'罗乐','BD超清',1508917890,1508917951,1,'http:||www.33uudy.com|inc|seacmsapi.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/6943','H',0,0,NULL),(29134,49,'决对争锋','上白,,,高明,,,赵蕾,,,孙启恒,,,刘青','大陆',NULL,2017,1280,'商界精英顾青裴新官上任第一天，董事长就把自己管教不了的儿子原炀扔给了他。年轻气盛、嚣张跋扈的原炀烦透了顾青裴虚伪的精英面具，可碍于父亲原立江的压力，又不敢打他，这让原炀第一次体会到这世上还有拳头和钱解决不了的事情。原炀为了摆脱受制于人的生活，不断地给顾青裴制造麻烦。在顾青裴看来这些都是小打小闹，一一轻松化解。原炀请好友帮忙调查，终于掌握了顾青裴的把柄，两人之间的战争就此展开。明争暗斗的日子里，顾青裴渐渐变成了原炀亦师亦友的伙伴、并肩作战的兄弟。直到顾青裴遭到竞争对手的恶意打击，无奈辞职，原炀远走美国，两人不欢而散。两年后原炀学成回归，在经历了一系列的挫折和磨练之后，终于在顾青裴的帮助下初绽锋芒，成为了商界新锐，而顾青裴也在原炀的影响下，找到了新的人生方向。',1,0,0,0,'',0,0.0,0,'孙承志','15集全',1508861969,1508917955,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/41149','J',0,0,NULL),(29135,44,'树大招风','林家栋,任贤齐,陈小春,姜皓文,林雪,黄光亮','香港',NULL,2016,1281,'1997年初，卓子强、叶国欢、季正雄互不相识，却恰巧在同一家酒楼出现。此後，江湖上便风声四起：香港犯罪史上最恶名昭彰的三大贼王，正密谋合作，做一件惊天大案。<br />剧照海报<br />剧照海报(17张)<br />&nbsp;众人都以为他们要趁回归前，成就犯罪界的最後辉煌。殊不知，身为主角的三人却懵然不知。<br />　　卓子强刚刚绑架富豪的儿子，不动刀枪却成功勒索了数十亿的天价赎金，犯罪事业已臻顶峰。不断寻求挑战的他已难再突破，却无意中听见了传闻。本来只是一笑置之，却渐被这个想法吸引，为实现无中生有的惊天合作而不能自拔。想法慢慢变成痴迷，令他甘冒极大风险，也要把隐秘的叶国欢、季正雄找出来。<br />　　一幕警匪枪战，叶国欢凭籍强大火力压制警方包围，亡命天涯，震动全城。面对天罗地网的封杀，他只能另谋发财大计，走私水货电器。昔日八面威风，如今却要卑躬屈膝，拢络高官。生意财源滚滚，他却在不断压抑自己。风声传来，没多久便引爆了内心的嗔怒，毅然放弃一切，重拾枪杆，要与卓子强会合。<br />　　行事低调、小心谨慎是季正雄的屏障，作案规模虽然远不及其馀二人，但多次行劫警方对他仍是一无所知。小规模的行劫对他来说已是熟能生巧，风险甚微，但利润也不多。谣言传至，他虽知道三人合作利益必然丰厚，但起初仍克制自己，选择无视。可是贪欲已被勾起，一向极为谨慎的他也开始动摇。<br />　　子虚乌有的谣言，竟渐渐成真。表面上，彷佛是传闻令他们走在一起；然而，却更像是他们三人在各自的性格、欲望驱使下衍生的必然结局。树大招风，本已全城瞩目的三人渐行渐近，所谓的世纪合作，更似在引火烧身。',1,0,0,0,'',0,0.0,0,'许学文','BD1280高清国语|粤语中字版',1508865418,1508917955,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/41155','S',0,0,NULL),(29136,56,'完全娱乐','许孟哲JR,,,王仁甫,,,JR,,,王绍伟','台湾',NULL,2011,1282,'《完全娱乐》是台湾三立都会台的一档综艺节目，最High Speed的各类星闻及明星艺人专访，让你的八卦神经完全启动，绝不秀逗台港大陆三地劲爆红星，惊人内幕、大胆呈现，明星八卦，漏网星闻，世界性娱乐新闻、国际化独家采访，台前幕後，国内国外，让您绝对第一手了解最新最HITO的娱乐新闻。',1,0,0,0,'',0,0.0,0,'未知','20171022期',1508865477,1508917955,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40671','W',0,0,NULL),(29137,56,'娱乐百分百',NULL,'台湾',NULL,2017,1283,' 《娱乐百分百》是台湾八大综合台的一个娱乐新闻节目，是继TVBS-G《娱乐新闻》（Entertainment News）、三立都会台《完全娱乐》（Showbiz）之后开播的台湾第三个娱乐新闻节目，1997年开播，早期由蔡荣祖及何笃霖先后主持数个月，而后改由ASOS（徐熙媛、徐熙娣）接手，创下娱乐新闻节目双主持人的首例，现任主持人为罗志祥、小鬼，首播时间为每周一至周日晚间18:00至19:00，重播时间为隔天凌晨1:00、早上6:00、早上11:00。现时节目一星期通常有两天是现场直播，其他则以单元形式录影播出，星期日重播精选集。制作人为祝志杰。',1,0,0,0,'',0,0.0,0,NULL,'20171023期',1508865556,1508917955,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/12923','Y',0,0,NULL),(29138,56,'上班这党事','陈建州,,,徐薇','台湾',NULL,2011,1285,'《上班这党事》是台湾TVBS欢乐台的一档综艺节目，由黑人陈建州和徐薇共同主持。节目找上班族畅谈职场话题，令多角化投资、老板当上瘾的黑人有感而发：“主持让我学会聆听的艺术”。主持搭档徐薇擅长以夸张“脑筋急转弯”方式出题主持，常让录像来宾与黑人傻眼，不知如何接话，黑人甚至说：“这真是史上最考验我接话功力 的拍档。',1,0,0,0,'',0,0.0,0,NULL,'20171023期',1508865649,1508917955,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40232','S',0,0,NULL),(29139,66,'传销风云','卢江宇,吴蓓蓓,陶子','大陆',NULL,2017,1286,'林麟来到陌生的城市，见到武佳丽，然而他却发现，武佳丽并不是在所谓的三星上班，而是加入了一个叫无限连锁业的传销团伙。林麟计划连同女友一起带离，所以就住了下来，可是他发现，女友已经彻底沉迷上了传销，根本无法带走，而且传销分子正一步步收紧枷锁，想将他拘禁起来，陷入恐慌中的林麟终于在一次外出的机会中成功逃脱，并回到武佳丽家说明情况，并带着武佳丽的父亲返回，前往工商局报案。经过公安工商部门的联合执法，经历了重重困难，总算将武佳丽找到，然而沉迷于传销的她却不打算离开。最后武父和林麟只得强行将其带走。同时，公安工商部门加紧侦查，最终将传销份子头目一举抓获。',1,0,0,0,'',0,0.0,0,'吕培振','HD1280高清国语中字版',1508865697,1508917955,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/41153','C',0,0,NULL),(29140,51,'老表，毕业啦！粤语','郭晋安,蔡少芬,林欣彤,王祖蓝,蒋志光','香港',NULL,2017,1287,'　　《老表，毕业喇！》，香港电视广播有限公司拍摄制作的喜剧电视剧，此剧为《老表，你好嘢！》及《老表，你好hea！》的姊妹作，但故事以香港教育制度为背景，跟前作内容没有关联。由郭晋安及蔡少芬领衔主演，张继聪客串演出，监制黄伟声。',1,0,0,0,'',0,0.0,0,'黄伟声','更新到22集',1508865729,1508917955,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40196','L',0,0,NULL),(29141,55,'美妙天堂：偶像时间','茜屋日海夏,伊达朱里纱,大地叶,山田唯菜','日本',NULL,2017,1288,'《偶像时间Pripara》是根据龙之子X东宇A&amp;E公司联合出的电视动画《美妙天堂》的第4期作品。&nbsp;<br />　　电视动画第4期制作决定的消息于2016年1月18日公布。&nbsp;<br />　　第4期于2017年4月4日起每周二17：55在东京电视台首播。',1,0,0,0,'',0,0.0,0,'森胁真琴','更新到30集',1508865768,1508917955,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/33868','M',0,0,NULL),(29142,55,'黑色四叶草','梶原岳人,岛崎信长,诹访部顺一,优木加奈,福山润,室元气,村濑步,日野聪','日本',NULL,2017,1289