，以自己的性命与灵魂为赌注的战斗。 参加者是『子』『丑』『寅』『卯』『辰』『巳』『午』『未』『申』『酉』『戌』『亥』的十二位异样的战士们。 摘得这场战争的胜果的人，任何愿望都可以成真，但数额只有一个。 无论如何都想要成真的、那仅此一个的愿望—— 最后活下来的会是谁？在谋策与杀戮的战场漩涡之中，流下的是谁的泪水？ 震撼灵魂的盛大战斗，即将开战。',1,0,0,0,'',0,0.0,0,'细田直人','更新到04集',1508900839,1508917957,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40488','S',0,0,NULL),(29156,53,'处女情缘 第四季','吉娜·罗德里格兹','美国',NULL,2017,1305,NULL,1,0,0,0,'',0,0.0,0,'Gina Lamar','更新至01集',1508901095,1508917957,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/41159','C',0,0,NULL),(29157,66,'活着','葛优,巩俐,姜武,牛犇,郭涛,张璐,倪大红,肖聪,董飞,刘天池,董立范,黄宗洛,刘燕瑾,李连义,杨同顺','大陆',NULL,1994,1306,'根据余华同名小说改编。&nbsp;<br />　　富少福贵（葛优）嗜赌成性，妻子家珍（巩俐）屡劝无果后带着女儿凤霞离开了他，当夜，福贵输光所有家产气死父亲，被迫靠变卖母亲首饰租间破屋过活。一年后，家珍手拉凤霞怀抱刚出世的儿子有庆回到家中，福贵痛改前非，开始靠演皮影戏过起安份守己的日子。&nbsp;<br />　　但好景不常，内战时期，福贵被国民党抓去当劳工，一番辗转终回到家乡与一家人团圆后，凤霞因病变成哑巴，而在后来的大跃进运动和文化大革命中，他虽获某些小福，逆境却也一直与他如影相随。',1,0,0,0,'',0,0.0,0,'张艺谋','BD1280高清国语中字版',1508907985,1508917957,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/41160','H',0,0,NULL),(29158,55,'相亲对象是强硬问题儿学生','本泉莉奈,白井悠介,新垣樽助,青井美海,古河徹人,樱井真人','日本',NULL,2017,1307,'菜乃是受到学生崇拜的人气教师。但只有男学生宗二总会让她感到困扰。某天，她在熟人的介绍下去相亲。由于不成熟而在一开始充满不安的菜乃，逐渐敞开心扉，与相亲对象营造出不错的气氛。但，那个对象却是……竟然是变装了的宗二！虽然她断然拒绝了相亲，但宗二却以此为契机不分场合地展开攻势。认真的教师菜乃能够拒绝宗二的爱吗……？',1,0,0,0,'',0,0.0,0,'三浦三郎','更新到04集',1508908060,1508917957,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40449','X',0,0,NULL),(29159,44,'罪恶之城','罗莎里奥·唐森,伊利亚·伍德,玛丽娅·贝罗,布鲁斯·威利斯','美国',NULL,2005,1308,'讲述三个故事：Sin City，The Big Fat Kill和That Yellow Bastard。这三个故事都发生在一个虚构的城市——罪恶之城，而在这座城市中，主教大人、参议员、警察却正是罪恶的根源。故事由米基·洛克所扮演的丑陋的大块头Marv开始。他与漂亮女人歌迪发生了一夜情，歌迪的美貌与柔情令他有一种被救赎的感觉，并让他第一次感受到来自女人的“爱”。但当MARV半夜惊醒，却发现睡在身边的歌迪已经被杀。他却成警方追捕的对象。MARY为抓住杀死歌迪的真凶，展开了复仇之旅。',1,0,0,0,'',0,0.0,0,'罗伯特·罗德里格兹','BD1280高清中英双字版',1508909970,1508917957,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/8925','Z',0,0,NULL),(29160,44,'罪恶之城2','米基·洛克,杰西卡·阿尔芭,乔什·布洛林,约瑟夫·高登-莱维特,罗莎里奥·道森,布鲁斯·威利斯','美国',NULL,2014,1310,'德怀特（乔什·布洛林 Josh Brolin 饰）是一名身材强壮的私家侦探，某日，他接到了前妻爱娃（爱娃·格林 Eva Green 饰）打来的电话约其见面，曾经，爱娃背叛了德怀特，嫁给了富有的商人达米安（马尔顿·索克斯 Marton Csokas 饰），这成为了德怀特心中永恒的伤痛，而如今，许久了无音讯的爱娃再度找到德怀特，究竟欲意何为呢？&nbsp;<br />　　通过爱娃的叙述，德怀特得知她的生活并不美好，而一直紧紧跟随和监视着爱娃的司机马努特（丹尼斯·海斯伯特 Dennis Haysbert 饰）亦让爱娃显得更加楚楚可怜。忘记了曾经的伤痛，德怀特决定解救爱娃，他伙同曾经的好友马维（米基·洛克 Mickey Rourke 饰）一起前往达米安家，然而，等待着他们的却是爱娃亲手编织的重重陷阱。',1,0,0,0,'',0,0.0,0,'罗伯特·罗德里格兹,弗兰克·米勒','BD1280高清中英双字版',1508911430,1508917957,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/41161','Z',0,0,NULL),(29161,55,'激战奇轮3','内详','大陆',NULL,2017,1311,'奇轮星被自称是制造者的始源星族侵略了。为了拯救奇轮星，李小吉与前代的奇轮王结为搭档，他们与鸣日星、冷志释、武明、田丝丝、冷志傲以及各自的奇轮人搭档成为伙伴一同抵抗外敌。小吉与伙伴们对抗始源星族，收获了友情与梦想，强大了自己的意志，最终成功拯救奇轮星，并确立在宇宙中推广奇轮比赛，实现和平的梦想。',1,0,0,0,'',0,0.0,0,NULL,'更新到31集',1508915204,1508917957,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40190','J',0,0,NULL),(29162,49,'小五当官','文松,宋晓峰,杨树林,刘小光','大陆',NULL,2017,1312,'《小五当官》是一部具有乡土气息的民国喜剧，讲述的是北洋年间的“真假县长”的荒诞故事，很有点像“让子弹飞”的剧版故事。原本在大阳村崩爆米花的村民王小五，为人忠厚老实，但结婚多年膝下无子、经常被人取笑作弄，剽悍泼辣的妻子田大红经常寻找各种偏方让他服用，导致多次中毒，不堪忍受的王小五决定进城寻医问药圆自己生儿育女的梦，哪知进城途中被赴卧龙县上任的县长姜行进强行掳走，准备当作替死鬼，恰巧姜行进当天暴病而亡，王小五因此躲过一劫。但县长夫人刘会弟不愿失去即将到手的荣华富贵，又要偿还丈夫买官欠下的大笔饥荒债，威逼利诱王小五冒名顶替去当县长，而闹出一系列啼笑皆非的事件。&nbsp;<br />　　面对权力带来的种种好处，王小五一度迷失，贪生怕死，做了亏心事，枉法断案，害了百姓。后在田大红的修理下，良知回归，一步步走上了造福百姓的为官之路。置身险恶官场，小五以其天性中的单纯善良，再加上悍妻田大红的辅佐，一路惩恶扬善、以德报怨、逢凶化吉、遇难呈祥，竟然干出了一番轰轰烈烈的事业，成为了百姓爱戴的好官。',1,0,0,0,'',0,0.0,0,'苑立孔','更新到29集',1508916602,1508917957,1,'http:||www.zuidazy.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/40721','X',0,0,NULL),(29163,49,'特勤精英 TV版','张丹峰,李乃文,包贝尔,','大陆',NULL,2016,1313,'林毅怀揣着英雄梦来到了消防特勤队，成为一名光荣的消防员战士。在与队长郑志勇的不断冲突中，林毅慢慢融入特勤队这个大家庭，队员们也慢慢接受了他。大家不但看到了林毅在消防业务上表现出的过人才能，更看到了他的改变。在一次次的突发事件中，林毅和他的同伴们一起披荆斩棘，救人于危难，一步步实现着自己关于英雄的梦想。林毅不但在...</span><span class=\"intro-more hide\">简介：林毅怀揣着英雄梦来到了消防特勤队，成为一名光荣的消防员战士。在与队长郑志勇的不断冲突中，林毅慢慢融入特勤队这个大家庭，队员们也慢慢接受了他。大家不但看到了林毅在消防业务上表现出的过人才能，更看到了他的改变。在一次次的突发事件中，林毅和他的同伴们一起披荆斩棘，救人于危难，一步步实现着自己关于英雄的梦想。林毅不但在消防群体中实现了自己的梦