着的幸福。四个中学生在放学路上遭遇意外，路见不平，出手救助被流氓调戏的麦琼，失手毙杀香港黑帮头目“过江龙”，欲盖弥彰不得，各自寻找保全兄弟的办法，方家俊去投案，梁锦坤试图替罪，方家庆在逼供下铁嘴钢牙，但这一切均不奏效，仇家还是寻到了南珠里。方家庆被杀，悬尸巷口。悲愤万分的少年们决意复仇，梁锦坤首当其冲，在阁楼上对兄弟的临别赠言深深震动谢天慧，少女对从来瞧不上眼的梁锦坤从此多了一分在意。',1,0,0,0,'',0,0.0,0,'[徐耿]','共40集全',1508894908,1508917962,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22779','F',0,0,NULL),(29168,49,'只比永远少一天','王力可,肖聪,王子嘉,潘艺心,','内地',NULL,2005,1319,'刚从北京某大学建筑毕业的陈水明，被分配到海南建筑设计院。大学里热恋四年的女朋友周蜜却留在北京读研究生，二人整天以思念度日。因偶然机会，水明认识了湖南女孩范小米，二人慢慢产生了说不清的感情。周蜜感受到小米的威胁，决定中断读研，到海口发展。在无形的压力下，水明与周蜜成婚。水明、周蜜、小米与同学阿曾一起，在海口炒地皮，但因地产低潮，阿曾卷钱跑了，水明被抓，周蜜栽脏小米，救水明出牢一起返回北京，小米则被判入狱。年后，已是海南某大公司副总的小米，在北京找到水明，帮着设计她们公司的总部大厦。虽然周蜜一直提防着小米，可是为了丈夫的成功，周蜜还是同意他们合作，只是经常找老同学邵辉倾诉。小米故意在水明和周蜜夫妻俩之间制造矛盾。阴错阳差，周蜜与邵辉发生一夜情，并有孕在身。孩子出生后，周蜜与水明离婚了，而小米却跟大洪结了婚。周蜜因孩子得了颅内出血整日奔波治疗。邵辉为孩子治病挪用巨额公款，被判处死缓二年。水明一个人去了上海，寻找新的生活。新世纪来临，水明成为上海著名建筑设计师。一个叫蒂娜的建筑学院女毕业生，对水明一见钟情。不料水明见到蒂娜的父亲竟是大洪，而小米是她的继母……水明和小米深藏在内心多年的感情，将何去何从呢。',1,0,0,0,'',0,0.0,0,'[梦继]','共32集全',1508894932,1508917962,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22780','Z',0,0,NULL),(29169,49,'中天悬剑','连奕名,芦亚宁,徐百卉,周扬,王佳宁,曹馨月,','内地',NULL,2009,1320,'该剧根据历史真实人物原型改编，通过讲述了一位爱国抗日将领肖弋将军九年抗战艰苦卓绝的故事。鹿原会战肖弋率陕军49师做为诱饵，发现了侵华首恶、日军中村中将师团部国军战区长官翁上将，欣喜若狂一面飞报蒋介石以慰其心，一面严令肖弋缠住中村等待战区主力合围试图创造第二个台儿庄辉煌。',1,0,0,0,'',0,0.0,0,'[连奕名]','共32集全',1508894955,1508917962,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22781','Z',0,0,NULL),(29170,49,'搜狐视频电视剧每周点评','马伊琍,朱亚文,杨志刚,','内地',NULL,2015,1321,'搜狐视频电视剧每周点评',1,0,0,0,'',0,0.0,0,'[郭靖宇','更新至93集',1508894998,1508917962,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/20914','S',0,0,NULL),(29171,49,'那片星空那片海2 DVD版',',冯绍峰,郭碧婷,黄宗泽,王阳明,刘恩佑,刘萌萌,','内地',NULL,2017,1322,'该剧延续第一季鲛人与人类之间的线索，以繁华盛唐时期恢弘大气的航海史诗为背景，讲述一个出身造船世家的平凡女孩和鲛人王子之间真挚动人的爱情故事。',1,0,0,0,'',0,0.0,0,'卫翰韬','更新到26集',1508895208,1508917962,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22165','N',0,0,NULL),(29172,49,'特勤精英 DVD版','张丹峰,李乃文