剧主要讲述了一个大家庭和三个小家庭的三代人在城市郊区幸福小楼里发生的现代都市生活故事。',1,0,0,0,'',0,0.0,0,'贾一平','30集全',1508895520,1508917962,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22799','X',0,0,NULL),(29189,49,'金牌红娘','徐璐,韩承羽,李帅,井凌潇,','内地',NULL,2017,1340,'本剧为芒果TV首部自制古装喜剧，讲述知府家的白富美金玲珑离家出走后当了媒人，随后与李悦琛以及林牧牧合伙经营起一家“红娘馆”，为广大剩男剩女牵线搭桥的故事。',1,0,0,0,'',0,0.0,0,'林育塘','20集全',1508895556,1508917962,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22800','J',0,0,NULL),(29190,49,'二婶','黄曼,王骏毅,斯琴高娃,李东霖,杨树田,唐沸潮,王纯,赵小天,张筝,葛秋谷,','内地',NULL,2017,1341,'该剧以女性视角为主，讲述了现实社会中平凡女性叶巧，在遭遇生活的重重磨难之际，展开关于亲情、爱情，甚至是人性的保卫战，上演了一幕幕荡气回肠的女性励志传奇。',1,0,0,0,'',0,0.0,0,'汪锡宏','38集全',1508895590,1508917962,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22801','E',0,0,NULL),(29191,49,'利箭纵横','于震,王力可,王若麟,管羽,张振华,赵达,左腾云,','内地',NULL,2017,1342,'《利箭纵横》是2013年初收视黑马《利箭行动》的续篇，被誉为中国版“敢死队”！主要讲述了李剑带领的利箭特战队作为先遣部队，执行代号为“纵横”的特别任务，挺进保卫金山城。',1,0,0,0,'',0,0.0,0,'王飞','43集全',1508895616,1508917962,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22802','L',0,0,NULL),(29192,49,'国民大生活 DVD版',NULL,NULL,NULL,2017,1343,NULL,1,0,0,0,'',0,0.0,0,NULL,'更新至30集/共40集',1508895696,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22253','G',0,0,NULL),(29193,49,'硬骨头','吴其江,王强,李梅可,褚峰,郭东文,葛玟希,王奕盛,王俊彭,周建鹏,','中国大陆',NULL,2016,1233,NULL,1,0,0,0,'',0,0.0,0,'马跃千','43集全',1508895730,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22803','Y',0,0,NULL),(29194,49,'到爱的距离','李晨,靳东,崔心心,李佳,潘虹,高鑫,张馨予,高姝瑶,张棪琰,季肖冰,宁文彤,王一楠,孙梦佳,齐俊盛,任洛敏,张天舒,杨璇姿,王志鹏,穆怀磊,姚鑫,谢钢,啜二勇,岳旸,张华,王新华,张莉莎,吴健,尹东军,朱子墨,尹馨梓,乔欣,赵吉,','中国大陆',NULL,2013,1233,'\n　　李睿（李晨饰）是外科医生中的青年才俊，他为人刚正执拗，不甘向当下流行的“潜规则”低头。院长凌远（靳东饰）是肝胆科专家，他坚持医患关系就是提供服务与购买服务的关系，坚决反对医生向病人投入不必要的热情。普外科医生郁宁馨（崔心心饰）是某大型医疗器械公司老板的千金，她到医院工作是因其父亲与医院的利害关系走了后门，被院长网开一面安排的，李睿身体力行影响着她，使她逐步认清什么才是医生真正的品行。妇产科主任廖克难（潘虹饰）几十年秉承治病救人理念，但当今的医患关系早已发生了改变，她沦为不识时务的牺牲品......\n',1,0,0,0,'',0,0.0,0,'简川訸','40集全',1508895754,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22804','D',0,0,NULL),(29195,49,'无贼','张国强,殷桃,孙海英,贾青,曹炳琨,许娣,张博,','中国大陆',NULL,2013,1233,'\n　　2002年，资深老贼段虎（张国强饰）的贼老婆乔安娜（殷桃饰）已怀有六个月身孕，但是一次盗窃将夫妻二人双双送入警察局。观音桥派出所所长向前进（孙海英饰）负责此案，他一面秉公执法，一面和徒弟周术术费尽心思保证安娜和她肚子里孩子的安全。孩子平安降生，前进为他起名段益，希望孩子将来能有益于人民。贼公贼婆锒铛入狱，但段益成为向家难以割舍的存在。时间一晃而过，段益（崔璨饰）进入小学，乔安娜和段虎也先后出狱。他们不仅要思索该如后走出改过自新的人生，更要考虑如何与他们的亲生骨肉相认相处。\n\n　　虽然穿着警服，但法不诛心，向前进前前后后、殚精竭虑为这个特殊的家庭谋划，只为他们拥有幸福无悔的人生……\n',1,0,0,0,'',0,0.0,0,'丁黑','48集全',1508895779,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22805','W',0,0,NULL),(29196,49,'老家门口唱大戏','范伟,闫学晶,白恩,吴紫彤,李静,刘永生,吴紫彤,','中国大陆',NULL,2013,1233,'\n　　纯洁美丽的女孩邵颖（吴紫彤饰）听从父辈的建议，大学毕业后回到爷爷所在的大阳山村当村官，在此认识了脑瓜机敏、胸怀大志的青年农民徐凤国（白恩饰）。在组建评剧团和尝试养牛新技术的过程中，两个年轻人各逞其能，尤其是凤国的新技术更带领村民们迈上了新的阶梯。在代理村长韩国梁（景松涛饰）、养牛大户孙大明白（范伟饰）、四舅妈（闫学晶饰）、暗恋凤国的韩艳玲（许诺饰）等人的环绕下，大阳山村的百姓生活变得愈加丰富多彩。\n\n　　伴随着大戏的锣鼓喧鸣，男女老少们携手朝着各自的幸福生活迈进……\n',1,0,0,0,'',0,0.0,0,'王硕','40集全',1508895802,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22806','L',0,0,NULL),(29197,49,'风雷动','涂松岩,王雷,陈丽娜,徐露,程煜,刘欢,石兆琪,马苏,','中国大陆',NULL,2013,1233,'\n　　20世纪30年代，狼子野心的日本其实力逐渐渗透到内地，暗中进行着他们不可告人的计划。日本驻哈尔滨生化武器研究小组在黑龙会的监督授意下秘密进行生化武器的研究，但其中一名感染鼠疫的研究员私下逃跑。他在被黑龙会追杀过程中被驻哈守备旅的军医冷风（王雷饰）救下，但此人最终被特务杀害。鼠疫事件宛如一枚炸弹，令各方势力大受触动，甚至连境外的苏联也派出特工潜入哈尔滨。局势愈加紧张，日本人丧心病狂试图湮灭一切证据，而身处漩涡中央的冷风无疑成为他们最为切齿的对象。\n\n　　战争年代，民族危亡的关键时刻，不同的人以各自的行动做出了不同的选择……\n',1,0,0,0,'',0,0.0,0,'姜凯阳','34集全',1508895827,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22807','F',0,0,NULL),(29198,49,'女人的抗战','温峥嵘,陈昊,高明,曾黎,','中国大陆',NULL,2014,1233,'\n　　又名《雪蚕》，该剧由温峥嵘、陈昊、曾黎领衔主演的谍战情感大戏，故事纵横交错，既有缜密的故事情节，又有错综复杂的家庭关系，打破了已往谍战剧的风格。虽然该剧还没有播出，但是这部电视剧在四川电视节的销售量获得第一名，主题曲《陪月亮不孤单》已经在网络上十分流行，必将掀起谍战剧新风潮，将于中央台的黄金时间段播出。\n',1,0,0,0,'',0,0.0,0,'彭景泉','35集全',1508895852,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22808','N',0,0,NULL),(29199,49,'我和我的传奇奶奶','宁静,罗晋,芦芳生,洪悦,杨静,范明,李杨,池源,张永健,杜金京,王梁双全,马京,赵钢,','中国大陆',NULL,2013,1233,'\n　　故事开始于二十世纪20年代的陕南地区。胡家村村民因不满官府苛捐杂税、横征暴敛，与官府发生冲突，遭官兵追杀，全村老少被迫逃到豫西山区狗娃山，自立山寨为伙。大家一致推举大黑骡（范明饰）为大当家，女当家被尊称为山寨的“奶奶”（宁静饰）。逃亡途中奶奶捡到一名将要饿死的男孩，为好养活遂起名狗娃（罗晋饰）。数年后狗娃长大成人，时逢当地遭百年不遇的大旱，张家堡农民因交不起地租遭恶霸吃人贼（李耕饰）血洗，奶奶率山寨一干人马驰援张家堡。吃人贼之子李冬青（芦芳生饰）留日归来，继承恶父衣钵，率保安团围剿狗娃山，大当家殒命。狗娃义愤填膺，率众五战五捷，直至抗日战争爆发，和奶奶一起投入到民族解放战争的洪流之中......\n',1,0,0,0,'',0,0.0,0,'陶秋普','40集全',1508895877,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22809','W',0,0,NULL),(29200,49,'暗花','刘青云,梁朝伟,邵美琪,王天林,卢海鹏,郑浩南,林雪,龙方,','香港',NULL,1998,1233,'\n　　澳门两大黑帮洪兴帮和义英帮为争夺赌场利益火并数月后决定言和，不想这时江湖上传出洪兴帮老大崩牙华已出五百万高价聘请外来杀手，准备不日刺杀义英帮大哥高佬忠。为保证高佬忠的安全以免天下再次大乱，崩牙华派出手下得力干将也是腐败警察的阿深（梁朝伟）去阻止事情发生。\n\n　　光头杀手耀东（刘青云）和神秘女子阿凤（邵美琪）常在阿深左右出没，不断给他制造麻烦。原来，耀东是黑帮幕后老大洪先生派来的粉碎洪兴帮和义英帮的超级杀手，他的杀人手段十分精妙狠绝。经过一番安排，耀东制造出崩牙华与高佬忠均死于阿深手中的局面，然而他的命运亦不掌控在自己手中。\n',1,0,0,0,'',0,0.0,0,'游达志','36集全',1508895904,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22810','A',0,0,NULL),(29201,49,'让爱作主',NULL,NULL,NULL,2017,1233,NULL,1,0,0,0,'',0,0.0,0,NULL,'22集全',1508895929,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22811','R',0,0,NULL),(29202,49,'美人如画未删减版',NULL,NULL,NULL,2017,1233,NULL,1,0,0,0,'',0,0.0,0,NULL,'50集全',1508895952,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22812','M',0,0,NULL),(29203,49,'神枪之倒刺','徐僧,王晓晨,马诗红,付庆,蔡子伦,周子茵,','中国大陆',NULL,2013,1233,'\n　　1944年末，日伪秋季扫荡和叛徒出卖使得白城陷入艰难。江满根和地下党员彭秀女临危受命进入白城。满根毫无地下斗争经验，鲁莽冲动，行动不断脱离组织计划，引起日本人和伪警察局长楚强的怀疑，并害死了秀女。为了完成任务，他只得求助仇人、父亲当年好友——伪县长廖一清。原来白城失陷时，时任城防司令的江父决定牺牲自己，让廖假投降以保百姓安全。在廖帮助下，满根与当地各种势力建立了联系，并利用土匪等势力另辟蹊径完成了各项任务，建立了白城交通站。日军投降后，满根开始策反廖一清，楚强和廖的女儿春晓的军统身份也随之浮出水面。廖一清要和平解放白城，楚强武力相逼，满根和春晓赶来营救，春晓为满根挡了子弹，楚强最终被满根击毙。满根回到部队，踏上解放全国的征程。\n',1,0,0,0,'',0,0.0,0,'陈健','40集全',1508895977,1508917963,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22813','S',0,0,NULL),(29204,49,'特勤精英DVD版','张丹峰,苏青,张丹峰,苏青,任天野,徐洪浩,',NULL,NULL,2017,1345,'《特勤精英DVD版》是由徐宗政导演，张丹峰,苏青,包文婧等主演的内地电视剧，共40集。爱奇艺在线观看《特勤精英DVD版》全集高清视频。剧情简介：林毅怀揣着英雄梦来到了消防特勤队，成为一名光荣的消防员战士。在与队长郑志勇的不断冲突中，林毅慢慢融入特勤队这个大家庭，队员们也慢慢接受了他。大家不但看到了林毅在消防业务上表现出的过人才能，更看到了他的改变。在一次次的突发事件中，林毅和他的同伴们一起披荆斩棘，救人于危难，一步步实现着自己关于英雄的梦想...',1,0,0,0,'',0,0.0,0,NULL,'更新至第17集',1508897407,1508917966,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22713','T',0,0,NULL),(29205,49,'国民大生活DVD版','郑恺,袁姗姗,郑恺,袁姗姗,',NULL,NULL,2017,1346,'《国民大生活DVD版》是由夏晓昀导演，郑恺,袁姗姗,朱孝天等主演的内地电视剧，共40集。爱奇艺在线观看《国民大生活DVD版》全集高清视频。剧情简介：王舒望和陆露在泰国相遇相识，经历了一系列惊心动魄的事情之后，相爱了。回国后，两人准备结婚，却遭到了双方家庭的反对。王舒望放弃了北京的事业，来到上海，开了一家陶瓷店，向陆露的家人证明自己可以给陆露更好的生活。陆露的父母依旧认为王舒望和陆露不合适，不同意他们的婚事。王舒望的异父异母姐姐赵燕也多次来到上海...',1,0,0,0,'',0,0.0,0,NULL,'更新至第30集',1508897409,1508917966,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22511','G',0,0,NULL),(29206,49,'那片星空那片海2DVD版','冯绍峰,郭碧婷,冯绍峰,郭碧婷,冯绍峰,郭碧婷,冯绍峰,郭碧婷,',NULL,NULL,2017,1347,'《那片星空那片海2DVD版》是由卫翰韬导演，冯绍峰,郭碧婷,黄宗泽等主演的内地电视剧，共34集。爱奇艺在线观看《那片星空那片海2DVD版》全集高清视频。剧情简介：大唐盛世，锦绣繁华。在造船业发达的滨海小镇常乐，人类女子陆漓女扮男装混入造船厂，希望能在船厂大展身手，实现自己扬帆远航的梦想，鲛人王子吴居蓝也带着神秘任务来到船厂，两人不打不相识，产生了纯洁的爱情。随着陆漓和吴居蓝的相爱，两人背后的阴谋也逐渐浮出了水面，陆漓在亲情和爱情之间痛苦挣扎。最终，陆漓和吴居...',1,0,0,0,'',0,0.0,0,NULL,'更新至第26集',1508897412,1508917966,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22176','N',0,0,NULL),(29207,49,'假凤虚凰第二季','赵予熙,刘济恺,赵予熙,刘济恺,','中国大陆',NULL,2017,1356,'《假凤虚凰第二季》是由何佳男导演，赵予熙,刘济恺,董子鸣等主演的内地电视剧，共12集。爱奇艺在线观看《假凤虚凰第二季》全集高清视频。剧情简介：苏域与叶清歌被迫分离后，以假死之计拔除了她身边的暗桩，一对爱侣得以喜重逢，解开误会。谢清运无奈退出了三角关系，意外与小师妹赫连玖重逢。木大泱壮烈牺牲，叶清歌深受刺激，决心彻查军饷案。然而此时谢子兰却突然得知，叶清歌才是自己的亲生女儿，以死给了她最后的守护。正当叶清歌与苏域两情相悦之时，北褚太后杨恭淑...',1,0,0,0,'',0,0.0,0,'何佳男','共12集全',1508897443,1508917966,1,'http:||zy.wlzhan.com|inc|api.php?ac@list~pg@{p}~ids@{id}~h@{h}~t@{t}~wd@{wd}/22835','J',0,0,NULL),(29208,43,'徽州情缘','管乐,,,谭皓,,,万紫怡','大陆',NULL,2000,1357,'徽州青年导游马大海，收养了一个被遗弃的少女，取名马燕。两人相依为命，生活虽然清贫但却充满快乐。记者蓝岚在旅游度假之际，意外闯入了他们的生活。当发现余燕身患绝症，马大海和蓝岚一起，为了挽回余燕的生命……',1,0,0,0,'',0,0.0,0,'阮志强','BD超清',1508