INSERT INTO `lf_player` VALUES (1,'吉吉影音',1,1,0,'&lt;script type=&quot;text/javascript&quot;&gt;\r\n			var jjvod_url = \'&lt;$url&gt;\';//播放视频地址\r\n			var jjvod_w = \'100%\';//播放器宽度\r\n			var jjvod_h = document.getElementById(&quot;_player&quot;).offsetHeight;//播放器高度\r\n			var jjvod_ad = \'\';//缓冲和暂停调用广告地址，如http://www.abc.com/ad.html\r\n			var jjvod_c = \'baidu\'; //吉吉影音推广渠道，一般为域名简写，如baidu\r\n			var jjvod_install = \'http://player.jjvod.com/js/jjplayer_install.html?v=1&amp;c=\'+jjvod_c;\r\n			var jjvod_weburl = unescape(window.location.href);\r\n&lt;/script&gt;\r\n&lt;script type=&quot;text/javascript&quot; src=&quot;./Public/Player/player/jjplayer_v2.js&quot; charset=&quot;utf-8&quot;&gt;&lt;/script&gt;','',0,0,0),(2,'西瓜影音',1,2,0,'&lt;script language=&quot;javascript&quot;&gt;\r\nvar XgPlayer = {\r\n	\'Url\': &quot;&lt;$url&gt;&quot;,  //本集播放地址，需更改\r\n	\'NextcacheUrl\': &quot;&lt;$nexturl&gt;&quot;,  //缓冲下一集，需更改\r\n	\'LastWebPage\': \'&lt;$lastplay&gt;\',\r\n	\'NextWebPage\': &quot;&lt;$nextplay&gt;&quot;,  //下一集播放页面地址，需更改\r\n	\'Buffer\': \'http://player.xigua.com/xg_loading.html\',  // 播缓冲AD，需更改\r\n	\'Pase\': \'http://player.xigua.com/xg_loading.html\',  // 暂停AD，需更改\r\n	\'Width\': &quot;100%&quot;,   // 播放器显示宽度\r\n	\'Height\': document.getElementById(&quot;_player&quot;).offsetHeight,  // 播放器显示高度\r\n	\'Second\': 8,  // 缓冲时间\r\n	&quot;Installpage&quot;:\'http://static.xigua.com/installpage.html\'\r\n};\r\ndocument.write(\'&lt;script language=&quot;javascript&quot; src=&quot;http://static.xigua.com/xiguaplayer.js&quot; charset=&quot;utf-8&quot;&gt;&lt;\\/script&gt;\');\r\n&lt;/script&gt;','',0,0,0),(3,'先锋影音',1,3,0,'&lt;script type=&quot;text/javascript&quot;&gt;\r\n			var playerurl= \'&lt;$url&gt;\';//播放视频地址\r\n			var playerw= &quot;100%&quot;;//播放器宽度\r\n			var playerh= document.getElementById(&quot;_player&quot;).offsetHeight;//播放器高度\r\n&lt;/script&gt;\r\n&lt;script type=&quot;text/javascript&quot; src=&quot;./Public/Player/player/xfplay.js&quot; charset=&quot;utf-8&quot;&gt;&lt;/script&gt;','',0,0,0),(4,'在线播放',1,4,0,'&lt;iframe scrolling=&quot;no&quot; frameborder=&quot;0&quot; src=&quot;https://dy51.000webhostapp.com/player.php?url=&lt;$url&gt;&quot; style=&quot;height:100%; width:100%;&quot; allowfullscreen&gt;&lt;/iframe&gt;','',0,0,0),(5,'VIP播放',1,5,0,'&lt;div id=&quot;a1&quot; style=&quot;width:100%;height:100%&quot;&gt;&lt;/div&gt;\r\n&lt;script type=&quot;text/javascript&quot; src=&quot;./Public/Player/player/ckplayer/ckplayer.js&quot; charset=&quot;utf-8&quot;&gt;&lt;/script&gt;\r\n&lt;script type=&quot;text/javascript&quot;&gt;\r\n	var flashvars={\r\n		f:\'&lt;$url&gt;\',\r\n		c:0,\r\n		p:1,\r\n		loaded:\'loadedHandler\'\r\n		};\r\n	var video=[\'&lt;$url&gt;-&gt;video/mp4\'];\r\n    var params={bgcolor:\'#FFF\',allowFullScreen:true,allowScriptAccess:\'always\',wmode:\'transparent\'};\r\n    CKobject.embed(\'./Public/Player/player/ckplayer/ckplayer.swf\',\'a1\',\'ckplayer_a1\',\'100%\',\'100%\',false,flashvars,video,params);\r\n    function loadedHandler(){\r\n		CKobject.getObjectById(\'ckplayer_a1\').addListener(\'ended\',\'endedHandler\');\r\n	}\r\n	function endedHandler(time){\r\n		CKobject.getObjectById(\'ckplayer_a1\').openUrl(\'&lt;$nextplay&gt;\',\'_top\');\r\n	}\r\n&lt;/script&gt;','',0,1,0),(6,'VIP下载',1,6,0,'','',0,1,1),(7,'免费播放',1,7,0,'&lt;div id=&quot;a1&quot; style=&quot;width:100%;height:100%&quot;&gt;&lt;/div&gt;\r\n&lt;script type=&quot;text/javascript&quot; src=&quot;./Public/Player/player/ckplayer/ckplayer.js&quot; charset=&quot;utf-8&quot;&gt;&lt;/script&gt;\r\n&lt;script type=&quot;text/javascript&quot;&gt;\r\n	var flashvars={\r\n		f:\'/Public/Player/player/ckplayer/m3u8.swf\',\r\n        a:\'&lt;$url&gt;\',\r\n        s:4,\r\n		c:0,\r\n		p:1,\r\n		loaded:\'loadedHandler\'\r\n		};\r\n	var video=[\'&lt;$url&gt;-&gt;video/mp4\'];\r\n    var params={bgcolor:\'#FFF\',allowFullScreen:true,allowScriptAccess:\'always\',wmode:\'transparent\'};\r\n    CKobject.embed(\'./Public/Player/player/ckplayer/ckplayer